INSERT INTO tour_testimonial VALUES(1, NULL, 13, '2009-09-11', 'Сушальская', 'Татьяна', 'Евгеньевна', 'sofe@blitz.kiev.ua', NULL, 'Здравствуйте, уважаемая Лилия!\r\n\r\nПозвольте выразить Вам наше искреннее восхищение незабываемым туром в Западную Канаду, из которого мы вернулись буквально несколько дней назад. \r\n\r\nСобираясь в путешествие, мы, конечно же, ожидали увидеть незабываемые красоты, узнать много интересного о стране, но реальность многократно превысила наши ожидания. Имея за плечами большой опыт путешествий по Европе, а также возможность сравнивать, прежде всего, хочется сказать, что организация тура, его сбалансированность в плане осмотра природных достопримечательностей и городов, выше всяких похвал. Нет ни малейших сомнений, что туристическая фирма, которую Вы возглавляете, проделала колоссальную работу, чтобы туристы смогли увидеть все самое лучшее, что только есть в Западной Канаде. И слова «прекрасно», «удивительно», «грандиозно» и т.д., к сожалению, мало помогают, чтобы выразить все чувства, которые переполняли нас не просто ежедневно, а ежечасно на протяжении всей поездки. Мы искренне счастливы, что нам выпала такая удача – посетить Канаду, увидеть страну,  наше путешествие оставило яркий след в памяти. Мы видели много гидов – и сопровождающих туристические группы, и специализирующихся на проведении экскурсий в разных городах Европы. Но с таким высочайшим профессионализмом, с таким теплым и заботливым отношением к туристам, встретились впервые. Мы были просто как за каменной стеной, хотя мы прекрасно понимаем, что сопровождать группу по сложному и насыщенному маршруту, когда почти все рассчитано по минутам, дело очень не простое. И сколько бы слов благодарности мы не нашли, их будет мало, чтобы выразить ее нашему гиду в полной мере.  \r\n\r\nЖелаем Вашей фирме процветания, а Вам всяческих успехов, здоровья и благополучия.\r\n\r\n \r\n\r\nСергей, Татьяна\r\n\r\n            Киев, Украина\r\n', 'Отзыв о туре по Западной Канаде от туристов из Киева', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO tour_testimonial VALUES(2, 28, 12, '2009-09-11', 'Костомовская', 'Мадлен', NULL, 'tanugka@mail.ru', NULL, 'Здравствуйте, уважаемый NEWTOURS!!! \r\nЯ очень рада что имею возможность вам написать. Меня зовут Татьяна, я из Нижнего Новгорода, Россия. В этом 2009 году я была в Америке и посетила две ваших чудеснеёших экскурсии. Именно этими экскурсиями мнеи запомнилась Америка. Это одни из ярчайших впечатлений, которые остались у меня от этого лета. Ваша компания позволяет увидеть Соединённые Штаты по иному с другой стороны, она помогает путешествовать по незабываемым местам!!!! Вы дарите людям море позитивных эмоций, заряд и хорошего настроения. Я побывала всего лишь на двух ваших экскурсиях: на Ниагару и в Вашингтон и надеюсь что уже возможно в следующем году я отправлюсь с вами в другие замечательные места и уголки такой замечательной страны как Америка, которая гостеприимно раскрывает объятия и встречает гостей! У вас замечательный персонал и очень умные, образованные и тактичные гиды, которые дауют огромное количество знаний по истории Америки, их рассказы очень интересны и увлекательны. Я желаю вам процветания, долгих лет существования, ровных дорог и прекрасной погоды!!!!\r\n\r\nС уважением, Татьяна.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO tour_testimonial VALUES(3, NULL, NULL, '2009-04-25', 'Bassin', 'Юлия и Владимир', NULL, 'vbassin@yahoo.com', NULL, 'Хотим выразить свою благодарность экскурсоводу по имени Борис (фамилию мы не запомнили), который был нашим гидом во время экскурсии в Вашингтон 13-14 апреля. Было очень интересно и очень хорошо организовано. Хотим также отметить профессионализм и доброжелательность водителя Володи, с которым мы ездили не только в Вашингтон, но и на Ниагару 15-16 апреля', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
