INSERT INTO tour_testimonial VALUES(5, NULL, NULL, '2010-04-24', 'Gorsky', 'maksim', NULL, 'mail@mail.ru', '1232131232', 'We have a client in Ft. Worth who is looking for a Web designer with some style and pizzazz! If your portfolio doesn’t include some truly hip and eye catching design, this probably isn’t the best role for you. This position will carry the responsibilities of general art direction, concepting, some motion graphics and various levels of production as well.\r\n\r\nThe person for this position will basically support all of the marketing and advertising needs and supply those departments with the visual communication needs for all web projects ranging from Google landing pages to banner ads to Social Media sites.\r\n\r\nIn regard to Skills, consider a strong knowledge and experience level in Photoshop, Illustrator and Indesign to be the basics. What this team needs is a talented designer who is also skilled in HTML, CSS, Flash Actionscripting, JavaScript and even some After Effects.\r\n\r\nThis is a temp to hire opportunity. If you''re interested and available to start freelance work immediately, please be sure you send your best work for consideration!\r\n\r\nAs the nation''s premier internet marketing staffing company, Onward Search is focused on one thing and one thing only. We connect the most talented internet marketing and creative professionals in the country with the nation''s best companies.\r\n\r\nOnward Search is the number one provider of internet marketing talent in the nation. We offer a full range of recruiting, staffing, and talent management solutions to include temporary staffing, strategic consulting, and executive search to ensure our customers have access to the right talent to get the job done. ', NULL, NULL, NULL, NULL, NULL, '127.0.0.1', 'localhost', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.3) Gecko/20100401 Firefox/3.6.3', 'USA', 'Brooklyn', 'e13a4f37362a9f9bccb0ad2eee330856');
