INSERT INTO tour_testimonial VALUES(12, NULL, NULL, '2010-05-29', 'Gedrich', 'Iren ', NULL, 'iraged@gmail.com', '718-2531863', 'Безобразный сервис, сотрудники фирмы не имеют ни малейшего понятия  корпоративноой культуре. Договоренности о бронировании экскурсий не выполняются. Никогда больше не обращусь в эту компанию. Стыдно перед друзьями, прилетевшими в гости из Германии  - фирма нагло сорвала забронированную обзорную экскурсию по N.Y. Русские бизнесы  с Брайтона - действительно не умеют работать.', NULL, NULL, NULL, NULL, NULL, '71.183.178.66', 'pool-71-183-178-66.nycmny.east.verizon.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.3) Gecko/20100401 Firefox/3.6.3', 'USA', 'N.Y.', 's8rnr431u4grn0d4bmnfmvgu61');
INSERT INTO tour_testimonial VALUES(13, NULL, NULL, '2010-05-29', 'Фридман', 'Элла ', NULL, 'elf137@yahoo.com', '8184451502', 'Я бы хотела поблагодарить вашу компанию за прекрасную организацию тура на Американскую Ниагару.  Особое восхищение и почтение вызвал наш экскурсовод Эмиль. Этот потрясающий человек на протяжении двух дней делился с нами своими знаниями. Информация была предоставлена в заниманительной форме, доступной туристам всех возрастов и уровней образования. Мой 9-летний ребенок получил не меньшее удовольствие, чем я :-).  <br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '173.56.161.228', 'pool-173-56-161-228.nycmny.east.verizon.net', 'Mozilla/5.0 (Windows; U; Windows NT 6.0; en-US; rv:1.8.1.20) Gecko/20081217 Firefox/2.0.0.20 GTB7.0 (.NET CLR 3.5.30729)', 'USA', 'Лос Анжелес', 'q7mhrfnfq0l415gci19oaai9o7');
INSERT INTO tour_testimonial VALUES(14, NULL, NULL, '2010-06-04', 'Портман', 'Александр', NULL, 'san6ka99@mail.ru', '89114510010', 'Очень не понравилось отнашение экскурсовода Эллы, всё делает для себя, многое неорганизованно, были трудности с расселением в отель.', NULL, NULL, NULL, NULL, NULL, '64.255.180.51', 'r03-03.opera-mini.net', 'Opera/9.80 (Windows NT 5.1; U; ru) Presto/2.2.15 Version/10.00', 'Russia', '', 's3a5j6ei27hc297f2i4v63erg5');
INSERT INTO tour_testimonial VALUES(15, NULL, NULL, '2010-06-14', 'Chuzhina', 'Polina', NULL, 'chpo2009@gmail.com', '', 'Экскурсия: Сады Дюпонов, 30 мая, экскурсовод Лена.<br />\r\nАвтобус опоздал на 30 мин. В Сады приехали в 7:20 веч. Прошли все галопом. Мы ехали на экскурсию  -посмотреть САДЫ, а в итоге толком не увидели ни Филаделфии ни САДОВ. <br />\r\nЛена очень неприветливая, абсолютно не реагирует на пожелания людей. Oчень отличается от экскурсовода с кот. мы ездили в 2009 в Вашипгтон (не помним имени - живет в NJ - замечательный экскурсовод). <br />\r\nПоедем 2-ой раз в Longwood Gardens но уже с другой компанией.<br />\r\n ', NULL, NULL, NULL, NULL, NULL, '69.117.159.192', 'ool-45759fc0.dyn.optonline.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.1.9) Gecko/20100315 Firefox/3.5.9', 'USA', 'Brooklyn', 'e48hgc1m7ivsoj5gqet0lfjli4');
INSERT INTO tour_testimonial VALUES(16, NULL, NULL, '2010-06-21', 'Усатенко', 'Татьяна', NULL, 'tm@usatenko.com', '111 111 1', 'При первой же возможности и наличии времени (мы только вчера вернулись из путешествия по США) хочу<br />\r\nот имени моей семьи поблагодарить сотрудников компании "Newtours" за прекрасно организованный для нас тур "От океана до океана".<br />\r\n<br />\r\nМы путешествовали с вами с 21 мая по 7 июня 2010 года и эти 18 дней пролетели как один день, даря нам радость открытий и общения с новыми людьми.<br />\r\nИнтересные, красивейшие места, необычайно эрудированные гиды, внимание менеджеров сделали наш отдых феерическим и просто незабываемым.<br />\r\n<br />\r\nОтдельное спасибо хочется сказать гидам. К сожалению я не знаю их фамилий, поэтому только имена:<br />\r\nИрине, которая открыла для нас Бостон и Вашингтон;<br />\r\nМиле, подарившей нам Ниагару;<br />\r\nВладимиру. Мы были уже в Нью Йорке, но о тех местах и фактах, которые он показывал и рассказывал нам, мы даже не догадывались;<br />\r\nАлексу за Калифорнию и Инне за Сан Франциско.<br />\r\n<br />\r\nСпасибо вашим водителям Игорю (Бостон, 05/22-23), Илье (Ниагара, 05/24-25), еще одному Игорю (Вашингтон, 05/26-27 ) и Серджио (Калифорния, 28-07/05). Мы много путешествовали по Европе и, можете поверить, более пунктуальных и внимательных водителей не было. <br />\r\n<br />\r\nЖелаем процветания вашей компании, а всем ее сотрудникам здоровья, счастья и материального благополучия :)<br />\r\n<br />\r\nЕще раз спасибо.<br />\r\n<br />\r\nС ув. Татьяна, Денис и Данил<br />\r\n<br />\r\n<br />\r\n<br />\r\nP.S. Сын очень просил передать руководству компании (далее дословно), что Алекса необходимо повысить в должности, если есть такая должность, ну а если нет, то повысить зарплату.  ', NULL, NULL, NULL, NULL, NULL, '195.64.148.10', 'nat3.tica.com.ua', 'Opera/9.80 (Windows NT 5.1; U; uk) Presto/2.5.24 Version/10.53', 'Ukraine', 'Киев', 'uhg4bcrf6mq2uhlqksm4ngso57');
INSERT INTO tour_testimonial VALUES(17, NULL, NULL, '2010-07-13', 'Unger', 'Inna', NULL, 'iflm1@aol.com', '7189341175', 'Sunday,July 11 i came back from Cape Cod (4 days),beautiful tour & very knowlegable tour guide Mila.I travel with New Tours every year & she is one of the best.<br />\r\n<br />\r\nAlso ,my friend left her sunglasses on the bus,is it possible to somehow trace it & let me know.<br />\r\nThey were in large brown case-Christian Dior.<br />\r\nThanks for your help.<br />\r\nInna ', NULL, NULL, NULL, NULL, NULL, '24.184.232.236', 'ool-18b8e8ec.dyn.optonline.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.6) Gecko/20100625 Firefox/3.6.6', 'USA', '', '65sl33dnkqlm1794gc6lqk2od0');
INSERT INTO tour_testimonial VALUES(18, NULL, NULL, '2010-07-16', 'Сенькина', 'Ирина', NULL, 'irinasenkina@hotmail.com', '', 'Спасибо вам за понимание, за человеческое отношение, за советы и прекрасное обслуживание!<br />\r\nХочу поблагодарить вашу фирму за все экскурсии на которых мы побывали, а это и Нью-Йорк и Ниагара и Вашингтон. Особенно понравилась экскурсия на Ниагарские водопады с Анваром. Большой привет из Финляндии гидам Константину и Михаэлю и водителям!<br />\r\nЖелаем вам всего самого хорошего и много хороших клиентов!<br />\r\nP.S. Только поменяйте ресторан в экскурсии по Нью-Йорку. Солёные огурцы и капуста в железных мисках и непонятный суп не вызывают аппетита...', NULL, NULL, NULL, NULL, NULL, '85.77.191.129', 'YZDCXXVIII.gprs.sl-laajakaista.fi', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US) AppleWebKit/533.4 (KHTML, like Gecko) Chrome/5.0.375.99 Safari/533.4', 'Other ..', 'Ювяскюля', 'ktdfe8alf5dvstj382hl0vs7c6');
INSERT INTO tour_testimonial VALUES(19, NULL, NULL, '2010-07-16', 'Гамбарова', 'Лиза', NULL, 'Princssa@gmail.com', '3475305941', 'Поехала с Вами на Ниагару, агент сказал, что дорога занимает 6-8 часов, в зависимости от трафика, на ниагару прибываем часа в 2-3, экскурсии, а следующий день где-то 1-2 дня уезжаем..<br />\r\nДорогая заняла 12 часов , трафика НЕ БЫЛО!!! Уехали с Ниагары в 9 утра, гид нам сразу сказал, что дорога ориентировочно 11 часов займет..<br />\r\nЯ была такая не одна в автобусе, кого так обманули..Я больше никуда, никогда с вами не поеду(Хотя хотели всей семьей с вами в Вашингтон съезить) и скажу всем своим друзьям и знакомым, что вы обманываете клиентов..<br />\r\n', NULL, NULL, NULL, NULL, NULL, '68.195.99.223', 'ool-44c363df.dyn.optonline.net', 'Mozilla/5.0 (Windows; U; Windows NT 6.1; en-US; rv:1.9.2.6) Gecko/20100625 Firefox/3.6.6', 'USA', 'Нью Йорк', 'cisflotia96pp2vcu1pdaqmd24');
