INSERT INTO tour_testimonial VALUES(23, NULL, NULL, '2010-07-27', 'zolotova', 'tatiana', NULL, 'tatiana-zolotova@rambler.ru', '', '                 Здравствуйте!<br />\r\n  Хочу выразить свою благодарность экскурсоводу Томашевской Людмиле и водителю Павлу, с которыми мне посчастливилось побывать в поездке на Кейп-Код с 17 по 20 июля 2010 года.<br />\r\n Людмила произвела впечатление не только как интеллигентный человек и высокообразованный специалист, но и как приятный, доброжелательный собеседник. Её экскурсия отличается особым мастерством подачи материала. Людмила умеет тонко чувствовать настроение людей, знает, как, когда, в каком объеме и в какой форме преподнести материал, чтобы информация не только заинтересовала слушателей, но и запомнилась им. <br />\r\n Легкость, изящество, продуманность, абсолютная грамотность, тонкий юмор - вот чем отличается речь Людмилы. Она сумела создать в группе атмосферу хорошего настроения, комфортного душевного состояния, восхищения от увиденного и услышанного. <br />\r\n  Созданию такой атмосферы во многом способствовало мастерство профессионала и человеческое обаяние водителя Павла, с которым мы чувствовали себя комфортно и в полной безопасности. <br />\r\n   Пишу "мы", потому что участники путешествия обменивались впечатлениями и я слышала мнения других людей. <br />\r\n  Я уже много раз путешествовала с компанией "Нью-Турс", побывала в двенадцати различных поездках, в том числе и в таких далеких, как Канада, Аляска и Калифорния, и могу с уверенностью сказать, что профессиональный уровень экскурсоводов компании вне конкуренции.<br />\r\n  Поэтому особенно приятно отметить, что Людмила Томашевская достойно представляет Вашу компанию и поднимает престиж "Нью-Турс" на высочайший уровень! <br />\r\n  Спасибо!!! <br />\r\n  С уважением, Татьяна Золотова, <br />\r\n  преподаватель русского языка и литературы, <br />\r\n  Израиль.', NULL, NULL, NULL, NULL, NULL, '69.114.127.212', 'ool-45727fd4.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322)', 'Israel', 'hadera', '8ppmqbufhbci3rmdsl0itqg996');
INSERT INTO tour_testimonial VALUES(24, NULL, NULL, '2010-07-27', 'Gelfand', 'Liliya', NULL, 'newtoursusa@yahoo.com', '17189347644', 'Horosho! Ura!  nm,.,mn,mn,s;kflepoww''al;kfjglkgaklvzmv,cmz./mvz/.', NULL, NULL, NULL, NULL, NULL, '24.185.149.44', 'ool-18b9952c.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.0; Trident/4.0; GTB6.5; SLCC1; .NET CLR 2.0.50727; Media Center PC 5.0; 3P_AMG 1.0.25.0; 3P_SEC 1.0.11.2; UPAS 3.2.155.0; .NET CLR 3.5.30729; .NET CLR 3.0.30618)', 'USA', 'New York', 'qqkvmk3pn2rvnsgih9264878n3');
INSERT INTO tour_testimonial VALUES(25, NULL, NULL, '2010-07-27', 'Вайткевич', 'Лияна ', NULL, 'ryzakate@yahoo.com', '973 876 1810', '  В прошлую Субботу поехала в сады Дюпонов.Так как до этого ничего о семействе Дюпонов не знала,надеялась что то интересного услышать из уст гида.Что то услышала ,а сегодня залезла в инет и поняла,что нам такую дещёвую инфо наш гид подбросила,что это можно считать неуважением к своим клиентам...Не уж то у некоторых гидов Нью Тура нету подхода к инету и легче всего болтать на общие темы ,нежели посидеть несколько часов у компютера и подготовить тематическую экскурсию? ', NULL, NULL, NULL, NULL, NULL, '167.206.253.55', 'mail.peconiclanding.net', 'Mozilla/5.0 (Windows; U; Windows NT 6.1; en-US) AppleWebKit/533.4 (KHTML, like Gecko) Chrome/5.0.375.99 Safari/533.4', 'USA', 'Greenport', 'vv33mqi760hi6jktco8r7n3307');
INSERT INTO tour_testimonial VALUES(26, NULL, NULL, '2010-08-02', 'Свердлова', 'Юлия', NULL, 'redisothka@rambler.ru', '+7 903 146 99 34', 'Здравствуйте!<br />\r\nЯ прибрела в вашей фирме путёвку на четыре дня в Кейп Код, и 17 июля 2010 года отправилась в путешествие. Хотела бы выразить огромную благодарность нашему гиду - Людмиле Томашевской. С самых первых минут поездки Людмила настолько интересно вела экскурсию, что слушали мы её, в буквальном смысле - с открытым ртом. Очень много интереснейших фактов, очень много полезной и нужной информации, и вместе с тем, не нагружая нас. Настолько интеллигентный стиль общения, забота о нас, туристах, всё доброжелательно, и обязательно всегда с улыбкой. На пути к очередному пункту остановки Людмила максимально полно рассказывала нам о том, что нам предстоит увидеть, и уже на месте она проводила экскурсию, напоминая о тех фактах, которые мы слышали из её уст в автобусе.<br />\r\nОтдельное спасибо хочется сказать нашему водителю - Павлу (к сожалению, не знаю фамилию) за профессионализм и прекрасную музыку в салоне автобуса, которую мы слушали на протяжении всего путешествия.<br />\r\nБлагодаря таким людям, как Людмила и Павел, мы - туристы, смогли получить максимально полное удовольствие от поездки.<br />\r\nСпасибо огромное!<br />\r\nС уважением,<br />\r\nЮлия Свердлова.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '92.243.183.6', '92.243.183.6', 'Opera/9.63 (Windows NT 5.1; U; ru) Presto/2.1.1', 'Russia', 'Москва', '70o75std50f3dncbdaffpbjnm0');
INSERT INTO tour_testimonial VALUES(27, NULL, NULL, '2010-08-03', 'Иксангалиев', 'ЕсимБулат', NULL, 'yessim@yandex.ru', '+77772403331', 'Добрый день.<br />\r\nНеделю назад завершился мой тур по США-Канада.<br />\r\nВсе прошло замечательно.<br />\r\nПрограмма продумана до всего.<br />\r\nОсобенно запоминающий тур в Канаду 5 дней.<br />\r\nКомпания была дружественной нас 15 человек. Все интересные. <br />\r\nТакже очень запомнился водитель Исай. как человек и много подавал полезной информации. Ему и Володе отдельное спасибо. <br />\r\nГиды на протяжения всех туров профессионалы. общительные и внимательные.<br />\r\nНе хватило конечно еще одного дня в Нью-Йорке Манхэтен.<br />\r\nДумаю, что в марте-апреле если позволит время через вашу компанию напрямую организовать тур в Калифорнию.<br />\r\nДетали тура я видел. Если будут предложения по цене и изменеия по организации присылайте.<br />\r\nРекомендую своим знакомым Вас.<br />\r\nВам успехов и продвижений в удивительном бизнессе.<br />\r\nС уважением ЕсимБулат<br />\r\nгород Уральск Казахстан ', NULL, NULL, NULL, NULL, NULL, '88.204.221.123', '88.204.221.123.dial.online.kz', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1)', 'Kazakstan', 'Уральск', 'c5a97fdffvd4ne0vpkd7bu8hm4');
INSERT INTO tour_testimonial VALUES(28, NULL, NULL, '2010-08-04', 'Chernin', 'Jane', NULL, 'jchernin@yahoo.com', '646-752-6080', 'I would like to comment on the trip to Philadelphia that I booked for my friend from Russia. The trip took place on August 3rd, 2010 and the tour guide\\''s name was Rita. My friend took another trip with NewTours, but this trip was a disappointment and spoiled her impression of NewTours. Rita was not knowledgeable of the subject matter, her speech and presentation lacked basic grammar skills. The tour group spent excessive time at service stations long after people finished eating and refreshing themselves. The tour did not leave adequate time for Rodin Museum or DuPont Gardens or Philadelphia historical sites. Rita did not show the tourists the Bell in Philadelphia - one of the major attractions and something my friend wanted to see. She showed tourist the direction of the Bell and said they don\\''t have time to go there anyway. Rodin Museum and DuPont Gardens were also rushed through.<br />\r\nOn the way home after spending another 45 mins at the service station for no apparent reason, tourists going to Brighton Beach were put on another (already overcrowded) bus to save time. My friend who suffers from motion sickness and had a front seat on her first bus was bumped to the back of the second bus. Overall, my friend was very disappointed with the tour and upset and was not interesting in taking additional tours with NewTours. I felt very embarrassed she had to spend time and money for something as unprofessional as this. As a result of this experience, I will be reluctant to recommend NewTours for my other quests.  <br />\r\n ', NULL, NULL, NULL, NULL, NULL, '208.87.234.180', 'webdefence.cluster-h.websense.net', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; GTB6; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.04506.30; InfoPath.2; .NET CLR 3.0.04506.648; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'USA', 'New York', 'rijl1kbfmrs3uiok96gigl0gf6');
INSERT INTO tour_testimonial VALUES(29, NULL, NULL, '2010-08-05', 'Гапонова', 'Ольга', NULL, 'ol55249-dary@yandex.ru', '8-916-217-8241', 'Спасибо вам огромное !!! я была в Нью-Йорке в начале июня 2010 года и воспользовалась вашими услугами - обзорная экскурсия по Нью-Йорку и 2х дневная поездка на Ниагарский водопад.Масса впечатлений !! Особая благодарность водителям Илье и Нино и гидам Константину и Анвару за юмор , терпение , великолепное знание маршрута и любовь своей работы !! Очень здорово , что есть New Tours!!! Спасибо! Ольга.', NULL, NULL, NULL, NULL, NULL, '92.243.182.13', '92.243.182.13', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.1.11) Gecko/20100701 Firefox/3.5.11', 'Russia', 'Москва', 'esdb9moe9h580kpka11041tnq3');
INSERT INTO tour_testimonial VALUES(30, NULL, NULL, '2010-08-09', 'Khromenkova', 'Olga', NULL, 'winter_lady@rambler.ru', '718-664-38-12', 'Хочу сказать СПАСИБО за экскурсию в Вашингтон 7-8 августа гиду компании Саше и водителю автобуса Славе, благодаря которым экскурсия была интересной, познавательной и комфортной! Обширные знания гида о города и стране, отличный автобус и организация тура сделали поездку маленьким праздником! Спасибо им огромное! Желаю компании New Tours процветания и всего самого наилучшего!!!<br />\r\nОльга (Харьков, Украина)  ', NULL, NULL, NULL, NULL, NULL, '24.47.255.190', 'ool-182fffbe.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; GTB6.5; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.04506.648; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'Ukraine', 'Kharkov', 'm8l6ve7g1t1nlfvhmfnfq2pum1');
INSERT INTO tour_testimonial VALUES(31, NULL, NULL, '2010-08-17', 'Polt', 'Lika', NULL, 'pog_pol@yahoo.com', '', 'здравствуйте! помогите составить интересный тур по северу восточного побережья или по ближайшей Канаде на RV,сроком на3- 4 дня, спасибо.', NULL, NULL, NULL, NULL, NULL, '68.196.180.224', 'ool-44c4b4e0.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.0; WOW64; Trident/4.0; SLCC1; .NET CLR 2.0.50727; Media Center PC 5.0; .NET CLR 3.5.30729; .NET CLR 3.0.30729; .NET4.0C)', 'USA', '', '4b23ec6v7grlkiu5vqkrf972o0');
INSERT INTO tour_testimonial VALUES(32, NULL, NULL, '2010-08-30', 'Метелкина', 'Елена', NULL, 'lm@kppublish.ru', '89627291960', 'Здравствуйте,  уважаемое руководство “New Tours”!<br />\r\n<br />\r\n           Меня зовут Елена Метелкина, я коммерческий директор газеты “Комсомольская правда” в С-Петербурге. В августе этого года я была в Нью-Йорке по заданию нашей редакции, которoe я совместила со своим отпуском. <br />\r\nЯ купила однодневную экскурсию по  городу с русскоговорящим гидом, который поразил меня совершенно красивым и правильным русским языком. Наряду с огромным количеством интересной, познавательной информации, касающейся непосредственно города, я узнала много интересного о том, как  и чем живет город и какие люди его населяют. Благодаря этой поездке по городу я просто влюбилась в  Нью-Йорк и полностью прочувствовала его атмосферу.<br />\r\nВсе эти добрые слова  я отношу в адрес Вашего агенства и персонально в адрес гида Антоненко Веры. Сердечное Вам спасибо!<br />\r\n<br />\r\nС уважением,<br />\r\nЕ. Метелкина<br />\r\nТел: 89627291960<br />\r\nЕ-майл: лм@kppublish.ru<br />\r\n', NULL, NULL, NULL, NULL, NULL, '74.88.47.210', 'ool-4a582fd2.dyn.optonline.net', 'Mozilla/5.0 (Windows; U; Windows NT 6.0; en-US) AppleWebKit/533.17.8 (KHTML, like Gecko) Version/5.0.1 Safari/533.17.8', 'Russia', 'С-Петербург', '64i1q9due3btl5go7efk0uk5u7');
INSERT INTO tour_testimonial VALUES(33, NULL, NULL, '2010-08-30', 'Vaitkeviciute', 'Lijana ', NULL, 'ryzakate@yahoo.com', '973 876 1810', '    Добрый день.У меня он сегодня был не самый добрый,так как мучил вопрос о том,почему в дни кризиса наблюдается деградация уважения предпринимателя к своим клиентам.Заметила я это в ресторанах и магазинах родного Брайтона,а сегодня оказалось,что тем же путём шагает и ваше турагенство.Дело в том,что я очень хотела поехать на 3 дня в \\"Американскую Швейцарию\\".Деньги заплатила почти месяц тому назад,так как живу в дальнем Лонг Айленде и появляюсь на Брайтоне далеко не каждый день.Сегодня выяснилось,что меня не отпустят с работы в панедельник,так что уезжать где то я могу лишь на дня два...Позвонила в ваше агентсво с просьбой поменять мою 3х дневную поездку на 2-х дневную.Милая девушка Даша хотела записать меня в Беркщиры,но уточнив ситуацию,сказала,что переговорит с менеджером.Слова менеджера Славы меня озадачили:\\"Нельзя поменять,так как идёт большой поток людей\\".Раз уж большой поток,то видимо кто то и на моё место может поехать,а и я ведь место в Беркширы ни у кого не отнимаю..Так где же проблема??? Или мне нужно понять,что когда большой поток людей,то о внимании к клиенту ( лично я за этот сезон с вашим агенством сьездила на 4 поездки)можно позабыть... Не думаю ,что New tours станет богаче,присвоив мои бедные 300$ и не обеднеет от того,что я буду вынуждена тратить свои деньги в других агенствах,хотя скорее всего и там идёт та же самая деградация..:((((( Даже не знаю где можно было бы серьёзно подискутировать на эту тему...Может быть нашёлся бы кто то ,кто бы обьяснил мне дуре,что происходит ....', NULL, NULL, NULL, NULL, NULL, '167.206.253.55', 'mail.peconiclanding.net', 'Mozilla/5.0 (Windows; U; Windows NT 6.1; en-US) AppleWebKit/533.4 (KHTML, like Gecko) Chrome/5.0.375.127 Safari/533.4', 'USA', 'Greenport', '3rlufs67m7g1t7tcru9tpd0vh6');
INSERT INTO tour_testimonial VALUES(34, NULL, NULL, '2010-09-02', 'Sigal', 'Tatyana', NULL, 'janebash56@yahoo.com', '', 'Tour in New York which should starts at 10:45 from Battery Park on September 1, 2010 was really terrible. Gid was not a professional at all. Information was really bad quality, nothing at all. On the street, almost all group can heard an ekskursovod. She did not give enough time make a picture, not time for bathroom. But she said a few time about tips for her and a driver. First time did not satisfy with trip. Absolutely useless Gid. Almost everybody talk about unprofessional person, who should take care about people, but she does not care at all. She start talk and never finish any information, like person who forgot what she was start talking about. Check carefful, who show our gest our Beautifull and most popular City. Never recomended to any of my friends or gests. ', NULL, NULL, NULL, NULL, NULL, '161.185.157.24', 'bcpxy2d.nyc.gov', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; GTB5; (R1 1.6); .NET CLR 2.0.50727; .NET CLR 3.0.04506.30; .NET CLR 3.0.04506.648; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'USA', 'New york', '2hnvu978ov1qoh4th7a7em6476');
INSERT INTO tour_testimonial VALUES(35, NULL, NULL, '2010-09-05', 'Dauksh', 'Nadia', NULL, 'commodore2004@mail.ru', '347-634-6012', 'Zdravstvuyte Uvajaemie! Y kupila svoey Mame tur na Niagarskie vodopadi, dumala chto moya Mama poluchit massu ydovolstviy, no vishlo vse naoborot. Moya bednaya Mama bila v choke posle vashey poezdki. Y sama ezdila na NIAGARI, slava Bogy s drugoy kompaniey, i polychila OGROMNOE UDOVOLSTVIE. S vachey je NEW TOURS etogo ne proizoshlo. Vi ne dali nikakogo otdixa luydyam posle dlitelnogo pereezda, i srazy pognali ix smotret vodopadi, vecherom  cmotert mojno tolko cvetnie vodopadi, chto smogli uvidet vashi bednie turisti Y ne ponimauy. Zatem po "signaly" vse obyazani yavitca ytrom (7 a.m.) na avtobus, i so skorostuy sveta mchatca obratno v NY, pri etom pochemyto zatratit 12chasov, i priexat v 9 vechera, a ne polojenix 8-9 chasov. Vopros? Pochemy nujno bilo izdevatca tak nad luydmi? Kogda vse normalnie turisti UTROM smotryat vodopadi, UTROM ezdyat na korablike, spokoyno, ne toropyas vozvrachauytca v NY v 11 vechera domoy.Moya Mama imeet xorochee, krepkoe zdorove, no posle vashey poezdki, Y povezla ee v gospital s otekchimi nogami i povishennim davleniem. I Y budu dobivatca chtobi mne vernuli dengi za IZDEVATELSTVO NAD moey MAMOY. Y vsem bydy govorit kak NE NUJNO ezdit s vashey kompaniey.Xotya Y ne raz eto slishala, no ne poverila, teper sama ybedilas v etom. Y jelauy Vam, chto bi takie "negodyai" myagko skazano, popalis vashim materyam i otcam na ix jiznenom puti, kak popalis oni moey Mamochki. Esli est voprosi,zvonite.', NULL, NULL, NULL, NULL, NULL, '24.184.157.85', 'ool-18b89d55.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; InfoPath.2)', 'USA', 'Brooklyn', '11eboc99rr0gpa0qj7o1koc9r2');
