INSERT INTO tour_testimonial VALUES(39, NULL, NULL, '2010-09-16', 'Федюшкина', 'Инга', NULL, 'finga@inbox.ru', '+7-916-653-44-82', 'Здравствуйте!<br />\r\nУ меня вопрос по экскурсии "Нью-Йорк - полная обзорная экскурсия". Нужен ли билет для ребенка 5-ти лет? Спасибо.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '91.78.199.46', 'ppp91-78-199-46.pppoe.mtu-net.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 2.0.50727; InfoPath.1; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'Russia', 'Москва', '6qqogl6dsig9e69gekf5m53uv7');
INSERT INTO tour_testimonial VALUES(40, NULL, NULL, '2010-09-21', 'Kirilova', 'Margarita', NULL, 'margaritausa@yahoo.com', '111111111111', 'Hello! I would like to inform owner of this business that I had 9 trips with New Tours and I was complitely satisfied with everything exept my last trip to Cape Cod with Natasha(9/4/2010). She is not professional. Me and my friends were so upset. We will never ever again spend our money to travel with her. Thanks.', NULL, NULL, NULL, NULL, NULL, '68.82.51.74', 'c-68-82-51-74.hsd1.pa.comcast.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C)', 'USA', 'Philadelphia', 'habacs9ss7vb77ufvd86tk1e67');
INSERT INTO tour_testimonial VALUES(41, NULL, NULL, '2010-09-27', 'Silivanov', 'Viktor', NULL, 'agovyada@yahoo.com', '3478403985', '100 thanks to Zanna+Ilya+New Tours who made our trip to Delaware 09/25/10 just awesome! We will recommend this trip to our friends.', NULL, NULL, NULL, NULL, NULL, '24.188.128.149', 'ool-18bc8095.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.0; WOW64; SLCC1; .NET CLR 2.0.50727; Media Center PC 5.0; .NET CLR 3.5.21022; .NET CLR 3.5.30729; .NET CLR 3.0.30729; .NET4.0C)', 'USA', 'Brooklyn', 'cnq7hiu1eafcgtsg0oetbqmeg4');
INSERT INTO tour_testimonial VALUES(42, NULL, NULL, '2010-09-27', 'Корнеева', 'Наталья', NULL, 'aksen7575@mail.ru', '917-734-34-13', 'Добрый день!<br />\r\nПрофсоюзная организация Постпредства России при ООН в Нью-Йорке свидетельствует Вам свое уважение и выражает заинтересованность в сотрудничестве с Вашей компанией в организации туров по США, включая предоставление услуг гида и бронирование гостиниц.<br />\r\nС уважением, <br />\r\nНаталья Корнеева', NULL, NULL, NULL, NULL, NULL, '216.220.114.156', 'host-216-220-114-156.dsl.bway.net', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; .NET CLR 1.1.4322; .NET CLR 2.0.50727)', 'USA', 'Нью-Йорк', '7pglkkpbfvp5c19ohq0qk9i2j7');
INSERT INTO tour_testimonial VALUES(43, NULL, NULL, '2010-09-28', 'Kitaychik', 'Dmitry ', NULL, 'dmkit3336@gmail.com', '347-451-8486', 'This is the first and the last time we use New Tour. From the first hours that we arrived to Italy to the last day on the beach we felt like we are the tourist who came from the third world countries.Poor organization, poor choice of hotels,especcialy in Venice and on the beach, poor food in hotels.Very sad that the agency owners do not do the recearch before they send clients on the trips. We will never recommend your agency to anyone.', NULL, NULL, NULL, NULL, NULL, '174.153.8.117', '174-153-8-117.pools.spcsdns.net', 'Mozilla/5.0 (webOS/1.4.5; U; en-US) AppleWebKit/532.2 (KHTML, like Gecko) Version/1.0 Safari/532.2 Pre/1.0', 'USA', '', 'd58lpm0s4e63pc74nv7n7papn0');
INSERT INTO tour_testimonial VALUES(44, NULL, NULL, '2010-09-30', 'brown', 'Lyudmila', NULL, 'lyudmilal13@msn.com', '7184902666', 'У меня был тур в Перу с 18 сентября.Тур назывался Перуанская мозаика.Я осталась не довольна сервисом перуанской компании \\"Journey\\".Отели не соответствовали статусу 3*.В Куско на высоте 3800м над уровнем моря в нашем номере не было окон.Не было елементарных вещей как фена или утюга.<br />\r\nНо самое обидное мы не увидели о.Титикаку.Запланированным автобусом мы не могли выехать из Куско т.к.с/х забостовка.\\"Journey\\" компания предложила лететь самолетом за доп.плату с человека по $158.Мы оплатили, но рейс был отменен.Деньги за самолет нам не вернули.Перуанская мозаика не получилась.Получилась Перуанская рулетка.Я хочу получить письменное разьяснение по поводу произошедшего.<br />\r\nСпасибо.<br />\r\n <br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '96.246.6.77', 'pool-96-246-6-77.nycmny.east.verizon.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.10) Gecko/20100914 Firefox/3.6.10', 'USA', '', '0dk11k7g784flfelav269b9ef2');
INSERT INTO tour_testimonial VALUES(45, NULL, NULL, '2010-10-08', 'goutkin', 'elena ', NULL, 'elena_goutkin@yahoo.com', '213 8801938', '!. New York tour with tour-guide Michael. Wasn''t very informative and interesting. Statue of Liberty and Ground Zero was good, the rest- most of the time from the bus window. Michael - wasn''t very enthusiastic passionate  in terms of shearing information about New York. I would not recommend this tour to anybody.<br />\r\n2. Niagara Falls. Anvar made this tour twice enjoyable. Thank you very much Anvar!!!!! He finally gave us all the information we were looking for about NYC and compensated for the day with Michael. The tour was very good planned, timed and conducted. Anvar did his best so we would see the most from NF. Driver Sergei was also very professional.<br />\r\nWe will recommend this tour for all our friends.<br />\r\nPlease reward our guide Anvar!<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '66.214.137.151', '66-214-137-151.dhcp.gldl.ca.charter.com', 'Mozilla/5.0 (Macintosh; U; Intel Mac OS X 10_5_8; en-us) AppleWebKit/533.17.8 (KHTML, like Gecko) Version/5.0.1 Safari/533.17.8', 'USA', 'los angeles', 'n5itb06s44go1mlc1i4urg21n3');
INSERT INTO tour_testimonial VALUES(46, NULL, NULL, '2010-10-12', 'савченко', 'мила', NULL, 'l_savchenko@ukr.net', '+380506557398', 'Здравствуйте все!<br />\r\nСентябрь этого года запомнился поездкой в Нью Йорк и прекрасно организованным экскурсионным сопровождением. Спасибо большое Зафар за помощь, поддержку и заботу. Владимир,своей обзорной экскурсией по городу вы показали, что вы его любите, и мы полюбили! Жанна и Бостон - большой минус. Она даже фактажа не знает! Но все равно:Спасибо вам большое!', NULL, NULL, NULL, NULL, NULL, '192.198.151.37', 'irdmzpr02-ext.ir.intel.com', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.2.10) Gecko/20100914 BTRS28354 Firefox/3.6.10', 'Ukraine', 'киев', 'lpe4s87mop2e1bpiu2tthk3i85');
INSERT INTO tour_testimonial VALUES(47, NULL, NULL, '2010-10-25', 'Качалова', 'Марина', NULL, 'kachalovamm@yandex.ru', '+79039680111', '     Здравствуйте! Я оставляла заявку на 2-х человек на экскурсию по Нью-Йорку со статуей Свободы на понедельник 01 ноября.Жду Вашего ответа для оплаты тура.', NULL, NULL, NULL, NULL, NULL, '46.73.167.160', 'ip-46-73-167-160.bb.netbynet.ru', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.0; GTB6.6; SLCC1; .NET CLR 2.0.50727; Media Center PC 5.0; .NET CLR 3.5.30729; .NET CLR 3.0.30729)', 'Russia', 'Москва', 'k9sv3ovhafmi41h8i7icbhenr1');
INSERT INTO tour_testimonial VALUES(48, NULL, NULL, '2010-11-02', 'Petrova', 'Nataliya', NULL, 'NATALIEPETROVA@VERIZON.NET', '718-373-5309', 'CALIFORNIA, ARIZONA, NEVADA, UTAH 8-18 OCTOBER 2010<br />\r\n MY FRIENDS HAD I ENJOYED THE PLACES WE HAVE SEEN,   <br />\r\nHOWEVER THE TECHNICAL PART OF TRIP WAS NOT PLANNED RIGHT<br />\r\nFIRST OF ALL   TOUR- GUIDE BY NAME INNA WAS NOT TOO POLITE OR HELPFUL AND DEFINITELY NOT –PEOPLE PERSON.  ( IN MY  HUMBLE OPINION)<br />\r\nTHANKS GOD SHE WAS REPLACED BY ALEX IN VEGAS, ALEX WAS/IS WONDERFUL. EDUCATED, TACTFUL, HELPFUL. EVERYONE WAS VERY SATISFIED WITH THE JOB HE HAS DONE. THANKS AGAIN.<br />\r\n2 HOTELS - PAGE, HOTEL SIX “AND QUALITY INN”<br />\r\nWERE MORE THEN AUFFUL--`.  DIRTY, NO ELEVATOR, DISGUSTING BREAKFAST/ ROOM WITH ROACHES. I WAS REALLY ASHAMED BEFORE MY RUSSIAN FRIENDS THAT IN AMERICA  OF 21 - ST   SENTURE IN THIS  EXPENSIVE   TRIP , NEW TOURS “ AGENCY COULD ACCOMMODATE TOURISTS IN THAT KIND OF ‘ HOTELS” SHAME ON  AGENTS  WHO PLANNED THE TECHNICAL PARTS OF  THIS TRIP/<br />\r\nIT WAS NY THIRD TRIP WITH “NEW TOURS”- UNFORTUNATELY I WAS NOT LUCKY WITH HOTELS CHOICES   EVER.<br />\r\nWOULD I GO ANYWHERE WITH “NEW TOURS” AGAIN- PROBABLE NOT<br />\r\nWOULD I RECOMMEND THE “NEW TOURS” TO MY FRIENDS – DEFINITELY NOT<br />\r\nPERHAPS MY OPINION WILL HELP YOU TO MAKE NECESSARY CHANGES TO ATTRACT MORE TOURISTS<br />\r\nTHANK YOU<br />\r\nNATALIYA PETROVA<br />\r\n <br />\r\n <br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '209.73.60.234', 'mail.solil.com', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; InfoPath.1; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'USA', 'New York', '0to0po8jia3r4mgh3ct21bf3r6');
INSERT INTO tour_testimonial VALUES(49, NULL, NULL, '2010-11-16', 'Филимонов', 'Юрий', NULL, 'filimonov65@yandex.ru', '+79859991719', 'Хотели бы  заказать тур по Нью Йорку на 22 декабря. Нас 4 человека (2 взрослых и 2 ребенка (12 и 8 лет). Сколько времени длится экскурсия?', NULL, NULL, NULL, NULL, NULL, '178.176.181.21', 'wimax-client.yota.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'USA', '', '40foi6umn6atvh9m0j6avgj2o6');
INSERT INTO tour_testimonial VALUES(50, NULL, NULL, '2010-11-19', 'bren', 'delphiaalex', NULL, 'girls4ilove@hotmail.com', '2152371086', 'we wanted to get pricing for family of 5 (2adults and 3 kids) for 2 nights new year party.<br />\r\ncan you please contact us for the best wat for us to go. thank you', NULL, NULL, NULL, NULL, NULL, '209.2.19.234', '209.2.19.234', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727)', 'USA', 'phila', 'nuio1ai8fn79gr11d555s8t835');
INSERT INTO tour_testimonial VALUES(51, NULL, NULL, '2010-11-24', 'Chibisova', 'Anna', NULL, 'anna_chibisova@mail.ru', '+380674888802', 'Подскажите пожалуйста, мы будем в Нью-Йорке 03.01.2011 года и хотели бы заказать обзорную экскурсию с рускоговорящим гидом часа на 2, возможно ли это и сколько это будет стоить нас 2 человека?', NULL, NULL, NULL, NULL, NULL, '178.94.8.219', '219-8-94-178.pool.ukrtel.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.1.15) Gecko/20101026 Firefox/3.5.15 ( .NET CLR 3.5.30729)', 'Ukraine', 'Харьков', 'm2logje5cpn7j84tf6dbrvsmf1');
INSERT INTO tour_testimonial VALUES(52, NULL, NULL, '2010-11-24', 'Petruk', 'Eduard', NULL, 'edia-jank@rambler.ru', '+380676744553', 'Zdravstvyjte.Est li vozmoznost y Vas zakazat tyr s Ukraine na Floridy,na vremia zimnix kanikyl(10-15dn)??? mne 19 let,est zagran pasport. <br />\r\n<br />\r\n                                    Ed.  spasibo.', NULL, NULL, NULL, NULL, NULL, '95.133.44.177', '177-44-133-95.pool.ukrtel.net', 'Opera/9.80 (Windows NT 5.1; U; ru) Presto/2.6.30 Version/10.63', 'Ukraine', 'Lutsk', '9ldjmisaehpcbo3aeaajoe5dg0');
INSERT INTO tour_testimonial VALUES(53, NULL, NULL, '2010-12-01', 'Пономаренко', 'Елена', NULL, 'poem2002@mail.ru', '111', 'Пожалуйста, сообщите,какие экскурсии в январе я могу посетить с Михаилом Голером.<br />\r\nСпасибо.<br />\r\nЕлена Пономаренко', NULL, NULL, NULL, NULL, NULL, '178.94.187.153', '153-187-94-178.pool.ukrtel.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.1.15) Gecko/20101026 Firefox/3.5.15 (.NET CLR 3.5.30729)', 'Ukraine', 'Харьков', '6a9uvs65rlsj4tc9q97c92aqs4');
INSERT INTO tour_testimonial VALUES(54, NULL, NULL, '2010-12-06', 'Shifer', 'Aleksandr', NULL, 'alexshifer@hotmail.com', '646-483-3308', 'Добрый день или вечер (это неважно)!<br />\r\nПользуясь случаем, хотим выразить Благодарность Вашей компании в лице гида Бориса и водителя автобуса Андрея за замечательно проведенную экскурсию в Французскую Канаду, которую Мы посетили с 25 по 28 ноября текущего года.<br />\r\nОтменный профессионализм, чуткость и внимание ко всем туристам Нашей группы, оперативность, чуство юмора, такт и глубокие знания (темы экскурсии) сделали<br />\r\nНашу поездку незабываемой.<br />\r\n Особая благодарность Борису за внесение изменений по маршруту экскурсии, связанных с невозможностью осуществления некоторых из них в зимний период.<br />\r\nНадеемся еще не один раз воспользоваться услугами Вашей компании и ознакомиться с новыми местами, конечно-же с таким гидом как Борис.<br />\r\n Еще раз СПАСИБО. До новых встреч.<br />\r\n                                              Семья Шифер.', NULL, NULL, NULL, NULL, NULL, '108.6.165.49', 'pool-108-6-165-49.nycmny.fios.verizon.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US) AppleWebKit/534.10 (KHTML, like Gecko) Chrome/8.0.552.215 Safari/534.10', 'USA', 'Brooklyn', 'kd7gajhh4o19p9e7ea0i8ru471');
INSERT INTO tour_testimonial VALUES(55, NULL, NULL, '2010-12-23', 'Берсенев', 'Виктор', NULL, 'Bersenev.viktor@mail.ru', '79213351025', 'Ездили автобусным туром во Флориду  11.12. по.  20.12 вашей турфирмой. Получили массу впечатлений и эмоций. За что огромное спасибо  гиду МИЛЕ а также особое спасибо водителю ЛЬВУ. Эти люди занимаются своим делом професионально , качественно,а самое главное с любовью. Спасибо ВАМ и компании NEWTOURS.   P.S  поздравляем с НОМЫМ ГОДОМ и желаем вашей компании удачи . С уважением ВИКТОР иСВЕТЛАНА  РОССИЯ Санкт Петербург.', NULL, NULL, NULL, NULL, NULL, '68.194.88.83', 'ool-44c25853.dyn.optonline.net', 'Mozilla/5.0 (iPad; U; CPU OS 3_2_2 like Mac OS X; ru-ru) AppleWebKit/531.21.10 (KHTML, like Gecko) Version/4.0.4 Mobile/7B500 Safari/531.21.10', 'Russia', 'Санкт петербург', '2qr5vv7gcfi2ahuu164bdmnhl1');
INSERT INTO tour_testimonial VALUES(56, NULL, NULL, '2010-12-26', 'Lipel', 'Angela', NULL, 'alipel7@yahoo.com', '718-541-4552', 'I would like to thank you for a great tour to Washington on 12/22-12/23/10 with guide Boris and driver Slava. Everything was organized very well. Boris made this tour very informative and pleasant. Everyone that I talked to had the same opinion. Thanks again. I wish you inform on your site who the guide will be for all future tours. I would travel with your company more often. I traveled several times already and not every trip was pleasant. Happy New Year!!! ', NULL, NULL, NULL, NULL, NULL, '173.63.85.149', 'pool-173-63-85-149.nwrknj.fios.verizon.net', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.0; SLCC1; .NET CLR 2.0.50727; .NET CLR 1.1.4322; .NET CLR 3.5.30729; .NET CLR 3.0.30618)', 'USA', 'Hazlet', 'm1r3bt7momsubmc85uhj9akoa7');
INSERT INTO tour_testimonial VALUES(57, NULL, NULL, '2010-12-27', 'Лерер', 'Алла', NULL, 'sagitariys69@gmail.com', '718-974-4346', 'Мы очен возмущены отношением к клиентам турагенства. Нам обещали поездку на Ниагарский водопад, утверждая накануне,что поездка состоится в любом случае.Однако, имея все наши координаты, никто не соизволил предупредить чтобы мы не выходили на остановку где нас должен  был взять автобус. В снег по колено, с багажом, так как даже такси не ходили мы вынуждены были в 5 утра идти на встречю с группой. Промерзнув на улице более часа при минусовой температуре и диком ветре,мы вернулись домой. Поездка не состоялась а на душе очень неприятный осадок от халатного отношения к людям. Больше не буду иметь дело с некомпетентным турагенством.', NULL, NULL, NULL, NULL, NULL, '24.184.49.197', 'ool-18b831c5.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.0; Trident/4.0; GTB6; SLCC1; .NET CLR 2.0.50727; Media Center PC 5.0; .NET CLR 1.1.4322; .NET CLR 3.5.30729; InfoPath.2; .NET CLR 3.0.30729; .NET4.0C; BRI/1)', 'USA', 'Нью Йорк', 'r39rk9cppoh33odfb847bv5g93');
INSERT INTO tour_testimonial VALUES(58, NULL, NULL, '2010-12-30', 'Базарова', 'Екатерина', NULL, '  bazarovane@gmail.com', '+79217271113', 'С Новым годом и Рождеством, дорогие бывшие соотечественники. Мы провели совсем немного времени с Михаэлем и Людмилой  Томашевской  в мае уходящего года и были очарованы ими как гидами. В нашем печальном отечестве редко можно услышать правильную русскую речь и получить удовольствие от мягкого юмора. Спасибо всем, спасибо им. Планируем путешествовать с вами.', NULL, NULL, NULL, NULL, NULL, '83.251.160.6', 'c83-251-160-6.bredband.comhem.se', 'Mozilla/5.0 (Macintosh; U; Intel Mac OS X 10_6_5; en-US) AppleWebKit/534.10 (KHTML, like Gecko) Chrome/8.0.552.231 Safari/534.10', 'Russia', 'Петрозаводск', 'na3427tol17ktefj840bp7u301');
INSERT INTO tour_testimonial VALUES(59, NULL, NULL, '2011-01-20', 'Артемова', 'Оксана', NULL, 'findbest@bk.ru', '8-921-345-10-13', 'Большое спасибо организаторам экскурсии в Вашингтон 5 января 2011г! Особенное восхищение и уважение гиду Эмилю! Потрясающие знания истории, кругозор, эрудиция, память на даты, имена, события! Если к этому добавить умение донести это до слушателя в наше скоротечное время, когда все мы спешим, плохо воспринимаем, торопимся увидеть и тп! Лучшего гида найти трудно, хотя мы с мужем много путешествуем. Гостиница супер, обед, экскурсии - все вовремя. Получили большое удовольствие, спасибо!', NULL, NULL, NULL, NULL, NULL, '78.37.180.226', 'ppp78-37-180-226.pppoe.avangarddsl.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; Trident/4.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0)', 'Russia', 'Санкт-Петербург', 'a0g1j96d473i5l5llk5tqinh80');
INSERT INTO tour_testimonial VALUES(60, NULL, NULL, '2011-01-20', 'Московский', 'Никита', NULL, 'garfild@mail.ru', '1813454', 'Аризона,Юта,Вегас,Лос-Анджелес-это конечно всё здорово,но тур жутко не продуман,просто идиотизм-пидарасты!!!!!Постоянное передвижение на некомфортабелном автобусе....', NULL, NULL, NULL, NULL, NULL, '67.100.196.123', 'h-67-100-196-123.lsanca54.static.covad.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; GTB6.6; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; OfficeLiveConnector.1.5; OfficeLivePatch.1.3; .NET4.0C)', 'Russia', 'Москва', 's5bb9jae0rch7hi6ljath6rmm5');
INSERT INTO tour_testimonial VALUES(61, NULL, NULL, '2011-02-09', 'Ким', 'Мила', NULL, 'chemila@mail.ru', '+79265587825', 'Руководству "Нью Турс№. Здравствуйте!В прошлом году в июне посетила Америку по частному приглашению.С вашей компанией ездила в Вашингтон и на Ниагару.Многие мои друзья и знакомые хотели бы посетить Нью-Йорк в октябре(группа 30 человек, срок 7 дей).Много вопросов по поводу приглашения,визы,прелета ,проживания и сколько  примерно будет стоить наша поездка?<br />\r\nНадеюсь на Ваш ответ.Всего доброго.<br />\r\n ', NULL, NULL, NULL, NULL, NULL, '95.25.105.201', '95-25-105-201.broadband.corbina.ru', 'Opera/9.80 (Windows NT 5.1; U; ru) Presto/2.7.62 Version/11.01', 'Russia', 'Москва', 'hi0jqh3bar3hj789kf5ehetg42');
INSERT INTO tour_testimonial VALUES(62, NULL, NULL, '2011-02-09', 'Ольга', 'Климович', NULL, 'klmv6@yandex.ru', '375 447 711 711', 'Здравствуйте! <br />\r\nРазрешите обратиться с просьбой. Я воспользовалась услугами Вашего агентства в августе 2008 года (с 16 по 24 августа, по-моему). Тур как Вы и обещали, был отличным, кроме того попутчики оказались очень компанейскими. Меня в автобусе подсадили к женщине по имени Ольга по фамилии (Я)Ерошева или очень похожая на эту фамилию. Мы подружились и т.к. у меня не было фотоаппарата, она меня фотографировала, а в конце поездки она написала мне в мой блокнот свой номер телефона для передачи потом фото, но я его потеряла при переезде из Нью-Йорка в Минск. Позже я пыталась в сентябре и октябре найти ее телефон, но она по американскому номеру была недоступна. Скорее всего, она выключила его, когда вернулась в Москву. <br />\r\nВремя идет, мы так и не связались, а я очень часто вспоминаю эту поездку, но, к сожалению фотографий - самых ярких впечатлений и воспоминаний нет. <br />\r\nПоследняя надежда на вас дорогой «Ньютурс». Только вы мне сможете помочь, а Москва слишком большой город, чтобы поэтому скудному описанию найти человека. Я вспомнила, что она обменивалась телефонами с семейной парой русских, живущих в Америке, которая сидела сбоку по мою правую руку и ещё одна пара, сидящая на первом ряду, справа от водителя (т.е. не за ним). Я уверена они меня вспомнят, т.к. мы общались и не будут против дать мне номер Ольги.<br />\r\nСпасибо Вам. <br />\r\n', NULL, NULL, NULL, NULL, NULL, '86.57.255.132', 'mail2.btg.by', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'Russia', 'Минск', '0dgobqs1o36lgqf4oc28b44rg4');
INSERT INTO tour_testimonial VALUES(63, NULL, NULL, '2011-02-16', 'Мальцева', 'Софья', NULL, 'sofyma@yandex.ru', '89127822059', 'Мы 5 февраля ездили в тур по Вашингтону. Экскурсию вели гид Эмиль и водитель Азиз. Все прошло супер, некоторых моментов, заявленных в программе частично не было из-за плохих погодных условий, но почти все ухитрилиь заместить равноценным. А Эмиль вообще провел экскурсию на высшем уровне, это постоянный поток информации, который не надоедает слушать, все было продуманно, с заботой о туристах и интересно. Только было очень смешно, когда нам говорили, что времени у нас очень много- целых 50 минут на Капитолий и оранжерею... Особое спасибо Виктории за координацию и в России, и после приезда.', NULL, NULL, NULL, NULL, NULL, '46.146.237.26', 'net237-26.perm.ertelecom.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; GTB6.6; MRA 5.3 (build 02564); TIOnline updater v Embedded Web Browser from: http://bsalsa.com/; .NET CLR 2.0.50727; .NET CLR 3.0.04506.30; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'Russia', 'Пермь', 'i4bk8qm044q084jkq7bfcqu0j6');
INSERT INTO tour_testimonial VALUES(64, NULL, NULL, '2011-03-08', 'plam', 'david', NULL, 'davidpl@education.gov.il', '+972-507383619', 'здравствуйте !<br />\r\nНас 2-человека,препологаемые экскурсии <br />\r\nна июнь<br />\r\n25-26 Вашингтон(предусмотрен вход в музей аэронавтики ?)<br />\r\n29-3- - Ниагара<br />\r\nиюль<br />\r\n2-11 - тур 10 дней Калифорния<br />\r\nВопросы :<br />\r\n<br />\r\nСтоимость и условия оплаты(есть у нас родственники в NU  )<br />\r\nЕсть ли скидки за предварительных заказ ?<br />\r\nГарантированный выход туров(мы заране должны заказать авиабилет)<br />\r\nСпособы оплаты(может есть ваши диллеры в Израиле ?)<br />\r\nВсего хорошего.Давид', NULL, NULL, NULL, NULL, NULL, '194.90.25.27', '194.90.25.27', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; InfoPath.2; .NET CLR 2.0.50727; .NET CLR 3.0.04506.30)', 'Israel', 'jerusalem', '4lpmgq574pmd7jh641evae7vd6');
