INSERT INTO tour_testimonial VALUES(70, NULL, NULL, '2011-06-21', 'Григоренко', 'Виктория', NULL, 'victoriagrigorenko@gmail.com', '6042448199', 'Доброго дня. Хотелось бы поблагодарить за чудесно организованные туры по Нью Йорку и Вашингтону 12 и 13 июня. Особая благодарность экскурсоводу Ирине за замечательные экскурсии и информацию. Надеюсь, что продолжим общение с Newtours. Victoria', NULL, NULL, NULL, NULL, NULL, '70.79.38.223', 'S0106001cf07188ab.vc.shawcable.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.17) Gecko/20110420 Firefox/3.6.17 ( .NET CLR 3.5.30729)', 'Canada', 'ВАнкувер', '7a8t0u10lsuaeo8iuv9vuck4j4');
INSERT INTO tour_testimonial VALUES(71, NULL, NULL, '2011-06-23', 'тен', 'ирина', NULL, 'irinaten@ymail.com', '123456789', 'мы были на экскурсии по нью йорку. это было небольшое интересное путешествие по знаменитым достопримечательностям удивительного и неповторимого мегаполиса. Я очень благодарна агентству за предусмотренный и организованный сервис,увлекательные рассказы гида Риты, опытную работу водителя сергея.', NULL, NULL, NULL, NULL, NULL, '24.215.198.213', 'user-0cdfhml.cable.mindspring.com', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'USA', 'нью йорк', 'rshk6cbb02ba2jskmutleggje4');
INSERT INTO tour_testimonial VALUES(72, NULL, NULL, '2011-06-29', 'Gibson', 'Vera', NULL, 'verag@nyc.rr.com', '7184791107', 'I have just returned from Cape Cod tour and I would like to say thank you to our dear tour guide Nellie Shevchenko and bus driver Pavel Malegik (sorry if I spelled your last names wrong). <br />\r\n<br />\r\nOn Saturday June 25th my husband dropped me off on Queens blvd, I found my bus and first thing I saw Pavel and Nellie waiting for me with the smile and greetings, ready to help with the luggage and get to my seat. You won’t believe how happy I was to learn that Nellia will be our guide, I remember her from my last trip to Pittsburg a few years ago, it was perfect, and this time once I saw her I said this trip will be perfect too no matter what. I got to my seat, relaxed and from that moment on I felt I was on vacation.<br />\r\n<br />\r\nI was right, Nellie knew about states we were passing by, events, people more than I or you can read in a life time, the information was correct, easy to digest, interesting, the history facts she presented were fun to listen and to remember for folks like me who come home and tell stories to friends and relatives of places we visited. Needless to mention that Nellie organized our time the way we wanted, official program, cruses, relaxation, fun, all in one or one after another. She encouraged us to use our time wisely and take opportunity to see and experience things and places that we would be lazy to do on our own.<br />\r\n<br />\r\nThe perfect picture cannot be complete without saying a few words about our bus driver Pavel, he is highly professional of driving a tour bus with lots of people of different age, background and disposition. His smooth, courteous driving is what we would expect from a tour bus driver, we never experienced any delays or situation where we were late or lost. Pavel knew the best route to use, always on time, bus was clean and ready every morning, our group felt to be privileged to have him as our driver.<br />\r\n<br />\r\nI cannot describe all good things that happened to us because of wonderful guide Nellie and lovely driver Pavel in this short letter but I am sure that all members of our group would sign up under what I said with both hands. All in all Nellie and Pavel thank you so much from all of us. <br />\r\n<br />\r\nOur group would like to ask management of New Tours to recognize these employees as best out of best, they deserve it.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '98.14.44.231', 'cpe-98-14-44-231.nyc.res.rr.com', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; InfoPath.2)', 'USA', 'Oakland Gardens', '1d0rkd0re4rclr3aq90tn9o4e1');
INSERT INTO tour_testimonial VALUES(73, NULL, NULL, '2011-07-03', 'Попова', 'Елена', NULL, 'breshenkov@rambler.ru', '+74955210133', 'От компании Туртрансвояж (Москва) в поездке 10-29 июня 2011 г. нас было 6 человек. Все прекрасно, замечательно,спасибо! Но есть некоторые просьбы-предложения по организации тура для приезжих из России. Лично я не знаю английского языка, и знакомых и родственников, которые мне бы помогли в Америке, нет. А проблемы начались с первого дня пребывания из аэропорта в гостиницу, когда выяснилось на рецепшене, что в первой же гостинице номера у наших 2 попутчиков не забронированы. Предложение 1: пусть хотя бы водители, которые привозят из аэропорта помогают нам заселяться в гостиницы, может им надо за это доплачивать. При вылете из Нью-Йорка в Лос-Анжелес в аэропорту проходим контроль через незнакомые нам терминалы, времени и нервов ушло масса. Аналогично и в других местах регистрации в аэропортах. Предложение 2: необходим помощник-сопровождающий при посадке на самолеты в аэропортах. Может такие туристы как мы - не основной Ваш контингент, но на форуме Туртрансвояжа такие моменты озвучены и они охлаждают пыл желающих поехать в тур по Америке. Не всегда гиды дают свои телефоны, а ТТВ практикует, что у гидов есть еще и список с телефонами туристов и опасения, что потеряешься сведены к минимуму. Предложение 3: гиды должны в обязательном порядке озвучивать номера своих телефонов в поездке. И предложение-пожелание 4: в длительных переездах показывать фильмы по теме предложенного маршрута, в которых бы рассказывалось о тех местах, к которым едем или по которым проезжаем. Буду писать отчет по прошедшей запоминающейся поездке и надеюсь, что Вы как-то учтете высказанные здесь предложения.      ', NULL, NULL, NULL, NULL, NULL, '81.13.5.194', 'breshenkov-av.rmt.ru', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.1.19) Gecko/20110420 Firefox/3.5.19 (.NET CLR 3.5.30729)', 'Russia', 'Москва', '3cuoosvurmpa5ln5flmmnf7ke3');
INSERT INTO tour_testimonial VALUES(74, NULL, NULL, '2011-07-21', 'Левчук', 'Алла', NULL, 'volevchuk@yandex.ru', '', 'Добрый день!<br />\r\nИнтересует индивидуальная экскурсия на русском языке по Н-Й на 4 человека, 20 ноября 2011, с посещением Статуи Свободы, на автомобиле, не менее 8 часов, проживание забронировано в отеле Grand Hyatt New York (Central, Midtown Адрес: 109 EAST 42ND STREET, NEW YORK 10017, UNITED STATES)', NULL, NULL, NULL, NULL, NULL, '95.140.22.198', 'tashirtelecom.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/534.30 (KHTML, like Gecko) Chrome/12.0.742.122 Safari/534.30', 'Russia', 'Москва', 'sd4hc07qoom8263une5j7sd4e3');
INSERT INTO tour_testimonial VALUES(75, NULL, NULL, '2011-07-22', 'Орт', 'Сергей', NULL, 'ortsv@mail.ru', '+7-926-246-0030', 'Огромное спасибо за отличную организацию тура "Зап.Канада и Сиэттл" с 1 июля 2011 года. Молодцы, всё было на высшем уровне. Обязательно съезжу через Вашу компанию по другим маршрутам', NULL, NULL, NULL, NULL, NULL, '94.159.40.134', 'mxs02.cse.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; .NET4.0C; .NET4.0E)', 'Russia', 'москва', 'efn70vntqain6dn79ddpepatq3');
INSERT INTO tour_testimonial VALUES(76, NULL, NULL, '2011-07-28', 'Osadchi', 'Olga', NULL, 'Olos11@yahoo.com', '', 'oiuouoyiuyiyoyoiyoioiooioioioiuyuiyiuyiuyiu', NULL, NULL, NULL, NULL, NULL, '69.114.178.172', 'ool-4572b2ac.dyn.optonline.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.10) Gecko/20100914 MRA 5.7 (build 3686) Firefox/3.6.10', 'USA', 'New Brunswik', '81u7v5u2a56kt2a8cu0q2fp6d3');
INSERT INTO tour_testimonial VALUES(77, NULL, NULL, '2011-08-01', 'БАЙРАМОВА', 'ТАТЬЯНА', NULL, 'tbay1964@yahoo.com', '', 'ОРГАНИЗОВАННЫЕ ВАМИ ЭКСКУРСИОННЫЕ ПОЕЗДКИ ПО АМЕРИКЕ НА СЕГОДНЕШНИЙ ДЕНЬ -ЭТО ЛУЧШЕЕ ИЗ ЛУЧШИХ.БЫЛА В ПОЕЗДКЕ 28-29 ИЮЛЯ ЭТОГО ГОДА С ЭКСКУРСОВОДОМ ЛЁВОЙ И ВОДИТЕЛЕМ СЛАВОЙ В ВАШИНГТОНЕ,БРАВО РЕБЯТАМ,БРАВО КОМПАНИИ.ЖЕЛАЮ СТАБИЛЬНОСТИ И ДАЛЬНЕЙШЕГО ПРОЦВЕТАНИЯ.РЕКОМЕНДУЮ ВСЕМ.СПАСИБО.', NULL, NULL, NULL, NULL, NULL, '98.109.71.127', 'pool-98-109-71-127.nwrknj.fios.verizon.net', 'Mozilla/5.0 (Windows; U; Windows NT 6.0; en-US; rv:1.9.2.18) Gecko/20110614 Firefox/3.6.18 ( .NET CLR 3.5.30729; .NET4.0C) sputnik 2.1.0.18', 'USA', 'RIDGEWOOD', 'knegu45soums004je9dbvpe077');
INSERT INTO tour_testimonial VALUES(78, NULL, NULL, '2011-08-05', 'бимбеева', 'кермен', NULL, 'kermen_1975@mail.ru', '6469575624', 'привет всем!путешествовала вашей компанией мне очень понравилось!молодцы хороший сервиз!спасибо нашим гидам ЛЕВЕ и РЕББЕКЕ а также водителям СЛАВЕ и ЖАНУ!удачи и процветания вашей компании!спасибо!', NULL, NULL, NULL, NULL, NULL, '173.54.33.117', 'pool-173-54-33-117.nwrknj.fios.verizon.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; Trident/4.0; GTB7.1; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; BRI/1; MAAU; .NET4.0C; MAAU)', 'USA', 'вайкофф', 'm3afes8tdlhh8ffgf1hm1sl9e1');
INSERT INTO tour_testimonial VALUES(79, NULL, NULL, '2011-08-05', 'ioulia', 'anossova', NULL, 'janossova@yahoo.com', '201 602 8902', 'I paid via pay pall for 7/16 trip to Rockefeller estate on the Hudson that was cancelled by NewTours, since that time I can not receive my money back.<br />\r\nI speak to the representative every other day - and still no money returned. Please let me know what is going on.', NULL, NULL, NULL, NULL, NULL, '63.117.201.120', '63.117.201.120', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.04506.30; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'USA', '', 'opprlqsgu7hvqo23n1nljfrdo2');
INSERT INTO tour_testimonial VALUES(80, NULL, NULL, '2011-08-24', 'Shumskaya', 'Natallia', NULL, 'nshumskaya@hotmail.com', '780-443-5818', 'We were very disappointed by your two-day tour to Niagara Falls. Of course I don\\''t mean Niagara Falls itself, because this is absolutely beautiful scenery! However, your service is way below North American standards. First of all, it took driver 12 hours to get to Niagara Falls! Seriously? 400 miles with 65 miles limit? NO traffic on the highway!!!  Should\\''ve taken 7 hours...the same as promised on your website. So, you should have disclosed honest description of the hours of this tour.<br />\r\nThe second, the tour-guide (Irina) was so unprofessional and had luck of knowledge regarding this excursion. The other lady, Galina, is no better. She asked us how was the tour and when I answered that I am not satisfied with really long driving; reply was, “What did you expect? You had nothing else to do in any way\\". Really? Is that how you talk to people? You stole tourists\\'' time to enjoy the Falls. I guess, it is normal practice for your company. <br />\r\nAnd so you know, my family planned to take 3 more tours with your company within next couple weeks and, perhaps, in the nearest future. However after this horrible experience, we will never use your service again...will NEVER advise to use your services to many of my friends. I am glad I paid only for one tour and didn\\''t book others in advance. <br />\r\nThere is so much room for the improvement in your customer service!!! And perhaps, you should send your tour-guide to learn a little bit more of history at list in the area of the tour she is providing.   <br />\r\n', NULL, NULL, NULL, NULL, NULL, '67.237.10.223', 'nj-67-237-10-223.dhcp.embarqhsd.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_6_8) AppleWebKit/534.50 (KHTML, like Gecko) Version/5.1 Safari/534.50', 'Canada', 'Edmonton', 'm0od39gu9an044t45vn7300av6');
INSERT INTO tour_testimonial VALUES(81, NULL, NULL, '2011-08-26', 'бадо', 'юрий', NULL, 'y.bado@mail.ru', '9161628423', 'Уважаемая госпожа Лилия Гельфант!<br />\r\n<br />\r\nЯ встречался с Вами на туристической выставке в Москве. Я хотел бы побывать в Нью-Йорке во второй декаде октября и воспользоваться Вашими экскурсиями. Можете ли Вы также помочь с выбором приличной гостиницы в пределах $150 в сутки, не на Манхеттене, но рядом с метро?<br />\r\n<br />\r\nС уважением,<br />\r\nЮрий Бадо', NULL, NULL, NULL, NULL, NULL, '91.79.36.228', 'ppp91-79-36-228.pppoe.mtu-net.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; GTB7.1; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; eSobiSubscriber 2.0.4.16; .NET4.0C)', 'Russia', 'москва', '9t9gl7053e3ta62dqa3fh3age1');
INSERT INTO tour_testimonial VALUES(82, NULL, NULL, '2011-08-30', 'Нестеренко', 'Елена Юрьевна', NULL, 'oksanenok@e1.ru', '+79617764924', 'Претензия руководству компании<br />\r\n"New Tours" от туристов<br />\r\n<br />\r\nНестеренко Елены Юрьевны,<br />\r\n<br />\r\nГузиковой В. В., Походзей Г. В.<br />\r\n<br />\r\nПретензия.<br />\r\n<br />\r\n Мы путешествовали с вашей компанией по программе "Звезды Атлантики" 10 дней+ 1 дополнительная ночь в Нью-Йорке с 9 по 19 августа 2011г. Когда мы прилетели в Лос-Анжелес 12 августа, нас никто не встретил, хотя в программе было указано, что нас встретят - цитирую вашу программу - "на выходе из багажного отделения. Встречающий с табличкой "New Tours". После того, как мы зарегистрировались в отели, мы позвонили в Нью-Йорк, и нам сказали, что мы должны были с вещами перебраться на другой терминал (не зная какой), чтобы встретиться с остальной группой. Мы считали, что гид должен был выяснить, на каком мы  были терминале и встретить нас сама (гид), либо отправить водителя или приехать за нами на автобусе. В результате мы потеряли целый день экскурсионной программы, деньги на телефонные переговоры (так как нас никто и не собирался искать ни в гостинице, ни в каком-либо другом месте), хотя 1 минута любого российского оператора при нахождении в международном роуминге стоит примерно 5$ и целый день пребывали в стрессовой ситуации, потому что встретились с гидом только поздно вечером.<br />\r\n<br />\r\nНаш гид Светлана Арон (не знаем точно ее фамилии, но ее номер тел. 917-915-67-34) повела себя хамским образом, обругав нас за то, что мы не присоединились к группе сами. Не будем описывать всех грубых выражений, которые нам довелось услышать, но заявляем с полной уверенностью, что ни в одной из тех стран, в которых мы побывали (Польша, Голландия, Франция, Германия, Италия, Бельгия, Люксембург, Англия, Тунис, Дания, Норвегия, Швеция, Кипр, Хорватия, Таиланд и др.) мы не встречали гида-хама, гида-националиста (Светлана ненавидит всех русских и не скрывает этого). В рекламе "New Tours" написано, что там работают "только лучшие, признанные гиды". Если это сливки,  то что же молоко? Светлана оскорбила не только нас, а также туристку Валентину, которая была с тросточкой, и Светлана в нелицеприятных выражениях высказала ей, что такие люди не должны путешествовать. Практически каждое утро Светлана начинала с ругани и неприязни по отношению к туристам. Кроме того, мы считаем, что она является непрофессионалом, так как пропутешествовав с ней 6 дней, мы узнали только о истории и географии США, т.е. те сведения, которые можно найти в Интернете, и не услышали ни слова о сегодняшней жизни США, быте, обычаях, традициях, образовании, уровне жизни и т.д. Приехав в Россиию, мы не смогли ответить ни на один вопрос о настоящей жизни США. За такой "disservice" она еще пыталась "выбить чаевые в конце программы".<br />\r\n<br />\r\n<br />\r\n<br />\r\nТребуем выявить виновного в том, что нас не встретили в Лос-Анжелесе и УВОЛИТЬ Светлану Арон, как несоответствующую занимаемой должности и позорящую как Америку (так как она для нас 6 дней была олицетворением этой страны), так и бывший Советский Союз (потому что 20 лет назад она жила здесь).<br />\r\n<br />\r\nОтвет пришлите на e-mail: oksanenok@e1.ru<br />\r\n<br />\r\nP.S. В программе на 08/18 у нас написано, что завтрак организует гид, так как мы улетали рано (8:15) мы не могли завтракать с группой, тем не менее Светлана сказала, что нам не положена компенсация за завтрак. Так ли это?<br />\r\n<br />\r\n<br />\r\n<br />\r\nС уважением, Елена Юрьевна.', NULL, NULL, NULL, NULL, NULL, '90.157.61.48', 'yoyoer.telenet.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/535.1 (KHTML, like Gecko) Chrome/13.0.782.215 Safari/535.1', 'Russia', 'Екатеринбург', '7h5s4rp0ii0aupfddvdfhenrg2');
INSERT INTO tour_testimonial VALUES(83, NULL, NULL, '2011-09-14', 'Кариб трэвел', 'Ольга', NULL, 'carib08@mail.ru', '7343355-33-44', 'Лилия,Дина добрый день!<br />\r\nотправила уже вам 5 писем.. но ни разу не получила ответ.... очень жду....<br />\r\nПРошу проверить правильность тура, его стоимость и после этого начнем бронировать на 4 человека.<br />\r\n(папсортные двнные уже предоставили)<br />\r\n<br />\r\nПрограмма тура:этот расчет частично с индивидуальным, частично с групповым туром.<br />\r\n На базе тура НЬЮ-ЙОРК - ЛАС-ВЕГАС - ЛОС-АНЖЕЛЕС- ЛУЧШИЕ ЗАПОВЕДНИКИ ЗАПАДА<br />\r\n11/20  День  1.  Индивидуальный  трансфер Вашингтон – Нью Йорк ( нужно<br />\r\nчтоб  вы  организовали).  Прибытие  в  Нью-Йорк  и  размещение  в  той<br />\r\nгостинице в которой будут жить клиенты по программе. Свободное время.<br />\r\n11/21 День 2. Свободное время.<br />\r\n11/22 День 3. Нью-Йорк. Обзорная автобусная экскурсия, Продолжительность 6-7 часов.<br />\r\n11/23 День 4. Свободный день в Нью-Йорке. <br />\r\n11/24 День 5. Трансфер в аэропорт. Перелет в Лос-Анжелес. Обзорная экскурсия.<br />\r\n11/25 День 6. Лос-Анжелес. Продолжение обзорной экскурсии по Лос-Анжелесу.<br />\r\n11/26 Переезд в район Гранд-Каньона, на границу штатов Невада и Аризона. Размещение в гостинице.<br />\r\n11/27 Переезд в Национальный Парк Гранд-Каньон. Осмотр заповедника, одного из природных «чудес света». Захватывающие дух панорамы Великого Каньона, прогулки. Переезд в район озера Пауэлл, второго по величине искусственного озера США. Размещение в гостинице.<br />\r\n11/28 Каньоны и приезд в гостиницу Лас-Вегаса. Размещение в гостинице.<br />\r\n11/29 День 10. Лас-Вегас - игорная столица мира, игорный гигант, город чудес, удивлений и открытий. Знаменитый “Стрип”<br />\r\n11/30 День 11. Самостоятельный трансфер. Перелет в Майями.Самостоятельный трансфер. Размещение в гостинице 3*.<br />\r\n12/1 День 12. Обзорная экскурсия по Майями 5 часов.<br />\r\n12/2 День 13. Свободный день в Майями<br />\r\n12/3  День  14.  трансфер  в аэропорт. Обратный вылет.(решают еще.. но<br />\r\nнапишите сколько он будет стоить если заранее заказать)<br />\r\nкакая цена  такого тура (включая внутрение перелеты)  + с 20.11-21.11 гостиница в Нью Йорке.<br />\r\n<br />\r\nсписок туристов могу уже выслать.. чтоб не быть голословной...:)<br />\r\n<br />\r\n-- <br />\r\nС уважением,<br />\r\nОльга                      mailto:carib08@mail.ru', NULL, NULL, NULL, NULL, NULL, '213.142.52.90', '90.52-142-213.telenet.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/535.1 (KHTML, like Gecko) Chrome/13.0.782.220 Safari/535.1', 'Russia', 'екатеринбург', '07u24mhr1mj6as4ggdgjfo6913');
INSERT INTO tour_testimonial VALUES(84, NULL, NULL, '2011-09-14', 'довгер', 'александр', NULL, 'adovger@yahoo.com', '496950519', 'Уважаемая компания Нью Турс.<br />\r\nХотелось бы выразить Вам нашу благодарность .<br />\r\nМы взяли у Вас 5 туров по Нью-Йорку, Бостону, Ниагаре,Вашингтон и Фейрверки с Филадельфией. Все было организовано отлично.  <br />\r\nВсе пятеро гидов были хороши. <br />\r\nОсобенная благодарность трем Вашим гидам. <br />\r\nАвару,который вез нас на Ниагару, Борису, который вез нас в Вашингтон и <br />\r\nБорису, который вел фейерверки и Фидадельфию.<br />\r\nАвар, мягкий, тактичный и очень знающий экскурсовод.<br />\r\nБорис Вашингтонский, человек огромной эрудиции и самых разносторонних <br />\r\nзнаний. Борис Филадельфийский, замечательный рассказчик. <br />\r\nМы были с русскими гидами на фейерверках в Испании, Нице и Флоренции, но такого<br />\r\nрассказа об истории фейерверков, типах фейрверков и  устройстве зарядов<br />\r\n не слышали ни от кого. Три гида  такого класса в одном агентстве - это замечательно.<br />\r\nЕдинственное замечание -это организация экскурсии в Нью-Йорке.<br />\r\nГид была неплоха, но обратный  двухчасовый проезд от музея через Квинс на Брайтон,<br />\r\nубил все впечатление. Это все таки очень тяжело.<br />\r\nНо в целом,Вы отлично работаете.<br />\r\nСпасибо.<br />\r\n <br />\r\nАлександр Довгер<br />\r\nМюнхен   ', NULL, NULL, NULL, NULL, NULL, '69.114.178.172', 'ool-4572b2ac.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0)', 'Germany', '', '2bbfdqe6jbfkq771job6n7a3s3');
INSERT INTO tour_testimonial VALUES(85, NULL, NULL, '2011-09-14', 'петров', 'федя', NULL, 'moskvarus@yandex.ru', '', 'все очень плохоюобслуживание ниже среднегоб автобусы тесныеб постоянно ломаються', NULL, NULL, NULL, NULL, NULL, '24.184.156.220', 'ool-18b89cdc.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.0; WOW64) AppleWebKit/535.1 (KHTML, like Gecko) Chrome/13.0.782.220 Safari/535.1', 'Russia', 'москва', '8gdj3i3069o9qjtjhnfn39jga5');
INSERT INTO tour_testimonial VALUES(86, NULL, NULL, '2011-09-16', 'Шевцова', 'Ольга', NULL, 'carib08@mail.ru', '343 355-33-44', 'Лилия,Дина добрый день"!<br />\r\n<br />\r\nпроверьте  мои  расчеты  пожалуйста  по  моей  четверке ( я просто уже немного запуталась)<br />\r\n-сам тур НЬЮ-ЙОРК - ЛАС-ВЕГАС - ЛОС-АНЖЕЛЕС- ЛУЧШИЕ ЗАПОВЕДНИКИ ЗАПАДА 1850 дол с чел ( комиссионый)<br />\r\nпри двухместном размещении<br />\r\n-трансфер  индивидуальный  Вашингтон-Нью йорк на чел 138 дол (550 дол на 4 чел исходя из этого)<br />\r\n-майями  отель  на  3  ночи  (145 дол х3н :2 чел=218 дол  с чел. лучше отель casablanca on the ocean<br />\r\n-обратный трансфер в майми в аэропорт 180 дол :4 чел=45 дол с чел<br />\r\n- в нью йорке доп. ночь вы ее посчитали в туре.<br />\r\n<br />\r\nт.е. итого 2251 дол с чел. за двухместное размещение<br />\r\nи что комиссионное что нет надо написать<br />\r\n<br />\r\nиз 4 чел.( две женщины и 2 мужчины)<br />\r\n<br />\r\nи мужчины возжелали по всему туру жить в одноместных номерах<br />\r\nдавайте  на них тоже посчитаем, сколько будет цена при одн. размещении<br />\r\nпо туру и в отелях в нью йорке и майями...<br />\r\n<br />\r\nочень жду ответ<br />\r\n-- <br />\r\nС уважением,<br />\r\nОльга                          mailto:carib08@mail.ru', NULL, NULL, NULL, NULL, NULL, '213.142.52.90', '90.52-142-213.telenet.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/535.1 (KHTML, like Gecko) Chrome/13.0.782.220 Safari/535.1', 'Russia', 'екатеринбург', 'kb1dp2s0uplmpn4kif1ajq8q44');
INSERT INTO tour_testimonial VALUES(87, NULL, NULL, '2011-09-17', 'Khachatryan', 'Ara', NULL, 'armenian_nj@yahoo.com', '646 704 3333', 'Не рекомендую вообще связываться с этой шарашкиной конторой жуликов, хапуг, воров и хамок.', NULL, NULL, NULL, NULL, NULL, '64.134.243.130', 'ip-64-134-243-130.public.wayport.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; Trident/4.0; GTB7.1; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729)', 'USA', 'New York', 'tod1b0s6au4jhephl3k4u9rf50');
INSERT INTO tour_testimonial VALUES(88, NULL, NULL, '2011-09-28', 'Шелест', 'Ирина', NULL, 'irina.shelest07@yandex.ru', '(495)2239222', 'Добрый день уважаемые коллеги,<br />\r\n1)можете ли Вы подобрать отель на Брайтон Бич на 2-3 недели с середины июня , 2 номера 2 и 3 человека?<br />\r\nЕсть ли там на берегу отели 4*? <br />\r\n2) так же мы хотели бы устроить ребенка 12 лет в летний лагерь или в школу на курсы ,практиковать язык, недалеко от Брайтона?<br />\r\nСпасибо, Ирина', NULL, NULL, NULL, NULL, NULL, '178.177.3.160', 'wimax-client.yota.ru', 'Mozilla/5.0 (Windows NT 5.1; rv:6.0.1) Gecko/20100101 Firefox/6.0.1', 'Russia', 'Москва', 'duebi7ic8vipr8uhk1e7bhg4h5');
INSERT INTO tour_testimonial VALUES(89, NULL, NULL, '2011-10-15', 'Sokolova', 'Marina', NULL, 'smarina1221@yahoo.com', '8454257261', 'Индивидуальные экскурсии в Майами были отвратительные.Мои гости из России были разочарованы.Самое обидное,что я точно знаю,что показывают на этих экскурсиях обычно.Я не в первый раз в Майами и брала эти экскурсии как на русском ,так и на английском.Например на обзорной экскурсии нам показали только Коллинз авеню и Южный пляж.Экскурсию на катере я не считаю,так наш экскурсовод просто присоеденился к американскому круизу.Ещё небольшой проезд по улице с домами с видом на залив.Мы не видели не маленькой Гаванны,не Венецианских бассейнов,не района Коралл Гейбл,ни отеляБилтмор.И ещё много чего.Такие деньги надо отрабатывать.Почему то аналогичные экскурсии в Лас Вегасе были просто супер.А полинезийское шоу вообще без комментариев.Заплатили бешенные деньги не понятно за что.Кстати в чек за еду были включены билеты на шоу(и на экскурсовода тоже).Получилось что заплатили дважды.Теперь подумаем с какой компанией сотрудничать.Мы клиенты вашей компании уже много лет.Но впервые разочарованы.', NULL, NULL, NULL, NULL, NULL, '69.127.44.96', 'ool-457f2c60.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; GTB7.1; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; HPDTDF; .NET4.0C)', 'USA', '', '910v8a4c80hvfn4krh3sdf2kr5');
INSERT INTO tour_testimonial VALUES(90, NULL, NULL, '2011-11-01', 'Шевченко', 'Владимир', NULL, 'Vl77vl@yandex.ru', '89053801188', 'UЗдравствуйте Лилия. Меня зовут Владимир. У нашей семьи произошла очень неприятная ситуация с компанией ньютурс. Ваши менеджеры продали нам тур в Мексику на 10 дней,и приэтом сказали "хотите мы вам возьмем авиабилеты". На что я спросил "сколько стоит эта услуга и на сколько дороже будут билеты" . На что мне ответили"мы на билетах не зарабатываем ,мы пришлем вам билеты,где будет указана цена,лишние деньги мы вам вернем". Деньги брала менеджер Лина. Потом со мной связывалась менеджер Деля которая сначала говорила тоже самое,потом она прислала билеты без цен. На мою просьбу отчитаться за взятые деньги она ответила отказом,когда я просил телефон руководства она сказада,что деньги оставшиеся от покупки остались в фирме имне уже не вернутся. Мне пришлось связываться с авиакомпаниями и узнавать цену покупки(они прислали мне билеты с ценами). Расчет по цифрам выглядит следующим образом. У меня взяли 3560 долларов за двух человек меня и мамы.Приобрели билеты сан Франциско-Мехико по 285$ каждый то есть 570$ за два. Канкун-Москва 1184$ каждый то есть за два билета 2368$.сумма обоих покупок 2938$. У ваших менеджеров осталась на руках сумма 622$ которую они должны были вернуть.билеты канкун- Москва я попросил их сдать и вернуть мне эти деньги за вычетом 10% отцены билетов удерживаемых компанией "трансаеро",на что мне было сказано эти деньги мы вам вернем в случае ,если вы не будете претендовать на622$,если же будете то мы их вам не отдадим. На что ясказал ,что могу обратиться в суд,а лучше в первую очередь к вам Лилия. Ваши менеджеры мне ответили обращайся куда угодно хоть к президенту,далеесказали что вы в курсе про эти махинации и поэтому им ничего не будет. Также не относятся к людям. Я прошу свои деньги. До этого мы брали у вас туры на трех человек в Вашингтон,на трех обзорную в нью иорке,на трех 10 дневный тур лос анджелес и т.д.(кстати мы туда прилетели сами,если бы мне сразу объявили что билеты дороже цен которые на сайте в интернет ,я бы их сам купил). Мы и отдыхать после лос Анджелеса поехали на гаваи сами из за такого отношения. Гиды у вас отличные везде и сейчас в Мексике очень эрудированный и интересный гид. Такие же сотрудники просто отпугивают клиентов, я вам не советчик но от них нужно избавляться. Даже с экономической точки зрения из за присвоенных ими денег,какое будет у меня отношение,что я могу сказать людям про" нью Турс",что написать в отзывах?прошу вас разобраться в ситуации. Вернуть мне 622$ и деньги за сданные билеты канкун-Москва вылет10 ноября 2012 в сумме 2368$-10% удерживаемых авиакомпанией. С уважением Шевченко Владимир. ', NULL, NULL, NULL, NULL, NULL, '189.236.34.227', 'dsl-189-236-34-227-dyn.prod-infinitum.com.mx', 'Mozilla/5.0 (iPad; U; CPU OS 3_2_2 like Mac OS X; ru-ru) AppleWebKit/531.21.10 (KHTML, like Gecko) Version/4.0.4 Mobile/7B500 Safari/531.21.10', 'Russia', 'Саратов', '4jonvll75q1i85d6bqm1hhpns1');
