INSERT INTO tour_testimonial VALUES(96, NULL, NULL, '2012-01-11', 'Krutko', 'Elena', NULL, 'krutko@ngs.ru', '+79139249849', '9-10 января 2012 года мы с супругом имели удовольствие отправиться в двухдневный тур к Ниагарскому водопаду с New Tours. Хочется выразить искреннюю благодарность всем работникам New Tours за прекрасно оганизованный тур. Особенных слов благодарности и восхищения  заслуживает Борис Волкин, который был нашим экскурсоводом эти два дня и сделал этот тур поистенне уникальным и незабываемым для нас. Мы искренне благодарим Бориса за обширное знание истории, творческий подход к своему ремеслу и за неутомимое желание поделиться своими знаниями с туристами. <br />\r\nЕлена и Александр Крутько ', NULL, NULL, NULL, NULL, NULL, '207.237.169.140', '207-237-169-140.c3-0.wsd-ubr2.qens-wsd.ny.cable.rcn.com', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; InfoPath.1)', 'Russia', 'Новосибирск', 'g1fm0aui135d19veh49r8ghg47');
