INSERT INTO tour_testimonial VALUES(99, NULL, NULL, '2012-02-10', 'Stroitelev', 'Vladislav', NULL, 'nina09@list.ru', '+79161161457', 'Уважаемый New Tours!В течении 2 месяцев мы организуем тур в Канаду.В настоящее время у нас есть билеты со2 по11 марта в Монреаль и обратно,а так же виза в Канаду.Ваш тур ЛУЧШЕЕ В КАНАДЕ нам очень подходит по датам и цене.Готовы оплатить его в удобной для Вас форме немедленно по получении Вашего ответа на заказ.Одна просьба:сообщите название отелей остановки Вашей группы в Монреале,Ниагарских водопадах и Торонто,так как нам нужно заказать в них места для дальнейшего самостоятельного проживания после окончания  Вашего тура.Заранее благодарен и жду ответа.Владислав.', NULL, NULL, NULL, NULL, NULL, '95.221.172.232', 'ip-95-221-172-232.bb.netbynet.ru', 'Mozilla/5.0 (Windows NT 5.1; rv:8.0) Gecko/20100101 Firefox/8.0', 'Russia', 'Москва', 'g8jph8fcnagd85gffbodatkqb5');
INSERT INTO tour_testimonial VALUES(100, NULL, NULL, '2012-02-17', 'Дубинина', 'Лилия', NULL, 'info@accenttour.com.ua', '+38-056-745-04-59', 'Добрый день,<br />\r\n<br />\r\n <br />\r\n<br />\r\n*****************************************<br />\r\n<br />\r\nПрошу просчитать и предложить индивидуальный тур в США  для 5 наших туристов.<br />\r\n<br />\r\n28.06 – прилетают  в Лос-Анжелес (в 13.00)<br />\r\n<br />\r\n12.07 – вылетают  из Нью-Йорка (в 17.00)<br />\r\n<br />\r\n <br />\r\n<br />\r\nХотят:<br />\r\n<br />\r\n- 3 дня провести в Лос-Анжелесе,<br />\r\n<br />\r\n- 5 дней в Лас-Вегасе<br />\r\n<br />\r\n- 3  дня в Вашингтоне<br />\r\n<br />\r\n- 4 дня в Нью-Йорке<br />\r\n<br />\r\n <br />\r\n<br />\r\nПоследовательность городов можно менять, учитывая города прилета и вылета.<br />\r\n<br />\r\n <br />\r\n<br />\r\nРазмещение по программе в хороших отелях 5*:<br />\r\n<br />\r\n- 1 двухместный Twin<br />\r\n<br />\r\n- 1 Dbl King + 1 Sngl connection (или 1 Junior Suite для 2 взрослых и ребенка 16 лет).<br />\r\n<br />\r\n <br />\r\n<br />\r\nВнутренние перелеты еще не бронировали.<br />\r\n<br />\r\nВ Лас-Вегасе просят предложить отель  THE WYNN.<br />\r\n<br />\r\nОбязательно в программу нужно включить экскурсию к Ниагарскому водопаду,  Гранд Каньон (разные варианты: вертолет, авто и т.п.)<br />\r\n<br />\r\nВиз пока нет, паспорта хорошие.<br />\r\n<br />\r\n <br />\r\n<br />\r\n<br />\r\n<br />\r\n-- <br />\r\nС уважением,<br />\r\n <br />\r\nДубинина Лилия<br />\r\nДиректор<br />\r\nТур. фирма "Акцент"<br />\r\nг. Днепропетровск<br />\r\nул. К.Либкнехта, 12, оф. 2Б<br />\r\nтел.   056-745-04-59<br />\r\nтел.   0562-32-35-03<br />\r\nмоб.  8-067-395-98-94<br />\r\nE-mail: info@accenttour.com.ua<br />\r\nwww.accenttour.com.ua<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n-- <br />\r\nС уважением,<br />\r\n <br />\r\nДубинина Лилия<br />\r\nДиректор<br />\r\nТуроператор "ACCENT TRAVEL"<br />\r\nг. Днепропетровск<br />\r\nул. К.Либкнехта, 12, оф. 2Б<br />\r\nтел.   056-745-04-59<br />\r\nтел.   0562-32-35-03<br />\r\nмоб.  8-067-395-98-94<br />\r\nE-mail: info@accenttour.com.ua<br />\r\nwww.accenttour.com.ua<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '93.127.23.20', '93-127-23-20.static.vega-ua.net', 'Mozilla/5.0 (Windows NT 5.1; rv:10.0.1) Gecko/20100101 Firefox/10.0.1', 'Russia', 'Днепропетровск', 'k74lpbpr3p9egu0moadv9hbek0');
INSERT INTO tour_testimonial VALUES(101, NULL, NULL, '2012-03-02', 'Филиппова', 'Татьяна', NULL, 'ftf@inbox.ru', '+7 903 741 9912', 'Добрый день.<br />\r\nПрошу оказать помощь в организации поездки по программе тура КАЛИФОРНИЯ - НЕВАДА - АРИЗОНА - ЮТА - 10 дней.Тур с перелетом. Мы с сестрой хотели бы бы  приехать в Нью-Йорк во второй половине марта. Есть ли места на туры в это время, можно ли забронировать места заранее, а заплатить наличными по приезду. Какие советы вы могли бы дать нам по этой теме. Визы в США у нас есть.С уважением,<br />\r\nТатьяна Филиппова, 65 лет, Ирина Казначеева, 55 лет.', NULL, NULL, NULL, NULL, NULL, '91.76.104.179', 'ppp91-76-104-179.pppoe.mtu-net.ru', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.2.27) Gecko/20120216 MRA 5.7 (build 03796) Firefox/3.6.27 sputnik 2.5.2.20', 'Other ..', 'Москва', 'caomgcpgspuv5noif80r6lg112');
