INSERT INTO tour_testimonial VALUES(103, NULL, NULL, '2012-04-09', 'Сухарникова', 'Ирина', NULL, 'irinasuh@hotmail.com', '+79852201346', 'Добрый день!<br />\r\nУ меня запланирована в июне поездка в США с длительной стыковкой в Нью-Йорке:<br />\r\n18 июня (понедельник), прилет в 6 утра, влеет в 19 час.<br />\r\nСколько времени длится обзорная экскурсия по Нью-Йорку с круизом к статуе Свободы?<br />\r\nКакие еще возможны варианты экскурсий?<br />\r\n', NULL, NULL, NULL, NULL, NULL, '193.125.99.9', 'black.elektra.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; MRSPUTNIK 2, 4, 0, 162; InfoPath.3; .NET4.0C; .NET4.0E; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; RubarToolbar4552)', 'Russia', 'Москва', 'n69eqdir4s5lil658909red4d7');
INSERT INTO tour_testimonial VALUES(104, NULL, NULL, '2012-04-11', 'Stunis', 'Semion', NULL, 'sulik@012net.il', '+97250638761', 'Ездил 1,5 года назад с вами на Аляску.В целом остался доволен.(Борис занимался мной).Был тогда в списке туров тур в Австралию.А или это еще существует?За ответ спасибо!', NULL, NULL, NULL, NULL, NULL, '77.127.236.116', '77.127.236.116', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.0; Trident/5.0)', 'Israel', 'Rishon Lezyyon', '8mv0qngob9h740d9enm58icgh4');
INSERT INTO tour_testimonial VALUES(105, NULL, NULL, '2012-04-17', 'viptimeforyou@gmail.com', 'viptimeforyou@gmail.com', NULL, 'vipwatch@gmail.com', '8 (800) 555-82-80', 'Хронографы, скелетоны, модели с вечным календарем и турбийоном. Классика и спортивный авангард от Patek Philippe, Hublot,Breitling,Rado и других от 8 970р!                        <br />\r\nСовершенные и модные швейцарские часы в нашем интернет-бутике.                                                                      <br />\r\n                                                               <br />\r\nЭти замечательные часы были востребованы во все времена, но позволить их могли только избранные,                                                                       <br />\r\nтеперь у нас появилась возможность предложить Вам уникальные модели часов богатейших                                                                  <br />\r\nлюдей планеты  по низким ценам.                <br />\r\n              <br />\r\nTopGear РЕКОМЕНДУЕТ                                                              <br />\r\n                                                                       <br />\r\nПЕРЕЙТИ В КАТАЛОГ ЧАСОВ  TopGear http://u.to/vScBAg                                                       <br />\r\n                                                               <br />\r\n                                                                <br />\r\nДоставка часов по России, Украине и Казахстану бесплатно                    <br />\r\n                          <br />\r\nПри заказе по телефону  или ICQ сообщите менеджеру Ваш номер клиента 2733 0000, и мы предоставим Вам                           <br />\r\nдополнительную скидку                          <br />\r\n                                   <br />\r\n                                    <br />\r\nДоставка по России, Украине и Казахстану бесплатно!', NULL, NULL, NULL, NULL, NULL, '188.143.232.181', '188.143.232.181', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows