INSERT INTO tour_testimonial VALUES(106, NULL, NULL, '2012-04-17', 'Вилкова', 'Лилия', NULL, 'vilkova_l@list.ru', '(921)945-89-38', 'Здравствуйте! Возможно ли мне подобрать пару для  размещения в гостинницах. Меня интересует тур в Нью-Йорк, Майями, или что-то подобное ориентировочно с 21 апреля по  10 мая ( в этот период) Спасибо.', NULL, NULL, NULL, NULL, NULL, '91.122.136.189', 'ppp91-122-136-189.pppoe.avangarddsl.ru', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_7_3) AppleWebKit/534.53.11 (KHTML, like Gecko) Version/5.1.3 Safari/534.53.10', 'Russia', 'Санкт-Петербург', '3b5l4hsnhcsmeeq8r9f1bfjkv2');
INSERT INTO tour_testimonial VALUES(107, NULL, NULL, '2012-04-19', 'Пелипченко', 'Ник', NULL, 'npelip@gmail.com', '(718) 347-2561', 'Дорогой New Tours!<br />\r\nОгромное спасибо за предоставленную возможность посетить Китай. Это была во всех смыслах восхитительная поездка: время года, погода,перелёты и переезды, маршрут, отели, питание и главное внимательное и профессиональное отношение со стороны гида и местных экскурсоводов.<br />\r\n5+ во всех категориях. Я путешествую с New Tours больше 10 лет и это всегда отменное качество и профессионализм. Поездка в Китай - новое этому подтверждение.<br />\r\nБудьте благополучны и до новых встреч.<br />\r\n<br />\r\nНик Пелипченко', NULL, NULL, NULL, NULL, NULL, '68.194.33.117', 'ool-44c22175.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.0.3705; .NET CLR 1.1.4322; Media Center PC 3.1)', 'USA', 'Бруклин', '3d1u63f83q1n6jije4cchbt4j7');
INSERT INTO tour_testimonial VALUES(108, NULL, NULL, '2012-04-21', 'Куликова', 'Татьяна', NULL, 'kultatv@mail.ru', '', 'Добрый день! Не нашла ,где можно задать Вам вопросы, поэтому обращаюсь в разделе "отзывы и пожелания". Собираюсь в мае воспользоваться услугами Вашей фирмы.Приезжаю из Санкт-Петербурга.К сожалению,я не попадаю по датам на те экскурсии, которые хотелось бы посетить.Приходится ограничить выбор. Поэтому,прошу Вас ответить на несколько вопросов.<br />\r\n1.Смогу ли я поехать на экскурсию в Канаду,имея только визу в США?<br />\r\n2.Сколько будет стоить (итого) тур во Флориду по акции "специальные цены" на неделю(1чел в номере)<br />\r\n4.И тур на 5 дн "Л.А.-Сан-Диего" с 12мая?<br />\r\n5.Возможно ли какая-то скидка при покупке 4-х различных по продолжительности  туров?<br />\r\nС уважением, Татьяна   ', NULL, NULL, NULL, NULL, NULL, '188.134.34.107', '188.134.34.107', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:11.0) Gecko/20100101 Firefox/11.0', 'Russia', 'Санкт-Петербург', 'kepv36ahfjttnt7ub8cnh6dqd1');
INSERT INTO tour_testimonial VALUES(109, NULL, NULL, '2012-04-25', 'Goryaynova', 'Lana', NULL, 'Sgoryayn@dmc.org', '248-738-8182', 'I would like to say a thank you for the best service  to people who take care of my tour to China /04/05-04/16-2012/ Especially ms.BELLA was really helpfull,nice and patient - thank you very much.Also i needed to say abou trip was very plesant and New Tours did a remerkably good job.Guides met us promtly at every turn and transportation to and from hotels were always on schedule. Our guid Vania was awesome.Very nice young man,knolegeble,always willing to help,intelligente, and recpectfull.His russian language is perfect, hi made our trip unforgetable', NULL, NULL, NULL, NULL, NULL, '155.139.3.85', '155.139.3.85', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.2; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; .NET4.0C; .NET4.0E)', 'USA', 'Detroit', '9pji2u4tlgcu6b68nm52gs6816');
