INSERT INTO tour_testimonial VALUES(113, NULL, NULL, '2012-04-28', 'Каганова', 'Людмила', NULL, 'l-ka2003@yandex.ru', '89023355702', 'Очень понравилась экскурсия в Филадельфию.Экскурсовод, которая представилась "Нэля", была профессионалом своего дела, рассказывала обо всем интересно, с воодушевлением. Кроме фотографий, у нас осталось очень хорошее впечатление об этой экскурсии.', NULL, NULL, NULL, NULL, NULL, '83.220.91.76', 'pppoe-83-220-91-76.samtelecom.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/535.11 (KHTML, like Gecko) Chrome/17.0.963.56 Safari/535.11', 'Russia', 'Самара', 'kq4g7a39ieof3id7t15mhhl0b2');
INSERT INTO tour_testimonial VALUES(114, NULL, NULL, '2012-04-30', 'Белячков', 'Юрий', NULL, 'avit@front.ru', '79219945745', 'Я прошу срочно разобраться с ситуацией заселения туристов в отель велингтон, туристов из Санкт-Петерлбурга! Им пришлось повторно оплачивать проживание в отеле, за который были проплачены деньги. Туристы грозят судебными преследованиями. Прошу Вас внимательно отнестись к этому вопросу! и компнсировать понесенныие туристами убытки. Генеральный директор авеню-тур.', NULL, NULL, NULL, NULL, NULL, '128.69.101.236', '128-69-101-236.broadband.corbina.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/535.19 (KHTML, like Gecko) Chrome/18.0.1025.162 Safari/535.19', 'Russia', 'Санкт_Петербург', '1dgoj0jiqtu65ot65l5vlknd10');
INSERT INTO tour_testimonial VALUES(115, NULL, NULL, '2012-05-08', 'Топчиева', 'Ольга', NULL, 'zeta3025@gmail.com', '0672895288', 'У компании New Tours брали 3 экскурсии: обзорную  по Нью-Йорку, Вашингтон (2 дня), Канада (6 дней).<br />\r\n<br />\r\nПовезло  только  с первой, обзорной экскурсией. Мила -  отличный и грамотный экскурсовод, и просто приятный  человек.  Так интересно  рассказывала  про  Нью-Йорк, что  мы просто были в восторге. Водитель  останавливался во  всех  самых  интересных  и красивых местах, чтобы мы могли сделать фотографии, даже по  желанию группы.  На протяжении всей экскурсии Мила нам что-то  рассказывала, исторические факты,  о современной жизни города. Никто не  скучал, всем было  интересно. В конце  группа, по  своей инициативе, собрала, так называемые типы (чаевые), так представьте себе она отказалась, в последствии меня  очень  это  удивило, так как остальные гиды, с которыми мы встречались, в принудительной форме объявляли, сколько  типов они хотели бы получить.<br />\r\n<br />\r\nНа этом, приятное,  от фирмы New Tours, можно  сказать закончилось.<br />\r\n<br />\r\nДалее была экскурсия 2 дня в Вашингтон, с экскурсоводом Александром.  Этот  молодой человек говорил  очень много, в основном закидывал  группу историческими книжными фактами  и очень  этим гордился. Очень  распространенное явление  у них, экскурсовод  договаривается с  какой-то  забегаловкой о “комплексном обеде”, собирает с вас 16-25 $  причем, в соседнем заведении можно поесть  вкуснее и дешевле и главное быстрее. Но экскурсоводу удобнее чтобы вы провели больше времени в таких  местах и + он  конечно -  же  имеет свой  интерес. А потом он  скажет, что  время  на саму экскурсию уже не  осталось. Самое обидное было, что  нас  привезли в  гостиницу в 18.00 и сказали все, на сегодня экскурсия закончена. Хотя  группа настаивала показать еще ночной город. Короче в итоге водитель и Александр сказали, что  за 100 $ покатают нас  еще час по  ночному городу. Мы согласились.  А на следующий день  они также попросили типы, в размере 2 $   с человека в день.   <br />\r\n<br />\r\nНо самым запоминающимся был  для нас тур на 6 дней в Канаду, с Борисом.<br />\r\nИз  6 дней запланированной экскурсии, сразу можете настроить  себя на 4 дня, так как первый и последний день у вас будет уникальная возможность  провести 2,5  незабываемых часа в магазине Duty Free,  а так же еще раз  пересмотреть все фильмы с участием Пьера Ришара, это  вместо  экскурсии. А в последний день, вместо  того, чтобы лишних  два часа провести на Ниагарских  водопадах или остановится  где-нибудь  на  дороге сфоторгафировать живописные пейзажи Канады, Боря вам скажет: “У вас будет  неограниченное  время в Duty Free”. А та немногословная экскурсия  у  Бориса проходит так : “Посмотрите налево - это  левый берег  реки, посмотрите направо - а это  правый берег  реки. Вот эти здания - новой постройки, а это- старой”.<br />\r\n<br />\r\nТакже вас отвезут на  заранее  оговоренный Борисом обед и тоже проведете там 2-3 часа, пока всем закажут и принесут еду. А кто не  хочет может отказаться и пойти погулять в городе, а потом еще час ждать остальную группу под  рестораном. Так как Борис вам назначает время встречи одно, а освобождаются они по  факту на 30-40 мин  позже.<br />\r\n Так мы провели ДЕНЬ в Квебеке. Ресторан  закончился в 15.30, а в 17.30  нас уже ждал  автобус назад.<br />\r\n Т.е  в красивейшем городе французской Канады вы проведете всего  2 часа, из  которых  30 мин  Борис действительно  рассказывает что-то  о  городе, а остальное – свободное время. <br />\r\n<br />\r\nВот и решайте сами, нужна ли вам такая экскурсия, за этим ли вы так далеко  ехали, чтобы посидеть в ресторане и провести время в Duty Free. К моему удивлению, таких  людей в нашей группе было  большинство. Но если же вас интересует как можно  больше времени провести в каждом городе, увидеть уникальные места, насладится замечательной и живописной природой Канады, узнавайте имена экскурсоводов, приблизительное время прибывания в городах.<br />\r\n<br />\r\nЭту информацию компания New Tours не предоставляет,  если мы спрашивали Борю что у нас дальше  по  плану, всегда был  один  ответ :”я потом  вам все расскажу.” <br />\r\n<br />\r\nВообще задумка, маршрут и программа - замечательные. Гостиницы хорошие, завтраки –никакие. Если только совсем убрать посещение Duty Free  и максимально  сократить время  в общепите, то  это  будет достойный тур. <br />\r\n<br />\r\nНу и конечно  дать нормального  экскурсовода,  а не  просто  сопровождающего  группы, который просто  отбывает время. Этот человек не  только  должен хорошо  знать места, в которые он  везет людей,  а любить свою работу, ну и конечно  выглядеть опрятно, ведь это  туристы едут на отдых, а он  на работе.<br />\r\n<br />\r\nВ любом случае, спасибо за предоставленный сервис. Желаю удачи.<br />\r\n<br />\r\n<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '195.114.130.130', '195.114.130.130', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; .NET4.0C; .NET4.0E)', 'Ukraine', 'Одесса', '6uhsvcho6iju3cb5lig8gcoub3');
INSERT INTO tour_testimonial VALUES(116, NULL, NULL, '2012-05-08', 'Costa Brava', 'Costa Brava', NULL, 'costabrava001@gmail.com', '', 'Профессионализм сотрудников Costa Brava Real Estate в сочетании с индивидуальным подходом <br />\r\nк Вашим желаниям и возможностям превращают Ваши заветные мечты в реальность. <br />\r\n <br />\r\nПокупка недвижимости на Коста Брава - это инвестиция в здоровое будущее <br />\r\nВашей семьи! <br />\r\n <br />\r\nhttp://CostaBravaRealEstate.ru', NULL, NULL, NULL, NULL, NULL, '122.141.242.199', '199.242.141.122.adsl-pool.jlccptt.net.cn', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1) Netscape/8.0.4', '', '', 'a7rfdun4cs1dphs7rksjfr2e72');
INSERT INTO tour_testimonial VALUES(117, NULL, NULL, '2012-05-08', 'myveryme', 'myveryme', NULL, 'info@myveryme.ru', '123456', 'За окном уже практически лето, а значит самое время купить яркую и оригинальную футболку. <br />\r\nПредлагаем женские дизайнерские футболки myveryme с нашивными аппликациями. <br />\r\n <br />\r\nФутболки myveryme это: <br />\r\nВысокое качество. Все футболки выполнены из 100% хлопка, имеют удлиненный, приталенный силуэт. <br />\r\nОригинальный дизайн: все аппликации необычны и сшиты в ограниченных сериях. <br />\r\nЯркий образ. Порой даже самый простой элемент одежды может улучшить настроение. Футболки myveryme позволят Вам выделиться и окружающие непременно влюбятся в милых зверьков на Ваших футболках! <br />\r\n <br />\r\nСпециальные цены до конца мая! <br />\r\n900 рублей на футболки с коротким рукавом и 1000 рублей на футболки с длинным рукавом. <br />\r\nДоставка по Москве и по всей России. Для оптовых покупателей действуют скидки от суммы заказа. <br />\r\n <br />\r\nКоллекция myvery...innocent (короткий рукав) http://www.myveryme.ru/rus/collection/innocent <br />\r\nКоллекция myvery...warm (длинный рукав) http://www.myveryme.ru/rus/collection/warm <br />\r\n <br />\r\nЖдем Вас в нашем интернет-магазине www.myveryme.ru', NULL, NULL, NULL, NULL, NULL, '188.143.232.181', '188.143.232.181', 'Mozilla/5.0 (Windows NT 5.1; U; en) Opera 8.01', '', '', 'uhauhgf047cm93hgq5hcbmjkp0');
INSERT INTO tour_testimonial VALUES(118, NULL, NULL, '2012-05-09', 'Дельцова', 'Лариса', NULL, 'fantazia-tour@yandex.ru', '+79272868577', 'Очень понравилась экскурсия на Ниагарские водопады. Очень профессиональный гид Анвар,спасибо большое ему за интересную и увлекательную поездку. Также хочется выразить благодарность водителю-профессионалу своего дела. Ездили с подругой из Бруклина год назад, впечатления до сих пор самые лучшие!', NULL, NULL, NULL, NULL, NULL, '217.118.90.241', '217.118.90.241', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/535.19 (KHTML, like Gecko) Chrome/18.0.1025.168 Safari/535.19', 'Russia', 'Пенза', '2gdlmbf66m8g40trpr9dqsjr92');
INSERT INTO tour_testimonial VALUES(119, NULL, NULL, '2012-05-11', 'Константин', 'Константин', NULL, 'moskowtipografy@gmail.com', '123456', 'Добрый день! <br />\r\n <br />\r\nПредлагаем Вам большой спектр полиграфических услуг - изготовление листовок и буклетов, брошюр и каталогов, блокнотов, рекламных и канцелярских папок, бумажных пакетов с фирменной символикой, календарей, POS-материалов и различной упаковки. <br />\r\n <br />\r\nТакже готовы предложить помощь в профессиональной подготовке макетов, дизайну и верстке. <br />\r\n <br />\r\nНадеемся, что наше предложение Вас заинтересует. <br />\r\n <br />\r\nГотовы ответить на все интересующие вопросы. <br />\r\n <br />\r\n <br />\r\nС уважением, <br />\r\nЧернышов Константин <br />\r\nМенеджер по работе с клиентами <br />\r\nМоб.: 8(916)545-54-74 <br />\r\ne-mail: kachernyshov@yandex.ru', NULL, NULL, NULL, NULL, NULL, '188.143.232.181', '188.143.232.181', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; en) Opera 9.0', '', 'Беларусь', 'ad6fh71pcj3v2nc0h5jk49peh0');
INSERT INTO tour_testimonial VALUES(120, NULL, NULL, '2012-05-14', 'Бубнова', 'Анна', NULL, 'aabubnova@mail.ru', '89165738204', 'Большое спасибо за организованный отдых в США!Побывала на 4 экскурсиях от агентства.Особенно хочу отметить работу гида Эмиля-бесподобный гид,умнейший,образованнейший,тонкий человек,была на экскурсии в Вашингтоне с 30 апреля по 1 мая.Этот экскурсовод просто ценность Вашей компании,он настолько интересно ведет туры,что не хочется пропустить ни одного момента путешествия!Надеюсь вернуться на экскурсии с этим гидом,и друзьям советую. Положительное впечатление также осталось от экскурсии в Бостон  с Максом-тоже прекрасный гид.По сравнению с ними экскурсия с Ребеккой была неинтересна,гид не смог увлечь и большинство дороги молчал или спал.А ведь было что рассказать про Ниагару!В результате все самое интересное о Ниагаре я узнала от тети,которая почерпнула свои знания на экскурсии с Эмилем.Еще раз спасибо,надеюсь еще приехать прицельно на экскурсии Эмиля с Нью-Турс.Общая оценка автобусов и организации отдыха- 5 баллов из 5-все комфортно.Спасибо Нью-Турс!', NULL, NULL, NULL, NULL, NULL, '213.33.213.190', 'mx.mzocm.ru', 'Mozilla/5.0 (Windows NT 5.1; rv:12.0) Gecko/20100101 Firefox/12.0', 'Russia', 'Москва', 'l5dkb6rflt50u3ic68bf050tu3');
INSERT INTO tour_testimonial VALUES(121, NULL, NULL, '2012-05-14', 'Mironova', 'Larisa', NULL, 'mironovalarisa@mail.ru', '+79142025486', 'Я собираюсь купить и оплатить on line банк. картой тур по Калифорнии на 23 июня (10 дней). <br />\r\nНеобходим ZIP code - где его взять?', NULL, NULL, NULL, NULL, NULL, '46.8.131.234', '46.8.131.234', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/535.19 (KHTML, like Gecko) Chrome/18.0.1025.168 Safari/535.19', 'Russia', 'Khabarovsk', 'rvof1mo11e5v5j3lk9251bq4c3');
INSERT INTO tour_testimonial VALUES(122, NULL, NULL, '2012-05-18', 'Torsuyev', 'Andriy', NULL, 'torsuev-an@mail.ru', '+380505282535', 'Здравствуйте! Мы с женой хотели бы воспользоваться Вашими услугами. Нас интересует 10-дневный тур Калифорния-Невада-Аризона-Юта в июне 2013г. Если возможно, подскажите когда будет анонсирован календарь туров на 2013г. <br />\r\nС уважением, Андрей Торсуев.', NULL, NULL, NULL, NULL, NULL, '91.124.38.132', '132-38-124-91.pool.ukrtel.net', 'Mozilla/5.0 (Windows NT 6.1; rv:12.0) Gecko/20100101 Firefox/12.0', 'Ukraine', 'Simferopol', 'och54acaj4jt6jh4rlmgrdmtg7');
INSERT INTO tour_testimonial VALUES(123, NULL, NULL, '2012-05-19', 'Гуревич', 'Алекс', NULL, 'GURALEX62@GMAIL.COM', '+972524768972', 'Здравствуйте! Мы семьёй(я,жена и дочка 12 лет)<br />\r\nпланируем этим летом(в начале июля)планируем посетить США.У вас на сайте я нашел много увлекательных экскурсий!Я хотел бы уточнить и предварительно записаться на некоторые из них!А точтее меня интересует 1. 8 июля Филадельфия 2. 9 и 10 июля Вашингтон 3. 11 или 12 по Нью-йорку и последняя 13 июля в Канаду на 5 дней ,по моему.<br />\r\nМеня интересует насколько эти туры точны по датам и сколько это мне будет стоить(путешевствовать мы будем в троем)И еще вопрос на обратном пути мы хотели бы остаться в Торонто(у нас там родственники) которые потом привезут нас в США.<br />\r\nЗаранее большое спасибо за внимание и жду ответа ', NULL, NULL, NULL, NULL, NULL, '77.125.111.194', '77.125.111.194', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/535.19 (KHTML, like Gecko) Chrome/18.0.1025.168 Safari/535.19', 'Israel', 'Кармиэль', 'v3jlbfs5qvgcunccjegme1tlu7');
INSERT INTO tour_testimonial VALUES(124, NULL, NULL, '2012-05-22', 'Игорь Леонтьев', 'Игорь Леонтьев', NULL, 'viptime@google.com', '123456', 'Новинки нашего салона Вас обрадуют! Швейцарские механизмы! Тотальное соответствие оригиналам! Гарантия до 25 месяцев! Hublot, Omega, Breitling, Rado и другие. <br />\r\n <br />\r\n <br />\r\nПерейти в магазин http://vtime-club.info/?entranceId=2733_0_4627', NULL, NULL, NULL, NULL, NULL, '188.143.232.181', '188.143.232.181', 'Opera/8.00 (Windows NT 5.1; U; en)', '', '', 'dr7cgks3jf4kt24jniujrn5l65');
INSERT INTO tour_testimonial VALUES(125, NULL, NULL, '2012-05-26', ' Вася', 'Гость', NULL, 'dadavasa337@yahoo.com', '510 837 5101', 'Обратился я в Вашу компанию. К сожалению впечатления оставляют желать лучшего. В основном раздражал экскурсовод по имени Лена. С самого начала и на протяжении всей экскурсии создавалось впечатление что она имеет дело с животными а не с гостями города. Она вела себя так будто все те кто там собрались ей чем-то обязаны... Постоянные упрёки и команды с ее стороны испортили общее впечатление об экскурсии. Среди членов нашей группы неоднократно звучали реплики недовольства в связи с таким поведением. Мне кажется Лена забыла что она работает и получает зарплату благодаря НАМ... гостям/туристам... и мы заслуживаем более уважительного отношения. Пару слов о чаевых. Прозвучала такая фраза  " У нас принято ставлять чаевые водителю и экскурсоводу.. обычно по 4 доллара с человека. Я сейчас пущу по рядам конверт. и т.д. ". Друзья мои, я не первый год в штатах и такой заявки еще не слышал. Т.е. вы МНЕ, клиенту, говорите открытым текстом сколько оставить чаевых...?! Я очень люблю оставлять чаевые, и делаю это с удовольствием, но только тогда когда человек этого заслуживает. Рядом сидела пожилая пара, они как и я принципиально отказались оставить типы, они мило улыбнулись и передали конверт дальше по рядам. При всей своей занятости я все же нашел время написать свой отзыв т.к. нахожу  это недопустимым чтоб такого рода "русский бизнес" портил людям настроение и отпуск тем более что они за это ПЛАТЯТ. <br />\r\nУдачи в бизнесе.   ', NULL, NULL, NULL, NULL, NULL, '108.95.140.36', '108-95-140-36.lightspeed.sntcca.sbcglobal.net', 'Mozilla/5.0 (Windows NT 6.0; WOW64) AppleWebKit/536.5 (KHTML, like Gecko) Chrome/19.0.1084.52 Safari/536.5', 'USA', '', 'g9980nnpv9gmjg6ta6rblgtqo5');
INSERT INTO tour_testimonial VALUES(126, NULL, NULL, '2012-05-28', 'Alissa', 'Alissa', NULL, 'sog2708@rambler.ru', '9031148433', 'Была в туре по 4 штатам (Калифорния, Невада, Аризона, Юта) тур грамотный, интересный, есть что посмотреть, НО, в Лас Вегасе нам поставили гида Лилю. И до этого был ужасный гид Мила, но это мы поняли только тогда, когда её заменили. Ужас был в том, что "чудесный гид" бросила группу в 55 человек в 5 вечера в Сан Франциско, потому что ей нужно было по делам домой, и сказала, что лучше бы вам из отеля не выходить, т.к. больше в Сан Франциско смотреть нечего. Мы попросили объяснить нам как попасть в парк Голден гейт, вместо этого парка нас отправили в какой то другой парк, из которого мы потом так и не смогли добраться до центра, и пришлось отдать 80 долларов за такси. Кстати о такси, мадам Лилия пояснила, что ходить вечером по городу опасно, и что такси ездят только со специальных стоянок, местонахождение которых нужно искать. Мне кажется бабушка явно перепутала Сан Франциско с каким нибудь Канкуном. Но самым ужасным была безусловно поездка из Вегаса в Сан Франциско. Люди были уставшие после длительных перегонов, а когда 84 летняя, выжившая из ума бабушка начала не своим голосом выдавать арии, якобы в далекой молодости она была оперной певицей, и рассказывать, что она лично помнит балы Наташи Ростовой, тут уж простите нервы окончательно сдали. Сам тур просто отличный, и продуман хорошо, и гостиницы почти все нормальные (кроме одной, после Вегаса, где кроме нас ещё жили 150 байкеров), водитель Дэвид-просто душка, замечательный парень, и все бы хорошо, но гиды-ПОЗОР! После этого тура, я ездила ещё на Ниагару, вот там был шикарный гид Майкл, от которого за 2 дня я узнала больше полезной информации чем от бабушек за 10 дней. Прошу Вас учесть не только мое мнение, потому что самый чудесный и замечательный тур может испортить заключительный аккорд в лице такой Лили. Больше того, на неоднократные просьбы людей прекратить мучить нашу нервную систему своим  завыванием она пояснила-а кому то нравится! И ещё,  мы сидели в конце автобуса, и каждый раз к тому моменту как мы выходили из него, гид уже спешила куда то уйти, приходилось сначала искать её мечась по сторонам, а потом бегом догонять, а оно мне надо? Неужели нельзя подождать КОГДА ВСЯ ГРУППА ВЫЙДЕТ ИЗ АВТОБУСА? Или по очереди выпускать то с начала, то с конца автобуса-но нет, мы услышаны не были, гидам было плевать. Спасибо за принятые замечания. ', NULL, NULL, NULL, NULL, NULL, '85.21.144.145', 'sovintel-ips.static.corbina.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/536.5 (KHTML, like Gecko) Chrome/19.0.1084.52 Safari/536.5', 'Russia', 'Moskow', '3qlrcldua338u3cs0hg1c9pas7');
INSERT INTO tour_testimonial VALUES(127, NULL, NULL, '2012-05-30', 'Royzman', 'Tetyana', NULL, 'taniaroyz@yahoo.com', '301-335-1562', 'Dear Vera,<br />\r\nWe would like to say a sincere "THANKS” to you for making our one-day-tour in New York at May 26th 2012 so memorable.<br />\r\nYou truly gave us a wonderful trip. We feel very fortunate that we had this opportunity to be on this tour you were the guide.<br />\r\nYou certainly have a wonderful manner of giving us very full, interesting, and unforgettable information of New York.<br />\r\nYour organization is faultless, your knowledge is wide, and we had all appreciated the care you have taken with each of us.<br />\r\nThe trip will be in our minds for a long time.<br />\r\nSincerely,<br />\r\nTetyana and her son Alexey.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '128.183.9.228', '128.183.9.228', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; MathPlayer 2.10d; .NET CLR 2.0.50727; .NET CLR 3.0.04506.648; .NET CLR 3.5.21022; .NET CLR 1.1.4322; InfoPath.1; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; .NET4.0C)', 'USA', 'Rockville', 'erct7n8dvu63s83jkt9hrabs71');
INSERT INTO tour_testimonial VALUES(128, NULL, NULL, '2012-05-30', 'Royzman', 'Pavel', NULL, 'pavelro@hotmail.com', '240-4479766', 'Мы пользовались услугами этой фирмы много раз начиная с 2005  года. Поездки: <br />\r\n2005: Ниагарский водопад, однодневная экскурсия по Нью Йорку<br />\r\n2006: Поездка во Флориду<br />\r\n2007: Поездка в Канаду<br />\r\n2012: однодневная экскурсия по Нью Йорку. Экскурсовод Вера. Все просто замеательно!<br />\r\nС нас никто и никогда не требовал никаких чаевых. Все было сделано культурно и ненавязчево. Мы ездим на эти туры из  Washington DC. Эти туры доступны финансово и достаточно пунктуальны.<br />\r\nЖалаем New Tours держать в том же духе!<br />\r\nПожелание: Обратите внимание на Washington DC! Может вы можете открыть здесь свой филиал? Экскурсий у нас нет почти. А,те что есть баснословно дороги и не интресны.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '134.192.176.2', '134.192.176.2', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C; .NET4.0E; InfoPath.3)', 'USA', 'Rockville', '75t1p08p51o91eespvi29mbfs0');
INSERT INTO tour_testimonial VALUES(129, NULL, NULL, '2012-06-01', 'Гройсман', 'Людмила', NULL, 'lgroysman@hotmail.com', '917-488-9131', 'Необыкновенно тёплые и добрые воспоминания о 6-дневной поездке в Канаду с 23-го по 28-е Мая 2012 года с экскурсоводом Ириной и водителем Пашей. Замечательная команда, которая умело, с чувством такта и терпения может профессионально сохранить обстановку отдыха и романтизма в группе туристов. Ирина-великолепный экскурсовод с незаурядной памятью, обладает замечательным организаторским талантом. Паша-умелый и предусмотрительный водитель, галантный помощник для женщин, душа компании.  <br />\r\nСоздавалось впечатление, что мы-их самая любимая группа, и что мы давно знакомы. <br />\r\nЭта поездка оставит незабываемые впечатления о Канаде и о тандеме Ира-Паша. Хочется снова в поездку, и только с ними. Спасибо вам, Ира-Паша. <br />\r\nС уважением-Люда.', NULL, NULL, NULL, NULL, NULL, '96.56.253.210', 'ool-6038fdd2.static.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; InfoPath.1; .NET CLR 2.0.50727; .NET CLR 1.1.4322; .NET CLR 3.0.04506.30; .NET CLR 3.0.04506.648; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; OfficeLiveConnector.1.3; OfficeLivePatch.0.0)', 'USA', 'Нью-Йорк', '0nlke7lk4t491jl5p3ebllii75');
INSERT INTO tour_testimonial VALUES(130, NULL, NULL, '2012-06-12', 'Цветкова', 'Ирина', NULL, 'marzogatto@gmail.com', '+?9213417676', 'Здравствуйте, уважаемый "Нью Турс"!<br />\r\nМы с подругой с удовольствием участвовали в маленьком 13-дневном приключении, которое носило название "Атлантика США и Чикаго". Тур был интересный и прекрасно организован. Спасибо Вам за это! Гид по Ниагарскому водопаду Саша был великолепен! Елена - гид по Нью-Йорку - также очень понравилась. На удивление нехорош был Борис, с которым нам, к сожалению, пришлось провести больше всего времени: 6-дневный тур в Чикаго и 2 дня в Вашингтоне. Прекрасный и интересный Чикаго весьма проиграл из-за отвратительной экскурсии, проведенной Борисом, чьи путевые заметки и рассказы о городах были удивительно невнятными и бесцветными. Похоже, Борис очень старался, чтобы поездки в его сопровождении остались в нашей памяти как унылое и никчемное время. Грустно! Потому что еще со своей поездки по Западному побережью, которую я совершила полтора года назад, я знаю "Нью Турс" как прекрасную компанию, объединяющую замечательных гидов, умеющих влюбить в США любого туриста. Борис - очень неудачное приобретение для уважаемого мною "Нью Турса"! Он старается "не слышать" вопросы туристов, дает минимум информации (да и ту просто зачитывает скучным голосом с распечатки). Короче, единственное, что Борис считал сообщить нам о штатах, которые мы проезжали, было количество поголовья крупного рогатого скота. Ужас, какие важные и интереснейшие сведения! На неоднократные просьбы туристов рассказать что-нибудь интересное, Борис резко (тут вдруг просыпались его эмоции) отвечал, что туристам нужно отдыхать (интересоваться страной, значит, по его мнению, - мешать работе гида?). Но, если забыть о бесцветном Борисе, поездка была замечательной!!! Организация - великолепная! Никаких накладок! СПАСИБО!!!', NULL, NULL, NULL, NULL, NULL, '188.134.33.98', '188.134.33.98', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:12.0) Gecko/20100101 Firefox/12.0', 'Russia', 'Санкт-Петербург', 'ctmgr1is0gfop9db4d5225f6p1');
INSERT INTO tour_testimonial VALUES(131, NULL, NULL, '2012-06-18', 'Oganesian', 'Irina', NULL, 'irinadvin@hotmail.com', '314 275 2403', 'Я была на обзорном туре 3 июня 2012.Я хочу поблагодарить водителя Льва и гида Веру за прекрасныйи и очень позновательны тур.Лев водитель от бога,я даже не могла представить,что на таком большом автобусе и при Нью-Йоркском трафике можно было себя чувствовать,какбудто ты едить на легковом автомобиле.И Вера рассказала очень много интересного.Большоре им спасибо.Я буду рекомендовать всем моим знакомым ,я получила огромное удовольстие от этого тура.Спасибо еще раз.', NULL, NULL, NULL, NULL, NULL, '24.107.96.25', '24-107-96-25.dhcp.stls.mo.charter.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:11.0) Gecko/20100101 Firefox/11.0', 'USA', 'St.Louis', 'lla0encmi7lhb3bpgkmk7mgi74');
INSERT INTO tour_testimonial VALUES(132, NULL, NULL, '2012-06-19', 'Смирнова', 'Ольга', NULL, 'smirnova3000@yandex.ru', '+79053427745', 'Добрый день! я бы хотела заказать у вас тур "Звезды Атлантики". но у нас в россии у всех операторов по туризму есть лицензии. хотела бы знать есть ли у вас операторская лицензия по туризму и страховка ?', NULL, NULL, NULL, NULL, NULL, '80.239.242.62', 'v03-15.opera-mini.net', 'Opera/9.80 (Windows NT 5.1; U; MRA 5.8 (build 4598); ru) Presto/2.10.229 Version/11.64', 'Russia', 'Москва', 'g7liavdakl4ipmqto368beo9b5');
INSERT INTO tour_testimonial VALUES(133, NULL, NULL, '2012-06-21', 'Панасенко', 'Лариса', NULL, 'pln-62@bk.ru', '0675672336', 'Посвятите нас пожалуйста, что вы курите перед тем, как заниматься расселением людей по отелям после экскурсий?! <br />\r\nКак можно было поселить людей в отель возле  аэропорта Ла Гвардия, если на следующий день они улетают самолетом из аэропорта Кеннеди в 7 утра?! Да еще и при том, что день перед вылетом- единственный свободный день в Нью Йорке, когда можно остаться в городе. А рядом с отелем нет метро и нужно долго добираться до центра! <br />\r\nНеужели вашим сотрудникам  так трудно включить мозг и  подумать над оптимальным вариантом расселения? Мне кажется, что это не требует чересчур сложной мозговой деятельности! ', NULL, NULL, NULL, NULL, NULL, '72.43.148.83', 'rrcs-72-43-148-83.nyc.biz.rr.com', 'Mozilla/5.0 (iPad; CPU OS 5_1_1 like Mac OS X) AppleWebKit/534.46 (KHTML, like Gecko) Version/5.1 Mobile/9B206 Safari/7534.48.3', 'Ukraine', 'Днепропетровск', 'ulibhe4r2q05gk913cpue7s451');
INSERT INTO tour_testimonial VALUES(134, NULL, NULL, '2012-06-22', 'Хвостова', 'Татьяна', NULL, 'tisagel@mail.ru', '89301773932', 'Здраствуйте!Я хочу забронировать тур для моей группы на Ниагарские водопады.с 15 сентября по 16 сентября.Наша группа состоит из 8 человек.Какие возможны скидки для группы или семьи?', NULL, NULL, NULL, NULL, NULL, '194.150.255.130', '194.150.255.130', 'Opera/9.80 (Windows NT 6.1; WOW64; U; ru) Presto/2.10.229 Version/11.64', 'Russia', 'Краснодар', '1he61lpc6b071ijggu4n1pqg60');
INSERT INTO tour_testimonial VALUES(135, NULL, NULL, '2012-06-30', 'Khalef', 'Boris', NULL, 'bor50des@gmail.com', '347-374-4456', 'One month ago, we ordered 4 days tour to the Quebec. Each time when we are tried to get real information about tour condition, company agents unfairly  gave us information that they are would be let us us know during the day what is real situation at this tour. Unfortunately, they are all lying to us and eventually we get our vacation for nothing due to low agents professional quality and inability properly performing service.', NULL, NULL, NULL, NULL, NULL, '68.194.243.188', 'ool-44c2f3bc.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; GTB7.3; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; .NET CLR 1.1.4322; msn OptimizedIE8;ENUS)', 'USA', 'Brooklyn', 'hs2c3fvo4ht8umd24ctdvcuec0');
INSERT INTO tour_testimonial VALUES(136, NULL, NULL, '2012-07-10', 'dyanhakelundhhg', 'dyanhakelundhhg', NULL, 'dyan_hakel14@rambler.ru', '123456', 'Здравствуйте! <br />\r\nОфициально по договору оформим на физических лиц и сотрудников организаций пропуска в метrо в сеть гипермаркетов МЕТРО:карточка метро только с вашим фото(делается при вас в самом магазине МЕТРО),с индификационным номером,штрих - кодом,магнитной полосой, названием фирмы, от которой вы будете нами зарегистрированы. Вы можете проводить с собой двоих человек. Карты клиента metro оформляются: на граждан Российской Федерации и иностранцев.Оформление производится без предварительной оплаты, то есть вначале мы регистрируем вас,вы получаете карты клиента метро , потом оплачиваете. Оплата производится в течение 1-го рабочего дня после оформления через Сбербанк России ,супермаркеты Metro CASH and CARRY работают круглосуточно.Срок действия карты клиента метро  3 года, по истечении этого срока договор перезаключается по взаимному согласию сторон.Для оказания этой услуги мы находим юридические лица, у которых есть свободные места в этих немецких тц,и заключаем с ними соответствующие договора, по которым фирмы обязуются предоставить вам право пользоваться их местами в этих магазинах сроком на три года. Оформление производятся в разных магазинах Metro Cash&Cаrry, по выбору юридических лиц в соответствии с их территориальным месторасположением. Получив карты metro в одном из магазинов МETRO вы можете ей пользоваться в любых других магазинах этой сети торговых центров «МЕТРО» в России и за границей. <br />\r\nТелефон в Москве: 8-967-143-66-53 <br />\r\nНЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ЗВОНИТЕ И ЗАКАЗЫВАЙТЕ ПРЯМО СЕЙЧАС!', NULL, NULL, NULL, NULL, NULL, '91.76.64.193', 'ppp91-76-64-193.pppoe.mtu-net.ru', 'Mozilla/1.22 (compatible; MSIE 2.0d; Windows NT)', '', 'MOSCOW', 'j2sulf4qbfab1e5s9jmqg62nb1');
INSERT INTO tour_testimonial VALUES(137, NULL, NULL, '2012-07-11', 'Золотарева', 'Светлана', NULL, 'Pankratovasg@gmail.com', '+7905 715 98 68', 'Здравствуйте,New Tours!Я много слышала о Вашей Компании от своих соотечественников. И мне захотелось обратиться к Вам с просьбой организовать для меня поездку в Мексику.Я живу в Москве.Хотела бы полететь на 14-15  ночей в первых числах декабря в составе 2( взрослых) человек.Москва-Мехико. В Мехико 1-2 дня обзорная экскурсия.Местными линиями из Мехико на курорт. Там отдохнуть на побережье дней 10 и оттуда улететь в Москву. Возможно ли это организавать через Вашу компанию и сколько это будет стоить. Спасибо, Светлана', NULL, NULL, NULL, NULL, NULL, '82.204.241.110', 'vfr01a04.hs-homestyle.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; GTB7.3; BRI/2)', 'Russia', 'Москва', '4hkcedq5jlkle6bc8il7v6acs1');
INSERT INTO tour_testimonial VALUES(138, NULL, NULL, '2012-07-12', 'Попов', 'Андрей', NULL, 'panout2011@gmail.com', '+79826114676', 'Добрый день!<br />\r\nПутешествовал с Вашей компанией с 19.06 по 3.07. В целом путешествием доволен, особая благодарность гидам Эмилю (Ниагара) и Александру (Вашингтон)- эрудированные высокообразованные люди,имеющие желание донести до слушателя не только сухую информацию, но и собственное отношение к жизни. Спасибо! Но, исключительно в целях улучшения работы компании - очень рекомендуем поменять гида по Нью-Йорку (Вера) - усталая пожилая женщина, для которой физически трудна многочасовая экскурсия, тихий голос, желание отдохнуть от разговора, минимум информации и т.д. и т.п. Разочарованы! Надеюсь на повторное путешествие с вами, так как виза двухлетняя. ', NULL, NULL, NULL, NULL, NULL, '62.168.227.54', 'mail.zdravso.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; InfoPath.2; .NET CLR 2.0.50727; .NET CLR 3.0.04506.648; .NET CLR 3.5.21022)', 'Russia', 'Екатеринбург', '8msdb07njtcna2mfqcrv96rj54');
INSERT INTO tour_testimonial VALUES(139, NULL, NULL, '2012-07-13', 'varv', 'Yra', NULL, 'od2008@mail.ru', '972528', 'Интересует купить билет Тель-Авив Гамбург и обратно. У Вас скайп есть? Мой скайп od2008  Я сейчас в скайпе. Спасибо.', NULL, NULL, NULL, NULL, NULL, '77.126.164.56', '77.126.164.56', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)', 'Israel', 'Tel-Aviv', '9saf3il0ubufd3k69d6nhoktn3');
INSERT INTO tour_testimonial VALUES(140, NULL, NULL, '2012-07-13', 'Зборовская', 'Наталья', NULL, 'nzbor@yandex.ru', '+79104584698', 'Добрый день!<br />\r\nХочу приехать в Америку из Москвы с 16.08.2012 г. по 30.08.2012 г. <br />\r\nМожете ли Вы скомбинировать мне тур по маршруту Нью-Йорк (4 дня на Манхэтене 4*)- Орландо (4 дня 3*-4* около парка Юниверсал)- Майами (5 дней район Сан Айлэнд 4*-5*).<br />\r\nПроживание в номере : двое взрослых + ребенок 10 лет.Если да, прошу прислать мне стоимость тура на мой e-mail : Nzbor@yandex.ru<br />\r\nВопрос: в чем выражена Ваша поддержка в получении визы?', NULL, NULL, NULL, NULL, NULL, '217.117.112.148', '217-117-112-148.proc.ru', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)', 'Russia', 'Москва', '1n3qnmjjku60909cj1amanlvr6');
INSERT INTO tour_testimonial VALUES(141, NULL, NULL, '2012-07-20', 'Гроберман', 'Дина', NULL, 'dgroberman@yahoo.com', '2128834153', 'Недавно я вернулась из тура Чикаго и Великие озера. - 6 дней.<br />\r\nЯ никогда не была на туре с русскоязычным агентством и была настроена очень скептически.<br />\r\n<br />\r\nНеожиданно я была приятно удивлена.<br />\r\n<br />\r\nВ первый же день, кода сломался наш автобус и мы просидели 4 лишние часа на остановке, я подумала, что мой отпуск окончательно испорчен. Однако благодаря профессионализму водителя Азиза, мы прибыли на нашу первую экскурсию в Кливленд почти вовремя и даже увидели салют!<br />\r\n<br />\r\nНаш гид Борис сделал этот тур незабываемым! Он дал нам много интересной информации о местах которые мы проезжали. Борис также на очень высоком уровне проводил экскурсии в городах, где мы останавливались и в музеях, которые мы посещали. В автобусе Борис сумел создать очень лёгкую и приятную атмосферу с познавательными викторинами, шутками, а также мы посмотрели много хороших фильмов из его коллекции. Благодаря Борису многие из нас подружились, обменялись адресами электронной почты и уже начали переписываться!<br />\r\n<br />\r\nЯ обязательно буду рекомендовать этот тур с Борисом и Азизом своим друзиям и знакомым.<br />\r\n<br />\r\nСпасибо Борис и Азиз за отлично проведённый отпуск!', NULL, NULL, NULL, NULL, NULL, '63.71.3.45', 'user45.angelogordon.com', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; .NET4.0C; .NET4.0E; MS-RTC LM 8)', 'USA', '', '034hsabu55ft854u3r0mah88n5');
INSERT INTO tour_testimonial VALUES(142, NULL, NULL, '2012-07-25', 'Gibson', 'Vera', NULL, 'verag@nyc.rr.com', '7184791107', 'Хочу написать о своих впечатлениях о поездке в Чикаго и Великие Озера, 14 июля 2012 года, тур мне понравился, очень емкий, за 6 дней мы побывали в нескольких штатах, повидали столько что я бы сама не увидела за много лет, хочется отметить замечательного экскурсовода Бориса, такого знающего, начитанного, умеющего подать информацию таким образом что нисколько не чувствуешь усталости когда едешь так далеко и так долго находишься в автобусе, не было наверно темы которую бы Борис не знал или хотя бы не имел собственного мнения, уже не говоря о теме экскурсии, здесь было все расказано на высшем уровне, подробно и к месту, было очень интересно, я когда приехала домой всем тоже все рассказала что смогла запомнить, спасибо ему на этом. Нашим водителем был Азиз, хочется и его поблагодарить за хорошо выполненную работу несмотря на проблемы в начале пути когда после 2 часов путешествия полетели 2 ремня, Азиз старался отремонтировать их сам, звонил в техобслуживание несколько раз, наконец-то ремни были привезены, заменены и мы поехали после 4 часов сидения на станции, после этого все работало, автобус был вовремя, водитель приложил все усилия чтоб мы были довольны. Наверно этого можно было избежать если компания проверяла бы автобусы более тщательно перед поездкой. Мне очень понравились гостиницы в Кливленде и Толедо, того чего я и ожидала увидеть, туриского типа, чистые, комфортабельные, современные, будто что недавно подновленные и ничего что в дали от всего, все равно мы там были поздно вечером и рано утром уезжали, но меня удивила и очень огорчила гостиница в Чикаго, такого сарая, старого, грязного, разбитого я давно не видела, чтоб ведра в холле стояли и собирали воду которая капала из комнат второго этажа, заметьте не последнего, и дождя не было несколько дней, наоборот была засуха, значит вода была из ванной или туалета, на первом этаже где меня поселили в первый раз обнаружились макрицы, на стенах не было обоев, ничего кроме дырок от картин, на третьем -черное пятно на пол комнаты, наверно плесень и половое покрытие все волнами, на втором - ужасный запах, который не прошел после проветривания, поливания освежителем воздуха, под столом - грязная вилка и начатая бутылка с водой, пришлось убирать самой, так как по словам человека за стойкой больше свободных комнат не было, это еще не все ужасы которыми можно было описать эту гостиницу, я думала раз эта поездка организована тур компанией то она как профессионал подберет достойные места проживания, я согласна заплатить дороже чтобы проживать в приличных гостиницах но эта уже никуда не годится, можете сказать что других эта гостиница устраивает тогда надо предлагать выбор, кто в таком сарае хочет жить пожалуйста а для тех кто не хочет есть получше с доплатой. Из негативных надо еще отметить что мне не позвонили что будет маленький автобус, почему всем позвонили а мне нет? Из всего сказанного выше надо отметить повторяюсь отличную работу Бориса и Азиза, без них я бы эту поездку не рекомендовала, и недостаточную работу компании по организации тура, тур буду рекомендовать если в Чикаго будет лучше гостиница такая как была в Кливленде и Толедо. Спасибо, Вера.', NULL, NULL, NULL, NULL, NULL, '147.4.169.146', '147.4.169.146', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 2.0.50727; .NET4.0C; .NET CLR 3.5.30729; .NET4.0E; AskTbORJ/5.14.1.20007; .NET CLR 3.0.4506.2152)', 'USA', '', 'rn69ubcvd66dimliuubk2p1125');
INSERT INTO tour_testimonial VALUES(143, NULL, NULL, '2012-07-26', 'Дягилева', 'Елена', NULL, 'dya-elena@yandex.ru', '+79262286255', 'Хочу поблагодарить,ОЧЕНЬ,ОЧЕНЬ, нашего гида Светлану!!!! От имени всей нашей группы, которая была в поездке с 5.07 по 15.07 по 4 штатам. Это настолько грамотный и интересный человек! Опытный гид. И просто великолепный собеседник. Всегда возможность получить от Светланы помощь, всегда "on line". Цените её, и берегите!!! <br />\r\n Ваш фирменный тур очень интересен. Молодцы. Всё, что можно было увидеть, почти, увидели! Почти, потому что увидеть всё не возможно. Но самое главное было Вами сделано: захотелось вернуться и обследовать-посмотреть-поиграть ещё раз! У меня свое тур.агенство и я всегда буду рекомендовать ваши туры. И, думаю, воспользуюсь сама не однократно. Также благодарю гида по Нью Йорку (обзорка 17.07). Молодец. Четко, сжато, но все понятно. СПАСИБО за ВСЁ!!!!! ', NULL, NULL, NULL, NULL, NULL, '83.149.8.222', 'gprs-client-83.149.8.222.misp.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/536.11 (KHTML, like Gecko) Chrome/20.0.1132.57 Safari/536.11', 'Russia', 'Солнечногорск', 'g2g4ua2ot4iao530ggflaba690');
INSERT INTO tour_testimonial VALUES(144, NULL, NULL, '2012-07-27', 'Groberman', 'Dina ', NULL, 'dgroberman@yahoo.com', '212.883.4153', 'Предложение<br />\r\n<br />\r\nДобавить Тур по Бруклину к турам по Нью-Йорку. Могут быть также добавлены туры по другим районам. Думаю что такие туры заинтересуют не только приезжих гостей, но и тех кто уже давно живет в Нею-Йорке. Я живя уже давно в Бруклине, никогда не была в Бронксе, Куинс тоже мало знаю. Буду рада присоединиться к такому туру с хорошим экскурсоводом.   <br />\r\n<br />\r\nДина', NULL, NULL, NULL, NULL, NULL, '63.71.3.45', 'user45.angelogordon.com', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; InfoPath.2; .NET4.0C; .NET4.0E; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729)', 'USA', 'Brooklyn, NY', 'susesd689bb45185il4g93ctb6');
INSERT INTO tour_testimonial VALUES(145, NULL, NULL, '2012-07-27', 'Серикова', 'Татьяна', NULL, 't_serikova@mail.ru', '+79161964579', 'Я планирую поехать с вашей фирмой в тур по скалистым горам Канады +круиз+ Денали в ииюне- июле.<br />\r\nКАк сильно изменятся даты? Для меня это важно чтобы можно было заранее купить дешевый билети когда будут известны точные даты этого тура.<br />\r\nЗаранее спасибо', NULL, NULL, NULL, NULL, NULL, '212.41.32.116', '212.41.32.116', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; Trident/4.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0)', 'Russia', 'Москва', 'tjtdk3qt4bqqmtffo1nr51kde7');
INSERT INTO tour_testimonial VALUES(146, NULL, NULL, '2012-07-30', 'Макаров', 'Валерий', NULL, 'makval85@mail.ru', '89637344445', 'Добрый день!<br />\r\n<br />\r\nСотрудничаете ли Вы с туристическими агентствами в России? <br />\r\nЕсли да, то есть ли какие-либо комиссии для агентств?<br />\r\n<br />\r\nС уважением, Валерий.', NULL, NULL, NULL, NULL, NULL, '217.118.78.44', '217.118.78.44', 'Mozilla/5.0 (Windows NT 5.1; rv:14.0) Gecko/20100101 Firefox/14.0.1', 'Russia', 'Вологда', 'e7j3btifp3ocak5v13vn6hn8b7');
INSERT INTO tour_testimonial VALUES(147, NULL, NULL, '2012-08-01', 'Johnson', 'Marina ', NULL, 'marina.johnson1208@gmail.com', '7857601303', 'We just came back from the 3 day tour to Pittsburg on Aug 30t and wanted to express our admiration and appreciation for our tour guide, Nelia Shevchenko, who was giving us a very high quality tour. Nelia is a very knowledgeable professional who not only was giving us lots of historical information about the places we visited, but also she is a perfect organizer who can easily manage large tour groups. At the very beginning of the tour Nelia created a perfect atmosphere on the bus that helped to build a team spirit with a flavor of kindness and a good mood for the next 3 days.  The tour was very enjoyable and interesting and we are looking forward to our next trips with Nelia!<br />\r\nRegards,<br />\r\nMarina, Maya, and Leonid.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '24.193.183.115', 'cpe-24-193-183-115.nj.res.rr.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/536.11 (KHTML, like Gecko) Chrome/20.0.1132.57 Safari/536.11', 'USA', 'Edgewater', 'l4ks09l2p66ud6c3k5mtlvhp50');
INSERT INTO tour_testimonial VALUES(148, NULL, NULL, '2012-08-05', 'Iosub', 'Leonid', NULL, 'ioleonid@gmail.com', '052-6565649', ' 21 июля у нас была  поездка в Питсбург. Наш экскурсовод Неля была выше всяких похвал. Отличное знание материла и красивая подача его сделали поездку незабываемой. Рассказали нашим родственникам и они заказали эту экскурсию на 1 сентября. Мы очень надеемся, что экскурсоводом будет Неля. ', NULL, NULL, NULL, NULL, NULL, '109.64.159.210', '109.64.159.210', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; InfoPath.1; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; AskTbFXTV5/5.15.1.22229)', 'Israel', 'Haifa', 'nlpsnnig3ppno52ev2n9qkrs80');
INSERT INTO tour_testimonial VALUES(149, NULL, NULL, '2012-08-11', 'Деревянко', 'Лариса', NULL, 'Derevyanko46@inbox.ru', '0684136780', 'Хочу поблагодарить Вашу фирму за прекрасно организованные туры с 27.07.12 по 06.08.12.<br />\r\nОсобую благодарность хочется выразить вашим высоко<br />\r\nпрофессиональным гидам:Борису,проводившим 5-дневный тур в Канаду с 27.07.12 по 31.07.12 и Наталье Заремской(2-дневный тур в Бостон 02.08.12<br />\r\n-03.08.12),владеющие большим объемом информации и предоставляющие ее в увлекательной и интересной форме.Теперь для меня Канада будет ассоциироваться<br />\r\nтолько с Борисом,а Бостон-с Натальей.<br />\r\nТакже хочется поблагодарить водителей:2-х Владимиров и Славу за их нелегкий труд.<br />\r\nДальнейших успехов Вашей фирме.Будем продолжать <br />\r\nсотрудничество с Вами .<br />\r\n', NULL, NULL, NULL, NULL, NULL, '213.227.228.97', '213-227-228-97.static.vega-ua.net', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.1.3) Gecko/20090824 Firefox/3.5.3', 'Ukraine', 'Днепропетровск', 'fnshhi0o4vft01qier42e1a8f1');
INSERT INTO tour_testimonial VALUES(150, NULL, NULL, '2012-08-18', 'armer', 'sima boris', NULL, 'simaa@moag.gov.il', '97239502462', 'мы были в туре западная Канада с 28 июля до 7августа.Хотим поблагодарить нашего гида Игоря Левит за его профессионализм, за умение передать свою любовь к стране и природе членам группы,а также за его отличные организационные способности.', NULL, NULL, NULL, NULL, NULL, '147.237.70.105', '147.237.70.105', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727)', 'Israel', 'rishon lezion', 'ge5jn3qgjgfcj9tqpefmc7c9r4');
INSERT INTO tour_testimonial VALUES(151, NULL, NULL, '2012-08-20', 'Попов', 'Юрий', NULL, 'yuragan.popov@gmail.com', '048-725-51-19', 'Добрый день,NewTour! Мы Ваши клиенты и неделю назад написали письмо Наталии Шеремет. Т.К. пока ответа нет, то сообщаем следующее:   <br />\r\n Мы планируем присоединяться ко всем экскурсиям - 12-го (в 8.00 ам), 15-го (в 7.00 ам) и 17-го (в 6.00 ам) сентября на остановке<br />\r\nпересечения Brighton Beach Avenue & Conney Island Avenue y Chase банка (или банка Washington Mutual? - может быть они находятся в одном здании?).<br />\r\nДля лучшей нашей ориентации высылаю Вам план этого перекрестка. Если Вас не затруднит, то отметьте на плане конкретно место посадки, и перешлите нам.<br />\r\nПолный расчет за все экскурсии мы произведем 12-го сентября вечером после возвращения с экскурсии по Нью-Йорку в офисе Вашего агентства.<br />\r\nДалее просим Вас ответить на наши некоторые возникшие вопросы.<br />\r\n1. Мы планируем прибыть в JFK в 5.00 рм. Скорей всего встречать нас никто не будет (еще рабочее время). Как проще и спокойнее добраться нам до Nixon court, Brooklyn?<br />\r\nВарианты: шатл - метро, автобус или такси? Какова примерная стоимость проезда на такси (расстояние  - 16 миль по GPS)? Стоит ли бронировать такси из самолета (кажется 5$) или их в аэропорту достаточно?<br />\r\n2. Мы не знаем, как у нас пройдет смена часовых поясов. Если все будет нормально, то возможно (при наличии мест) мы закажем еще экскурсию  Бостон - Кембридж<br />\r\nна 13-14 сентября. Можете считать это письмо как нашу предварительную заявку.<br />\r\n3. Сообщите, пожалуйста, адреса и название гостиниц нашего проживания в Вашингтоне и Сан-Франциско для информирования родственников.<br />\r\n4. Для сведения сообщаем номер одного из наших мобильных телефонов, которые будут с нами: 408-300-2821.<br />\r\nЗаранее благодарим,Юрий и Наталия.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '78.26.128.196', '78.26.128.196', 'Mozilla/5.0 (Windows NT 6.1; rv:14.0) Gecko/20100101 Firefox/14.0.1', 'Ukraine', 'Одесса', 'n050j620hsap78cc1erfag8ll5');
INSERT INTO tour_testimonial VALUES(152, NULL, NULL, '2012-08-21', 'Verzhanovskaya', 'Marina', NULL, 'maver_yatsm@mail.ru', '*7-915-403-35-90', 'Добрый день!<br />\r\nВ связи с составлением графика отпусков на 2013 год, планированием поездки на 2013 год, подскажите,пожалуйста,даты маршрута Нью-Йорк-Чикаго и Фейерверк в садах Дюпона на 2013 год.<br />\r\nС уважением и признательностью, Марина.', NULL, NULL, NULL, NULL, NULL, '83.149.9.16', 'gprs-client-83.149.9.16.misp.ru', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0; NP06)', 'Russia', '', 's121egbmc5jtrom3l2r4qn3na7');
INSERT INTO tour_testimonial VALUES(153, NULL, NULL, '2012-08-23', 'Савенко', 'Лидия', NULL, 'lsavenkol@mail.ru', '', 'Мы-граждане Украины,жители г.Киева,участники тура\\"Аляска на воде и на земле(31июля-14авг.2012г.)-Савенко Лидия,Удовиченко Александр,Удовиченко Лена - выносим свою благодарность за организацию тура!<br />\r\nНезабываемые впечатления будут сопровождать нас ещё долгое время.Особая благодарность нашему экскурсоводу Людмиле Левиной за профессионализм,организаторские способности,интеллигентнось,высокий уровень знаний и умение ими поделиться.Мы получили ограмное удовольствие не только от увиденного,но и от рассказов Людилы о прекрасной Аляске,её истории,её жителях,обитателях.Это путешествие оставило приятные воспоминания и незабываемые впечатления в наших сердцах!Огромное СПАСИБО Людмиле!Желаем ей здоровья и благополучия!Успехов и процветания желаем фирме\\"New Tours\\"!<br />\r\nС уважением и благодарностью -Савенко Лидия,<br />\r\n                              Удовиченко Александр,Удовиченко Лена.', NULL, NULL, NULL, NULL, NULL, '72.78.37.192', 'pool-72-78-37-192.phlapa.east.verizon.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; GTB7.4)', 'Ukraine', 'Киев', 'bsh0jju794o9fj2s97h1guaca4');
INSERT INTO tour_testimonial VALUES(154, NULL, NULL, '2012-08-29', 'Шульга', 'Регина', NULL, 'Regina1077@mail.ru', '+380502821077', 'Я,одна из участников тура “Чикаго и Великие озера”(23.06.2012.-28.06.2012.), выражаю огромную благодарность нашему гиду-Борису, за прекрасное проведение этого тура.<br />\r\nВ лице Бориса, нам посчастливилось получить необыкновенного, эрудированного и чуткого ко всем нашим проблемам сопровождающего, интересного собеседника и великолепного рассказчика.<br />\r\nЕго нестандартные и эмоциональные рассказы не только пополнили наши знания и расширили представления о городах, которые мы проезжали, но и сделали наше путешествие необыкновенно интересным и увлекательным.<br />\r\nБлагодаря его эрудиции, творческому подходу и находчивости мы смогли многое увидеть и прочувствовать.<br />\r\nХочу отметить, что имея огромный опыт в путешествиях, никогда мне не приходилось встречать, чтобы гид, проводя различные викторины, поощрял призами, правильно ответивших туристов. В качестве подарков-сувениров он отмечал, какие-либо личные  особенности многих из нас. Например, мне была подарена ручка с моим именем. А также, у нас в группе был вегетарианец, за что был "награжден" магнитом с надписью, касательно этого выбора питания!!! Т.е. вниманием не был обделен никто в группе.<br />\r\nЭта поездка нам понравилась, и несмотря на естественную физическую усталость мы отдохнули всей душой, и в этом заслуга Бориса.<br />\r\nБольшое спасибо компании “New Tours”, водителю, и низкий поклон и личная благодарность Борису.', NULL, NULL, NULL, NULL, NULL, '151.0.12.54', '151.0.12.54', 'Mozilla/5.0 (iPad; CPU OS 5_1_1 like Mac OS X) AppleWebKit/534.46 (KHTML, like Gecko) Version/5.1 Mobile/9B206 Safari/7534.48.3', 'Ukraine', 'Донецк', 'fcia5c9biv3bi99gugi2ggovn6');
INSERT INTO tour_testimonial VALUES(155, NULL, NULL, '2012-09-10', 'Семенова', 'Надежда', NULL, 'semenova-nadejda237@yandex.ru', '+7(391)2548602', 'Если хотите получить "совковый" сервис, то обязательно закажите туристический тур в компании "Нью турс"! И постарайтесь заказать этот тур не на один день, а на два или более, чтобы получить побольше впечатлений. И тогда вы в полной мере вспомните наш замечательный "совок", от которого, возможно, уже успели отвыкнуть, живя в России.<br />\r\nВы вспомните самые дешевые и грязные отели. А также неудобные автобусы с низкими подголовниками, в которых после многочасового сидения так затекает шея, что потом начинает болеть голова. А также хамовитых и грубых водителей, недовольных жизнью. А так же нытье гидов, которые помимо экскурсии, постоянно жалуются на то, как сложно и тяжело жить в Америке.<br />\r\nСловом, получите впечатлений массу. Но самое запоминающееся впечатление о поездках с этой компанией (а у нас  было три поездки)  - это  питание туристов в самых грязных китайских ресторанах или еврейских забегаловках, где воняет прогорклым маслом, на котором жарится еда, похоже, несколько лет. При входе в этот ресторан сразу же подступает тошнотный ком к горлу. Обеды в таких ресторанах гиды называют "шведский стол", альтернативных предложений этим тошниловкам нет. И еще в этих ресторанах Вы увидите такие туалеты, которых не сможете потом разыскать по всей Америке, как ни старайтесь! А лечить возникшие проблемы с желудком после посещения таких заведений Вы уже сможете дома, если конечно, не помрете от такой кухни раньше.<br />\r\nА если Вы все же не хотите рисковать собственным здоровьем, то Вам любезно предложат купить еду в гастрономе и съесть ее, сидя на лавочке. Если Вы еще не кушали на лавочках, как это делают американские бомжи, то получите новый опыт и опять же свежие впечатления. <br />\r\nСловом, незабываемых вам впечатлений, дорогие туристы, с компанией "Нью Турс"!', NULL, NULL, NULL, NULL, NULL, '68.173.5.233', 'cpe-68-173-5-233.nyc.res.rr.com', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.1 (KHTML, like Gecko) Chrome/21.0.1180.89 Safari/537.1', 'Russia', 'Красноярск', '0i7kit30kd6b3q6c2s4q2mi6d3');
INSERT INTO tour_testimonial VALUES(156, NULL, NULL, '2012-09-11', 'Bushueva', 'Daria', NULL, 'dariabushueva@gmail.com', '3476132393', 'ya bila v ture 4 state za 10 dnei, s 31avg-9sent, nashim gidom bil Evgenii, virazhau blagodarnost\\'' za nezabivaemoe puteshestvii, informacii, atmosferu kotoruy on nam predostavil. Puteshestvie bilo chudesnim, nasiwennim, polnim vpechatlenii, kotorii po pribitiyu ne pokidayut menya. Gid Evgenii s bogatim krugozorom i informaciei , muzica raznih shtatom,fil\\''mi,  vse bilo zamechatel\\''no.', NULL, NULL, NULL, NULL, NULL, '66.65.91.24', 'cpe-66-65-91-24.nyc.res.rr.com', 'Opera/9.80 (Windows NT 6.1; WOW64; U; en) Presto/2.10.289 Version/12.02', 'USA', 'nyc', 'j4ft3bq67okb5ecgi4rrl3j4c1');
INSERT INTO tour_testimonial VALUES(157, NULL, NULL, '2012-09-12', 'Брунь', 'Евгений', NULL, 'Johnen@mail.ru', '89098747787', 'Здравствуйте! Очень понравился тур "Вся Америка" Хотелось бы выразить отдельную благодарность Наталье Заремской, она у нас была гидом в Бостоне. Очень хорошо рассказывала. <br />\r\n   Хочется еще съездить. Тоже с вашей фирмой.<br />\r\nМожете ответить на мою почту, буду очень рад. :)', NULL, NULL, NULL, NULL, NULL, '85.26.241.63', '85.26.241.63', 'Mozilla/5.0 (Windows; U; Windows NT 6.1; ru; rv:1.9.2.12) Gecko/20101026 Firefox/3.6.12', 'Russia', 'Вяземский', 'vjgvmucmaioeq7k8u9rl136j14');
INSERT INTO tour_testimonial VALUES(158, NULL, NULL, '2012-09-12', 'Vecvagars', 'Ugis', NULL, 'uve70@@inbox.lv', '+371 29446373', 'Добрый день!<br />\r\nКогда появятся календарь на туры в Канаду на первое полугодие следующего года?<br />\r\n<br />\r\nBR<br />\r\nUgis', NULL, NULL, NULL, NULL, NULL, '79.135.148.131', '131.148.135.79.microlines.lv', 'Mozilla/5.0 (Windows NT 5.1; rv:15.0) Gecko/20100101 Firefox/15.0.1', 'Other ..', 'Riga', 'r0utehldetie0llqmg2jbe3nc0');
INSERT INTO tour_testimonial VALUES(159, NULL, NULL, '2012-09-12', 'Мурадов', 'Александр', NULL, 'amur57@inbox.ru', '+ (37529) 630-5065', 'Уважаемая компания "Newtours"!!!<br />\r\nПишут Вам жители города Минска (Беларусь), супруги Лилия Сенникова и Александр Мурадов.<br />\r\nВ этом году мы в очередной раз воспользовались услугами вашей компании и в очередной раз остались ОЧЕНЬ ДОВОЛЬНЫМИ!!!<br />\r\nВ период с 31 августа по 09 сентября мы отдыхали, гуляли и прекрасно проводили время в туре по четырём штатам США Калифорния-Аризона-Невада-Юта. Программа тура оставила в наших сердцах незабываемые впечатления. <br />\r\nОт всей души БОЛЬШОЕ ВАМ СПАСИБО!!!<br />\r\nОсобую благодарность мы хотим выразить гиду нашего тура господину Евгению Баранову!!!<br />\r\nВеликолепные знания истории США, умение чётко и лаконично их сформулировать и рассказать окружающей аудитории подтвердили его блестящую эрудицию!!! <br />\r\nТакже хотим отметить его организаторские способности, пунктуальность и умение общаться с публикой имеющей разносторонние взгляды. <br />\r\nЕщё раз огромнейшее спасибо Евгению Баранову за чудесно проведённые дни в туре!!!<br />\r\nИ в завершении нашего письма хотим пожелать компании "Newtours" дальнейшего процветания и благосостояния!!! <br />\r\nЗдоровья Вам и всех жизненных благ!!!<br />\r\nДо новых встреч!!!<br />\r\nС уважением,<br />\r\nсупруги Лилия Сенникова и Александр Мурадов.<br />\r\n<br />\r\n <br />\r\n    <br />\r\n', NULL, NULL, NULL, NULL, NULL, '76.104.203.77', 'c-76-104-203-77.hsd1.wa.comcast.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)', 'Other ..', 'Минск', '0sqb7me2uctm89utrv30cpbpf2');
INSERT INTO tour_testimonial VALUES(160, NULL, NULL, '2012-09-20', 'Marinich', 'Oksana', NULL, 'main@oldbank.com', '380503574125', 'Скажите пожалуйста, когда Вы размещаете информацию о турах на следующий год. Мне важно знать, так как при покупке авиа билета за пол года вперед я могу значительно  сэкономить. Спасибо.', NULL, NULL, NULL, NULL, NULL, '193.41.239.37', 'gate.oldbank.com', 'Mozilla/5.0 (Macintosh; U; Intel Mac OS X 10_6_8; ru-ru) AppleWebKit/533.21.1 (KHTML, like Gecko) Version/5.0.5 Safari/533.21.1', 'Ukraine', 'Kiev', 'a9beuam86m4bq4v16r1bb2gh02');
INSERT INTO tour_testimonial VALUES(161, NULL, NULL, '2012-09-27', 'Zelentsova', 'Larysa ', NULL, 'sampo47@i.ua', '+380964416708', 'Автобусный тур 13.10.2012 из Лос-Анжелеса до 22.10.2012', NULL, NULL, NULL, NULL, NULL, '46.202.76.193', '193-76-202-46.pool.ukrtel.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; GTB7.4; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; BRI/2)', 'Ukraine', 'Kiev', '09bjlm8oqiktffub0r3b8e0cr5');
INSERT INTO tour_testimonial VALUES(162, NULL, NULL, '2012-09-27', 'Каткалова', 'Лариса', NULL, 'Larysa8877@gmail.com', '718-844-8375', 'Я съездила в тур Калифорния-Невада-Юта- Лас Вегас с 21-27 сентября.Очень понравилось! Особенно хочу отметить нашего гида Евгения Баранова. Высокий профессионализм, творческий подход к работе, забота о членах группы оставила прекрасное впечатление. Огромное ему спасибо!', NULL, NULL, NULL, NULL, NULL, '24.46.202.248', 'ool-182ecaf8.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.1; rv:15.0) Gecko/20100101 Firefox/15.0.1', 'USA', 'Бруклин', '8ob3cat8o0f765nbs5luqsvm75');
INSERT INTO tour_testimonial VALUES(163, NULL, NULL, '2012-10-03', 'Киселева', 'Алла', NULL, 'akiseleva@countrycom.ru', '84994098800', 'Уже писала вам письмо, но ответа не получила. Как можно узнать стоимость новогодних/рождественских туров по США? Хотим поехать в тур, компанией из 4 человек. Но не знаем стоимость.', NULL, NULL, NULL, NULL, NULL, '93.92.138.2', '93.92.138.2', 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.9.2.18) Gecko/20110614 Firefox/3.6.18 (.NET CLR 3.5.30729)', 'Russia', 'Москва', 'ql4k3512dff9nrchei46to8bt3');
INSERT INTO tour_testimonial VALUES(164, NULL, NULL, '2012-10-03', 'kogen', 'yuiriy', NULL, 'yuriykogen@yahoo.com', '(415)640-1539', 'Большая благодарностьБэлле Минокрин за высокопрофессиональную работу по организации тура по Испании.Спасибо!', NULL, NULL, NULL, NULL, NULL, '108.89.39.25', '108-89-39-25.lightspeed.sntcca.sbcglobal.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Win64; x64; Trident/5.0)', 'USA', 'san francisco', 'th2fuhphjf2bt2ib5f2r256c47');
INSERT INTO tour_testimonial VALUES(165, NULL, NULL, '2012-10-08', 'Shtanko Volostnikova', 'Marianna', NULL, 'marianna.78@inbox.ru', '+79145411642', 'Здравствуйте, не могу с вами связаться уже несколько дней, оставляла сообщение на авто ответчик, делала запрос на тур 4 штата 7 дней, звоню вы не отвечаете, мне нужно что бы вы связались со мной или подтвердили мой тур,это важно для оформления визы, жду ответа, с уважением Марианна!', NULL, NULL, NULL, NULL, NULL, '95.70.19.27', '95.70.19.27', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)', 'Russia', 'Khabarovsk', '0ivnbfdgr6vu8n3h1br4h6r9v4');
INSERT INTO tour_testimonial VALUES(166, NULL, NULL, '2012-10-10', 'Lyashenko, Shikh', 'Galina, Ninel', NULL, 'nshikh01@gmail.com', '', 'Ув. господа,<br />\r\n<br />\r\nЕсли вы хотите посмотреть город Эдмонтон и красоты провинции Альберта, этот тур для вас.  Но если вам хочется ещё и увидеть Ванкувер, то тут стоит крепко подумать.  <br />\r\n<br />\r\nДело в том, что на Ванкувер в этой поездке отводится всего один день, что конечно маловато для лучшего города мира (постановление ЮНЕСКО), но если б нам дали хотя бы этот день!!!  В программе дня, отведённого на Ванкувер, читаем "Переезд по живописной дороге.  Прибытие в Ванкувер".  Но кто же мог предположить, что прибытие в Ванкувер предполагается в 5 вечера!  Гостиница предыдущей ночёвки была на расстоянии 7-9 часов езды от города, при том, что привезли нас в неё в 3:30 РМ предыдущего дня.  Неужели нельзя было заказать отель поближе к городу, если не вообще в нём?  Надо сказать, что в Британской Колумбии нашу группу вообще бросили.  Вёз нас в Ванкувер водитель-китаец (8 часов молчаливого перегона, без каких-либо комментариев гида, которого вообще с нами не было), в Ванкувере мы получили 4-хчасовую экскурсию по городу, последний час которой проходил в темноте и мы ничего не видели, даже селил нас в отель случайный человек, не знающий заранее о прибытии нашей группы.  Обратный трансфер в аэропорт тоже не был заказан, зато хамства и грубостей от ведущего нашего тура Бориса, мы услышали в избытке, стараясь получить от него какую-то помощь и хоть как-то исправить в последний момент недоработки в проведении тура.  Все звонки в Нью Йoрк конечно делались за наш счёт.<br />\r\n<br />\r\nТур требует доработки, а людям как Борис вообще противопоказана работа с людьми.<br />\r\n<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '134.174.110.10', 'nat-mah.mah.harvard.edu', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; .NET CLR 1.1.4322)', 'USA', 'Boston', 'dqh5b6m3vp6skc28n5dqiqonq6');
INSERT INTO tour_testimonial VALUES(167, NULL, NULL, '2012-10-16', 'Boudzinskaia', 'Tatiana', NULL, 'tmboudz@yahoo.com', '818-468-5012', 'за это спасибо.<br />\r\nОднако, есть замечания по поводу организации. Это касается поездки в Бостон. Два часа мы ездили по Нью Йорку и собирали людей, где-то брали одного, трех или шесть человек. Непонятно почему нельзя назначить одно или два места сбора. Нас четверых забрали в 5:30 утра и отвезли к первому месту сбора, мы не успели позавтракать, т.к. завтрак в гостинице предоставляется с 6:00, а потом два часа просто колесили по городу. При эксурсиях по Европе, в таких случаях, по карайней мере, туристам выдается сухой паек.<br />\r\nВторое касается чаевых. В принципе, все это знают, что чаевые- это дело добровольное, о чем и было сказано Верой и Наташей. Мы также знаем, что водителю всегда собирают деньги и ни у кого никогда не возникает вопросов по этому пункту. Но когда нам было объявлено в безапиляционной форме, что мы обязаны сдать не меньше чем по два $2.00 за каждый день на водителя и гида, это волей - неволей, вызвало определенный внутренний протест и не хотелось уже никих чаевых не давать.<br />\r\nПросьба учесть наши пожелания при дальнейшей работе.<br />\r\n<br />\r\nС уважением<br />\r\n<br />\r\nТатьяна Будзинская<br />\r\nОльга Столова<br />\r\nЕлена Савина<br />\r\nАлла Бернат', NULL, NULL, NULL, NULL, NULL, '204.102.252.38', '204.102.252.38', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 6.1; Trident/5.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C; InfoPath.3)', 'USA', 'Los Angeles', 'jsb0nk0dol259abipat885mld3');
INSERT INTO tour_testimonial VALUES(168, NULL, NULL, '2012-10-18', 'Тюрин', 'Владимир', NULL, 'avcibb@rosmail.ru', '+7 985 729-7045', 'Семья двое взрослых и ребенок 17 лет хотели бы заказть экскурсию с русскоговорящим гидом по Нью Йорку с посещением Статуи Свободы 7 ноября 2012 года.<br />\r\n<br />\r\nОтъезд от гостиницы Хилтон гарден инн таймз сквер 09.00<br />\r\n<br />\r\nПросим сообщить о возможности, стоимости, составе экскурсии.', NULL, NULL, NULL, NULL, NULL, '95.28.31.55', '95-28-31-55.broadband.corbina.ru', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.0; Trident/5.0)', 'Russia', 'Москва', 'ecrhf1svk8gthpf06gf41h7q74');
INSERT INTO tour_testimonial VALUES(169, NULL, NULL, '2012-10-22', 'Vaynerman', 'Vladimir', NULL, 'vaynerman@yahoo.com', '8569857674', 'Где можно припарковать машину на время тура по Нью Йорку?<br />\r\nСпасибо.', NULL, NULL, NULL, NULL, NULL, '173.61.24.223', 'pool-173-61-24-223.cmdnnj.fios.verizon.net', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.4 (KHTML, like Gecko) Chrome/22.0.1229.94 Safari/537.4', 'USA', 'MARLTON', 'cpojmte5unnnp7djqt6ekq4sv0');
INSERT INTO tour_testimonial VALUES(170, NULL, NULL, '2012-10-22', 'Вайнердухова', 'Галина', NULL, 'galhatka@yahoo.com', '7183681416', 'Хочу выразить крайнюю признательность экскурсоводу Нелле (не знаю её фамилии) за прекрасно организованную поездку в штат Вермонт с 19 по 21 октября. Эти три дня пролетели как одно мгновение. Хорошая гостинница, интересные экскурсии, даже погода радовала. Необыкновенные краски осенних лесов; мирный, расслабленный стиль жизни городков; непривычная для нас, бруклинцев, чистота улиц, чистота воздуха и, самое главное, прекрасная энергетика везде, куда бы мы ни заезжали. Каждый из нас нашёл много интересного для себя. Мне больше всего понравилась экскурсия в своеобразный музей технологии изготовления кленового сиропа. Любителям истории были интересны экскурсии по местам, связанным с образованием первых штатов Америки. И всё это - благодаря неутомимой, артистичной, преданной своему делу и своей компании "New tours" Нелле. <br />\r\nБраво, Нелля! <br />\r\nГалина и присоединившиеся к этому мнению Рахиль, Лана и Алла.', NULL, NULL, NULL, NULL, NULL, '24.46.207.34', 'ool-182ecf22.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.1; rv:16.0) Gecko/20100101 Firefox/16.0', 'USA', 'Бруклин', 'e3avovr3snaigf6prrudi48fa5');
INSERT INTO tour_testimonial VALUES(171, NULL, NULL, '2012-10-23', 'Basina', 'Anna', NULL, 'annavit27@yahoo.com', '718-266-40-27', 'Я благодарна Вашему агенству за хорошую организацию тура по Калифорнии,Неваде, Аризоне и Юте с 13-22 окрября. Особенно за привлечение гида из Лос Анжелеса, Сережу,интеллегентного, сдержанного,глубоко знающего материал,с прекрасным чувством юмора.Внимательного к пожеланиям и проблемам туристов.Надеюсь,что и в дальнейшем Ваше агенство будет сотрудничать с ним. ', NULL, NULL, NULL, NULL, NULL, '69.124.102.57', 'ool-457c6639.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.0; rv:16.0) Gecko/20100101 Firefox/16.0', 'USA', 'Brooklyn', 'is39i9bc89hblvcgnm5qjaph36');
INSERT INTO tour_testimonial VALUES(172, NULL, NULL, '2012-10-25', 'Podkopaev', 'Valentin', NULL, 'makushkin@google.ru', '162-38-26', 'Ochen''ponravilas'' ekskyrsia v Boston. Vel ekskursovod Max', NULL, NULL, NULL, NULL, NULL, '12.181.204.36', 'vpn.catalent.com', 'Mozilla/4.0 (compatible; MSIE 7.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.04506.30; .NET CLR 3.0.04506.648)', 'Russia', '', 'gd47id4u880277861d545i0dv0');
INSERT INTO tour_testimonial VALUES(173, NULL, NULL, '2012-10-26', 'Цинман ', 'Борис', NULL, 'bortsyn@gmail.com', '718-510-0533', 'С 13 по 22 октября ездил по Калифорнии-Неваде-Юте. Незабываемые впечатления, особенно каньоны - все три разные. Восхищаешься природотворными шедеврами. В Лас-Вегасе восхищаешься вещами человекотворными. Запомнились Санта-Моника и старый Сан-Диего.<br />\r\nОрганизация тура чёткая - всё по плану и расписанию, всё познавательно и информативно, причём, ненавязчиво, без избыточных усыпляющих подробностей, лаконично и доступно. Основная заслуга - слаженность работы экипажа- водителя и гида. Водитель - мастер своего дела. Особо хочется отметить Сергея (фамилию не знаю), нашего гида. Работа на совесть. Один раз, видя, что не можем в Лас-Вегасе продуктивно провести свободное вечернее время, просто водил по городским шоу немногочисленные остатки группы (остальные разбрелись по разным опереттам). Спасибо, New Tours.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '74.90.216.66', 'ool-4a5ad842.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 5.1; rv:15.0) Gecko/20100101 Firefox/15.0.1', 'USA', 'New York', 'eqppictle82mpv1imtvvefb9s3');
INSERT INTO tour_testimonial VALUES(174, NULL, NULL, '2012-10-30', 'Poepsel', 'Iryna', NULL, 'iryna8feb@yahoo.com', '7132698757', 'здраствуйте,<br />\r\n <br />\r\nдва туриста из Украина - Андрей Бурцев и Алена Малиновская - сейчас находятся в гостинице Ла Кинта и должны были сегодня утром вылетать в Чикаго. у них проживание заканчивается сегодня в 11 утра. пожалуйста, сообщите, какие действия им предпринять и как дальнейший маршрут будет согласован.<br />\r\n <br />\r\nих телефон +37259804093 или мой 7132698757. спасибо.<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '72.37.249.68', '1593ob.scansafe.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; .NET4.0C; MS-RTC LM 8; .NET4.0E; InfoPath.3)', 'USA', 'houston', 'lgf74014gsl1li124d2g1pml14');
INSERT INTO tour_testimonial VALUES(175, NULL, NULL, '2012-11-02', 'sonkova', 'marya ', NULL, 'sonka71@yandex.ru', '13477092552', '3 Day trip to Niagara Falls with New-Tours travel agency was terrible. Instead of promised bus with comfortable seats, toilet and other conditions, agency provided 15 seats van. Distance from NYC to Niagara Falls is 400 miles, but it took 13 hours to rich that destination. Tour had pour organization and scheduling. Trip was unsafe. Administration completely failed their responsibilities and got lost when hurricane Sandy came. Only because of professional Van driver, who handled this situation and found safe place for passengers we avoided terrible accident. I would not recommend to anybody to travel with New-Tours agency, which main office is located on Brighton Beach Ave.', NULL, NULL, NULL, NULL, NULL, '71.190.16.206', 'pool-71-190-16-206.nycmny.east.verizon.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:16.0) Gecko/20100101 Firefox/16.0', 'USA', 'new york', 'g1boiun2n9sua5o4trud554ju4');
INSERT INTO tour_testimonial VALUES(176, NULL, NULL, '2012-11-05', 'Khodak', 'Yuliya', NULL, 'safonova.j@gmail.com', '8628121177', 'Я выслала депозит (money order, 150$) письмом 15 октября из New Jersey и до сих пор не получила от Вас ответа ни про получение ни про резервирование мест. Также я не получила ответа ни на мой емайл ни на войсмайл :( Пожалуйста, связитесь со мной по емайлу или телефону.', NULL, NULL, NULL, NULL, NULL, '69.126.46.57', 'ool-457e2e39.dyn.optonline.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0; BOIE9;ENUS)', 'USA', 'Nutley', 'is9t23c8p3arb3qpg3c18qpjl4');
INSERT INTO tour_testimonial VALUES(177, NULL, NULL, '2012-11-08', 'Охлопковы', 'Юрий, Елена', NULL, 'yvo555@mail.ru', '', 'В августе 2012г. мы воспользовались услугами компании New Tours. <br />\r\nСамые прекрасные впечатления от тура "КАЛИФОРНИЯ - НЕВАДА -АРИЗОНА - ЮТА". Очень интересная, красивая и познавательная поездка. Тур был очень хорошо и четко организован, полностью соответствовал заявленной программе. Ни разу не было сбоев по трансферам, времени встреч с гидами. Особая благодарность замечательным женщинам-гидам - Светлане и Лиле за их превосходное знание и изложение материала, истории США, готовность ответить на любой вопрос по тематике тура, умение создать благоприятную и дружественную обстановку среди более чем 50 туристов. Большое спасибо водителю автобуса Sergio - высококлассному профессионалу, деликатному, хорошо воспитанному человеку. Мы с грустью расставались с этими людьми. <br />\r\nБольшая просьба к Вам: если это возможно, напишите нам E-mail нашего гида Светланы из Нью Йорка. Спасибо. ', NULL, NULL, NULL, NULL, NULL, '217.212.231.224', 'v60-15.opera-mini.net', 'Opera/9.80 (iPad; Opera Mini/7.0.5/28.2859; U; ru) Presto/2.8.119 Version/11.10', 'Russia', 'Москва', 'imvired0akmqns2qic2gf4eqk1');
INSERT INTO tour_testimonial VALUES(178, NULL, NULL, '2012-11-09', 'махоткина', 'тамара', NULL, 'mir@mir.cn.ua', '+380505708171', 'Добрый день, Лиля. Мы познакомились на выставке в Киеве, у меня турагенство Мир Тревел.<br />\r\nУ меня есть 2 туриста, хотят поехать в Канаду из Нью Йорка. На 30 декабря у вас есть английская Канада за 375$ Скажите, как я могу для них заказать, как произвести оплату и какой процент комиссии могу получить.  Спасибо, жду ответ . Удачи Тамаиа можете ответить на anna@mir.cn.ua mir@mit.cn.ua', NULL, NULL, NULL, NULL, NULL, '46.149.83.116', 'client-46-149-83-116.osnova.tv', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.11 (KHTML, like Gecko) Chrome/23.0.1271.64 Safari/537.11', 'Ukraine', 'Чернигов', 't6ad8unbnh3fked3r9ctpdl5v3');
INSERT INTO tour_testimonial VALUES(179, NULL, NULL, '2012-11-09', 'Григоренко', 'Марина', NULL, 'grigos@skynet.be', '3223812672', '25-26 октября посетили Вашингтон. Поездка была очень насыщенной и интересной. Огромное спасибо гиду Константину за его эрудицию и юмор. Спасибо также шоферу Валерию. В след. приезд воспользуемся услугами Вашей компании.', NULL, NULL, NULL, NULL, NULL, '109.129.112.69', '69.112-129-109.adsl-dyn.isp.belgacom.be', 'Mozilla/5.0 (Windows NT 5.0; rv:12.0) Gecko/20100101 Firefox/12.0', 'Other ..', 'Брюссель', '6ak9c18ejioh51i52be10t64r6');
INSERT INTO tour_testimonial VALUES(180, NULL, NULL, '2012-11-10', 'Родионов', 'Владимир', NULL, 'pediatr44@rambler.ru', '+3800509707586', 'С НЬЮСТУРОМ за три года проехали от Нью Йорка до Лос-Анжелеса, Гавайев,от Сиэтла до Коламбуса, от Чикаго до Лас Вегаса. Счастливы и покорены качеством работы всех, с кем нам пришлось общаться.Спасибо водителям Володе и многим другим,экскурсоводам Элле, Светлане,сотруднице оффиса Ульяне.Успешного бизнеса и счастья в жизни!<br />\r\n                  Валентина и Владимир Родионовы', NULL, NULL, NULL, NULL, NULL, '93.74.224.3', 'up-granter.volia.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)', 'Ukraine', 'КИЕВ', 'mqfunn8ipks4sfpd7vhsb28qj2');
INSERT INTO tour_testimonial VALUES(181, NULL, NULL, '2012-11-20', 'Зога', 'Владислав', NULL, 'vladislav.zoga@mail.ru', '0503264987', 'Был в США в сентябре 2012 г. по турпутёвке. Компания Нью-турс, скажу честно, гиды очень хорошие!!!! Очень Много дают информации во время экскурсий. Был по туру: Нью-Йорк, Вашингтон, Бостон + Ниагарские водопады. Отличный тур!!!  Из всех трёх гидов, которые были, больше всего понравился гид Эмиль, очень познавательно всё рассказывал....  Спасибо ему большое!!  Позже тоже планирую поехать в США, буду связываться только с этой компанией. Спасибо за хорошие экскурсии!!!  И напоследок, туристам: не соглашайтесь на отели 2 звезды ( к примеру Пан Американ ) в Нью-Йорке, самая настоящая общага!! Минимум это 3 звезды!!!    ', NULL, NULL, NULL, NULL, NULL, '46.35.249.93', '93-249-35-46.host.sevstar.net', 'Mozilla/5.0 (Windows NT 6.1; rv:16.0) Gecko/20100101 Firefox/16.0', 'Ukraine', 'Севастополь', '1dfttoh9s1vs0scjvijirniu35');
INSERT INTO tour_testimonial VALUES(182, NULL, NULL, '2012-11-29', 'Алиев', 'Рамиз', NULL, 'aliev.ramiz@mail.ru', '+79038913303', 'Я отдыхал с Вашей фирмой в апреле 2012 г. Виза истекает в марте 2013-го года. 17 янвря хотим с женой посетить г. Майами сроком 12-14 дней. Желательно отель "РАМАДА" в котором мы уже останавливались прошлый раз. Сможем ли мы еще раз посетить Америку с Вашей компанией? ', NULL, NULL, NULL, NULL, NULL, '91.237.253.89', '91.237.253.89', 'Mozilla/5.0 (Windows NT 5.1; rv:17.0) Gecko/17.0 Firefox/17.0', 'Russia', 'Вязьма, Смоленск', '96j1vrrn7icoj5p96sr30c1kn5');
