INSERT INTO tour_testimonial VALUES(184, NULL, NULL, '2012-12-03', 'Alenitchev', 'Vadim', NULL, 'vadallen@yahoo.com', '347-944-3400', 'Добрый день! Я ищу бюро по туризму, которому приглянется моя тематическая экскурсия (8-9 дн): закат королевских династий Баварии и Австрии. То есть речь идет о местах, связанных с безумным королем Людвигом и с трагической историей любви его кузины Елизаветы и императора Франца Иосифа с подробностями их сложных отношений и посещением мест. Если вам интересно - please send an e-mail.   ', NULL, NULL, NULL, NULL, NULL, '24.184.75.125', 'ool-18b84b7d.dyn.optonline.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0; MAAU; MAAU)', 'USA', 'NYC', 'gm1fb1uvj7s3gtbsph1ro1a6d5');
