INSERT INTO tour_testimonial VALUES(187, NULL, NULL, '2013-01-24', 'bazlov', 'ella', NULL, 'ella_bazlov@mail.ru', '514-288-0624', 'Дорогая Лиля!<br />\r\nЯ работала в Израиле в туризме,многогрупп перевозила в Европу,имею лицензию.<br />\r\nВ Монреале очень сложно набрать группу, но я тем не менее всезла 3 группы в Ванкувер,единственная ,кто сумел это организовать.<br />\r\nПоэтому многие пристают организуй...но у вас уже все есть.<br />\r\nмне хотелось бы продавать ваши туры, рекламировать и  делать билеты с вылетом от нас,', NULL, NULL, NULL, NULL, NULL, '67.71.116.210', 'bas8-montrealak-1128756434.dsl.bell.ca', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)', 'Canada', 'montreal', 'pgaf4v0jlr0up2osem4pkbr616');
