INSERT INTO tour_testimonial VALUES(190, NULL, NULL, '2013-01-29', 'Stroker', 'Irina  ', NULL, 'IStroker@gmail.com', '267-918-6235', 'Hello,<br />\r\nI am interested in your tour “on the Ocean with food” in Best Western Castillo Del Sol hotel, Ormond Beach. I will be traveling with my mother who is 75 years old and have traveled with the Russian tour to Florida before. She prefers to eat Russian food and I was wondering if we could stay in this hotel with the Russian food option. I plan to fly to Florida and do my own tours. I would like to check in late on Thursday night (3/7/2013) and check out on Tuesday (3/12/13). <br />\r\nCan you please let me know if we can get a room in this hotel with the Russian food option included for about 3 days and how much this would cost at your earliest convinience. <br />\r\nSincerely,<br />\r\nIrina Stroker<br />\r\n', NULL, NULL, NULL, NULL, NULL, '98.114.249.134', 'pool-98-114-249-134.phlapa.fios.verizon.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Win64; x64; Trident/5.0)', 'USA', 'Philadelphia', 'i5tvhho4org8v8aptlpln9riv6');
