INSERT INTO tour_testimonial VALUES(193, NULL, NULL, '2013-03-19', 'Вержановская', 'Марина', NULL, 'maver_yatsm@mail.ru', '(495)915-403-35-90', 'Добрый день!<br />\r\nМеня заинтересовал 2-х дневный тур:фейерверк в Садах Дюпонов. Подскажите, каким образом можно забронировать  место на эту поездку на 31.08-01.09.2013? Марина.', NULL, NULL, NULL, NULL, NULL, '83.149.9.39', 'gprs-client-83.149.9.39.misp.ru', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0; NP06)', 'Russia', 'Москва', 'tg6i0hp6sj0lm45agf089lap62');
INSERT INTO tour_testimonial VALUES(194, NULL, NULL, '2013-03-24', 'Кладова', 'Валентина', NULL, 'kladova_1963@mail.ru', '8-904-530-00-27', 'Здравствуйте, дорогие друзья! <br />\r\nЗаинтересовал тур по Флориде:<br />\r\n11-13 Дней 3 ночи в Орландо, 3 ночи на океане, в Майами-Бич, 5-7 дней круиз<br />\r\n	 авиа	<br />\r\nТур по программе «Мир Диснея» и круиз – по выбору<br />\r\n	Воскресенье	$549 + круиз<br />\r\n<br />\r\nОтветьте, пожалуйств, сколько стоит круиз, сколько + ? В стоимость 549 входит ли авиаперелет? Если я и моя попутчица из разных городов, можем ли мы забронировать 2-местное размещение и оплатить стоимость она свою, часть, а я свою? Заранее спасибо за ответ.', NULL, NULL, NULL, NULL, NULL, '95.71.66.62', '95.71.66.62', 'Mozilla/5.0 (Windows NT 5.1; rv:19.0) Gecko/20100101 Firefox/19.0', 'Russia', 'Старый Оскол', 'sekbi30pakto4qeioips3rtvn0');
INSERT INTO tour_testimonial VALUES(195, NULL, NULL, '2013-03-25', 'sirotin', 'igal', NULL, 'tamarsir@gmail.com', '03-9322846', 'we want to order turistic tour to turkey from 14/09/13 for 10 days without tickets.', NULL, NULL, NULL, NULL, NULL, '79.181.108.228', 'bzq-79-181-108-228.red.bezeqint.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.22 (KHTML, like Gecko) Chrome/25.0.1364.172 Safari/537.22', 'Israel', 'petach-tikwa', '7l26quhet4m2068ivju8tvg8v0');
INSERT INTO tour_testimonial VALUES(196, NULL, NULL, '2013-03-25', 'Girina', 'Galina', NULL, 'Girinagalina@yandex.ru', '89268365130', 'Добрый день! Хотелось бы приобрести у вас экскурсию на ниагарские водопады на 2 дня на автобусе. Планируют быть в нью йорк в конце апреля. Меня интересует приблизительное время окончания экскурсии и возвращения <br />\r\nНью йорк  автобуса в', NULL, NULL, NULL, NULL, NULL, '37.110.80.70', 'broadband-37-110-80-70.nationalcablenetworks.ru', 'Mozilla/5.0 (iPad; CPU OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25', 'Russia', 'Moscow', 'eadogkume75sd0vhefttemscr2');
INSERT INTO tour_testimonial VALUES(197, NULL, NULL, '2013-04-11', 'Тихонова', 'Лариса', NULL, 'larisa_tikhonova@yahoo.com', '+7 916 920 93 78', 'Добрый день!<br />\r\nМы намерены приобрести у Вас однодневный тур по Нью Йорку (79$) на 11 мая 2013. Нас 4 человека. Входит ли в эту стоимость Рокфеллеровский центр? И сколько часов по времени занимает эта экскурсия?<br />\r\nС уважением, Лариса', NULL, NULL, NULL, NULL, NULL, '158.255.188.125', 'ppp158-255-188-125.pppoe.spdop.ru', 'Mozilla/5.0 (Windows NT 5.1; rv:19.0) Gecko/20100101 Firefox/19.0', 'Russia', 'Москва', 'cpqkdn8bu1jrdke3cqmnsb5h64');
INSERT INTO tour_testimonial VALUES(198, NULL, NULL, '2013-04-24', 'Белозерова', 'Любовь', NULL, 'belozerovaluybov@gmail.com', '(917)5753430', 'Доброе время суток! Отдыхала с подругой по вашему туру Лос-Анджелос-Сан-Франциско, а так же Нью-Йорк, Вашингтон. Тур наш начинался с 6.04.2013.В Лос-Анджелесе. Экскурсоводом был Александр. Очень профессиональный и грамотный. К нашей большой радости группа у нас была маленькая:21 человек и это большой плюс, он даже компенсировал неполадки маленького автобуса, когда мы поехали по Калифорнии, поскольку у кондиционера было только две функции вкл и выкл. Вот так мы и путешествовали: одним холодно, другим жарко.К большому минусу ваших туров отношу удаленность гостиниц от центров городов, и об этом сетовали многие. Я понимаю, что от этого зависит стоимость тура, но ведь возможно многие и захотели бы доплатить, но вечером находиться в городе, а не на окраинах. Подумайте над этим предложением. Далее про чаевые,у нас менталитет наверное все-таки другой, и мне достаточно неудобно давать чаевые экскурсоводам,таким интеллигентам, как Александр, Мила, Наталья.Почему их сразу не включить в стоимость тура отдельной строкой и выдать их потом после опроса экскурсантов по бальной системе, вот и получится на круг лучшие получат больше, а худшие ничего. Кстати, чаевые не давали граждане США (сказали, что это все  вымогательство). А теперь про экскурсоводов. С нами по Калифорнии путешествовала Мила, и если бы составляли топ лучших мировых экскурсоводов, то несомненно , она бы попала в первую пятерку. Мы все ей бесконечно благодарны. Огромаднейший запас информации, энциклопедические знания истории США и России, она хотела с нами поделиться всем-всем-всем, такое впечатление, что мы все были ее самые ближайшие родственники, сколько информации, все время в дороге она нас насыщала знаниями. В дороге, кроме того она показывала фильмы только по рассказанной теме. И если бы вы на сайте заявляли экскурсоводов на предлагаемые вами туры, то с Милой мы хоть в Канаду, хоть на Аляску, хоть по всей Америке, с Милой, только с Милой.И вот следующая наша экскурсия  была в Вашингтон. Экскурсовод Ирина, а водитель Слава. И вот тут-то вспомнили не раз мы Милу и Сэма.Про водителя: всю дорогу он без умолку говорил по телефону, такое впечатление, что не он для нас, а мы так случайные попутчики, когда мы уже взревели, нам было доложено, чтог имеет право. Так кроме всего он же тихоход: ехал еле-еле хотя никакого, как вы говорите, трафика на дороге не было.Тянул время, а зачем? Дали бы по-больше время в Вашингтоне. Второй день в Вашингтоне, я не поняла, почему всех надо было высадить в одном месте, анельзя было лодвезти к библиотеке, и почему нельзя было отвезти в библиотеку, благо она открывалась в 9.00, а надо было везти в магазин сувениров к 9.00. Еще очень хотелось бы, чтобы в начале тура выдавалась откорректированная программа тура. Если написано ночной Вашингтон, то это какой-то показ, а не выезд из Вашингтона ночью. И еще, как только на обратной дороге экскурсовод собрала сама в конвертик для себя и водителя у каждого чаевые, то и замолчала. И тут мы опять с величайшей благодарностью вспомнили Людмилу. Я даже представить немогу, чтобы она с конвертиком подходила к каждому себе за чаевыми. Но дальше еще хлеще. Нам решили поставить фильмы, российские бандитские. Это было уже сверх меры. Причем объяснили , ну нет, понимаете нет по истории Америки фильмов с перевом, а вот у Милы были. Может быть вы со стороны тур.агенства обеспечите их фильмами . Аэрофлот показывал Линкольна, данаверное много чего можно показать про Америку. Короче смазали все впечатление. Кстати, из нашей группы, кто ездил на Ниагару, рассказывал примерно то же самое (мы с ними воссоединились на экскурсии по Нью-Йорку) про фильмы в пути. Хочу высказать благодарность за трансферы на экскурсии, нас привозил Владимир, это было на 5+. И наконец экскурсия по Нью-Йорку. Наталья и Игорь полностью реабилитировали вашу фирму.Если сначала бегали фотографировать, то впоследствии боялись пропустить хоть одно слово из рассказа НатальИ: высокий профессионал. Единственно, группа конечно очень большая для экскурсий по городу, может быть есть смысл ездить с двумя экскурсоводами? Да и времени на обед в данной экскурсии было жалко (хотя понимаю, что экскурсия длительная), но хотелось бы лучше послушать Наталью. И Игорь, выше всех похвал, вот Славе бы у него поучиться. Вот вроде и все. Хочу вас поблагодарить за встречу с Милой, Натальей, Александром, Игорем и Владимиролм и кончно же с США. ', NULL, NULL, NULL, NULL, NULL, '95.221.102.105', 'ip-95-221-102-105.bb.netbynet.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; InfoPath.1)', 'Russia', 'Москва', 'jhql29sd9vmaj7mo1tjr8ks912');
INSERT INTO tour_testimonial VALUES(199, NULL, NULL, '2013-04-25', 'Поконова', 'Ася', NULL, 'ugra-audit@yandex.ru', '+79257036602', 'Здравствуйте!40 минут не могу заполнить анкету на заказ тура, пишет проверку данных, уже не знаю, что проверять. Я бы хотела заказать тур Новый Орлеан на 18 июня и на 4 ночи отель Майами бич по туру отдых на океане. С уважением Поконова А.Ю. Адрес электронной почты ugra-audit@yandex.ru', NULL, NULL, NULL, NULL, NULL, '188.123.237.9', '188.123.237.9', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0; BOIE9;RURU)', 'Russia', 'Москва', '4082hpjpbr0fr61knesv1ev061');
INSERT INTO tour_testimonial VALUES(200, NULL, NULL, '2013-04-26', 'Nesterova', 'Galina ', NULL, 'galanes25@mail.ru', '+7 903 9614797', 'Thank you very much to Rita for fine tour to Lancaster-amishi 20 April 2013.', NULL, NULL, NULL, NULL, NULL, '174.44.101.111', 'ool-ae2c656f.dyn.optonline.net', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)', 'Russia', 'Moscow', 'kekgrvck4tfeu144s2aqhvce86');
INSERT INTO tour_testimonial VALUES(201, NULL, NULL, '2013-05-12', 'Kleba', 'Tatiana', NULL, 'Klebat@mail.ru', '+79044871212', 'Огромное спасибо гиду Борису Волкину!!!! Тур Чикаго 6 дней, 4 мая. Была очень интересная поездка и каждая экскурсия , узнали очень много нового о стране и каждом городе! Спасибо!!!!', NULL, NULL, NULL, NULL, NULL, '83.149.34.188', '83.149.34.188', 'Mozilla/5.0 (iPad; CPU OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25', 'Russia', 'Нижневартовск, хмао', 'ib95attm5k96rl3r0pp1d5ois1');
INSERT INTO tour_testimonial VALUES(202, NULL, NULL, '2013-05-13', 'Королева', 'Инна', NULL, 'koroleva.iy@vtb24.ru', '8-903-508-34-09', 'Добрый день,<br />\r\nу меня есть свободные дни в нью йорке (19.05, 24.05 и 27-30.05) и хотелось бы узнать <br />\r\n1.есть ли экскурсия в хемптон? по вашему графику в "золотой лонг айленд" не вписываюсь.<br />\r\n2.сколько длится экскурсия на кораблике вокруг манхетена с ланчем и о каком дрес коде идет речь.<br />\r\n3. сколько длится экскурсия на вертолете.<br />\r\n<br />\r\nПрошу оперативно ответить т.к. мне нужно спланировать экскурсии.<br />\r\nСпасибо, Инна.', NULL, NULL, NULL, NULL, NULL, '217.14.52.2', 'proxy.vtb24.ru', 'Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1; SV1; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; InfoPath.3)', 'Russia', 'москва', '3bct4olqkkreg23bguodlv6nm3');
INSERT INTO tour_testimonial VALUES(203, NULL, NULL, '2013-05-15', 'Mizhiritskaya', 'Valentina', NULL, 'naumbronz@aol.com', '7182532537', 'On May 10th, my brother and his wife who are visiting from Israel went on your tour to Maine, specifically to Acadia National Park. <br />\r\n<br />\r\nFirst of all, the bus we were provided with was not large enough for the number of people who went on the tour, and does not comply with any sort of reasonable standard of comfort for a trip that is over 300 miles in each direction, not including subsequent trips within Maine.<br />\r\n<br />\r\nHad this been the only issue with the tour, I would not be writing this complaint, however that was not even the beginning of the problems we experienced with this tour. <br />\r\n<br />\r\nThe brochure advertises a scenic tour through Portland and Canonbank where we will view the numerous art galleries.<br />\r\n<br />\r\nInstead of walking through these historic streets and galleries, we went through by bus for a grand total of 20 minutes. <br />\r\n<br />\r\nHowever, the main surprise was when we arrived at Acadia National Park and realized that it was in fact, closed. When you spend $385 per person on a tour where the highlight is the national park, and realize it is closed with a large sign that says that the season starts on May 19th, you aren''t going to be pleased.<br />\r\n<br />\r\nYou start questioning the competence of the tour guide and the agency as a whole, and you begin to wonder why this sham of an agency is even in business. How can an agency that provides this tour on a regular basis not realize that this park is closed for the season. <br />\r\n<br />\r\nAnyone would expect some sort of compensation for this occurrence, whether it be a free lunch on the company''s expense, or a general refund but this tour guide did neither. She promised to "drive us around the park". We did not pay for that, nor do we care about some drive in an uncomfortable bus. We paid to visit Acadia national park.<br />\r\n<br />\r\nIn addition, the tour guide promised us the opportunity to sample beer and coffee, as well as the lobsters that Maine is so famous for. As it turned out, the tour guide bought beer for herself in a supermarket and instead of going on the boat tour with the group who barely speaks English and translate for them, she decided to stay in town. As for the coffee, well, we are certainly glad that she bought the coffee for herself and allowed us to smell the coffee aroma in this joke of a bus. <br />\r\n<br />\r\nWhen it came to the lobsters, we were provided with three hours (from 2-5pm) to experience the town and have a lobster dinner. Unfortunately, ALL of the restaurant in this town only open at 4:30 pm. It took us over 2 hours to find a single restaurant that opens before 4:30, so you can imagine how much time we had to enjoy the famous Maine lobster. Is your agency so incredibly inept at organizing a single task that you cannot even plan a simple lunch without turning it into a disaster?<br />\r\n<br />\r\nWe were promised a look at the Bush family residence, but because of a thick fog, it was not possible. Now, I realize that you cannot blame the weather on the tour guide, but she had the nerve to say that there, and I quote "is nothing special about this house". If there is in fact nothing special about this house, why are we paying money to see it? <br />\r\n<br />\r\nA similar fog descended upon us when we visited the Cadillac mountain, and the tour guide of course did not have a backup plan, but at this point, we did expect any better.  <br />\r\n<br />\r\nWe were not allowed a reasonable amount of time to experience the beautiful, old towns that we came to visit because the tour guide was more concerned with leaving earlier than scheduled for the sole purpose of avoiding expected traffic on Mother''s Day, however we ended up getting caught in gridlock traffic anyway, and had we stayed longer, we would have beat the traffic.<br />\r\n<br />\r\nWhile the tour guide happened to know various textbook information about Maine, her enthusiasm in conveying this information to the group left a lot to be desired.<br />\r\n<br />\r\nThe only positive note of this entire tour is the beautiful scenery of the state of Maine and that your driver was indeed skilled and experienced. <br />\r\n<br />\r\nYou can expect to see a similar message sent to the Better Business Bureau as well as any review site where New Tours are advertised. ', NULL, NULL, NULL, NULL, NULL, '67.80.148.101', 'ool-43509465.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.31 (KHTML, like Gecko) Chrome/26.0.1410.64 Safari/537.31', 'USA', 'Brooklyn', '816mla85vjv3fokj547lfik431');
INSERT INTO tour_testimonial VALUES(204, NULL, NULL, '2013-05-26', 'Ибрагимова', 'Гуля', NULL, 'ig.meanstream@yandex.ru', '+7(903)725-63-40', 'Я и мой муж Андрей благодаря турфирме "Нью Турс"  и, в частности, гидам Эмилю и Сергею, в период с 24.04.2013 по 10.05.2013, посмотрели Нью-Йорк, Вашингтон, Бостон, Ниагарский водопад, Лос-Анжелес, Сан-Диего, Сан-Франциско, Гранд-Каньон, Йосемитский заповедник. Это самое лучшее и незабываемое путешествие в нашей жизни. Яркие, потрясающие впечатления!!! Рассказы высочайшего профессионала в своем деле Эмиля глубоко запали в наши души. Мы благодарны Эмилю за его энциклопедические знания, старомосковский, аристократический говор, на котором в Москве уже практически никто не говорит. Сергею большое спасибо за музей Пола Гетти в ЛА, за истории о Ховарде Хьюзе, Кире Киркоряне и др. Всем спасибо за душевную, дружескую обстановку, за опеку и искреннее отношение к нам. Мы полюбили Америку! Мы увидели самое лучшее в этой стране, гостеприимно принявшей нас. Теперь хочется приехать в каждый город отдельно и пожить, побродить, подышать этим воздухом, насладиться атмосферой. Так что не прощаемся, а говорим до новых встреч!!! Отдельный респект Президенту Ассоциации Евгению Баранову, вложившему душу и часть своей жизни в Нью-Турс, сумевшему собрать такой коллектив , организовать и продумать самые наилучшие туры! Процветания и стабильности Вашей турфирме, больших доходов, состоятельных и воспитанных туристов и крепкого здоровья Вашим близким и родным! С уважением, Гуля Ибрагимова', NULL, NULL, NULL, NULL, NULL, '134.0.98.48', '134.0.98.48', 'Mozilla/5.0 (iPad; CPU OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25', 'Russia', 'Москва', '9kl708so5utl05rlhrg536dv86');
INSERT INTO tour_testimonial VALUES(205, NULL, NULL, '2013-05-28', 'Немчен', 'Олег', NULL, 'nemchen@meta.ua', '+380504473489', 'Добрый день! Хочу поделиться своими впечатлениями о поездке с фирмой НьюТурс по Америке. Мы с женой были в США с 13.04.2013 по 01.05.2013 года. И, соответственно, ездили на 3 экскурсии с фирмой. 14.04.2013 по Нью-Йорку (экскурсовод Рибека). С 16 по 17 апреля на Ниагару (экскурсовод Эмиль). С 18 по 19 апреля в Вашингтон (экскурсовод Евгений, фамилия по-моему Гольдер).<br />\r\nПоложительное:<br />\r\n- все вышеперечисленные экскурсоводы очень квалифицированы, рассказывают интересно, нарушений графика не допускают. В общем, обо всех трех осталось очень приятное впечатление и хорошие воспоминания.<br />\r\n- построение экскурсий тоже не вызывает нареканий. Все хорошо продумано и графики подобраны довольно оптимально.<br />\r\n- на маршрутах в Нью-Йорке и на Ниагару хотелось бы отметить водителей, которые кроме того, что нормально выполняли свою работу, были очень вежливы и учтивы с пассажирами. Их, по-моему, зовут Владимир и Михаил.<br />\r\nОтрицательное:<br />\r\n- на экскурсии в Нью-Йорке использовался микроавтобус с низкими окнами. Учитывая то, что Нью-Йорк, все-таки город небоскребов было очень неудобно. Фактически люди, сидевшие не у окна, ничего увидеть не смогли. Это было большой ложкой дегтя в бочке меда. Наверное, компании надо об этом подумать.<br />\r\nВ целом же впечатления остались очень приятные. Возможно будем пользоваться услугами фирмы и в следующий раз.  <br />\r\n  ', NULL, NULL, NULL, NULL, NULL, '212.90.165.162', 'nat.danielbank.com.ua', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/27.0.1453.94 Safari/537.36', 'Ukraine', 'Киев', '4h4n4tk0so3c67c83hhe7sef53');
INSERT INTO tour_testimonial VALUES(206, NULL, NULL, '2013-05-28', 'Ivanova', 'Natasha', NULL, 'Rnd21@ya.ru', '6462380445', 'Мы с подругой ездили 26 мая в Филадельфию/сады Дюпонов в компании гида Риты и водителя Дмитрия. Были в полном восторге от обоих! Рите удавалось найти подход к самым ворчливым пассажирам в автобусе и сгладить все острые углы. Интересный тур, много познавательной, талантливо изложенной информации! Вежливый, доброжелательный  водитель.<br />\r\nНам очень понравилось, хотелось бы, чтобы так везло с гидами почаще! ', NULL, NULL, NULL, NULL, NULL, '98.14.36.163', 'cpe-98-14-36-163.nyc.res.rr.com', 'Mozilla/5.0 (iPad; CPU OS 5_1_1 like Mac OS X) AppleWebKit/534.46 (KHTML, like Gecko) Version/5.1 Mobile/9B206 Safari/7534.48.3', 'USA', '', '8fldrfov041mqqiqv12hcu0915');
INSERT INTO tour_testimonial VALUES(207, NULL, NULL, '2013-06-03', 'Новоселя', 'Алексей', NULL, 'alex7162@yandex.ru', '+79882452962', 'Хочу приобрести тур в США на 3-х взрослых по срокам примерно с 25 августа по 15 сентября 2013г. Хочу дней 5-7 пляжного отдыха, остальное - экскурсии. Что посоветуете?', NULL, NULL, NULL, NULL, NULL, '188.95.186.130', '188-95-186-130.krasnodar.realcomm.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:21.0) Gecko/20100101 Firefox/21.0', 'Russia', 'Краснодар', 'tp1teq3jh57sqsqshg0rk5epd3');
INSERT INTO tour_testimonial VALUES(208, NULL, NULL, '2013-06-08', 'Okrend', 'Oxana', NULL, 'Oksanafdesign@yahoo.com', '6462679055', 'Хочу поблагодарить Риту за прекрасную поездка в Филадельфию. Замечательный и очень позитивный гид !', NULL, NULL, NULL, NULL, NULL, '74.72.224.221', 'cpe-74-72-224-221.nyc.res.rr.com', 'Mozilla/5.0 (iPhone; CPU iPhone OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25', 'USA', '', '2c3f5pf6mia41lue4cqi8vsmn5');
INSERT INTO tour_testimonial VALUES(209, NULL, NULL, '2013-06-09', 'Касимова', 'София', NULL, 'Sophiekasimova@yahoo.com', '79534397900', 'Хотела сказать всем огромное спасибо!!! Вы лучшие, и даже находясь не в сша сейчас, все равно друзей отправляю к вам за турами! Огромное спасибо хочу выразить Лиле и менеджеру Славе. Вы молодцы! А Слава, вам отдельное спасибо за вашу помощь и вашу поддержку! До сих пор помню как вы меня поругали за сарафан с огромным вырезом на груди и сказали, что я не на гулянку пришла, а в офис) прилечу, отдельно поблагодарю! Процветания Вам, и всего самого лучшего! <br />\r\nSent from my iPhone', NULL, NULL, NULL, NULL, NULL, '109.188.127.141', 'client.yota.ru', 'Mozilla/5.0 (iPhone; CPU iPhone OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25', 'Russia', 'Тула', 'v6v41damriqdo3r4485phtu3c0');
INSERT INTO tour_testimonial VALUES(210, NULL, NULL, '2013-06-12', 'merkina', 'marina', NULL, 'mmerkina@gmail.com', '3473428780', 'Hello <br />\r\nI want to know if tourist from Germany who has visa to enter USA can visit Canada and what documents does he need. Thanks', NULL, NULL, NULL, NULL, NULL, '173.56.190.40', 'pool-173-56-190-40.nycmny.fios.verizon.net', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)', 'USA', 'brooklyn', 'lf78cvcuadrrl0t4411g76ss40');
INSERT INTO tour_testimonial VALUES(211, NULL, NULL, '2013-06-17', 'Ле Галль', 'Ольга', NULL, 'olga_le_gall@hotmail.fr', '33251852048', 'Я и двое моих детей 12 и 13 лет совершили в апреле этого года двухдневную поездку в Вашингтон с турагентством НьюТур. Экскурсия была замечательная. Я очень хочу поблагодарить нашего гида Ирину за великолепную работу и высокое качество подачи материала, нашего водителя Алексея, сидевшего за рулем комфортабельного автобуса и чудесную Лесю, оператора агентства, которая очень помогла нам в организации нашей культурной программы в Америке. ', NULL, NULL, NULL, NULL, NULL, '62.34.213.153', 'i02v-62-34-213-153.d4.club-internet.fr', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_7_5) AppleWebKit/536.29.13 (KHTML, like Gecko) Version/6.0.4 Safari/536.29.13', 'Other ..', 'Нант', 'jn4td5ddf7ommcr2b6d6qvej32');
INSERT INTO tour_testimonial VALUES(212, NULL, NULL, '2013-06-28', 'Севастьянова', 'Ольга', NULL, 'son_1.55@mail.ru', '2779693', 'Не могу не выразить благодарность вашей компании, вашими гидам Эмилю, Михаилу, Ребекке за интересно проведенные экскурсии, заботу о клиентах, оставившие замечательные впечатления и эмоции о людях и стране. СПАСИБО. ', NULL, NULL, NULL, NULL, NULL, '95.56.158.215', '95.56.158.215.megaline.telecom.kz', 'Opera/9.80 (Windows NT 6.0; U; ru) Presto/2.10.289 Version/12.00', 'Kazakstan', 'Алматы', 'i7gav10c00b9dab5kkdi1lrgi0');
INSERT INTO tour_testimonial VALUES(213, NULL, NULL, '2013-07-06', 'Брук', 'Лени', NULL, 'Lb@mail.ru', '095/233678957', 'Разочарование в вашей пунктуальности.Ожиданиие автобуса  в течении 1:45,queens - амиши тур.совет друзьям - не пользоваться вашими услугами', NULL, NULL, NULL, NULL, NULL, '174.255.113.115', '115.sub-174-255-113.myvzw.com', 'Mozilla/5.0 (iPhone; CPU iPhone OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25', 'Russia', 'Москва', 'hs6hsb2vfmijr9uq1uv39am3f5');
INSERT INTO tour_testimonial VALUES(214, NULL, NULL, '2013-07-13', 'lika', 'lika', NULL, 'likavilt@gmail.com', '646 386 6767', '<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nУважаемые гости и жители Нью-Йорка....... Хочу вас предупредить................. если вы приобретаете тур .путёвки в компании New Tours вас ожидает мягко сказать разочарование.. и на ветер выброшенные деньги.......... Я в свою очередь не послушала свою дочь,которая имела "счастье" столкнуться с этой компанией........ У неё был тур в Вашингтон был неквалифицированный гид и в добавок попрошайка собранные им чаевые с 40 человек по $10 оказалось НЕДОСТАТОЧНО.........Жаль на её ошибке я ничему не научилась...... И вот..............Я хочу рассказать как проходила наша поездка Нью-Йорк -Чикаго.........Перед тем как приобрести путёвки,а они приобретались за полтора месяца,до путешествия.Я уточнила какие автобусы, в компании меня заверили -большие комфортабельные. А на деле ,когда пришло время отправляться на экскурсию,нас поставили перед фактом-предоставили автобус маленький тесный на 3 меньше посадочных мест. Нас 15,а мест 12. "Приятного путешествия" сказали нам...... Сдать билеты невозможно.......... почему? купите узнаете............ Я хочу ВАС- потенциальных путешественников предостеречь................... Путешествуйте........... но не с New Tours  . Прежде чем платить деньги в подобные компании ,обратите внимание на комментарии......<br />\r\n<br />\r\n.Оценка- единица..... но самую маленькую оценку .которую можно поставить на их сайте "3"-до этой оценки им не дотянуться <br />\r\n<br />\r\n..', NULL, NULL, NULL, NULL, NULL, '24.146.219.57', 'ool-1892db39.dyn.optonline.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)', 'USA', 'Brooklyn', 'nr1f72v95bi54o8jtrt9etnul4');
INSERT INTO tour_testimonial VALUES(215, NULL, NULL, '2013-07-14', 'Fisher', 'Vladimer ', NULL, 'vladimerfisher@gmail.com', '6462697054', 'я и моя жена были в составе групи, которая посетила ниагарские водопады 6-7июлия... <br />\r\nтур прошел отлична...<br />\r\nоднако, когда мы уже были в квинсе и автобус осановилсия-некоторые туристы должны были сойти, я спросил гида, где можно найти туалет...<br />\r\nох ответил - в кустах...<br />\r\nя повторил, что не для меня, а для женщины...<br />\r\nон опять ответил, что где нибуть вокруг...<br />\r\nмы в женой и пошли искать туалет в 11.00 ночи...<br />\r\nнашли субвай...<br />\r\nвернулись и на нас налетела вся группа!!!<br />\r\nони орали как звери на нас  и ругали nac как могли!!!<br />\r\nдо этого все туристы заплатили типы по 2 долара для вадителя и для гида...<br />\r\nоказиваеция,  когда они спросили гида, где мы, он ответил, что не знает...<br />\r\nи еще - как рассказали другие туристы, после, когда мы посли искать туалет, он открыл nаходиашисия  в салоне автобуса туалет для других туристов!!!<br />\r\nэто было гнусно со стороны гида и обманутых туристов!!!<br />\r\nзвали гида Борис!!! <br />\r\nтак что смотрите...<br />\r\nмы граждане этой страны и неоднократно путешествовали, но такого...<br />\r\nмы платим деньги за соответствуиуши сервис но никак за это!!! <br />\r\nи некак не можем дать позитивный фитбек!!! ', NULL, NULL, NULL, NULL, NULL, '174.44.100.13', 'ool-ae2c640d.dyn.optonline.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_8_3) AppleWebKit/536.28.10 (KHTML, like Gecko) Version/6.0.3 Safari/536.28.10', 'USA', 'Brooklyn', 'rkp4ne4fk8b446b8ge5of40ps0');
INSERT INTO tour_testimonial VALUES(216, NULL, NULL, '2013-07-21', 'Поконова ', 'Ася', NULL, 'ugra-audit@yandex.ru', '+79257036602', 'Здравствуйте! У меня вопрос по туру Вашингтон-Вирджиния и Вирджиния Бич  8 дней с датой начала 8 августа. Меня интересует, состоится ли тур 8 августа, интересует первый вариант, с выездом и возвращением в Нью-Йорк. И не нашла в интернете информацию о температуре воды в океане в районе Вирджиния Бич, только температура воздуха. Пожалуйста, подскажите по цельсию, насколько теплая вода в океане. С уважением Поконова А', NULL, NULL, NULL, NULL, NULL, '188.123.237.9', '188.123.237.9', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0; BOIE9;RURU)', 'Russia', 'Москва', 'i50agbmjcpic3sen82b8ua7lu2');
INSERT INTO tour_testimonial VALUES(217, NULL, NULL, '2013-07-22', 'Харитонова', 'Жанна', NULL, 'Bra18j1@yandex.ru', '', 'Здравствуйте! Недавно вернулись из тура "Вся Канада" с 29 июня. Хочется выразить огромную благодарность за такой превосходный тур всей вашей компании. Замечательная программа, прекрасная организация, обслуживание, сюрпризы - все на высшем уровне! <br />\r\nЛегким и приятным, интересным и эмоционально насыщенным сделали наше пребывание в Канаде ваши неповторимые гиды: Борис - в восточной части и Игорь - в западной. Спасибо им огромное и низкий поклон их нелегкому труду, их профессионализму, их терпению. Хочется отметить и работу водителей. С этими людьми у автобусов всегда есть крылья. По долгим, длинным дорогам мы словно летели. Спасибо им!<br />\r\nЖелаю всей огромной команде дальнейшего развития и больших успехов!!!<br />\r\nС наилучшими пожеланиями,<br />\r\nЖанна и Артем Харитоновы.', NULL, NULL, NULL, NULL, NULL, '91.188.176.238', '91.188.176.238', 'Mozilla/5.0 (iPad; CPU OS 5_1_1 like Mac OS X) AppleWebKit/534.46 (KHTML, like Gecko) Version/5.1 Mobile/9B206 Safari/7534.48.3', 'Russia', 'Москва', 'u8rbs2mi6b238s55k388icgpl7');
INSERT INTO tour_testimonial VALUES(218, NULL, NULL, '2013-07-28', 'Юдин', 'Павел', NULL, 'pavelyoudin@yandex.ru', '+79853665721', ' Мне рекомендовал вашу компанию и конкретно менеджера Анжелу мой друг Бляхер Аркадий из Нью Йорка. Мы с женой (нам по 65 лет)хотим посетить США в период с 1.09.2013 до 20.09.2013г. Хотим посмотреть Нью Йорк, возможно Вашингтон, отдых в Майами затем переезд на западное побережье (Сан Франциско, Лас Вегас) чтобы можно было улететь в Россию из Сан Франциско во Владивосток через Сеул. отель в Нью Йорке (Миллениум) я заказал на 1.09. и оплатил до 8.09.2013. Жду от вас предложений по путешествию. Условия проживания: у отели 3-4 звезды по европейской классификации, туры, зкскурсии и переезды предпочтительней в составе русскоязычной  группы. Идеально встречи и проводы в аэропортах. Заранее благодарю.  ', NULL, NULL, NULL, NULL, NULL, '87.255.21.57', 'host-87-255-21-57.bigtelecom.ru', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0; BOIE9;ENUS)', 'Russia', 'Москва', 'jvf5k0mvv0ehvf7ptmv5babi57');
INSERT INTO tour_testimonial VALUES(219, NULL, NULL, '2013-07-28', 'Tsvelikhovsky', 'David', NULL, 'london2@bezeqint.net', '972523201569', ' Мы с женой впервые воспользовались услугами вашей компании<br />\r\nТур по Аляске с гидом Игорем Левитом оставил у нас прекрасное впечатление как в организации тура,так и в профессионализме его организаторов<br />\r\n Советуем всем обратить внимание на туры проводимые с его участием<br />\r\nОн грамотный экскурсовод и прекрасный человек<br />\r\nУдачи вам<br />\r\nС уважением, семья Цвелиховских', NULL, NULL, NULL, NULL, NULL, '79.176.152.210', 'bzq-79-176-152-210.red.bezeqint.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_7_5) AppleWebKit/536.30.1 (KHTML, like Gecko) Version/6.0.5 Safari/536.30.1', 'Israel', 'Nazareth Illit', 'g2ep9td1g2mptvcru7e3b42fl5');
INSERT INTO tour_testimonial VALUES(220, NULL, NULL, '2013-07-30', 'Шарова', 'Елена', NULL, 'sharova.elena@mail.ru', '3562106', 'Здравствуйте!<br />\r\nМы путешествовали с Вашей турфирмой в июле. Хотелось бы сказать ещё раз спасибо гиду по имени Анвар, который сопровождал нас с 12.07 по 21.07.13 по Калифорнии. Всё очень чётко организовано, Анвар показал максимально и оптимпльно всё, что было достойно внимания путешественника. Кроме того, продумано музыкальное сопровождение в автобусе (джаз, кантри), что создаёт дополнительное впечатление и настроение, а также  фильмы по теме экскурсий.<br />\r\n Также был очень хороший гид на экскурсии на Ниагарские водопады по имени Майкл. И Лариса на экскурсии по Нью-Йорку тоже очень профессиональный гид.<br />\r\n  Борис возил нас в Вашингтон, много и интересно рассказывал (иногда даже слишком много), но почему-то всю дорогу туда и обратнл стоял в автобусе лицом к пассажирам. Разве в Америке разрешено стоять во время движения? Разве за это не штрафуют?<br />\r\n  А вот гида по имени Лев, пожалуйста, не приглашайте, если не хотите отрицательных отзывов о вашей турфирме. Он не умеет работать с туристами, информация старая и пустая. Человек живёт в 70-80 годах.<br />\r\n   У нас остался вопрос о непонятном бонусе в конце программы в Сан-Франциско 21.07. В нашей программе было написано, что 21.07 -- свободный день, и мы взяли авиабилеты на утро 21.07. И вдруг бонус (программа в первой половине дня 21.07), которым мы не смогли воспользоваться. Хотя могли бы. Тем более работа гида и водителя в любом случае оплачивается и очевидно,что это из денег нашего тура.<br />\r\n  Хотелось бы внести предложение на будущее при организации двухдневных экскурсий из Нью-Йорка. Для людей, которые берут и Ниагару, и Вашингтон, объединять 2 поездки в одну на 4 дня, чтобы не надо было возвращаться в Нью-Йорк и терять много времени и сил на переезды. Пусть это будет дороже, но сэкономит время и здоровье.<br />\r\n  Ещё раз спасибо за организацию туров и не забудьте поблагодарить от нас гидов, о которых я писала в начале письма.<br />\r\n  Елена.<br />\r\n  ', NULL, NULL, NULL, NULL, NULL, '95.55.134.216', 'pppoe.95-55-134-216.dynamic.avangarddsl.ru', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; .NET CLR 1.1.4322; .NET CLR 2.0.50727; .NET CLR 3.0.4506.2152; .NET CLR 3.5.30729; SVD)', 'Russia', 'Санкт-Петербург', '7b6duu0p3ctijgs5ti4k15svd1');
INSERT INTO tour_testimonial VALUES(221, NULL, NULL, '2013-07-31', 'Gilmutdinov', 'Ildar', NULL, 'Ildar0611@yandex.ru', '+79872961771', 'Подал 31.07. заявку на тур Лос-Анжелес 7 дн. Дополнительно сообщаю личный e-mail для Натальи.<br />\r\nЗаранее благодарю Ildar.', NULL, NULL, NULL, NULL, NULL, '213.87.138.54', '54.gprs.mts.ru', 'Mozilla/5.0 (iPad; CPU OS 5_1_1 like Mac OS X) AppleWebKit/534.46 (KHTML, like Gecko) Version/5.1 Mobile/9B206 Safari/7534.48.3', 'Russia', 'Kazan', '70jqk5d8fh7251ggg3ggm6s4p6');
INSERT INTO tour_testimonial VALUES(222, NULL, NULL, '2013-08-01', 'соколова', 'марина', NULL, 'smarina1221@yahoo.com', '8454257261', 'Хочу поблагодарить вашу компанию и экскурсовода Иру и водителя Славу за очень хорошую экскурсию в Вашингтон 22 и 23 июля 2013 .', NULL, NULL, NULL, NULL, NULL, '24.189.130.143', 'ool-18bd828f.dyn.optonline.net', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)', 'USA', '', 'ckd1rbmvb2o0oaj9rqcb440ng1');
INSERT INTO tour_testimonial VALUES(223, NULL, NULL, '2013-08-02', 'Килимник', 'Мила', NULL, 'kilimnm@gmail.com', '3366010542', 'Пыталась найти отзывы клиентов вашей компании на поездки и поездку в Мексику в частности, но к сожалению не смогла - подскажите, где я могу эту информацию найти.   ', NULL, NULL, NULL, NULL, NULL, '216.54.213.76', 'barracuda.aha-net.org', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1500.95 Safari/537.36', 'USA', 'Гринсборо', 'tlfau2ubvd2tvpr67ipo3qve10');
INSERT INTO tour_testimonial VALUES(224, NULL, NULL, '2013-08-02', 'Ветшев', 'Борис', NULL, 'vetshev@rambler.ru', '89099213673', 'Добрый день! Путешествовали с New Tours по программе Звезды Атлантики и Чикаго 14 дней - VETSHEV BORIS И VETSHEVA ELENA. Путешествие понравилось, все прошло без нареканий. Особенно хотелось поблагодарить гидов Бориса и Эмиля.<br />\r\nТак же хотелось задать вопрос по следующей проблемме: при заселении в отель Pensylvania 19.07.13 с моей карты была списана сумма в 40$, при заселении в отель Fairfield Inn by Marriott списана сумма в 20$ и при заселении в отель Pensylvania 24.07.13 опять 40$. Всего 100$. Как нам объяснили это депозит, который после выселения должен возвратиться на карту в течении 7 дней. Сегодня уже 2 августа, а денег нет!!! Просьба оказать содействие в решении данного вопроса. Ждем от вас обратной связи.<br />\r\nС уважением. Ветшев Борис.<br />\r\n ', NULL, NULL, NULL, NULL, NULL, '95.25.29.235', '95-25-29-235.broadband.corbina.ru', 'Opera/9.80 (Windows NT 6.1; WOW64) Presto/2.12.388 Version/12.16', 'Russia', 'Москва', '3hve31flab5csch008qbpa0202');
INSERT INTO tour_testimonial VALUES(225, NULL, NULL, '2013-08-02', 'Титова', 'Римма', NULL, 'Rnt2502@mail.ru', '4155703174', '  Хочу выразить свою благодарность всему коллективу Вашей фирмы в Квинсе. Я.пользуясь услугами Вашей фирмы при каждом приезде в Америку.<br />\r\n         В данном письме я хочу выразить благодарность Вашему гиду Михаилу.С ним мы только что вернулись из Кейп- Кода.   <br />\r\n         Эта поездка не входила в наши планы, мы собирались посетить Чикаго, но обстоятельства сложились иначе и мы поехали в К-К. <br />\r\n          Погода несколько подкачала, но усилиями Михаила нам удалось выполнить программу почти в полном объеме.Меня приятно удивила огромная эрудиция Михаила.  (Почему удивила?  Я была во многих поездках по США, но не всегда я была удовлетворена рассказами экскурсовода.После поездки в Пенсильванию у меня почти не осталось никаких впечатлений о Филадельфии. Имя экскурсовода я не помню.  Когда из этой же поездки вернулась моя дочь,она рассказала мне много  интересного о Филадельфии. У нее экскурсоводом был Михаил.)<br />\r\n           В Поездке на Кейп Код я  узнала очень много интересных фактов из истории США и современной жизни Америки. Рассказывал Михаил   в очень доступной и   в тоже время в увлекательной форме.<br />\r\n          Наша жизнь тоже была очень четко организована.Михаил объяснял все мелочи нашей жизни( где,что,когда).<br />\r\n            Я просила его рассказать о самых интересных экскурсиях, он много говорил о поездках с Нью-Турс.   <br />\r\nВпечатления остались очень хорошие. Хотелось бы встретиться с Михаилом и в других экскурсиях.  <br />\r\n              Ваш постоянный турист из России.', NULL, NULL, NULL, NULL, NULL, '74.72.255.227', 'cpe-74-72-255-227.nyc.res.rr.com', 'Mozilla/5.0 (iPad; CPU OS 6_1_3 like Mac OS X) AppleWebKit/536.26 (KHTML, like Gecko) Version/6.0 Mobile/10B329 Safari/8536.25', 'USA', '', '3vjlmv1mquidchnlmf51mqa4g1');
INSERT INTO tour_testimonial VALUES(226, NULL, NULL, '2013-08-05', 'Alikhodjaev', 'Marina', NULL, 'mp_company_90048@yahoo.com', '8478163818', 'Ja s roditeljami, muzem i druz''jami iz Rigi bila na polnoi obzornoi ekskursii New York 20-go ijulja 2013 goda. Spasibo vam bol''woe! Mi polu4ili ogromnoe udovol''stvie i do sih por vspominaem s voshiweniem vaw ocen'' horowo organizovannij i interesnij tur. Mi ne mogli zelat'' lu4wego gida/ekskursovoda 4em Vera. Vera, ewe raz spasibo, nam bilo ocen'' prijatno i interesno obwat''sja s vami.  Blagodarja vam moi papa daze izmenil svoe otnowenie k etomu velikomu gorodu. Mi uvideli vse, 4to hoteli (naskol''ko eto pozvoljalo po vremeni) i uznali ocen'' interesnie fakti. Mne kazetsja, 4to vse 4leni nawei gruppi bili dovol''ni. Takze nam ocen'' ponravilsja obed, ocen'' vkusno i sitno. Voobwem, vas ne stidno rekomendovat'' druz''jam i znakomim. Ewe raz spasibo :)', NULL, NULL, NULL, NULL, NULL, '67.173.167.82', 'c-67-173-167-82.hsd1.il.comcast.net', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1500.95 Safari/537.36', 'USA', 'Schaumburg', 'plr1a3mrvuuesnf4n6usfogqf5');
INSERT INTO tour_testimonial VALUES(227, NULL, NULL, '2013-08-05', 'Obraztsov', 'Igor', NULL, 'igorobraztsov@rambler.ru', '007-919-962-45-69', 'Уважаемые руководители компании в марте месяце я произвел заказ тура и оплатил его полностью (13.03.2013) Америка: два океана (маршрут 3). Начало тура 12.08.2013 г. Однако до сих пор я не получил НИКАКИХ ДОКУМЕНТОВ, подтверждающих мойю поездку. На мои письма ответа нет. Пожалуйста, проинформируйте меня о состотянии моего тура. ', NULL, NULL, NULL, NULL, NULL, '91.77.211.63', 'ppp91-77-211-63.pppoe.mtu-net.ru', 'Opera/9.80 (Windows NT 6.0) Presto/2.12.388 Version/12.15', 'Russia', 'Moscow', '5ghkn1plr9k7auilets5f4i1a3');
INSERT INTO tour_testimonial VALUES(228, NULL, NULL, '2013-08-07', 'Shneyder', 'Viktor', NULL, 'vshn68@gmail.com', '3479099561', 'Здравствуйте сотрудники компании Нью-Турс.<br />\r\n<br />\r\n Хотели Вам выразить благодарность за Ваши экскурсии,<br />\r\n<br />\r\n Особенно двум Вашим экскурсоводам Эмилию, который ..<br />\r\n<br />\r\n вез нас на Ниагару и Борису во дворцы Ньюпорта.<br />\r\n<br />\r\nМы у Вас брали 4 экскурсии и все Ваши экскурсоводы были очень хороши.<br />\r\n<br />\r\nИ Константин в Вашингтоне, и женщина в Нью-Йорке. Но эти двое нас особенно<br />\r\n<br />\r\nпоразили. Эмилий человек потрясающей эрудиции.<br />\r\n<br />\r\nЕго знания в разных областях  поражают.<br />\r\n<br />\r\nЗнания глубокие и серьезные. Мы  гида с такой эрудицией<br />\r\n<br />\r\nза долгие годы путешествий встречали только однажды.<br />\r\n<br />\r\nОгромное ему спасибо и восхищение.<br />\r\n<br />\r\n Борис по Ньюпорту блестящий рассказчик.<br />\r\n<br />\r\nОн так увлекательно рассказывает, что его можно слушать с<br />\r\n<br />\r\nудовольствием, даже если он будет рассказывать о жизни черепах.<br />\r\n<br />\r\nИ он очень знающий в социологии, чем гиды обычно не балуют.<br />\r\n<br />\r\nИ организация у него была на высшем уровне.<br />\r\n<br />\r\nЕдинственное замечание. Во всех турах, которые мы брали,<br />\r\n<br />\r\nводители беспрерывно без наушников говорили по телефону.<br />\r\n<br />\r\nЭто нам кажется не безопасно.<br />\r\n<br />\r\nВ остальном, Вы работаете на очень хорошем уровне.<br />\r\n<br />\r\nСпасибо. <br />\r\n<br />\r\n <br />\r\n<br />\r\nВиктор Шнейдер<br />\r\n<br />\r\nСофия Рокова', NULL, NULL, NULL, NULL, NULL, '69.114.180.11', 'ool-4572b40b.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1500.95 Safari/537.36', 'USA', 'Mobil', 'mdies7s766ho70le02egsgqr36');
INSERT INTO tour_testimonial VALUES(229, NULL, NULL, '2013-08-16', 'Volkova', 'Svetlana', NULL, 'volkova.svetlana1985@gmail.com', '347-259-5107', 'Я заказывала тур по Нью-Йорку 08/15/2013. От тура остались ужасные воспоминания. Не верьте, что у New Tours гиды с многолетним стажем (как было заявлено в рекламе) нам дали гида с 1,5 годовым стажем которая знает только то, что заучила. Обратно на тоже место не высаживают, выбрасывают на 59 улице добирайтесь на метро или такси как хотите, не предупреждая об этом заранее. Не посетили все места которые были запланированы (например ничего не было рассказано о China Town и Little Italy). Тур был 5.30 часов вместе с обедом. Ездили в некомфортабельной газеле из которой почти ничего не было видно. Складывается такое мнение, что New Tours не дорожат своей репутацией. Я говорила с менеджером, она обвинила меня в том, что мы сами виноваты что мы не спросили куда привезут, какой транспорт будет, и по каким местам будут возить, и затем положила трубку. ', NULL, NULL, NULL, NULL, NULL, '69.122.92.104', 'ool-457a5c68.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1500.95 Safari/537.36', 'USA', 'Staten Island', '6j6pk9eosmf75vracpr43t9rq6');
INSERT INTO tour_testimonial VALUES(230, NULL, NULL, '2013-08-17', 'Cheveleva', 'Irena', NULL, 'icheveleva@ywcatulsa.org', '9187068063', 'Dear Friends,<br />\r\n<br />\r\nJust would like to thank you for an amazing tour,West Canada that we just returned from. It was unbelievably experience, that we never forgot. We are also grateful for our excellent guide, Igor Levit, who was very professional,caring, thoughtful,shared lots of interesting information and had a great sense of humor. We are really enjoyed his company. We hope we will travel with you again in the future.  <br />\r\n', NULL, NULL, NULL, NULL, NULL, '70.185.219.4', 'ip70-185-219-4.ok.ok.cox.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1500.95 Safari/537.36', 'USA', 'Tulsa', '29vb5tq8onvle6onkg80re8rr6');
INSERT INTO tour_testimonial VALUES(231, NULL, NULL, '2013-09-03', 'Лазански', 'Мария', NULL, 'Maria.lazanski@gmail.com', '917 742 3442', 'Отзыв:<br />\r\n<br />\r\nМы с мужем были на 3-х дневной экскурсии "Канада Английская" (Канада: Ниагарские Водопады, Торонто). Мы от всей души благодарим нашего великолепного гида Наташу и водителя автобуса Сергея. Дорога, организация дня, отель в котором мы жили, путевая информация, полезные советы нашего гида и просто атмосфера этой экскурсии были просто волшебными! Мы с радостью воспользуемся услугами New Tours еще раз!<br />\r\n<br />\r\nСпасибо!', NULL, NULL, NULL, NULL, NULL, '198.179.83.98', 'rrcs-198-179-83-98.nyc.biz.rr.com', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_6_8) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/29.0.1547.65 Safari/537.36', 'USA', '', 'kbh39q0i79q99puiimnfs75fc5');
INSERT INTO tour_testimonial VALUES(232, NULL, NULL, '2013-09-05', 'Khramtsova', 'Lyudmila', NULL, 'milakhram@hotmail.com', '347-374-2603', 'We have returned from the 3-day trip to the Finger Lakes with Emil. It was very nice and beautiful journey for us. Emil is a very professional and knowledgeable person who provided tremendous interesting information during the whole trip. We learned a lot from him and definitely enjoyed our time. Thank you very much for such a good trip.      ', NULL, NULL, NULL, NULL, NULL, '67.87.210.107', 'ool-4357d26b.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:23.0) Gecko/20100101 Firefox/23.0', 'USA', 'Brooklyn', 'okhkt0jvtj76n949qcu0crl0p5');
INSERT INTO tour_testimonial VALUES(233, NULL, NULL, '2013-09-08', 'Sam', 'Mila', NULL, 'sendsmile7@gmail.com', '516-670-7332', 'Уважаемая Лилия Гелфанд!<br />\r\nМеня зовут Людмила Самоукова. Я была на 25 месте в автобусе «Лучшее в Канаде» Тур, 24-29 августа, 2013. <br />\r\nМой телефон: 516-670-7332, email: sendsmile7@gmail.com<br />\r\nЯ хочу сдалать официальную жалобу на гида Бориса, с которым наша группа провела 6 дней – «Лучшее в Канаде» Тур, 24-29 августа, 2013. Он показал себя крайне грубым, непрофессиональным, эгоистичным и жадным до денег человеком.<br />\r\n1.	В течение первого дня у нас не было ни малейшего представления о маршруте и плане на следующие 6 дней. Мы даже не знали с какого города начнется нат тур. Когда Бориса спрашивали о маршруте и плане, он тянул время, говорил прибаутками, много говорил о себе и уходил от ответа. <br />\r\n2.	Говорил он долго об Испанцах, Европейцах, завоевателях Америки. По 40 минут о значении и происхождении разных имен. С задних рядов ему послали записку: «Дорогой Борис, наш тур – Канада и мы хотели бы узнать как можно больше об этой стране». Он ответил: «Я этим и занимаюсь, и отправляю назад к вам вашу записку». После этого он продолжил свой долгий рассказ о Европейцах и про Канаду мы так и не услышали. Какие-то отрывочные незапоминающиеся и несвязанные между собой кусочки информации, но никакого подробного и логического рассказа о Канаде и тех городах, где мы побывали.<br />\r\n3.	В нашей группе были люди разных вероисповединий и религиозных конфессий: Православные, Католики, Протестанты, Евреи, жители Израиля и Германии. Очень неприятно, иногда невыносимо было слушать его неуважительные, саркастические, полные насмешек, долгие рассуждения на спорные, для многих святые религиозные моменты. <br />\r\nОн ссылалася на разные теории, мифы, на 80 неканонических евангелий, на «Код Давинча» и прочее. Например, он утверждал, что Христос был женат, ссылаясь на свои источники. Подчеркивая при этом, что он – атеист и все люди произошли от обезьян. <br />\r\n4.	Когда мы были около Церкви Святого Иосифа он стал снова рассуждать на тему были ли сексуальные отношения у Марии (матери Иисуса) и Иосифа до, во время и после Зачатия Христа.<br />\r\nЯ не выдержала и сказала: «Не стоит касаться этих моментов, ссылаясь на неканонические книги. Мы можем говорить только о том, что есть в Библии. Билия умалчивает о сексуальных отношениях между Марией и Иосифом и умалчивает, были ли у них общие дети после Христа». Борис ответил: «Тогда вы проводите экскурсию, а я отдохну». Я сказала: «Вы все время неуважительно и насмешливо отзываетесь о вещах, которые для других людей – святые». На это Борис ответил: «Отойдите в сторону, не мешайте и идите погуляйте где-нибудь». Я же сказала: «Я заплатила 680 дол., почему я должна отойти и где-то гулять?». <br />\r\nЭто был единственный раз, когда я выразила свое мнение, выразив его Борису в присутствии всей нашей группы. <br />\r\nВ тоже время, я общалась с другими людьми и знаю, что многим не нравилось, что мы ничего не узнаём о Канаде, но зато слушаем его многочасовые безапелляционные лекции на спорные религиозные моменты. <br />\r\n5.	 Еще один момент – это наш проживание в гостинице и питание. Каждый день на обед Борис водил нас по ресторанам, утверждая и настаивая, что «25 долларов за обед – это самый лучший вариант для каждого в данном городе, что лучше и дешевле мы ничего не найдем». <br />\r\nНо люди все равно уходили, находили более дешевые кафе и делились с другими этой информацией. Борис это старался пресекать. <br />\r\nВсе понимали, что он, приводя группу в ресторан, сам питается в нем бесплатно и, более того, имеет за этот счет еще и доход от ресторана. Таким образом, он делает свой бизнес внутри бизнеса за счет нас, туристов.<br />\r\n6.	Так как я была изначально «не в паре», то меня посадили и поселили с женщиной по имени Антонина. Она должна была ехать на 26 месте в автобусе. Она в первый же день поругалась с людьми, что разговаривали сзади нас. На третьем ряду было свободное место и она ушла туда. Но проживали мы с ней в одном номере. <br />\r\nЭта женщина лечится у психиатора, она неуравновешенная, агрессивная, сильно храпела и кричала во сне. После 3-х бессонных ночей, я объяснила Борису ситуацию, сказала, что я устала от невысыпания, что готова доплатить за следующие 2 ночи добавочные деньги и получить отдельный номер. Он ответил: «Доплатить –невозможно. Можно только заново заплатить на отдельный номер, так, как будто вы отдельно от группы вселяетсь в отель». <br />\r\nКогда же в пятницу, 30 августа, я разговаривала с менеджером Светланой, то выяснила, что это – ложь и он меня обманул. Но позвонить в офис New Tours из Канады я не могла, у нас не было телефонной связи. <br />\r\n7.	В Квебеке, Борис потерял одну женщину из группы - Татьяну. Он никогда не объявлял группе, что «сейчас мы идем в другое место», рупора у него тоже не было, он просто трогался с места и всё. <br />\r\nОтсутствие Татьяны заметила другая женщина из группы, соответственно он и эта женщина ушли на поиски Татьяны, причем безуспешные. Татьяну случайно заметил шофер в конце дня, перед самым нашим отъездом из Квебека в Монреаль. Из-за такого инцидента, для всех других, обзор города Квебека состоял из прогулки по 2-м улицам и всё, хотя ехали мы туда 4 часа из Монреаля. <br />\r\nБорис вполне мог бы попросить водителя сделать хотя бы небольшой круг вокруг и по городу на автобусе, но нет, мы просто быстро покинули город и всё. <br />\r\n8.	Когда мы приехали на Ниагарский водопад (последний перед отправлением в Нью-Йорк день), после прогулки на катере, ехали в автобусе в отель, я спросила Бориса можно ли тем у кого американские паспорта посетить американскиую сторону. Борис сказал: «Делать там совершенно нечего. Если я вас завтра не досчитаюсь – проблемы будут ваши», высмеял при всех эту затею, как абсолютно глупую и лишенную здравого смысла. <br />\r\nНа мой взгляд, Ниагарские Водопады – это существенный процент всей поездки и,  приехав туда только в 4 часа дня, неправильно терять уникальные возможности этого дня.<br />\r\nЗная точно, что проблем никаких не будет, позже я снова подошла к нему, спросила об условиях перехода назад в Канаду, он сказал: «надо знать номер телефона нашей гостиницы и мой номер в отеле», но потом Борис заявил: «я вам идти на ту сторону ЗАПРЕЩАЮ! ЗАПРЕЩАЮ! Всё! Разговор окончен!». <br />\r\nНесмотря на его запугивания, я и еще 2 женщины, все с американскими паспортами, пошли на Американскую сторону и видели очень много туристов, которые самостоятельно или организованно с другими и со своим гидом приходили по мосту и возвращались, и никто ничего не боялся. <br />\r\nУ нас также не было никаких проблем.<br />\r\n9.	Четверг, 29 августа – день выезда. Борис делает с утра в автобусе часовой обзор экскурсий, в которых он как гид участвует и всё, после этого он не проранил ни слова за целый день. Мы ехали по штату Нью-Йорк, видели горы, населенные пункты, хотели что-то узнать новое об этих местах, но Борис абсолютно ничего нам не рассказывал. Только ставил нам разные фильмы. За 6 дней мы посмотрели 7 (!) фильмов. <br />\r\n10.	Сразу после выезда с Ниагары, после выезда из нашей последней гостиницы, в автобусе Боис заявил: «А теперь по американской традиции, пришло время для собирания «типов» водителю и экскурсоводу, и Лариса это сейчас и сделает». <br />\r\nЛариса уже собирала с нас по 5 долларов за 30 минутное вечернее шоу у Парламента в Оттаве. Конечно, это была не ее инициатива, а Борис сам предварительно объявил о том, что шоу столько будет стоить. <br />\r\nТогда водитель Сергей или они оба с Борисом уже заработали 200 дол. за 30 мин., хотя мы могли бы до парламента и пешком дойти. <br />\r\nТеперь нам было сказано: «24 доллара даёт каждый человек – 12 долларов Борису и 12 долларов – водителю Сергею». У нас было несколько семей по 3 человека им пришлось отдавать по 72 доллара. <br />\r\nЛариса шла по автобусу и собирала с каждого человека деньги. Если люди упирались, говорили, что нет денег, она психологически нажимала на людей, говорила, что «это – обязательно, что таковы правила, вы должны дать», предлагала занять у других, разменять, снять в «Дьюти Фрии» с карточкии прочее.<br />\r\nКогда дошла очередь до меня, я сказала, что «типы – абсолютно добровольное дело, я даю – 12 дол.водителю, экскурсоводом я совершенно разочарована и ничего давать ему не хочу». <br />\r\nКогда деньги были переданы водителю и Борису, тот заявил: «Спасибо всем, кто дал, а кто не дал, тот пусть подумает над своим поведением». Хотя деньги собирала Лариса, но она дала понять нам, что эти цифры «24 доллара – с каждого» были ей объявлены Борисом.<br />\r\nКогда же эта Лариса, собиравшая типы, покинула автобус в Буффало, Борис скзал такую фразу: «Баба – с возу, кобыле –легче». Это были его обычные неуважительные фразы.<br />\r\nПосле этого, как я уже отметила, Борис потерял к нам всякий интерес, мы его больше на слышали, вплоть до поломки автобуса в 7 вечера.<br />\r\n11.	Нас было около 40 человек, получается, что вытрясая из людей нажимом деньги, он зарабатывает легко и просто 400 дол. за 6 дней поездки, помимо своей зарплаты. Питаясь за счет туристов бесплатно, не напрягась, не выполняя даже того, что он должен делать. ЭТО – ПРОТИВОЗАКОННО. Раз он делает свой бизнес внутри бизнеса, требуя деньги, он должен платить налоги со своего стабильного дохода от нас – туристов, и от рестаранов, что ему платят за приводы групп. <br />\r\n12.	29-го августа в 7 вечера автобус внезапно остановился. Свет потух, телевизоры и кондиционеры выключились. Мы были в Нью-Джерси, на трассе. По салону пошел дым, люди спрашивали друг-друга, пытаясь понять, ГДЕ мы находимся и ЧТО происходит. Борис молчал «как рыба». Водитель тоже молчал, не объясняя ничего, только входил и выходил из автобуса. <br />\r\nНам было жарко, пахло гарью, мы видели дым в темноте. Так прошли 30 минут. Первыми из автобуса вышли курильщики, за ними все остальные. <br />\r\nБорис, по прежнему, ничего не объяснял.<br />\r\nЯ спросила его: «Вы можете прояснить, что случилось? На что рассчитывать?». <br />\r\nНа это Борис ответил: «Поломка». Я: «Как долго?». Он: «Как починимся, так и поедем». Я сказала: «Люди имеют право на более подробную информацию, на знание того, на что им рассчитывать». <br />\r\nПосле этого Борис придвинулся ко мне вплотную, едва не касаясь своим неприятным лицом моего лица и с ненавистью громко и чётко проговорил: «ВЫ НЕ ЗАПЛАТИЛИ НИ КОПЕЙКИ И ХОТИТЕ ВСЁ ЗНАТЬ?!», <br />\r\nна что я ответила: «Я –свободный человек в свободной стране и ЗАПЛАТИЛА ЗА ПОЕЗДКУ и тому, кому посчитала нужным, а вы действуете – непрофессионально и ПРОТИВОЗАКОННО, выбивая из людей деньги. Звтра я буду общаться с менеджером New Tours, кроме того у меня есть видео-материалы ваших деяний». <br />\r\nПосле этого он закричал так, чтобы его все слышали: «А вы оскорбляете меня матом!» Я же ответила: «Я не выношу мат и никогда не произношу такие слова. Вас Бог за клевету накажет». <br />\r\nЗа дни поездки, Борис неоднократно подчеркивал, что он, якобы защитил диссертацию, что он работает в New Tours более 20 лет, но я такого непрофессионального, высокомерного, невоспитанного и жадного до денег гида еще не встречала ни в этой компании, ни в других. <br />\r\nА последний день и его отношение к людям просто отравили все приятные впечатления.<br />\r\nКакое он имеет право придвигаться к своим клиентам вплотную, требовать деньги, оскорблять и клеветат?! И молчать, когда люди нуждаются в ясной картине и в защите своего здоровья и жизни?! .<br />\r\nЯ опубликую данное письмо на английском языке, на всех возможных для отзывах сайтах в Интернете. Потому что «не потерплю преступного нарушения моих прав». <br />\r\nАмериканский принцип – не в чаевых, Борис, которые вы выбиваете из людей; американский принцип - в следующем: «сделай для другого, как для себя», вы же делали всё – для себя, за счет других и это показывает вашу недалёкость, незнание жизни и нарушение Закона. <br />\r\nК сожалению, не могу написать «спасибо» или «с уважением»<br />\r\n<br />\r\nЛюдмила Самоукова.<br />\r\n9/8/13<br />\r\n<br />\r\n  <br />\r\n', NULL, NULL, NULL, NULL, NULL, '67.80.149.254', 'ool-435095fe.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; MRA 6.0 (build 6015); GTB7.5; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C)', 'USA', 'Brooklyn', 'hs71sbih2i5rjr8t0tpe3mgtu0');
INSERT INTO tour_testimonial VALUES(234, NULL, NULL, '2013-09-14', 'bazlov', 'Ella', NULL, 'ella_bazlov@mail.ru', '514-2880624', 'Добрый день!<br />\r\nГруппа собирается из Монреаля посетить Лас Вегас,<br />\r\nмогли бы вы нам сделать программу на 5 дней,2 дня каньон,остальные по вашему усмотрению.Мы купим полет и проживание ,или вы можете нам все организовать.<br />\r\nПрошу вас также подсказать ,какое время наиболее приятно для приезда.<br />\r\nЗаранее благодарю.<br />\r\nЭлла,координатор клуба.', NULL, NULL, NULL, NULL, NULL, '70.51.192.131', 'bas8-montreal19-1177796739.dsl.bell.ca', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)', 'Canada', 'montreal', 'tulpfaf0ufuaj8nql3v7oimr27');
INSERT INTO tour_testimonial VALUES(235, NULL, NULL, '2013-09-16', 'Lin', 'Tanya ', NULL, 'minsk1958@yahoo.com', '3143087566', 'I''m an outside travel agent in St Louis, MO. Working from my home since 1999 for World Travel and Tours Agency, but interested to sell some of your tours. How can I become an outside travel agent for your agency? Please call or email to me. Thank you. Tanya', NULL, NULL, NULL, NULL, NULL, '70.253.163.250', 'adsl-70-253-163-250.dsl.stlsmo.swbell.net', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)', 'USA', 'st louis', '4et8jn53o39jgb0p6bs8ehdp21');
INSERT INTO tour_testimonial VALUES(236, NULL, NULL, '2013-09-21', 'Bukshteyn', 'Vladimir', NULL, 'vbukshteyn@aol.com', '770-931-1819', 'Здравствуйте.<br />\r\nМы находились несколько дней в НЙ и на 19 сентября у нас был заказан тур по городу, который оформляла Лана Симанович и провели гид Вера и водитель Владимир.<br />\r\nМы хотим поблагодарить вашу компанию и особенно работавших с нами сотрудников за замечательную экскурсию. Все было организовано и исполнено точно, обстоятельно и очень удобно.<br />\r\nОсобая благодарность от нас - нашему экскурсоводу. Вера, специалист с большой подготовкой, эрудицией и красивой грамотной речью, провела всю поездку с любовью к городу, о котором рассказывала, и с большим уважением к своим слушателям. Эта экскурсия оставила у нас самые замечательные впечатления и создала великолепное настроение.<br />\r\nПередайте, пожалуйста, нашу благодарность также и водителю Владимиру, который так удобно и учтиво провел поездку и так профессионально вел машину все эти часы в очень непростых условиях трафика на улицах Нью-Йорка.<br />\r\nБольшое всем спасибо.<br />\r\nВладимир Букштейн<br />\r\nАтланта, Джорджия.', NULL, NULL, NULL, NULL, NULL, '99.157.53.241', '99-157-53-241.lightspeed.tukrga.sbcglobal.net', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)', 'USA', 'Atlanta', 'hqh3dodvl6phhhrfluv7qoif67');
INSERT INTO tour_testimonial VALUES(237, NULL, NULL, '2013-09-23', 'Guta', 'Tiana', NULL, 'tianaguta@mail.ru', '3472164520', 'Доброе время суток<br />\r\n<br />\r\nЯ занимаюсь планированием отдыха на ноябрьские и рождественские праздники. Хотелось бы поехать куда-нибудь. <br />\r\nМне понравились ваши туры, но возникли вопросы на которые хотелось бы получить ответ:<br />\r\n<br />\r\n1. Большой тур Гранд-тур (без Канадской визы) КАЛИФОРНИЯ - АЛЯСКА - ДЕНАЛИ - 13 дней какова примерная стоимость перелета на внутренних рейсах? Чтобы понять общую сумму тура? (хотя бы примерно)<br />\r\n2. Чтобы поехать в канаду по одному из ваших туров для владельцев Грин карты  делаете ли вы канадскую визу?<br />\r\n3. Планируются ли туры ТЕННЕСИ, КАМБЕРЛЕНДСКОЕ УЩЕЛЬЕ и МАМОНТОВЫ ПЕЩЕРЫ, КЕНТУККИ, ОГАЙО - 6 дней<br />\r\nНа ноябрь и декабрь?<br />\r\n4. Тур вся Вирджиния включает в себя посещение 2 штатов: Вирджинии и  западной Вирджинии ?<br />\r\n5.  Тур южная Америка: Бразилия, Аргентина , Чили  или Уругвай. Туры проходят индивидуально или собираются группы ', NULL, NULL, NULL, NULL, NULL, '74.73.252.5', 'cpe-74-73-252-5.nyc.res.rr.com', 'Mozilla/5.0 (iPad; U; CPU OS 4_3 like Mac OS X; ru-ru) AppleWebKit/533.17.9 (KHTML, like Gecko) Mobile/8F191', 'USA', 'Brooklyn', 'f3na207c3ok8nvuqa7m9ljkvq2');
INSERT INTO tour_testimonial VALUES(238, NULL, NULL, '2013-09-29', 'Неймарк', 'Елена ', NULL, 'elenanei@freenet.de', '0049-9421-187880', 'Уважаемые дамы и господа , <br />\r\nпрошу  ответить на мои вопросы по поводу вашего Фирменного тура :Лос-Анжелес, Лас-Вегас, Сан-Франциско, Сан-Диего, Гранд Каньон, Зайон Каньон, Брайс Каньон, Йосемитский Национальный Заповедник* ( или Санта-Барбара* ). 1. Даты туров в мае и июне 2014 уже окончательные ? Не произойдет ли изменений ? 2. Есть ли свободныя путевка на май-24,31 июнь -7,14. 3. Когда ,самое позднее, вы рекомендуете купить путевку на одно из перечисленных чисел . 4. Гарантированна ли поездка ( или сообщите даты в которые поездка гарантированна )5. В первый день , во сколько примерно начинается экскурсия , вероятно что-бы не пропустить экскурсию мне необходимо приехать на 1 день раньше . возможно ли в этом случае забронировать гостиницу на день раньше ? 6. Я хотела бы забронировать одноместный номер и трансфер из аэропорта и в аэропорт . 7. Я могу деньги перечислить только в ЕВРО поэтому прошу сообщить стоимость тура . Зарание очень благодарю за помощь. Елена Неймарк', NULL, NULL, NULL, NULL, NULL, '95.130.165.242', '95-130-165-242.hsi.glasfaser-ostbayern.de', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:23.0) Gecko/20100101 Firefox/23.0', 'Germany', 'Straubing', 'e29u2u96fn9ob1kdsrorj66k71');
INSERT INTO tour_testimonial VALUES(239, NULL, NULL, '2013-10-02', 'dreyzina', 'yelena', NULL, 'ydreyzin@yahoo.com', '7186715710', 'We went on 2 days Niagara falls tour on 9/25 with Boris(guide) & Vladimir(driver). Boris was talking to us like we are kindergardeners, which was not appropriate. Most people on the bus had similar if not better education and did not deserve his \\"jokes\\". Our group of 5 were picked up at 181 street in the morning. When we were dropped off, Boris said that it is 178 street & Broadway. In reality, they drop us off at 179 street & Fort Washington Avenue. We had hard time meeting our relatives who were waiting at 178 & Broadway. ', NULL, NULL, NULL, NULL, NULL, '69.113.19.217', 'ool-457113d9.dyn.optonline.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)', 'USA', 'bronx, ny', '4ro05smmkh6fiafppu7u5090b7');
INSERT INTO tour_testimonial VALUES(240, NULL, NULL, '2013-10-02', 'dreyzina', 'yelena', NULL, 'ydreyzin@yahoo.com', '7186715710', 'Amish Country tour on 9/28 with Rita (guide) & Slava(driver) was great. Thank you to these wonderful and very professional people.', NULL, NULL, NULL, NULL, NULL, '69.113.19.217', 'ool-457113d9.dyn.optonline.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)', 'USA', 'bronx, ny', '5jf5i202fiig5pkqkqnh5mjqg7');
INSERT INTO tour_testimonial VALUES(241, NULL, NULL, '2013-10-11', 'Gelfand', 'Liliya', NULL, 'newtoursusa@yahoo.com', '17189347644', 'I''d like to check how this page works.', NULL, NULL, NULL, NULL, NULL, '67.84.78.202', 'ool-43544eca.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:24.0) Gecko/20100101 Firefox/24.0', 'USA', 'New York', 'kl24kde72gvhe24t017h9abc11');
INSERT INTO tour_testimonial VALUES(242, NULL, NULL, '2013-10-14', 'Bazarova', 'Nina ', NULL, 'ninochki@yandex.ru', '89688735865', 'Здравствуйте! Подскажите по туру на 10 дней из LA, меня интересует, <br />\r\n1) во ск группа приезжает в Лас Вегас на 5-й день, будет ли возможность посетить шоу <br />\r\n2)во ск экскурсия по Лас Вегасу на 6-й день, чтобы опять таки понимать, каким свободным временем можно располагать.<br />\r\n3) вопрос по Гранд Каньену, будет ли возможность при желании заказать экскурсию на вертолете? (все американские тур фирмы предлагают на выбор 3 опции включая вертолет).<br />\r\n4) Вопрос по автобусам - какие используются? <br />\r\n5)по количеству человек в группе, приблизительно сколько человек бывает?<br />\r\nМеня интересует дата 9 ноября.<br />\r\nв качестве предложения - в лас вегасе хотелось бы остановиться на 3 дня, дабы успеть посетить хотя бы некоторые из многочисленных шоу, а также аутлет.<br />\r\nОчень жду ответы на все вопросы! и дайте, пожалуйста, знать, есть ли места на 9 ноября на 1 человека.<br />\r\nи есть ли возможность с кем либо из покупающих данный тур заселиться в двухместный номер, чтобы не переплачивать за сингл?<br />\r\n<br />\r\nThank you in advance!<br />\r\nRegards,<br />\r\nNina', NULL, NULL, NULL, NULL, NULL, '46.188.9.3', 'broadband-46-188-9-3.2com.net', 'Mozilla/5.0 (Windows NT 6.2; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1500.71 Safari/537.36 MRCHROME', 'Russia', '', 'ekbk74jrbc5nf1v1sk62na9cm7');
INSERT INTO tour_testimonial VALUES(243, NULL, NULL, '2013-10-19', 'Агафонова', 'Любовь', NULL, 'office@veterspb.ru', '+7 812 600 23 23', 'Добрый день, пожелаие в том что бы была оперативная связь с руководством и желательно указать котакты руководства на сайте, это очень дисциплинирует сотрудников. Очень плохо когда своевременно не предоставляются документы по опченным турам, партнерам работающим с Вами не первый год, с риском не вылта для нас и не зазда туристов, поскольку отель первого заселения не изестен, а трансфер не предусмотрен и турист отказывается выезжать без понимания в какой отель о аоедет на такси по пребытии, без ваучер. Очень плохо когда на наши просьбы много численные звоки и имейы не реагируют или обещают, но делают, странное отношение к старому и долговременному стабильному партнеру, не мало вкладывающему в рекламу нашего общего дела, хотелось бы понять в курсе ли руководство, чем так заняты работники и почему не принимаются меры по выстраиваиванию работы и количества сотрудников таким образом, что бы была возможность своевременно предоставлять партнерам документы по оплаченным турам. Очнь плохо когда при этом указанные как дежурные и круглосуточные телефоны для связи не отвечают , включется автоответчик по котрому никто потом не перезванивает, сколько сообщкений не оставляй. Значит если наши туристы попадут в не приятную ситуацию и будет срочный вопрос в неурочное время, икто им не ответит , е перезвонит и не поможет, тогда и не стоит указывать эти телефоны как срочные и круглосуточные для экстренной связи. Все это очень очень грустно и очень хотелось бы понять что думает по этому поводу руководство компании. Большое пожелание и предложение свериться с вашим руководством и понять вашу общую позицию по этим вопросам.', NULL, NULL, NULL, NULL, NULL, '92.255.7.90', 'ip-90.7.255.92.net.unnet.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/30.0.1599.101 Safari/537.36', 'Russia', 'Санкт - Петербург', 'o5d73qrsqolrjsa4rd3r6b3ms3');
INSERT INTO tour_testimonial VALUES(244, NULL, NULL, '2013-10-19', 'Askinadze', 'Ilya', NULL, 'askinadze-ilya@yandex.ru', '+79219934962', 'Добрый день уважаемые сотрудники компании new tours.<br />\r\nОтдыхал от вашей компании в США с 01 октября по 09 октября 2013 года,правда тур бронировал в Москве через ваших коллег американ тревел.Хочу сказать,что в принципе отдыхом я остался доволен,мне понравилась четкая организация процесса,все водители всегда приезжали во время,и на мой взгляд были достаточно вежливы.Но все же есть и некоторые замечания в вашей работе,хочу сразу заметить,что я ни какой то жалобшик,просто некоторые моменты меня мягко говоря удивили,а именно чаевые водителям и гидам.Нет ничего плохого в чаевых,но я хочу обратить внимание вашего руководства как это происходит.Был двухдневный тур в Бостон с гидом по имени Эмиль,на второй день по дороге обратно в Нью-Йорк,как всегда звучит фраза о чаевых,происходит следующее:гид берет пакетик,и идет с ним по автобусу,(правда сразу оговорившись,что это только для водителя чаевые,для него можно потом)дак вот идет он по автобусу собирает дежурные два доллара в день,у кого нет без сдачи он ее честно дает,а кто не хотел давать просил объснить причину,вы меня извините но это просто смешно,как можно это назыавать чаевыми когда человек дает тебе слдачу!!!!!!!!!,а кто не давал денег спрашивал причину,я конечно дал деньги,но скажу больше,если человек отработал нормально я сам дам значительно больше и поблагодарю его,но лично такой подход меня просто унизил,я сам в Питере занимаюсь тем же самым делом что и вы,в Америке,правда я не имею таких объемов,но скажу вам точно, если я в Питере со своими туристами делал такое,то поверьте ни одна фирма со мной не сотрудничила,а туристы просто написали жалобу. Меня задели мои профессиональные качества,и поверьте здесь ни только мое мнение,а мнение многих людей из группы,просто ка всегда наши люди немного ленивы и вряд ли будут вам писать,я даже если честно хотел встретиться с вашим директором Лилией,но просто хватило время,мне кажется,что если вы будете работать в таком духе и дальше,люди будут отказываться от ваших услуг.Конечно были и другие мелкие недочеты и в работе других гидов,все же видно,что до этой работы все они занимались другим делом,просто я выбрал вышеуказанного гида поскольку случай с пакетиком меня немного поразил,особенно когда тебе дают сдачу.Очень хочу услышать реакцию на мое письмо(если конечно посчитаете нужным),заранее благодарю за ответ.', NULL, NULL, NULL, NULL, NULL, '176.14.60.91', '176.14.60.91', 'Mozilla/5.0 (Windows NT 5.1; rv:24.0) Gecko/20100101 Firefox/24.0', 'Russia', 'Cанкт-Петербург', 'qcujc5v9f1ci3b04aqh1lqg0h7');
INSERT INTO tour_testimonial VALUES(245, NULL, NULL, '2013-11-11', 'Серебрянникова', 'Татьяна', NULL, 'tatiana.silver@mail.ru', '79166442046', 'Спасибо огромное вашему гиду Воробьевой Светлане!<br />\r\nВеликолепная экскурсия по Нью=Йорку, много успели, много услышали...И историю, и архитектурные вопросы города затронули... И она такая живая, веселая и красивая женщина! Если буду в США - обязательно хотела бы с ней куда-нибудь поехать! Спасибо Вам, Светлана! Приезжайте в Нью Джерси в Русский Дом Родина! ', NULL, NULL, NULL, NULL, NULL, '185.19.20.97', '185.19.20.97', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/30.0.1599.101 Safari/537.36', 'Russia', 'Москва', 'n4qopbdq9jam777ujv4p9ftoj5');
INSERT INTO tour_testimonial VALUES(246, NULL, NULL, '2013-11-25', 'Резанов', 'Владислав', NULL, 'vladirez@rambler.ru', '+79217300454', 'Здравствуйте, Друзья!Хотим поблагодарить Вас за прекрасно организованные туры! Были в ноябре 2013 в НЙ, Ниагаре, Орландо, Майами. Всё супер и вовремя!Особо хочется отметить Вашего гида Эмиля - мы с ним были в Вашингтоне! Оч эрудированный мужчина - слушали его запоем!Назад в НЙ мы со всеми не возвращались - он поймал нам такси и мы уехали в аэропорт Даллеса!А над его классными шутками мы особо "угарали"!))) В общем, передайте ему особое спасибо! Так же хотим сообщить, что будем в марте опять в НЙ. какие экскурсии по НЙ и окрестностям вы можете предложить нам? И развлекательные вечерние мероприятия? Пжлст, на почту. Спасибо!) ', NULL, NULL, NULL, NULL, NULL, '62.118.142.69', '62.118.142.69', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/30.0.1599.69 Safari/537.36', 'Russia', 'великий новгород', 'tugn60dhda7aapgbjd8snq3jh4');
INSERT INTO tour_testimonial VALUES(247, NULL, NULL, '2013-12-01', 'Фоминых', 'Мария', NULL, 'fominykh_m@mail.ru', '+79058061012', 'Добрый день!<br />\r\nЯ хочу оставить свой отзыв по поводу поездки в Вашингтон  01-02.11.2013, гид  Евгений Голер (извините, если ошиблась в ФИО). Поездка мне не понравилась,т.к.<br />\r\n1.	Наш гид сильно уставал, да ,я понимаю его проблемы с одышкой, но под конец уже просто надоело самим бегать и смотреть достопримечательности.<br />\r\n2.	Все время сравнивал США  с СССР, вспоминал КПСС, возможно интересно, но прошло более 20 лет  и многое у нас в стране  изменилось , поэтому это не только уже не интересно, но даже не актуально. <br />\r\n3.	Если, что гиду нравилось в бывшем СССР, он говорил, что это его Родина, если нет, то он истинный американец, а если в России и США проблемы, его родина Израиль и т.д. еще очень много можно перечислять.<br />\r\n4.	Моя мама с дамами из Питера и Киева в Вашингтоне решили сходить с ним в музей Искусства, только потому , что  он пообещал им , что все-все покажет и расскажет. Этим всем-всем оказались туалеты на первом этаже.  <br />\r\n5.	  А как он хвастался своим лексусом гибридом и машиной своей жены, заполнила на всю жизнь, такое ощущение сложилось, что мы в 90-х(говор , жаргоны- слух режет), как будто в кино. И мы тут нищие понаехали с просьбой о помощи нашего гида, впервые слышим про такие «тачки», т.к. ездим на «ведрах». Было смешно.<br />\r\n6.	Когда он с нас собрал на «чай», был очень расстроен, что водителю досталось больше, чем ему, больше не разговаривал, спал пока мы ехали 3 часа до НЙ, а при выходе никому не сказал ДО СВИДАНИЯ, видно сильно был обижен.<br />\r\nЕдинственное , за что я благодарна Евгению, я стала патриотом своей страны, т.к. мне(и не только мне) было крайне обидно слышать весь негатив, связанный с Россией (вплоть до обсуждения смены караула у Кремля)<br />\r\nВ сравнении с этой экскурсией  на других мы просто отдыхали, в восторге от Бостона, там был Борис (фамилию ,к сожалению ,не помню), Наталья –НЙ.<br />\r\nЭтот отзыв я написала с целью сделать более современные экскурсии, интересные не только поколению за 60 и старше, но и молодежи, т.к. считаю, что каждый должен познакомиться в этой великой страной как США<br />\r\nС уважением, Фоминых Мария<br />\r\n', NULL, NULL, NULL, NULL, NULL, '92.248.254.170', '170.254.248.92.akado-ural.ru', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)', 'Russia', 'Екатеринбург', 'lti41658ts603iag39ut5o15o2');
INSERT INTO tour_testimonial VALUES(248, NULL, NULL, '2013-12-02', 'Купина', 'Неля', NULL, 'Nelik.k@mail.ru', '89166673374', 'Интересует тур"лучшее в Канаде" на 6 дней. <br />\r\n21и 27 декабря, 18 января, 14 февраля. Любое число подходит. Американская виза до 26 февраля, Канадская виза до 26 марта. С уважением, Неля. <br />\r\nАдрес в скайпе такой же как E-mail', NULL, NULL, NULL, NULL, NULL, '93.80.101.192', '93-80-101-192.broadband.corbina.ru', 'Mozilla/5.0 (iPad; CPU OS 7_0_4 like Mac OS X) AppleWebKit/537.51.1 (KHTML, like Gecko) Version/7.0 Mobile/11B554a Safari/9537.53', 'Russia', 'Москва', 'f9is846icrn1p79i1i8f6ig8q5');
INSERT INTO tour_testimonial VALUES(249, NULL, NULL, '2013-12-04', 'Додонова', 'Анна', NULL, 'dodonova@inbox.ru', '+79166808278', 'Хочу поблагодарить New Tours за прекрасно организованные и проведенные экскурсии!!! Мы были на обзорной экскурсии по НЙ (гид Наталья) и на Ниагаре (гид Борис). Экскурсии были очень увлекательными и познавательными. Особая благодарность Борису за превосходный тур :))). От всей нашей большой семьи :)', NULL, NULL, NULL, NULL, NULL, '193.232.56.116', 'host-56-116.muctr.net', 'Opera/9.80 (Windows NT 5.1) Presto/2.12.388 Version/12.13', 'Russia', 'Москва', 'fgkl5k4qq758oe884lajnrmbk2');
INSERT INTO tour_testimonial VALUES(250, NULL, NULL, '2013-12-16', 'rudelsn', 'roza', NULL, 'roza.dom@gmail.com', '', 'Добрый день!<br />\r\nВ ноябре путешествовала но Вашей замечательной стране.Брала 2 экскурсии у Вашей компании-7.11 по Н-Йорку и 25-26.11 в Вашингтон.Первая была проведена на Высшем уровне, а от второй осталось очень плохое впечатление.<br />\r\nЭкскурсовод не заинтересовал группу,на все вопросы отвечал с раздражением (если вообще отвечал), сократил поездку, сославшись на дождь( выехали из Вашингтона в 12.30 вместо заявленных 15)и не было возможности посетить музеи, все решения принимались в диктаторской манере, а в конце вышел из автобуса,не сказав элементарного до свидания группе.<br />\r\nОчень жаль, т. к такие вещи не приносят дивиденты и конечно же я своим друзьям  порекомендую обратиться в другую фирму...<br />\r\nС уважением Роза', NULL, NULL, NULL, NULL, NULL, '212.143.120.116', 'mailgw.or-kam.co.il', 'Mozilla/5.0 (Windows NT 5.1; rv:25.0) Gecko/20100101 Firefox/25.0', 'Other ..', 'tel aviv', 'cbpseaar4d4ebh66887u2t0s97');
INSERT INTO tour_testimonial VALUES(251, NULL, NULL, '2013-12-24', 'СМирнова ', 'Анастасия', NULL, 'nassmirnova@yandex.ru ', '+79152774386', 'Добрый день! А существуют ли в Вашей компании открытые вакансии? ', NULL, NULL, NULL, NULL, NULL, '91.226.208.34', '91.226.208.34', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0; MALC)', 'Russia', 'Москва', '35ejl28146pl7p93p0n4t211u3');
INSERT INTO tour_testimonial VALUES(252, NULL, NULL, '2013-12-28', 'anders', 'Drew', NULL, 'andydrewanders@gmail.com', '311', 'You put two of your tour buses right under our bedroom windows at 3250 Coney Island Ave. at 6:45 am today on Saturday, with their engines running non-stop for 30 minutes now and no end in sight, waking us up and disturbing everything in the vicinity. This disrespectful outrageous practice continues non-stop and we strongly detest it. We''re filing complaints to the city about this and sending them a number of videos we took of these multiple occurrences of peace disturbance and idling engines with buses half-parked where they shouldn''t be parked. ', NULL, NULL, NULL, NULL, NULL, '96.25.239.3', '96-25-239-3.nyc.clearwire-wmx.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/31.0.1650.63 Safari/537.36', 'USA', 'brooklyn', 'r6t07ge8rjp6t37lljmjlnp8q3');
INSERT INTO tour_testimonial VALUES(253, NULL, NULL, '2014-01-04', 'Kane', 'Tamara ', NULL, 'tamarak1@optonline.net', '516-735-1622', 'Thank you guys for wonderful new year in winter haven resort. It was amassing !!!', NULL, NULL, NULL, NULL, NULL, '67.84.215.247', 'ool-4354d7f7.dyn.optonline.net', 'Mozilla/5.0 (iPad; CPU OS 7_0_4 like Mac OS X) AppleWebKit/537.51.1 (KHTML, like Gecko) Version/7.0 Mobile/11B554a Safari/9537.53', 'USA', 'New York', 'dn28m5t8fi2rifg0njubkim0m6');
INSERT INTO tour_testimonial VALUES(254, NULL, NULL, '2014-01-06', 'Bernovskaya', 'Elena', NULL, 'ebernone@yahoo.com', '', 'Tour: New Year in Washington, 3 days.<br />\r\nпоездка в целом прошла неплохо. Наш гид Элла великолепно проводила экскурсии. Сергей- водитель прекрасно выполнял свою работу. Улыбался несмотря ни на что...<br />\r\nПравда, вечерняя поездка по Вашингтону 30 декабря почему-то была объеденена с нашей дневной экскурсией. Мы вынуждены были ездить в автобусе до 7 вечера... В это время мы приехали в отель и разместились. Больше никакой вечерней поездки по Вашингону не проводилось...<br />\r\nНо самое главное разочарование- это водитель Володя, который быд с нами 31 и 1-го. Не столько его хмурое и неприветливое лицо с которым можно было бы смириться, но его очень грубое поведение и обращение с нами- туристами.<br />\r\nУдивительно, что такую фирму, как New Tours, которая так давно на маркете, представляют такие грубые работники. Видимо, никаких треннингов ы ыодителями не проводяться.<br />\r\nКроме того, почему-то скрывалось название гостиницы- прямо "военная тайна"<br />\r\nВсе желания отправиться в путешствие с вашей фирмой пропало надолго. И никому не буду рекомендовать.<br />\r\nВам не хватает открытости в ведении бизнеса и вежливых водителей.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '68.160.249.227', 'pool-68-160-249-227.nycmny.btas.verizon.net', 'Mozilla/5.0 (Windows NT 6.0; rv:26.0) Gecko/20100101 Firefox/26.0', 'USA', 'New York', '6dbn8a39hgiqlc6jf0u5hsbeg5');
INSERT INTO tour_testimonial VALUES(255, NULL, NULL, '2014-01-09', 'Матвеева', 'Юлия', NULL, 'myv08@mail.ru', '+79276554162', 'Здравствуйте! В июле 2013 года ездила вместе с компанией New Tours по маршруту Калифорния, Невада, Аризона, Юта. Все не успевала по возвращению написать отзыв. Наконец собралась!) Хочу поблагодарить Наташу с которой я контактировала находясь в России. С ее стороны все было сделано четко и хорошо, и по поводу оплаты и по организации тура. Хороший автобус, хороший водитель. И огромное СПАСИБО гиду СВЕТЛАНЕ, благодаря которой поездка была не просто экскурсией, а путешествием запоминающимся на всю жизнь.  Все понравилось, со мной даже случилось там интересное приключение: неожиданно индеец в одном из штатов подарил бусы которые снял с себя! Вот такой трофей висит у меня  теперь дома. Потеряла электронный адрес Светланы, очень хотелось бы послать ей фото на память. Светлана, огромное спасибо!! Только радостные и приятные воспоминания. Поздравляю New Tours с Новым 2014 годом! Желаю быть весь год на Коне. И только вперед и вверх!! С уважением, Юлия. г. Самара, 38 лет', NULL, NULL, NULL, NULL, NULL, '46.0.156.5', 'dynamicip-46-0-156-5.pppoe.samara.ertelecom.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/31.0.1650.63 Safari/537.36', 'Russia', 'Самара', 'fm8vq05uuoabsa2n2mea5rrgt0');
INSERT INTO tour_testimonial VALUES(256, NULL, NULL, '2014-01-10', 'К.', 'Михаил', NULL, 'mihey1286@yandex.ru', '', 'В октябре - ноябре 2013 года ездил с Нью Турс в тур "4 штата: Калифорния, Невада, Аризона, Юта" из Нью Йорка. Что тут сказать, одно удовольствие смотреть Америку с этой компанией. Гидом у нас был Анвар. Замечательный гид начитанный, знает множество исторических фактов, может ответить на любой ваш вопрос! Внимание уделял всем деталям, каждому вопросу туристов. Никого не оставлял без внимания. Замечательный гид!!! Если он вам попадется, вам очень очень повезло!!! <br />\r\nТеперь о самой компании Нью Турс. Я был с этой компанией почти на всем Восточном побережье и на западном в этом туре. Организация замечательная! Все построено максимально продуктивно. Нет потерь времени, хватает времени на сон и при этом хватает времени максимально все увидеть. Кто то может сказать что все бегом, но, одно большое но: в обзорном туре по другому никак. Не получится посмотреть все подробно за двух недельный отпуск. Хотите подробно - увольтесь с работы и проведите эти 10 дней в одном Лос Анжелесе. Птом еще пару недель в следующем городе и так далее. Посмотрите все тогда подробно :-) о и стоимость будет уже на много выше. Но для большинства такой возможности нет из за короткого отпуска. Поэтому тур в 10 дней построен очень продуктивно, вы успеваете посмотреть очень многое, при этом Нью Турс построила план таким образом, чтоб вы успевали высыпаться. Огромное спасибо Ною Турс за организацию такого замечательного отдыха!<br />\r\nПо поводу стоимости туров. Цена очень адекватна. Тот же тур в Москве стоит на 1000 $ дороже, но в него еще не включен Сан  Франциско. Лично я оплатил его из Москвы через пай пал на сайте Нью Турс. Можно спокойно таким образом оплачивать туры этой компании. Одним словом я очень доволен результатом! Огромное спасибо кампании Нью Турс за отлично организованный отдых и отдельное спасибо Наташе и Анвару!!! Обязательно встретимся снова!!!<br />\r\n', NULL, NULL, NULL, NULL, NULL, '85.249.3.250', '85.249.3.250', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/31.0.1650.63 Safari/537.36', 'Russia', 'Москва', 'av06ftc6i0v1cbamqd6dot8qm4');
INSERT INTO tour_testimonial VALUES(257, NULL, NULL, '2014-01-10', 'Werch', 'Julie', NULL, 'jxw@csatp.com', '8588102124', 'I have sent 4 emails to your company.  We have an insured that has cancelled a trip Leonid Blinder # GR225267 and we need to know what your cancellation policy is and if they were refunded any monies for this cancellation.  The trip was from October 4-October 16, 2013.  I would appreciate a response ASAP.', NULL, NULL, NULL, NULL, NULL, '12.22.206.194', '12.22.206.194', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/31.0.1650.63 Safari/537.36', 'USA', 'San Diego', '3tisa7mc0ui63hpadu0j8r5me0');
INSERT INTO tour_testimonial VALUES(258, NULL, NULL, '2014-01-11', 'свекольников', 'сергей', NULL, 'svekol-technos@mail.ru', '+79262292507', 'Всех поздравляю с Новым Годом! Виюле прошлого года я с женой Мариной вместе с Вашей компанией (гид Майкл) путешествовали по Атлантической Канаде. Всё было замечательно, профессионально. Спасибо. Хотели бы в марте с.г. посетить Нью-Йорк, Вашингтон, Бостон (прилёт 01.03 , убытие 09.03). Были бы благодарны Вам за организацию тура. Билеты ещё не брали, поэтому возможен наш вылет из Бостона. С уважением, Сергей.  ', NULL, NULL, NULL, NULL, NULL, '213.79.89.165', '213.79.89.165', 'Mozilla/5.0 (Windows NT 5.1; rv:26.0) Gecko/20100101 Firefox/26.0', 'Russia', 'москва', 'vkdjcolp7pkmkhnf0024m70pi0');
INSERT INTO tour_testimonial VALUES(259, NULL, NULL, '2014-01-13', 'Каплунова', 'Ольга', NULL, '3olga@mail.ru', '+7(916)171-32-28', 'Здравствуйте! Хочу выразить огромную благодарность Вашей фирме и всем организаторам нашего тура по Калифорнии с 3-9 января 2014 года. Все-все очень понравилось начиная от программы и заканчивая качеством и содержанием экскурсий (это отдельная благодарность Дмитрию). Особенно хочу выразить огромную признательность организаторам за встречу нас в аэропорту Сан-Диего, куда мы прилетели после задержки и отмены нашего рейса из Нью-Йорка в Лос- Анджелес. Было очень приятно! Огромное-огромное всем  спасибо!<br />\r\nЕдинственное что огорчает - это то, что Вашу фирму достаточно сложно найти в интернете( в строке контекстного поиска она появляется только после введения СТРОГО определенных слов. Если можно расширьте эту возможность). В результате чего мы были вынуждены купить Ваш тур у посредников, чем были очень огорчены. Именно поэтому я ставлю "8", а вообще сайт очень информативный и удобный.<br />\r\nЕще раз всем-всем огромное спасибо! Буду рекомендовать вашу фирму своим друзьям и знакомым и скорее всего воспользуюсь Вашими услугами еще.', NULL, NULL, NULL, NULL, NULL, '93.188.45.75', '75-45-188-93.dapl.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/28.0.1500.95 YaBrowser/13.10.1500.9323 Safari/537.36', 'Russia', 'Москва', 'tg6s0vpfvkh2c4e1jl6dctvug2');
INSERT INTO tour_testimonial VALUES(260, NULL, NULL, '2014-01-16', 'МИНЬКОВСКАЯ', 'ТАТЬЯНА', NULL, 'rus@cmktour.ru', '89096329940', 'ДОБРЫЙ ДЕНЬ, КОЛЛЕГИ!<br />\r\nК сожалению, ничего, кроме возмущения,не вызывает поездка моя с внуком в БОСТОН - если так можно это назвать - 04.01. Я сама работаю в туристической фирме уже 20 лет, но с такой экскурсионной пр-мой встречаюсь впервые. Причём, удивилась не только я, а ещё 5 человек (всего 7)путешествующих.<br />\r\nПоездка называется БОСТОН-2 дня. И в путёвке так написано (№317091). При заказе нам ничего не сказали о ещё 2-х так называемых городах посещения. В итоге - БОСТОНА, замечательного города, мы, практически, не увидели. К экскурсоводу - никаких претензий. Очень много интересной информации обо всех посещаемых объектах. Поэтому, приезжая в город, мы уже были в курсе дела. В Бостоне вся наша программа заняла 3 часа, а дальше...увезли в пригород. На следующий день в 9.00 началось путешествие,которое ничем не оправдаешь. Весь день в дороге, включая 2 городка: в одном - полчаса в музее, и в дорогу, во втором - камень и статуя, и в дорогу. Всю историю этих объектов мы уже услышали в автобусе. Даже экскурсовод сказал, что для русских групп это мало интересно. Да и города эти зимой мёртвые - всё закрыто. Т. е. с 9.00 до 21.00 мы были в дороге. Заплатив 400 дол.(за 2-х)мы так и не увидели толком ничего.<br />\r\nЭто вопиющее безобразие. Это с самого начало - обман. Это то, чего нельзя допускать по отношению к клиентам. Мы специально из Нью-Йорка ехали к вам - за удовольствием. ИТОГ: полное разочарование!<br />\r\nЯ в США не первый раз и буду ещё. Но в Вашу фирму больше никогда не обращусь, и других буду предупреждать.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '193.239.242.146', '146.242.239.193.static.trngroup.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:18.0) Gecko/20100101 Firefox/18.0', 'Russia', 'МОСКВА', '3g72hn7hfej0n3hhmcf946nf83');
INSERT INTO tour_testimonial VALUES(261, NULL, NULL, '2014-02-03', 'bazlov', 'Ella', NULL, 'ella_bazlov@mail.ru', '514-2880624', 'Дорогие друзья!<br />\r\nЯ хотела бы заказать на группу 20 человек на апрель обзорную по Нью Йорку( мы приедем и в этот жедень часа в 4)сколько по времени идет ваша обзорная?Мы приедем из монреаля на 3 ночи и один день планируем на Вашингтон.Можете ли вы нам сделать отель?хотелось бы не дорогой но с удобным месторасположением.Пожалуйста дайте нам цену на группу и ваши рекомендации.Элла, координатор и руководитель туров.', NULL, NULL, NULL, NULL, NULL, '70.51.194.207', '70.51.194.207', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'Canada', 'montreal', 'cshuk20qcqs6q8dhl2elrbvbd1');
