INSERT INTO tour_testimonial VALUES(265, NULL, NULL, '2014-02-20', 'Шефер', 'Галина', NULL, 'ga.shefer@gmail.com', '+79164379678', 'Добрый день!<br />\r\nХотели бы поехать с 1 мая в Коста Рику индивидуально. <br />\r\nБюджет поездки 3,5 тысячи на человека.<br />\r\nПриоритеты: национальные парки, дождевые леса, горы. вулканы. Очень хотелось бы иметь возможность увидеть красивых экзотических птиц. Пляжный отдых не интересует - больше природы!<br />\r\nМожете предложить нам маршрут? Количество дней зависит от того, насколько дней хватит данных денег. Если можно организовать посещение с шофером и без гида, еще лучше, с английским все хорошо. Отели насколько хватит денег, главное птиц посмотреть.<br />\r\nПожалуйста посмотрите сразу с билетом. Наверно знаете, у нас здесь ужас с валютой, доллар 36 рублей. Очень надеюсь на вашу помощь.<br />\r\nГалина Шефер', NULL, NULL, NULL, NULL, NULL, '95.72.206.223', '95.72.206.223', 'Opera/9.80 (Windows NT 5.1) Presto/2.12.388 Version/12.16', 'Russia', 'москва', 'td035lu6vl8emkqo184nc4mvd4');
INSERT INTO tour_testimonial VALUES(266, NULL, NULL, '2014-02-23', 'Лошкарева', 'Любовь', NULL, 'loshkarevalm@mail.ru', '+79221013482', 'Добрый день!<br />\r\nСкажите пожалуйста, работают ли ваши офисы по выходным? Приезжаем в пятницу. В понедельник планируем экскурсию на Ниагару', NULL, NULL, NULL, NULL, NULL, '82.193.155.224', 'nat224-ubik.convex.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.117 Safari/537.36', 'Russia', 'Екатеринбург', '26q1293dbr583415f75533gn33');
