INSERT INTO tour_testimonial VALUES(269, NULL, NULL, '2014-03-29', 'Мухин', 'Андрей', NULL, 'anmuk84@gmail.com', '+7 985 231 92 38', 'Уважаемые коллеги,<br />\r\nВ период с 14 по 23 марта 2014 г. вместе с семьей (жена и сын)совершили путешествие в рамках автобусного тура \\"Новый Орлеан - Старый Юг\\" в составе интернациональной группы (Россия + Украина)из 12 человек. Мы - опытные путешественники, объездившие всю Европу и многие страны в Латинской Америке и Азии от острова Пасхи до Китая и Лаоса. Так что есть с чем сравнить. Для меня и жены это было первое путешествие в США. Организованная вашей компанией туристическая поездка произвела на нас наилучшее впечатление, доставила большое удовольствие и оставила много ярких воспоминаний.<br />\r\nВо-первых, сам тур составлен очень грамотно, как с познавательной, так и технической стороны - все по-максимуму, только бы уложиться и успеть, но ведь получилось! Все, что можно было выжать из 12 штатов и 10 дней, мы получили.<br />\r\nВо-вторых, успехом тур обязан прежде всего нашему гиду-сопровождающему от вашей компании г-же Элле Воиновой. Поверьте нашему опыту, она обладает самыми лучшими и необходимыми качествами своей профессии. Это - поистине энциклопедические знания, блестящая культура речи и интеллигентная в лучшем смысле манера общения, стойкость и умение решать постоянно возникающие в путешествии задачи, чуткость и, главное, умение и ЖЕЛАНИЕ прислушиваться к индивидуальным запросам туристов. Мы глубоко благодарны Элле за проведенные с ней на американской земле 10 дней и мечтаем о новых путешествиях под ее чутким руководством. До встречи, Элла!<br />\r\nВ-третьих, своим успехом тур во-многом обязан нашему водителю Исаю (к сожалению, не знаю его фамилии). Благодаря его профессиональной закалке, опыту и знанию дорожной сети, на протяжении более чем 3500 км пробега у нас не было ни одного технического сбоя, опоздания или ЧП. Все строго по расписанию и с соблюдением строжайших мер безопасности, что очень важно! Исай, большое спасибо!<br />\r\n<br />\r\nВ части пожеланий рекомендую компании подобрать другую гостиницу в Атланте. Наша хоть и была неплохо расположена, но уж очень уступает по качеству всем остальным по маршруту. Это не критично, но все же ...<br />\r\n<br />\r\nЕще раз большое спасибо и до новых встреч!<br />\r\n<br />\r\nС уважением,<br />\r\nАндрей Мухин<br />\r\n', NULL, NULL, NULL, NULL, NULL, '91.77.146.140', 'ppp91-77-146-140.pppoe.mtu-net.ru', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; rv:11.0) like Gecko', 'Russia', 'Москва', 'dpc9o64ipngdjdbihejblkskk3');
INSERT INTO tour_testimonial VALUES(270, NULL, NULL, '2014-04-05', 'Корягин', 'алексей', NULL, 'Lamajor@inbox.ru', '+375296762807', 'Мы втроем вылетаем в Ньюйорк 17-го, назад-2мая, планировали попутешествовать по трассе 66( юг северной амер). Возможно вы нам организуете интересное пребывание. Прошу рассказать какое, если с финансами все в порядке. Спасибо', NULL, NULL, NULL, NULL, NULL, '37.17.112.48', '37.17.112.48', 'Mozilla/5.0 (iPhone; CPU iPhone OS 7_1 like Mac OS X) AppleWebKit/537.51.2 (KHTML, like Gecko) Version/7.0 Mobile/11D167 Safari/9537.53', 'Russia', 'Минск', 'luftf4hmde53t27k6ju74vhu47');
INSERT INTO tour_testimonial VALUES(271, NULL, NULL, '2014-04-12', 'Ekaterina', 'Pozhidaeva', NULL, 'kleorinaz@rambler.ru', '-', 'Добрый день!<br />\r\nбыли в туре с 29 марта "Чикаго".<br />\r\nСпасибо за приятные впечатления.<br />\r\nОсобо хотим выразить благодарность нашим сопровождающим -  Борису и Павлу!<br />\r\n', NULL, NULL, NULL, NULL, NULL, '89.22.62.53', '89.22.62.53', 'Mozilla/5.0 (Windows NT 5.1; rv:17.0) Gecko/20100101 Firefox/17.0', 'Russia', '', 's6nap477rat5gnja1f6a71cp11');
INSERT INTO tour_testimonial VALUES(272, NULL, NULL, '2014-04-16', 'anders', 'andy', NULL, 'andydrewanders@gmail.com', '311', 'We''re woken up yet again by your "New Tours Coach" buses, coming at 5:45 AM(!) under our bedroom windows at 3250 Coney Island Ave and running their roaring engines non-stop and keeping us awake for the rest of the night. If you can''t find any other spot to pick up people, at least have the decency NOT to wake up the whole building and NOT keep the engines running full-throttle up to an hour, with 2 to 4 buses at a time. How are you so egotistical, when is this stress gonna stop?! ', NULL, NULL, NULL, NULL, NULL, '96.25.239.3', '96-25-239-3.nyc.clearwire-wmx.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/34.0.1847.116 Safari/537.36', 'USA', 'brooklyn', 'boufrbcbg05kivl5mjec2lbh42');
