INSERT INTO tour_testimonial VALUES(275, NULL, NULL, '2014-04-24', 'Омаров', 'Ержан', NULL, 'omarov1402@gmail.com', '13474212452', 'Хотел у вас спросить . есть у вас туры на чемпионат мира по футболу в Бразилию (июнь-июль) ?<br />\r\nспасибо жду ответа . ', NULL, NULL, NULL, NULL, NULL, '91.75.144.198', '91.75.144.198', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10.8; rv:28.0) Gecko/20100101 Firefox/28.0', 'USA', 'NYC', 'utsuf573cqo8vn8bjkrc9saae4');
INSERT INTO tour_testimonial VALUES(276, NULL, NULL, '2014-05-06', 'Boroditsky', 'Innesa', NULL, 'innesaboro@gmail.com', '8476878360', 'Dear Svetlana, <br />\r\n<br />\r\nThis is to follow up on our discussion over the phone on very unpleasant experience we had during the NY tour on April 27.  <br />\r\nAs I communicated, the van that you provided was absolutely unsuitable for the group of 13 people paying full price for the sightseeing tour with few stops and few hours in the vehicle. As the van was overloaded, I was seating on a middle of the last row with no access to the windows. As the van had very small windows, even people seating on the better seats had very hard time to follow the guided tour. <br />\r\nTherefore, I believe I was overcharged for the substandard experience your company has provided and I request a refund.<br />\r\nIn our phone conversation on Monday, April 28th when I complained about the experience you promised to call me back after fact finding exercise, but you failed to do that. I hope you will be able to respond to this inquiry before I file formal complaint with NY Better Business Bureau as well as made my experience known on English and Russian travel web sites.<br />\r\n<br />\r\nRegards,<br />\r\nInnesa.<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '167.127.218.64', '167.127.218.64', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1; WOW64; Trident/4.0; SLCC2; .NET CLR 2.0.50727; .NET CLR 3.5.30729; .NET CLR 3.0.30729; Media Center PC 6.0; .NET4.0C; .NET4.0E; InfoPath.3)', 'USA', '', '0asf2enkg70mbvfg2tqduh4vq3');
INSERT INTO tour_testimonial VALUES(277, NULL, NULL, '2014-05-13', 'Almakaev', 'ALEXANDER', NULL, 'almakaev49@rambler.ru', '79166875432', 'Очередной раз совершили тур с Вашей компанией. Остались очень довольны работой гида Нелли! Очень приятно находиться в одной поездке с человеком, который имеет большой опыт сопровождения туристических групп, обладает великолепным багажом знаний по истории территории, знаменитостей и достопримечательных мест посещения, которые  мы проезжали. Мы всегда ощущали на себе заботу и внимание со стороны гида и Александра - водителя нашего микроавтобуса . Большое человеческое спасибо этим замечательным людям, всему коллективу  компании Ньютурс. До новых встреч на просторах США!!! Низко кланяемся гиду Нелли, семья Алмакаевых.', NULL, NULL, NULL, NULL, NULL, '188.123.230.193', '188.123.230.193', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/34.0.1847.116 Safari/537.36', 'Russia', 'Moscow', 'k0edpg0h2kamb6ude0l7jb98m7');
INSERT INTO tour_testimonial VALUES(278, NULL, NULL, '2014-05-15', 'Рудая', 'Оксана', NULL, 'Xenia-177@yandex.ru', '4991731021', 'Ездили в тур на Ниагару из Нью-Йорка 30 апреля-1 мая. Несмотря на то, что с погодой не очень повезло, путешествием остались очень довольны. Выражаем благодарность компании New Tours и нашему замечательному гиду Рите! Очень душевный человек, не формально относится к работе, рассказала очень много интересного об истории Нью-йорка, Америки и индейцах. Рита - лучший гид, которого мы встретили за всё время путешествий! Большое вам спасибо!', NULL, NULL, NULL, NULL, NULL, '176.99.242.21', '176.99.242.21.inetcom.ru', 'Mozilla/5.0 (Windows NT 6.0; rv:26.0) Gecko/20100101 Firefox/26.0', 'Russia', 'Москва', 'vt1hmgo6peg8rt133g08ge10u1');
INSERT INTO tour_testimonial VALUES(279, NULL, NULL, '2014-05-19', 'Чупраков', 'Дмитрий', NULL, 'dimach99@mail.ru', '+79068784399', 'Здравствуйте! В ноябре 2012 года мы заказывали у вас 3 экскурсии с моей  спутницей Надеждой - по НЙ, на Ниагару и в Вашингтон. Теперь планирую 12 июня прилететь в Калифорнию или Нью-Йорк, и заказать на 14 июня экскурсию на 10 дней http://www.newtours.us/regular/regular.php?tour=california_10days Есть ли еще места, и как лучше взять билеты в США - сразу в ЛА или только до НЙ, а там лететь с вами?<br />\r\nОт вашего ответа зависит покупка моих билетов в США.<br />\r\nИ Да, возможны ли скидки для постоянных (хоть и не очень частых) клиентов )))<br />\r\nС уважением, Чупраков Дмитрий, Россия, г. Пермь', NULL, NULL, NULL, NULL, NULL, '62.16.61.49', 'homeuser61-49.ccl.perm.ru', 'Mozilla/5.0 (Windows NT 5.1; rv:29.0) Gecko/20100101 Firefox/29.0', 'Russia', 'Пермь', '9vpj41mrsu194rklmgvnl77kq7');
INSERT INTO tour_testimonial VALUES(280, NULL, NULL, '2014-05-22', 'Пальмин', 'Виктор', NULL, 'vipall07@mail.ru', '79115503312', 'Тур А1TTV. Прекрасный, насыщенный, полный впечатлений и эмоций тур. Сплошной позитив и никаких минусов. По 5ти бальной системе организован на 5+. Хотим выделить отдельно искусство нашего Гида как организатора, психолога, знатока своего дела, истории, культуры, быта. И, что очень важно, неравнодушие ни к одному из более чем 40 человек группы. Человек для которого главное,-это турист с его проблемами. Имя Гида Анвар. Слово уже затертое, но повторю наш ГИД-супер.<br />\r\nP.S. Навскидку прикинул: Он, гид, съэкономил наш семейный бюджет примерно на 200$.... Вот такой вот расклад + понимание есть люди с широченной душой и любовью к народу. СПАСИБО. Виктор и Лена.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '62.192.250.172', '250.172.nat.atknet.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/34.0.1847.137 Safari/537.36', 'Russia', 'Архангельск', 't3eirgr06qn30umjrtfvhg9f75');
INSERT INTO tour_testimonial VALUES(281, NULL, NULL, '2014-05-27', 'Назмеева', 'Елена', NULL, 'lennaz09@rambler.ru', '89115694407', 'Здравствуйте! Меня зовут Лена, мы путешествовали с мужем с  в вашей фирмой в туре Вся Америка в стиле ТТВ с 27 апреля по 15 мая 2014 года. Я конечно, запоздала с отзывом, хотелось сразу после возвращения сесть и написать слова благодарности нашему гиду - Анвару, который за эти 18-19 дней стал самым близким человеком, стал нашим другом, учителем, человеком который открыл для нас Америку. Я абсолютно уверена, что на 90% успешность подобного тура, атмосфера в коллективе, то с каким чувством и настроением мы провели эти три недели, есть только заслуга  Анвара.  Мы не новички в туризме и не единожды путешествовали на автобусе, имели возможность слушать разных гидов, и заявляем с полной уверенностью, Анвар лучший гид. Его организаторские способности просто покоряли, ни какой спешки, ни какой суеты, все так подробно и своевременно расскажет, объяснит, что у тебя просто не возникает нужды что-то переспрашивать и уточнять.  Он прислушивался к мнению каждого туриста, подходил к каждому, беседовал и у всех была возможность задать интересующие именного конкретного человека вопросы. Было видно, что человек не формально исполняет свою работу, ему хотелось избавить нас от всего рода не удобств, свести к минимуму все потери времени, чтобы дать нам возможность как можно больше увидеть, узнать, чтобы мы были сосредоточены на наших эмоциях, на наших реально восторженных чувствах с которыми мы открывали Америку. Спасибо за эту возможность. Спасибо, что Анвар смог сделать свою программу очень гибкой, от нас не требовалось, чтобы мы всем составом шли в одно и тоже место, туристы имели право выбора. Например, в Лос-Вегасе, каждый пошел на то шоу, которое было ему интересно, и каждому он помог приобрести билет и подробно объяснил как туда добраться. <br />\r\nА о его профессиональных навыках, знаниях, именно как гида, человека который имеет в своем багаже столько информации, настолько разносторонней, такой полной, человек, хорошо знающий и понимающий историю, который может связать прошлое с настоящим, этому только можно удивляться.  <br />\r\nХотелось бы закончить свой отзыв пожеланием, чтобы руководство фирмы учитывало мнение туристов при вознаграждении своих сотрудников, оплата труда должна соответствовать  рангу и степени мастерства.  В программе нашего тура не было указано обязательных чаевых для гида, и Анвар, как человек глубоко порядочный, и скромный, даже не посмел намекнуть нам на чаевые, хотя все туристы нашего автобуса №1 единодушно были бы «за». Хотя гиды с автобуса №2, а их было два, по Восточному и Западному побережью, сразу собрали с каждого туриста чаевые для водителя и себя. <br />\r\nСпасибо New Tours ,что вы предоставили нашему автобусу Анвара.  Хочется еще раз приехать в Америку, осталось еще столько мест, которые нужно увидеть своими глазами, потрогать руками и оставить в своем сердце.<br />\r\nС наилучшими пожеланиями, Назмеева Лена  <br />\r\n', NULL, NULL, NULL, NULL, NULL, '62.192.250.172', '250.172.nat.atknet.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:24.0) Gecko/20100101 Firefox/24.0', 'Russia', '', 'jmhqhs4lfr03us8sk5n4k17d90');
INSERT INTO tour_testimonial VALUES(282, NULL, NULL, '2014-05-27', 'Zemnovich', 'Alisa', NULL, 'Alisa1z@aol.com', '718 494-5711', 'Мы с мужем  путешествовали с вашей компанией в трех дневной поездке в город Питтсбург и его окрестности на на день Памяти ( Memorial Day ). Получили огромное удовольствие - очень грамотный, интеллигентный с глубокими знаниями гид (Нелличка) сразу создала теплую атмосферу в автобусе 54 человек. Хороший организатор, милый человек.   Будучи простуженной и неважно себя чувствую она во время работы этого никак не показала. Только когда мы попали в гостиницу и спросили её будет ли она обедать, Нелличка сказала что ей нездоровиться и она пойдет отдыхать.  Если кому-то могла не понравиться эта поездка - это просто злые и всем недовольные люди. С удовольствием поедем с вами еще много раз!!!  Спасибо за хороших профессиональных гидов. ', NULL, NULL, NULL, NULL, NULL, '71.167.21.82', 'pool-71-167-21-82.nycmny.fios.verizon.net', 'Mozilla/5.0 (iPhone; CPU iPhone OS 7_1_1 like Mac OS X) AppleWebKit/537.51.2 (KHTML, like Gecko) Version/7.0 Mobile/11D201 Safari/9537.53', 'USA', '', 'fihht761f3oq98hi43l5od36p6');
INSERT INTO tour_testimonial VALUES(283, NULL, NULL, '2014-06-01', 'Чу парк', 'Ольга', NULL, 'Cholsen@mail.ru', '+79119118489', 'Тур Чикаго 6 дней 26.04.14-01.05.14 Тур интересный,грамотно спланирован,но отель под Чикаго,в котором провели 3 ночи в очень плохом состоянии:окна выходили на трассу,спать невозможно,грязно,не опрятно,в отеле ремонтные работы.', NULL, NULL, NULL, NULL, NULL, '78.25.122.238', '78.25.122.238', 'Mozilla/5.0 (iPad; CPU OS 7_1_1 like Mac OS X) AppleWebKit/537.51.1 (KHTML, like Gecko) GSA/4.0.0.29643 Mobile/11D201 Safari/9537.53', 'Russia', 'Санкт-Петербург', 'mak4l8tu694kljmkklac03tng5');
INSERT INTO tour_testimonial VALUES(284, NULL, NULL, '2014-06-06', 'Гросман', 'Фира', NULL, 'blagovova@mail.ru', '922-3-924 96 37', ' C 24 апреля по 1мая 2014 года я была в туре Чикаго - Великие Озёра. Остались самые лучшие впечатления от организации тура и особенно от гида Бориса Волкина, который обладает огромной эрудицией. Видно, что он не только хорошо знает и любит Чикаго, но и передал всё это нам. Я очень благодарна ему за то что этот 6-дневный тур был одним из самых ярких впечатлений об Америке. ', NULL, NULL, NULL, NULL, NULL, '94.159.184.13', '94-159-184-13.orange.net.il', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'Israel', 'Петах-Тиква', 'tr594s9q8q5v0l9s3pe63ee1a7');
INSERT INTO tour_testimonial VALUES(285, NULL, NULL, '2014-06-10', 'Сидоров', 'Алексей', NULL, 'orzalex@gmail.com', '89263751449', 'Пользовался вашими турами, очень доволен. Спасибо! Есть ли ваши аккаунты и группы в социальных сетях? Хотелось бы вступить в них', NULL, NULL, NULL, NULL, NULL, '95.163.161.86', '95.163.161.86', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_9_3) AppleWebKit/537.76.4 (KHTML, like Gecko) Version/7.0.4 Safari/537.76.4', 'Russia', 'Москва', '4duj2itghi0abtsgh5c08fpks0');
INSERT INTO tour_testimonial VALUES(286, NULL, NULL, '2014-06-13', 'Solovyeva', 'Liudmila', NULL, 'mila_455@hotmail.com', '8 917 619 2221', 'Здравствуйте! Рассматриваю маршрут на вторую половину августа. Нашла несоответствие по датам в файле "Однодневные туры" и в конкретном описании туров. Например, тур "Золотой берег" LONG ISLAND в перечне однодневных туров даты 5, 26 августа, в конкретной программе - 2, 16 августа. Уточните, пожалуйста. С уважением Людмила', NULL, NULL, NULL, NULL, NULL, '92.252.161.139', '5cfca18b.dynamic.mv.ru', 'Opera/9.80 (Android 2.3.6; Linux; Opera Mobi/ADR-1309251116) Presto/2.11.355 Version/12.10', 'Russia', 'Ulyanovsk', '1hd5l35iv4gia9tg7i3n7dtcr0');
INSERT INTO tour_testimonial VALUES(287, NULL, NULL, '2014-06-17', 'Копиленко', 'Марина', NULL, 'maryna.kopylenko@life.com.ua', '=380632100492', 'Благодарю за прекрасный тур Йеллоустоун-ГрандТетон (24-31 мая 2014). Великолепная природа, отличная организация и интересное сопровождение от Натальи Зарембской сделали мой отпуск незабываемым. Отдельное спасибо водителю Дмитрию', NULL, NULL, NULL, NULL, NULL, '212.58.160.160', '212.58.160.160', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; Trident/5.0)', 'Ukraine', 'Киев', 'ts3e2tc6b2veber8t21ts38rs0');
INSERT INTO tour_testimonial VALUES(288, NULL, NULL, '2014-06-24', 'Денисова', 'Галина', NULL, 'office@ckti.ru', '+79219043128', 'Добрый день! 12 мая я оплатила инвойс за 2 тура на Аляску и по Канаде.Канадскую визу мне пока не дали. С 20 июня ежедневно прошу вернуть мне деньги. НИКТО вообще не отвечает! У меня украли деньги? Пора обращаться в суд?', NULL, NULL, NULL, NULL, NULL, '94.140.205.218', '94.140.205.218', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36', 'Russia', 'Санкт-Петербург', 'vgbc5pvula4c89hh11fj1lvgk5');
INSERT INTO tour_testimonial VALUES(289, NULL, NULL, '2014-06-30', 'Kvyatkovsky', 'ludmila', NULL, 'vkvyat1@gmail.com', '7182586762', 'Is your ticket refundable? I order ticket on August for my Ukrainian friend. Because of situation there she is not sure if she coming. Can I return ticket if something bad happen?<br />\r\n', NULL, NULL, NULL, NULL, NULL, '24.184.72.245', 'ool-18b848f5.dyn.optonline.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_9_2) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/33.0.1750.152 Safari/537.36', 'USA', 'Brooklyn', 'v2u3voapsrdc5pefcrq66uv9h2');
INSERT INTO tour_testimonial VALUES(290, NULL, NULL, '2014-07-03', 'Корнилова', 'Наталья', NULL, 'zyrnaluga@mail.ru', '89226579759', 'Путешествовали по Америке с New Tours много. 5 экскурсий. Понимаю,что надо было искать альтернативу, так как каждая поездка была по сути "котом в мешке" - повезет-не повезет с экскурсоводом. Высказывать свою точку зрения на исторические события и факты, давать оценку политикам, роли евреев и так далее и так далее - привычное дело для гидов компании. А еще очень щепетильный вопрос -сбор чаевых. Кто-то делает это ооочень корректно (к примеру Ребекка), а кто-то превращает в унизительный и грязный сбор (Анвар). Из 5 экскурсоводов комфортно было только с Ребеккой. А в Филадельфию вообще отправили с какой-то бабушкой, у которой очень несвязная речь. Не работал в микроавтобусе микрофон, личного оборудования у нее, конечно, не было. Не запомнила ни то что рассказов, даже имени ее. Неприятные воспоминания во всех многодневных поездках оставляет также ужасное и опасное питание в китайских буфетах и "откатные" сувенирные магазины. Плюс совершенно "холодные" менеджеры в офисе, которые не утруждают себя тем, чтобы заинтересовать клиентов, делают ссылку на сайт и буклеты, да еще и позволяют себе давать оценку политике Путина и происходящему в Украине. Не профессионализм высшей степени. Если компания не обновит команду, ей не продержаться. Дабы была возможность разобраться по факту, распишу даты туров:<br />\r\n<br />\r\n1.Бостон. 12-13.06.<br />\r\n2.Ниагара. 16,17.06.<br />\r\n3.Вашингтон. 19,20<br />\r\n4.Нью-Йорк, 23.06.<br />\r\n5.Филадельфия, 24.06. ', NULL, NULL, NULL, NULL, NULL, '188.17.2.122', '188.17.2.122', 'Mozilla/5.0 (Windows NT 6.2; WOW64; rv:30.0) Gecko/20100101 Firefox/30.0', 'Russia', 'Западная Сибирь', 'b6lui8j5v4v6eegkffjj22rir4');
INSERT INTO tour_testimonial VALUES(291, NULL, NULL, '2014-07-07', 'Yakkelevich', 'Yuriy', NULL, 'Yankelevich59@gmail.com', '2673222485', 'С 4 по 6 поучаствовал в хорошем туре по французской Канаде . Все очень понравилось , проведение экскурсии, профисиализм водителя но есть одно маленькое пожелание . Наша группа была 14 человек из Филадельфии. потратили на дорогу в Нью-Йорк и изНью-Йорка вцелом около 8 часов . Можно ли привозить и забирать людей в Нью Джерси с последнего места посадки и первого места высадки было бы очень здорово<br />\r\n', NULL, NULL, NULL, NULL, NULL, '208.54.35.163', 'ma32336d0.tmodns.net', 'Mozilla/5.0 (iPhone; CPU iPhone OS 7_0 like Mac OS X) AppleWebKit/537.51.1 (KHTML, like Gecko) Version/7.0 Mobile/11A466 Safari/9537.53', 'USA', 'Philadelphia', 'fll482u62o4ol546cj5uenpor0');
INSERT INTO tour_testimonial VALUES(292, NULL, NULL, '2014-07-21', 'ISAKOV', 'OLGA', NULL, 'olgalend@yahoo.com', '718-897-7048', 'Я хочу поблагодарить гида Бориса и водителя Исайя за прекрасно проведеный тур в Канаду - 5 дней с 07/16/14 - 07/20/14.Было очень интересно и комфортно.Хочу также поблагодорить руководство компании \\''\\''NEW TOURS\\''\\'', за сервис и професcиaлизм - которым моя семья получает у вас на протяжении многих лет. С уважением,<br />\r\n                               Olga <br />\r\n<br />\r\nI hope in the future we will be traveling on a tour from you.', NULL, NULL, NULL, NULL, NULL, '108.46.116.128', 'pool-108-46-116-128.nycmny.east.verizon.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', '', 'tsu0472eb1up90d4nq1pt83f00');
INSERT INTO tour_testimonial VALUES(293, NULL, NULL, '2014-07-29', 'http', 'nevermind', NULL, 'nevermind_http@yahoo.com', '123-456-7890', 'Данный отзыв - о туре в Питтсбург, Золотой дворец и дом на водопаде. Тур как-то странновато распланирован. Все жаловались, что вечернюю экскурсию в первый день вообще-то лучше было бы проводить при дневном свете. Какого-то определенного смысла в ней я так и не уловила, ибо никакого особого ночного освещения на самом деле не было. Во время той вечерней экскурсии нам пообещали, что на следующий день мы еще вернемся в те места; на самом же деле мы их видели максимум из окна автобуса, пешком мы уже туда не вернулись. Золотой дворец по хорошему нужно из этого тура исключить. Не то, чтобы там было совсем уж нечего смотреть, но потраченного на него полдня он не стоил. Лучше бы мы остались в Питтсбурге и посмотрели его более основательно (опять таки, не только мое мнение - это мнение многих людей, с которыми я разговаривала в группе). Если честно, даже сам экскурсовод в этом Золотом дворце звучал как-то недоуменно, почему эта тетенька туда постоянно приезжает с группами туристов. Ну и тем более, что жалко даже подумать, что реально в самом Питтсбурге мы провели только полдня. Ехать ведь туда - не ближний свет. При этом там есть что посмотреть и есть что делать. Еще одна проблема: ни в один из дней не было отведенного для ужина времени. Получалось так, что после ланча мы больше не если, потому что в гостиницу возвращались уже слишком поздно. Итог: поездка неплохая, но уж слишком галопом по Европе, и в Питтсбург я еще сама обязательно съезжу. (P.S.: мой адрес e-mail выше - настоящий, а вот телефон я не хочу давать. Эти отзывы вообще-то должны быть анонимными.)', NULL, NULL, NULL, NULL, NULL, '69.120.248.243', 'ool-4578f8f3.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.3; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0', 'USA', 'New York', '48pvskrjp39k0gpeoisjpc74e6');
INSERT INTO tour_testimonial VALUES(294, NULL, NULL, '2014-08-05', 'Петропавлова', 'Галина', NULL, 'petropavlova@mail.ru', '+79313073909', 'Благодарим за отличную организацию проведения и внимательное отношение к каждому туристу со стороны гида Игоря Левита во время нашего путешествия по Скалистым горам (Канада) в период с 17 по 25 июля 2014 года. Мы высказали ему наше отношение вовремя прощания, а также решили это сделать через сайт вашей компании. Благодарим за возможность быть с вами. Просим довести эту благодарность и до Лили Гелфанд ', NULL, NULL, NULL, NULL, NULL, '95.54.8.126', '95-54-8-126.dynamic.lenobl.dslavangard.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0', 'Russia', 'Санкт-Петербург', '51m18ns5b06gb0ledv0k0gbt82');
INSERT INTO tour_testimonial VALUES(295, NULL, NULL, '2014-08-07', 'Белов', 'Алексей', NULL, 'alexeybelow@mail.ru', '+79199929859', 'За последние две недели воспользовался двумя турами. Первый 10-дневный в Калифорнию и ласвегас и второй - Вашингтон. Хотелось бы сказать отдельное спасибо и выразить благодарность команде экскурсовода Дмитрия Грозовского и водителя Дэвида. Потрясающие люди! С ними интересно. Дмитрий знает все по теме! Абсолютно всем рекомендую этот тур! Он завораживает, он хорошо построен. <br />\r\nЧто касается второго тура в Вашингтон. Мало того что два дня тут делать нечего, экскурсовод Борис не считает что группе нужен туалет, что нужны подарки.  И общение с ним в целом оставляет желать лучшего. В первый день два часа вместо экскурсии бегали туда сюда за автобусом. Во второй день водитель уехал не туда и заехал в тупик. Сама экскурсия построена почему то так, что мы ездим туда обратно теряя на этом время. Вообщем с этим туром надо что то делать. Надо его как то менять.<br />\r\nВ завершении хочется еще раз выразить благодарность Дмитрию и Дэвиду. И хотелось бы чтобы фирма \\"Нью турс\\"поощьрила их за работу!!!', NULL, NULL, NULL, NULL, NULL, '172.56.2.96', '172.56.2.96', 'Mozilla/5.0 (Linux; Android 4.4.2; HTC One Build/KOT49H) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/36.0.1985.131 Mobile Safari/537.36', 'Russia', 'Москва', 'av02cn0emf9u9losi69vdggfr4');
