INSERT INTO tour_testimonial VALUES(297, NULL, NULL, '2014-08-11', 'kolik', 'irina', NULL, 'hollywoodsmile007@gmail.com', '917-306-6594', 'Zdravstvuite ! Menia zovut Irina Kolik . 8/9/14 ia i moi muzh Yury Kolik ezdili na tour v Newport  . Kogda ia zakazivala tour , ia sprashivala ili budet bolshoi avtobus , mne skazali , chto skoree vsevo budet bolshoi avtobus . Za den\\'' do poezdki , ko mne pozvonila Ada , vasha rabotnica i skazala , chto budet malenkii , no komfortnii avtobus dlia poezdki v Newport . Mi uzhe ezdili na tours s vashim agenstvom , na malenkom avtobuse, on bil ochen komfortnii s miagkimi sideniami . No 8/9/14  dlia nashevo tura bil podan avtobus ochen NEkomfortnii , s tverdimi sideniami . Exat\\'' v takom avtobuse na dlitelnoe rasstoianie NEVOZMOZHNO . Iz za traffica v storonu Newporta , mi naxodilis v avtobuse 6 chasov . Moi muzh , Yury  , imeet problemu so spinoi , i ezdit v na tverdix sideniax dlia nevo eto pitka ..... Tolko radi menia on molchal vsiu dorogu , no na sleduiushii den\\'', posle etovo tura , on popal v gospital s problemoi spini iz za tverdix sidenii . Nesmotria na to , chto u nevo bila specialnaia podushka pod spinu , emu nichevo ne pomoglo . Ia pitalas dozvonitsia v vash office i pogovorit s menagerom Svetlanoi , no menia s nei ne soediniali a tolko prosili moi nomer telefona . Ia neskolko raz davala svoi nomer , nikto mne ne perezvonil . Poslednii raz ia sama opiat\\'' pozvonila i podniala trubku kakaia-to grubianka , nedoslushav menia , prosto brosila na menia trubku , eio imia ia ne zapomnila , k bolshomu sozhaleniu . Ia ivliaius klientkoi vashevo agency uzhe mnogo let , ezgu v otpusk tolko cherez vashu agentshu Ludu , Turi na avtobusnie ekskursii vsegda zakazivaiu po internetu , a potom esho zvoniu i vsegda<br />\r\n<br />\r\n sprashivaiu ob komfortnosti avtobusa .  <br />\r\nMne ochen nepriatno i protivno stalo, kogda nedoslushav menia po telefonu o moiom komplaine , na menia brosila trubku vasha rabotnica . Po eio  golosu, ia poniala , chto eto dama ne imeet ni kakix proffesionalnix dannix dlia raboti s klientom . Proshu VAS  pozvonit mne ASAP i izvenitsia za neproffissionalnost vashei rabotnici . A na budushee ia esho podumaiu ili prodolzhat polzovatsia vashimi turami iz za neproffisionalnovo otnoshenia k klientam . <br />\r\nS uvazheniem , Irina kolik <br />\r\ntel: 917-306-6594', NULL, NULL, NULL, NULL, NULL, '67.84.78.104', 'ool-43544e68.dyn.optonline.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_9_4) AppleWebKit/537.77.4 (KHTML, like Gecko) Version/7.0.5 Safari/537.77.4', 'USA', 'brooklyn', '57br7nsh72didqb5bqj1qs9qg0');
INSERT INTO tour_testimonial VALUES(298, NULL, NULL, '2014-08-12', 'Zankina', 'Olga', NULL, 'ezh11@yandex.ru', '', 'Очень понравился тур "4 штата"!Отдельное спасиба гиду Игорю Есину!!!!:)', NULL, NULL, NULL, NULL, NULL, '107.107.57.70', '107.107.57.70', 'Mozilla/5.0 (iPhone; CPU iPhone OS 7_1_2 like Mac OS X) AppleWebKit/537.51.2 (KHTML, like Gecko) Version/7.0 Mobile/11D257 Safari/9537.53', 'USA', 'New York', '04kt9sr9t1ncn0kb77mna05np2');
INSERT INTO tour_testimonial VALUES(299, NULL, NULL, '2014-08-12', 'Якоби', 'Александр', NULL, 'yaksar86@gmail.com', '972507498254', 'Добрый день!<br />\r\nХочу поблагодарить за прекрасный отдых,организованный вашей компанией 12 июля в "КАЛИФОРНИЯ - НЕВАДА -АРИЗОНА - ЮТА". А профессионализм и интеллект гида Анвара, его организаторский дар и способность сплачивать людей в единный дружный коллектив создали благоприятную атмосферу отдыха, прекрасного настроения,наслаждения Америкой с её красотами и разнообразными коллоритами и желанием ещё вернуться.<br />\r\nСпасибо всем вашим сотрудникам за прекрасную организацию без единного сбоя.<br />\r\nУдачи вам! Я с удовольствием в будующем вновь воспользуюсь вашими услугами и буду рекомендовать вас всем.До встречи. ', NULL, NULL, NULL, NULL, NULL, '194.90.99.129', '194.90.99.129', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/36.0.1985.125 Safari/537.36', 'Israel', 'Ashdod', '9c00ebpkqceig3j1lv03m5vu51');
INSERT INTO tour_testimonial VALUES(300, NULL, NULL, '2014-08-13', 'TRAVEL', 'GOLD', NULL, 'gold.travel2013@yahoo.com', '0037496554557', 'satrudnichestva ......................................', NULL, NULL, NULL, NULL, NULL, '37.157.214.80', 'host-80.214.157.37.ucom.am', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/36.0.1985.125 Safari/537.36', 'Other ..', 'EREVAN', 'iphj7ph5j3p0p88rnemhrj4ui0');
INSERT INTO tour_testimonial VALUES(301, NULL, NULL, '2014-08-14', 'Победимов', 'Андрей', NULL, 'avpobedimov@rambler.ru', '79219262361', 'Здравствуйте! Я совершал тур из серии Звёзды Атлантики по Атлантическому побережью США и Канаде с 29.07 по 11.08. Очень хочу поблагодарить вас за отличную организацию тура. Всё, начиная с самого первого дня, когда была первая поездка в Вашингтон (гид группы Михаил), затем обзорная экскурсия по Нью-Йорку (гид Наталья)и совершенно замечательные поездки в Канаду и Бостон с гидом Ириной Лейкиной, оставили самые радужные впечатления. Спасибо вам за вашу работу! С уважением и наилучшими пожеланиями А.В.Победимов, Санкт-Петербург, Россия.', NULL, NULL, NULL, NULL, NULL, '46.32.84.13', '46.32.84.13', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 YaBrowser/14.7.1916.15705 Safari/537.36', 'Russia', 'Санкт-Петербург', 'i2mn42carhc8vad68ak5gceml1');
INSERT INTO tour_testimonial VALUES(302, NULL, NULL, '2014-08-15', 'Метленко', 'Вера', NULL, 'metlenko@inbox.ru', '79262839603', 'Большое спасибо менеджеру Лане за отличную организацию нашей поездки в тур Звезды Атлантики+ Чикаго с 28.07.2014г. Очень понравилась работа гида Волкина Бориса в Чикаго. Это профессионал высокого класса и чудесный человек. Все туристы его просто обожали. Спасибо водителю Алексею-очень хороший водитель и прекрасный человек! Спасибо всем, кто работал с нами. Очень понравилась Ваша компания. Будем дружить. Сайт просто замечательный -все просто и понятно. Успехов Вам! ', NULL, NULL, NULL, NULL, NULL, '46.39.229.178', 'ip-178.pool-229.ms-dpc03.cpx.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/36.0.1985.125 Safari/537.36', 'USA', 'Москва', '63dp33ebeahfdb8jgglp2kkou1');
INSERT INTO tour_testimonial VALUES(303, NULL, NULL, '2014-08-15', 'Polonsky', 'Konstantin ', NULL, 'Mdmikny@gmail.com', '3474456424', 'Мы с супругой только что вернулись из 6-ти дневной поездке по Канаде и хотим поблагодарить вашего сотрудника - гида Михаила за то, что, благодаря его эрудиции, энциклопедическим знаниям и совершенно неповторимому чувству юмора, эта поездка надолго останется в нашей памяти. Мы также очень благодарны водителю автобуса Жану за высокий профессионализм. Спасибо New Tours!!', NULL, NULL, NULL, NULL, NULL, '207.38.220.67', '207-38-220-67.c3-0.43d-ubr1.qens-43d.ny.cable.rcn.com', 'Mozilla/5.0 (iPad; CPU OS 7_1_2 like Mac OS X) AppleWebKit/537.51.2 (KHTML, like Gecko) Version/7.0 Mobile/11D257 Safari/9537.53', 'USA', 'New York ', 'fu82h09c84r8804h5agahokhl3');
INSERT INTO tour_testimonial VALUES(304, NULL, NULL, '2014-08-25', 'Frenklakh', 'Evguenia', NULL, 'solfren@gmail.com', '61 3 97720656', 'Dear Manager, my husband and I are interested in your tours to Japan with a Russian guide in April-May 2015.Please send us any information that would be available now or later and put us on the waiting list for a tour duration around 10-12 days approximately. We are pensioners in our late 70s. thank you. Your sincerely. Evguenia. Iouri', NULL, NULL, NULL, NULL, NULL, '123.243.128.90', '123-243-128-90.static.tpgi.com.au', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'Other ..', 'Melbourne Australia', 'q49m13qllt6hb50s3b8he8s0a0');
