INSERT INTO tour_testimonial VALUES(308, NULL, NULL, '2014-09-07', 'Shkolnikov', 'Lev', NULL, 'l.shkolni@yahoo.com', '1 347 860 4867', 'I was on the trip to Yellow stone with my wife from August 30., 2014 It was a very well organized tour with knowledgeable tour guide Natasha (forgot last name). We saw so much beautiful places and Natasha always tried to make this trip interesting. Comfortable big bus (which was one of my condition to have this tour), good hotels plus nice places we visit all this left a very good mood and memory.<br />\r\nVery happy and will recommend this tour to my friends.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '142.255.87.138', 'cpe-142-255-87-138.nyc.res.rr.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; EIE10;ENUSMCM; rv:11.0) like Gecko', 'USA', 'New York', 'qvtkfllnfdehnlikut245pgmn2');
INSERT INTO tour_testimonial VALUES(309, NULL, NULL, '2014-09-09', 'Petrova', 'Nataliya', NULL, 'Vita1913@yahoo.com', '718-373-5309', 'Could  be better<br />\r\n3 days trip to wonderful state Main.<br />\r\nBelow even low standards: tour guide acted as  he wanted to take revenge over people which paid money for the trip. Zero people skills. Zero politeness and attentiveness  to tourists  The driver  of the bus ( small bus have to admit),  used the cell phone . When  one  lady  asked not to do that  he got  offended<br />\r\n and act very unprofessional. Good idea  to have  the  trip, which  performed very poorly.<br />\r\nPlease pay  attention who are  you hiring. I am sure you would not have such a trip in your own Vacation my Dear people from the agency<br />\r\nThank you<br />\r\nnp', NULL, NULL, NULL, NULL, NULL, '71.125.248.191', 'pool-71-125-248-191.nycmny.east.verizon.net', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; rv:11.0) like Gecko', 'USA', 'Brooklyn', '2l7p1trgimp0a2tlk0d3560ek1');
INSERT INTO tour_testimonial VALUES(310, NULL, NULL, '2014-09-19', 'Гладун', 'Сергей', NULL, 'gladuns@inbox.ru', '+380973369075', 'Добрый день! Надеюсь у вас все Ок. Я приеду в США на Рождество и Новый год. Планирую совершить 7-дневный тур ЛОС-АНДЖЕЛЕС - ЛАС-ВЕГАС - САН-ДИЕГО - ГРАНД-КАНЬОН - ЗАПОВЕДНИКИ (начало 2.01.15). Согласен ночевать с подселением, лучше номер на троих. Прошу ответить на следующие вопросы. 1. Каким рейсом летим из НЬЮ-ЙОРКА в ЛОС-АНДЖЕЛЕС. Если есть варианты - то какие. 2. Каким рейсом летим из ЛАС-ВЕГАСА в НЬЮ-ЙОРК. Если есть варианты - то какие. Заранее благодарен за ответ и надеюсь это вас не затруднит. Сергей ГЛАДУН, 65 лет, профессор', NULL, NULL, NULL, NULL, NULL, '176.36.20.131', 'host-176-36-20-131.la.net.ua', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 Safari/537.36 u01-04', 'Ukraine', 'Киев', '3a216vc99ji4ur1jkamoimack3');
