INSERT INTO tour_testimonial VALUES(312, NULL, NULL, '2014-09-29', 'Лобунец', 'Нонна', NULL, 'lobunec57@mail.ru', '89182032181', 'Здравствуйте! Пожалуйста, помогите определиться с выбором экскурсии на 21.12.2014 - воскресенье. Интересует вопрос, что лучше выбрать в декабре: Немурс или Филадельфию с садами Дюпонов? Где зрелищнее и живописней (все-таки зима!) Спасибо!', NULL, NULL, NULL, NULL, NULL, '95.153.203.17', '95.153.203.17', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/35.0.1916.153 YaBrowser/14.7.1916.15705 Safari/537.36', 'Russia', 'Москва', 'i5h241qkv2qkoi4e0phqnobff6');
