INSERT INTO tour_testimonial VALUES(314, NULL, NULL, '2014-10-01', 'Сысуев', 'Денис', NULL, 'visaastoria@gmail.com', '+380992815668', 'Здравствуйте , меня зовут Сысуев Денис. Я руководитель туристической компании<br />\r\n"ASTORIA-TRAVEL", наша компания получила лицензию тур оператора в Украине, в сентябре этого года, и нам очень интересно туристическое  направление США. Так как Америка является стратегическим и очень важным партнером для Украины.Мы также занимаемся внутренним туризмом в Киеве , по всей Украине и Европе,(организацией программных, индивидуальных, групповых туров для молодёжи и студентов). Мы работаем под патронатом "КМДА" (КИЕВСКАЯ ГОРОДСКАЯ ГОСУДАРСТВЕННАЯ АДМИНИСТРАЦИЯ). Сегодня на выставке Туризма в Киеве , я подходил к вашей стойке. Мне дал вашу визитку Игорь" HOLLYWOOD TOUR BUREAU", он позиционировал вас , как очень надежного и профессионального партнера. И нам бы очень хотелось с вами работать. Мы молодая компания и мы были бы очень рады сотрудничеству с вами! Я 15 октября записан на приём в Консульство США в Киеве, к генеральному консулу, и мне бы очень хотелось при встрече с консулом предоставить договор о совместном сотрудничестве с вами, так как это будет в дальнейшем положительно влиять , на нашу с вами работу. Если есть у вас скайп то , я очень хотел бы познакомится с вами по ближе. Мой скайп: denis1978.<br />\r\nСпасибо ! С уважением Сысуев Денис.', NULL, NULL, NULL, NULL, NULL, '93.74.255.190', 'nibbling.pincers.volia.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/37.0.2062.124 Safari/537.36', 'Ukraine', 'Киев', 'mp4vkg02jma9nn75uv6ad1t6v1');
INSERT INTO tour_testimonial VALUES(315, NULL, NULL, '2014-10-03', 'Ambrazaitiene', 'Ona', NULL, 'onaspoke@gmail.com', '860 706-2862', 'Hello, <br />\r\nWhile traveling the US we used your agency 7 times. We were always happy and tolerated if something was a little off. It''s understandable that it''s not always the organizers fault.<br />\r\nSeptember 24th, this year we went on tour in Manhattan. I''ve been to Manhattan more than once, but I had a guest from overseas, so I wanted her to see as much as possible in a day. I thought the tour ( at least by the description ) will do that. I was very disappointed. The tour started an hour late and ended before 3pm. Lunch was offered to us for $20, so no wonder no one wanted. There was no need to say that there was an assembly at the UN, because it''s not our problem and there are lots of other interesting places to see in the city. Alternatives would off been appreciated. We didn''t stop at the ground zero, no Time square, no Metropolitan opera, no Lincoln center, Broadway theater district or 5th Ave. <br />\r\nI''m writing this because we are planing to use your agency for other travels in the future, but we won''t be comfortable offering this particular tour for our guests. Your response - is your reputation.<br />\r\nSincerely, <br />\r\nOna ', NULL, NULL, NULL, NULL, NULL, '50.169.105.43', 'c-50-169-105-43.hsd1.ct.comcast.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_9_4) AppleWebKit/537.78.2 (KHTML, like Gecko) Version/7.0.6 Safari/537.78.2', 'USA', '', 'udkdtaspgnglr6k497f7pt19e0');
INSERT INTO tour_testimonial VALUES(316, NULL, NULL, '2014-10-14', 'Логунова', 'Виолетта ', NULL, 'vitlogunova@gmail.com', '', ' Хочу высказать наше недовольство поездкой на Ниагарские водопады.Ещё ехав в автобусе  Ребекка(так звали нашу сопровождающую), прошла и собрала по 20$ с человека на вечернее шоу индейцев. Все это происходило чуть ли не в приказном порядке, не объяснив , что это за шоу, каков уровень этого шоу, а на вопрос - сколько длиться это шоу, ответила 40 минут. На самом деле шоу было уровня детского сада, длилось 15 мин. и  много людей из нашей группы выходили и \\"плевались\\". Мы выкинули 40$, хотя могли бы потратить их на что нибудь более полезное!!!! Но больше возмущает даже не это,   а отношение к туристам -   отношение  как   к \\" лохам\\", которым можно все \\"втюхивать\\",что выгодно фирме и сопровождающей.  Вы должны давать выбор своим клиентам. Для этого нужно давать полную и ПРАВИЛЬНУЮ информацию, а мы уже сами решим - идти нам туда или нет!!! Это касается, конечно мероприятий не входящих в основной пакет экскурсий.   И ЕЩЁ!! Ребекка в конце поездки пошла сама по автобусу, собирая чаевые!!!! Такого я ещё нигде и никогда не видела!!! Обычно передают конверт по автобусу и туристы в добровольном порядке дают или не дают чаевые!  Она НЕ ОСТАВИЛА ВЫБОРА людям в нашем автобусе!! Людям, которые тоже были  чем-то не довольны,  было не \\" удобно\\" и они платили!!! Такого хамства, еще раз повторюсь, я нигде, ни в одной стране не видела!!', NULL, NULL, NULL, NULL, NULL, '95.90.195.11', 'ip5f5ac30b.dynamic.kabel-deutschland.de', 'Mozilla/5.0 (Linux; U; Android 4.2.2; ru-ru; A3-A10 Build/JDQ39) AppleWebKit/534.30 (KHTML, like Gecko) Version/4.0 Safari/534.30', 'Germany', 'Landshut', '1t5jjofg42fiqdecbav2851dq1');
INSERT INTO tour_testimonial VALUES(317, NULL, NULL, '2014-10-21', 'Yablonskaya', 'Marina', NULL, 'MAY-Aktau@mail.ru', '87015286102', 'Здравствуйте! Впервые поеду в США. Последний город по моему маршруту - Майами. Планирую остановиться там на 2-3 дня, начиная с 6 декабря 2014. Какие туры-экскурсии вы можете предложить? Может в составе вашей группы? Я еду одна. <br />\r\nP.S. Зашла на ваш сайт по рекомендации друзей, но не успеваю разобраться в нём (времени нет)<br />\r\nБуду признательна за ответ. ', NULL, NULL, NULL, NULL, NULL, '147.30.209.94', '147.30.209.94', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/38.0.2125.104 Safari/537.36', 'Kazakstan', 'Aktau', 'ejhor2odbp9f6ninkophe8knj2');
