INSERT INTO tour_testimonial VALUES(328, NULL, NULL, '2014-12-24', 'Zagorinsky', 'Helen', NULL, 'Polbrey1@gmail.com', '', 'We wanted to thank you and give our compliments on a great New York tour last week. My friend from Moscow and I had an excellent time and really appreciate you taking care of us.  Natasha, our tour guide, was the best. As your ad suggests my friend arrived as a tourist and left as a local with understanding of not just logistics and history but a feeling of who New Yorkers are, how the City works and insight as to how Sept. 11, 2001 felt as your - in the City at the time - New Yorker guide described the infamous day. Thanks for hiring such good people as Natasha and the driver who got us safely around town.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '67.80.29.131', 'ool-43501d83.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.3; WOW64; Trident/7.0; MAGWJS; rv:11.0) like Gecko', 'Russia', 'Moscow', '0ejj1q8mqaqbdfhjp5bh3pvr85');
