INSERT INTO tour_testimonial VALUES(330, NULL, NULL, '2015-01-09', 'Кондратьева', 'Ирина', NULL, 'irakondr@bk.ru', '84957072144', 'Спасибо большое за проведенную обзорную экскурсию по Нью-Йорку 2 января. Особая благодарность гиду Елене. Экскурсия очень понравилась, первое знакомство с городом не разочаровало. ', NULL, NULL, NULL, NULL, NULL, '46.39.37.170', '46.39.37.170', 'Mozilla/5.0 (Windows NT 6.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/39.0.2171.95 Safari/537.36', 'Russia', 'Москва', '7ojoebflr0evslecbcajhce043');
INSERT INTO tour_testimonial VALUES(331, NULL, NULL, '2015-01-22', 'Gibson', 'Vera', NULL, 'verag7777@gmail.com', '7184791107', 'I would like to thank New Tours, tour guide Ella and driver Sai for wonderful trip to New Orleans on 29 Dec, 2014. We had great time and saw a lot going through New Orleans, cities and towns nearby and on the way to New York. This trip will be one of the best experiences I ever had with your tour company. For the rest of the review I would like to say that hotels and meals were adequate, even better than I expected, maybe just worth to mention that La Quinta could be substituted for something nicer, this hotel was in need of serious repairs and overall improvements. Our tour guide Ella and driver Sai made our trip unforgettable, I will always remember New Year’s Eve party in French Quarter as I think the rest of the group will do too. All in all I would recommend this tour to anyone who is interested to learn about culture, traditions and nature of American South. Please recognize Ella and Sai as excellent tour guide and driver who can make a difference and who do their jobs professionally with smile.  ', NULL, NULL, NULL, NULL, NULL, '147.4.169.146', '147.4.169.146', 'Mozilla/5.0 (compatible; MSIE 10.0; Windows NT 6.1; WOW64; Trident/6.0)', 'USA', '', '9162kdt3vrvgvv93p8opd292i4');
