INSERT INTO tour_testimonial VALUES(333, NULL, NULL, '2015-02-02', 'Нарожный', 'Николай', NULL, 'nikolay.narozhny@ru.schindler.com', '89037907702', 'У меня тур на 10 дней с 07 марта 2015 года: "Четыре штата запада: Калифорния, Невада, Аризона, Юта" без перелета. Все оплачено.<br />\r\n Я понимаю, что документы вы высылаете перед поездкой, но мне очень важно знать:<br />\r\nгде в Сан Франциско территориально будет находиться наш отель, хотя бы приблизительно, в каком районе.Ведь, наверное, вы используете в основном одни и те же отели. Мне очень нужно. Заранее спасибо.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '195.65.184.230', '195.65.184.230', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)', 'Russia', 'Москва', 'arph3vlgk05q9ncur2mkc0a714');
