INSERT INTO tour_testimonial VALUES(337, NULL, NULL, '2015-03-20', 'Никитина', 'Наталья', NULL, 'pnarenda@mail.ru', '13476591759', 'Добрый день!На этой неделе вернулась из поездки по Калифорнии.Благодарю вас за хорошо разработанный маршрут,подобранные отели,все исключительно понравилось.Но особенно хочу поблагодаристь за отличного руководителя группы и гида Дмитрия,который замечательно провел всю нашу поездку,давал очень интересную  информацию обо всем,что мы встречали на своем пути,смог прекрасно по теме подобрать музыкальное сопровождение,соответствующее тому месту,по которому мы проезжали и той теме,которой был посвящен его рассказ.И как человек,и как профессионал своего дела,он покорил всех в нашей группе. Поэтому очень прошу вас официально от всей нашей группы передать Дмитрию нашу сердечную благодарность за прекрасно проведенное время,за полученное представление о прекрасном штате Калифорния.Спасибо большое за прекрасный  актиный и познавательный отдых.Наталья. ', NULL, NULL, NULL, NULL, NULL, '69.114.3.6', 'ool-45720306.dyn.optonline.net', 'Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 5.1; Trident/4.0; SIMBAR={C53BD458-78C3-4e53-8538-E1D5695C91E3}; .NET CLR 1.1.4322; .NET CLR 2.0.50727; InfoPath.1; IEMB3; OfficeLiveConnector.1.3; OfficeLivePatch.0.0; IEMB3)', 'USA', 'Нью-Йорк', 'njo5655h66qtn4mkkd9jog2r65');
INSERT INTO tour_testimonial VALUES(338, NULL, NULL, '2015-04-09', 'Исакова', 'Валентина петровна', NULL, 'bfas@yandex.ru', '+79163633514', 'Здравствуйте!<br />\r\nЯ и моя внучка (12 лет) хотели бы на 2-х дневную экскурсию на Ниагарский водопад. Планируем 24 июня.Вопросы: 1. Автобус большой? Есть ли кондиционер и туалет? Можно ли забронировать места во втором ряду от начала не со стороны водителя? Планируем отъезд от Brooklyn 6.15<br />\r\nБенсонхерст. Пересечение 85 Street и Bay Parkway, возле банка Chase.    <br />\r\nМожно ли отказаться от поездки, если автобус будет маленьким (нас укачивает)?.<br />\r\n2. Как называется гостиница? Сколько звёзд?<br />\r\n3. Если плыть на кораблике, нужно ли иметь одежду и обувь для смены мокрой одежды?<br />\r\nЗаранее благодарю,<br />\r\nВалентин Петровна.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '109.252.86.16', 'ppp109-252-86-16.pppoe.spdop.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:37.0) Gecko/20100101 Firefox/37.0', 'Russia', 'Москва', '1onjei280863mifvmbm6rmpag1');
INSERT INTO tour_testimonial VALUES(339, NULL, NULL, '2015-04-13', 'Розенштейн', 'Вадим', NULL, 'vadimrosenstein@hotmail.com', '718-996-6645', 'Только вчера вечером мы с семьёй вернулись из путешествия по Калифорнии. Нашим туристическим гидом был Анвар, к сожалению не знаю его фамилию. Очень хорошо продуман маршрут, организация тура. Но особенную благодарность мы бы хотели выразить Анвару. Пунктуальность, вежливость, продуманность своих действий, подача информации, ну и конечно, знание материала, способность ответить на любые вопоросы и забота о людях отражают высокий проффесиональный уровень этого человека. Блгодаря Анвару это путешествие было просто, без преывелечения, великолепным. Спасибо большое, New Tours, за организацию этого замечательного путешествия и осбенное, многократное спасибо Вам, Анвар, за то, что вы его осуществили.<br />\r\n<br />\r\nС уважением,<br />\r\nВадим Розенштейн.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '100.37.125.2', 'pool-100-37-125-2.nycmny.fios.verizon.net', 'Mozilla/5.0 (Windows NT 6.0; rv:36.0) Gecko/20100101 Firefox/36.0', 'USA', 'New York', 'h111ohli3ab27tscap1qs8t6c6');
INSERT INTO tour_testimonial VALUES(340, NULL, NULL, '2015-04-14', 'Михалева', 'Наталья', NULL, 'makeda09@yandex.ru', '+7-915-403-60-74', 'Сайт нравится.Аляска-на следующий год.А сейчас рассматриваю маршруты с Чикаго.Вопрос:можно ли маршрут"Атлантика США и Чикаго уменьшить до 8 дней вкл.+ночь в Нью-Йорке.Прошу ответить. спасибо.Наталья.', NULL, NULL, NULL, NULL, NULL, '109.188.86.36', 'client.yota.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/41.0.2272.118 Safari/537.36', 'Russia', 'Москва', 'v13utt45vf7rktbijhb589q004');
INSERT INTO tour_testimonial VALUES(341, NULL, NULL, '2015-04-24', 'Бойчук', 'Светлана', NULL, 'sveta.boichyk@gmail.com', '+380677503912', 'Уважаемые коллеги!<br />\r\nОбращаюсь к Вам с просьбой !<br />\r\nНаши VIP туристы в составе 10 чел. ( 5 хDBL)( фамилии прилагаються в файле ) едут с вами в экскурсиооный тур с 01.05-08.05 Нью Йорк-Ниагарский водопад-Вашингтон. По програме им в Нью Йорке заказан отель Clarion Hotel La Guardia Airport  - отзывы по отелю ужасные,кроме того очень плохое соединение траспортное, нет рядом ни метро ни автобусов. Туристы просят поменять им отель пусть на такую ж категорию, но гдето поближе к траспортной развязке. ЕНсли нет возможности поселить их вместе все 5 номеров в один отель, то возмоно и в близь стоящие отели. <br />\r\nОбращаюсь к Вам с огромной просьбой помочь, решить даный вопрос, так как туристы частои много ездят, очень хорошие люди и будут еще не раз пользоваться Вашими услугами, так как имеют визы и хотят неоднократно еще посетить США.<br />\r\nПрошу Вас посодействовать нам в решении даного вопроса и надеюсь на Ваш скорый ответ!!!<br />\r\nЗаранее Вам благодарна! с уважением исп. директор Пирамида - Тур , Бойчук Светлана.', NULL, NULL, NULL, NULL, NULL, '95.133.39.190', '190-39-133-95.pool.ukrtel.net', 'Mozilla/5.0 (Windows NT 5.1; rv:37.0) Gecko/20100101 Firefox/37.0', 'Ukraine', 'Львов', 'n9khc24ivapl30in2uisbshgr6');
INSERT INTO tour_testimonial VALUES(342, NULL, NULL, '2015-05-05', 'Щербинская', 'Мария', NULL, 'manusha515@mail.ru', '4135223560', 'Здравствуйте. Хочу поблагодарить гида Анвара, который сопроваждал нашу группу в поездке по 4-м штатам. Получилась очень интересная и насыщенная программа. Гид дал много информации не только по теме экскурсии, но и по общей истории сша, и другим интересующим группу вопросам. Анвар очень квалифицированный, терпеливый и ответственный гид. Выполнил все пожелания туристов, уделяя при этом внимание каждому. Вобщем, Анвар лучший, побольше бы таких гидов!', NULL, NULL, NULL, NULL, NULL, '24.218.217.178', 'c-24-218-217-178.hsd1.ma.comcast.net', 'Mozilla/5.0 (iPhone; CPU iPhone OS 7_1_2 like Mac OS X) AppleWebKit/537.51.2 (KHTML, like Gecko) Version/7.0 Mobile/11D257 Safari/9537.53', 'USA', '', 'r12jqs5ntd3gnpn330bnurjp32');
INSERT INTO tour_testimonial VALUES(343, NULL, NULL, '2015-05-06', 'Brailovsky', 'Anna', NULL, 'limonitta@gmail.com', '0505760885', 'Здравствуйте!<br />\r\nМы пара, заинтересованы в организованном туре "от океана до океана" на 15-18 дней. Нас интересуют даты начиная примерно с 22 июня до середины июля. Если есть возможность, пришлите пожалуйста перечень подходящих туров и укажите из какого города начинается тур, чтобы мы могли приобрести билеты на самолёт и запланировать трансфер.<br />\r\nЗаранее спасибо.<br />\r\nАнна, Олег.', NULL, NULL, NULL, NULL, NULL, '62.219.123.217', 'bzq-123-217.red.bezeqint.net', 'Mozilla/5.0 (Macintosh; U; PPC Mac OS X 10.4; en-US; rv:1.9.2.28) Gecko/20120306 Firefox/3.6.28', 'Israel', 'Hifa', '3u659ufm5r8u719rbmebq3gm27');
INSERT INTO tour_testimonial VALUES(344, NULL, NULL, '2015-05-29', 'Strener', 'regina', NULL, 'reginastrener@gmail.com', '4082181299', 'Can you send me list of recommended hotels in Brooklyn, New York.<br />\r\nThank you.<br />\r\nRegards, regina', NULL, NULL, NULL, NULL, NULL, '199.255.44.5', 'pat.hitachigst.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/43.0.2357.81 Safari/537.36', 'USA', 'San Jose', 'ac4qgr4n5569qs8o8tke5n2ud3');
INSERT INTO tour_testimonial VALUES(345, NULL, NULL, '2015-06-02', 'гриб', 'любовь ', NULL, 'Liubov.gryb@ mail.ru', '+380672569932', 'Добрый день У меня есть желание поехать в тур Четире Штата Америки Нюанс: у меня нет попутчицы Я оставила заявку в Киевского туроператора Инкомартур но они пока что никого для меня не подыскали Возможно Вы поможете разрешить этот вопрос С уважением   Жду ответа                           ', NULL, NULL, NULL, NULL, NULL, '37.115.177.243', '37-115-177-243-broadband.kyivstar.net', 'Opera/9.80 (Windows NT 6.1) Presto/2.12.388 Version/12.17', 'Ukraine', 'хмельницкий', '2vuvn42ak8f2ofv1m7mm4kl9h4');
INSERT INTO tour_testimonial VALUES(346, NULL, NULL, '2015-06-07', 'Pervina', 'Svetlana', NULL, 'Lana.Pervin@gmail.com', '215-764-9995', 'Hello. I recently went to New Orleans tour for 9 days. From May 3 to May 11. Very beautiful places, very good tour. Bus driver was very professional.<br />\r\nBut  tour guide her name was Ella was not good. She did not know many answers of questions  when people asked her. Her speech was blurred, even people corrected her. When she give as wrong information about places.', NULL, NULL, NULL, NULL, NULL, '71.224.24.135', 'c-71-224-24-135.hsd1.pa.comcast.net', 'Mozilla/5.0 (Windows NT 6.1; rv:38.0) Gecko/20100101 Firefox/38.0', 'USA', 'philadelphia', 'r1qp8084u9ttlih4getcb27j71');
INSERT INTO tour_testimonial VALUES(347, NULL, NULL, '2015-06-10', 'atajykov', 'sahet', NULL, 'sahet.atajykov@gmail.com', '99364145336', 'Дело в том что я не знаю по английский. И в тоже время самостоятельно хочу посетить Нью Йорк в сентябре. Я хочу поселиться в хостеле и гест хаусе возле вашего бюро, не подскажете пару адресов, и еще мне с аэропорта как добраться экономно и легко тот отел который вы подскажете. ', NULL, NULL, NULL, NULL, NULL, '217.174.226.96', '217.174.226.96', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/535.11 (KHTML, like Gecko) Chrome/17.0.963.47 Safari/535.11 MRCHROME', 'Other ..', 'ASHGABAT', 'pgf0vgmcu41oqi3u2kqot8kl64');
INSERT INTO tour_testimonial VALUES(348, NULL, NULL, '2015-06-15', 'Lauria', 'Oxana', NULL, 'ptlauria@comcast.net', '8606696234', 'Пожалуйста, сообщите точный адрес Chase Bank,  где начинается обзорная экскурсия по Нью-Йорку.Спасибо!', NULL, NULL, NULL, NULL, NULL, '73.142.233.230', 'c-73-142-233-230.hsd1.ct.comcast.net', 'Mozilla/5.0 (Windows NT 5.1; rv:38.0) Gecko/20100101 Firefox/38.0', 'USA', 'Clinton', 'u3vdap8a74jir5vdifok69q1n1');
INSERT INTO tour_testimonial VALUES(349, NULL, NULL, '2015-06-23', 'туркомпания', 'Елена', NULL, 'elena@dalinvest-tour.ru', '+79145421214', 'Добрый день<br />\r\nколлеги, у меня есть заявка (2 чел), которые хотят совершить поездку по след маршруту, прошу рассчитать стоимость и нужен совет по отелю в Майами 4-5* (пожелания 1 линия моря, близость к ресторанам, инфраструктура и если есть собств пляж...  предложите пожалуйста 2-3 отеля), так же у супруги будет день рождение и супруг хочет организвать мини-праздник (что можете посоветовать? для информации сколько стоит аренда яхты на 1 день, либо ужин в Мишленовском ресторане, в общем хотят красоты)<br />\r\n<br />\r\nмаршрут:<br />\r\n<br />\r\n10.09.2015 прилет в Нью Йорк и Ваша программа от Океана до океанта (маршрту1) отели 3* с внутренним перелетом<br />\r\n<br />\r\n27.09.2015 окончание тура + перелет в Майами (перелет самостоятельно)<br />\r\n<br />\r\n27.09 - 13.10.2015  Майами, отель 4-5*', NULL, NULL, NULL, NULL, NULL, '188.93.129.114', 'mail-server.dalgaso.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/43.0.2357.130 Safari/537.36', 'Russia', 'Хабаровск', 'v23r0cqclgncfgte22gdd83b16');
INSERT INTO tour_testimonial VALUES(350, NULL, NULL, '2015-07-01', 'Trubetskaya', 'Svetlana', NULL, 'svetat@rcn.com', '6178792644', 'Hello!<br />\r\nЯ пишу относительно тура 22 Июня.<br />\r\nМоя клиентка Мария Белкина купила 3 ех дневный тур - Канада Английская.<br />\r\nОна доплатила $90 долларов за single supplement , но места, в отеле где останавливалась<br />\r\nвся группа ей не хватило. Ее привели в соседний грязный мотель, где на reseption<br />\r\nбыли удивлены что она доплачивает такие деньги, так как в отеле были single rooms<br />\r\nкоторые в доплате не нуждались...<br />\r\nНа обратном пути эту группу пересадили в сломанный автобус и отдали их автобус <br />\r\nгруппе, которая ехала в Канаду.<br />\r\nВ результате они застряли посередине дороги и вернулись в New York<br />\r\nна несколько часов позже.<br />\r\nМоя клиентка, выразила обоснованное недовольство по поводу данного тура<br />\r\n( тем более что год назад она уже имела проблемы с New Tours Company , которые отменили<br />\r\nэкскурсию год назад в последний день и у нее пропал отпуск!<br />\r\nМария хочет получить обратно $90 за отель и credit for future travel за испытанные неудобства<br />\r\n<br />\r\nSincerelly, Svetlana Trubetskaya<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '207.172.209.188', '207-172-209-188.c3-0.bkl-ubr2.sbo-bkl.ma.static.cable.rcn.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', 'Boston', '27vs1r5qmtlb00jo0mnp0cu5j3');
INSERT INTO tour_testimonial VALUES(351, NULL, NULL, '2015-07-10', 'baranovskaya', 'anna', NULL, 'majami55@yahoo.com', '0663431624', 'Добрый день. брала у вас поездку в Вашингтон в начале июня. Организация, автобус все на высшем уровне.Единственный минус это гид, кажется его звали айдар или акбар, даже не запомнила, очень скучный, все читает с листочка монотонным усыпляющим голосом, на вопросы отвечает грубо или вообще не отвечает. делает сравнения американских президентов с лениным, что не приемлемо, и все время вставляет русскую историю при рассказе про Америку. Если я захочу услышать про россию то я поеду для этого в россию. Я очень много  путешествую но такого ужасного гида я встречаю в первые. а так все было хорошо. В экскурсии по нью йорку все было здорово, гид замечательный и интересный. Но был один минус когда мы проезжали чайна таун нам не показали что то интересное а привезли посмотреть на здание на котором стоит Ленин. это омерзительно если честно. Я была в россии и много про нее знаю, и когда я еду в другую страну то я хочу слушать про эту страну а не слушать и смотреть то что к данной стране не относится никак. а в общем большое спасибо за чудесные воспоминания от увиденного))))).', NULL, NULL, NULL, NULL, NULL, '92.60.182.237', 'Via-Kiev-gw.gorkogo172-sw.kv.wnet.ua', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/43.0.2357.132 Safari/537.36', 'Ukraine', 'kiev', '1js53lb0t7730i4ume404vias6');
INSERT INTO tour_testimonial VALUES(352, NULL, NULL, '2015-07-15', 'Татаренко', 'Виктор', NULL, 'tatarenkoviktor@gmail.com', '+7(904)6454464', 'Здравствуйте! Услугами Вашей фирмы я с женой пользовались в 2012 и 2013 годах. Хотим на конец июля или в начало августа купить в Вашей фирме 13-ти дневный тур на Флориду + круиз. И можно ли купить страховой полис через Вашу фирму или с Вашей подсказкой, как это сделать?<br />\r\nС уважением, <br />\r\nВиктор и Таисия.', NULL, NULL, NULL, NULL, NULL, '217.118.78.90', '217.118.78.90', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.152 YaBrowser/15.6.2311.4879 Safari/537.36', 'Russia', 'Санкт-Петербург', '8cid17antnp8n9dq2herq87801');
INSERT INTO tour_testimonial VALUES(353, NULL, NULL, '2015-07-28', 'Mathura', 'Ekaterina', NULL, 'ekaterina.mathura@gmail.com', '3474240578', 'Vernulis is poezdki s 25 po 26 July, s bolshim otravleniem posle buffet po doroge v NY. Ne vodite tuda turistov, cena ne sootvetsuet kachestvu. Nas bylo troe v poezdke i vse druzhno slegli v vosk s otravleniem, mne prishlos obratitsy v bolnicu i sdat analizy. ', NULL, NULL, NULL, NULL, NULL, '134.74.194.90', 'orchid.ccny.cuny.edu', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_7_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/44.0.2403.107 Safari/537.36', 'USA', 'New York', 'r3nvp4usfa1e9t5kh61lulvqm7');
INSERT INTO tour_testimonial VALUES(354, NULL, NULL, '2015-08-02', 'Polinsky', 'Natalie', NULL, 'nataliepol@gmail.com', '1', 'Hi,<br />\r\nI have two questions:<br />\r\n1. Is there any discount for booking more than one tour?<br />\r\n2. I reviewed English speaking tours as well, and although you have exactly the same tours, your price is double. Can you please explain the difference?<br />\r\n<br />\r\nThank you ahead,<br />\r\nNatalie<br />\r\n', NULL, NULL, NULL, NULL, NULL, '199.203.170.69', 'optimal-cel.ser.netvision.net.il', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/43.0.2357.134 Safari/537.36', 'Israel', '', '6luo3c34oqavd0u7psp6ols4i4');
INSERT INTO tour_testimonial VALUES(355, NULL, NULL, '2015-08-04', 'Baravaya', 'Alena ', NULL, 'alenkatut@gmail.com', '2152909105', 'It''s hard to figure out how to request a 1 day Washington tour from Philadelphia.<br />\r\nPlease give me a call or better yet write me an email with information. We wanted Friday Aug 21st, 7 people.<br />\r\nThank you', NULL, NULL, NULL, NULL, NULL, '72.37.244.100', '187ob.scansafe.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.1; WOW64; Trident/5.0)', 'USA', 'Philadelphia', '9ee27idlitikbp34ivnb78pc47');
INSERT INTO tour_testimonial VALUES(356, NULL, NULL, '2015-08-06', 'Хорошилова', 'Мария', NULL, 'horosilova@rambler.ru', '', 'Добрый день. Ездили с мужем от вашей фирмы по маршуту Калифорния- Невада-Аризона-Юта. Очень понравилась экскурсия, но главное это ЭКСКУРСОВОД! у нас после этого были еще экскурсии, Нью Йорк, Вашингтон, дегустация вин Сан Франциско, ужасного проведения.Экскурсоводы ничего не помнят о чем шла речь 5 мин. назад. Но я хочу сказать что вам очень повезло с экскурсоводом по имени Анвар, большой мастер своего дела. Мы ездили 10 дней Калифорния- Невада-Аризона-Юта с Анваром и водитель Хосе,супер, получили огромное удовольствие, все было на высшем уровне. Большое спасибо  Анвару и Хосе! Молодцы! Всем брать с них пример.  ', NULL, NULL, NULL, NULL, NULL, '95.65.29.73', '95-65-29-73.starnet.md', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/44.0.2403.125 Safari/537.36', 'USA', 'Кишинев', 'sbtt0lpr3m2sf7bbj2silho4o3');
INSERT INTO tour_testimonial VALUES(357, NULL, NULL, '2015-08-08', 'inc', 'incognito', NULL, 'elady71s@yahoo.com', '9173798879', 'mногие туристы имеют жалобы на нью турс нам не верилось, но когда мы сами стали свидетелями афтобусного INCIDENTA in Bus Tour, po Manхээттану 08/07/2015. что ваш шофёр Cергей и Guid Rита угражали туристам что они остановят афтобус и вызавут 911 и ваших туристов которые как и все заплатили деньги,oni выведут ix из афтобуса как преступников, очень интересно что оказываеться у нью турс есть право угражать туристам за свои жэ собственныее денги. <br />\r\n<br />\r\nто что ваш шофер а так же гид поездки отвечали на свои  телефонные звонки и разговаривали это было можно и не заметно.  <br />\r\n<br />\r\na drygim lyudyam nel''zya ni razgovarivat'' ni pol''zovatsya tyaletom, vash bizness mozhet poteryat ochen'' mnogo clientov, a esli toi zhenshine byidet ploxo ona posle operatsii na serdtse, to mne kazhetsya ona mozhet zasydit'' vashy companiyu,po samie mama ne goryui dai B-g chto bi nichego s etoi zhenshinoi ne slychilos''<br />\r\n<br />\r\nA tyristka iz Izrailya tak ona v obshee v shoke, ona mogla na Sergeya <br />\r\nI na Rity sama vizvat'' politsiui za to chto oni ei u ee dryzyam ygrozhali<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nYZHAS DO ZHILIS'' CHTO NI ZA CHTO NA TYRISTA MOGYT VIZVAT'' 911 CHTO BI VIVELI EGO S AVTOBYSSA, ETO NADO SROCHO OPYBLIKOVAT''. INTERESNAYA STATYA POLYCHETSYA ', NULL, NULL, NULL, NULL, NULL, '104.162.130.158', 'cpe-104-162-130-158.nyc.res.rr.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', 'New York', '626c4ugjv5h6ftq4uuki3rjf95');
INSERT INTO tour_testimonial VALUES(358, NULL, NULL, '2015-08-10', 'Берман', 'Эльвира', NULL, 'elvira.berman@yahoo.com', '', 'Вернувшись (9 августа 2015) из 5-и дневной экскурсии по Cape Cod, не могу не выразить благодарности нашему экскурсоводу Людмиле Томашевской. Она не только знающий и эрудированный экскурсовод, но и хороший организатор, прислушивающаяся к пожеланиям каждого из нас. <br />\r\nУ нас был также замечательный, безотказный водитель – Павел, который старался  удовлетворить наши просьбы о поездках на пляж или в город.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '142.255.110.222', 'cpe-142-255-110-222.nyc.res.rr.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', 'Бруклин', 'j4med2rmkbqt93hko35p8nr1k0');
INSERT INTO tour_testimonial VALUES(359, NULL, NULL, '2015-08-16', 'Grimchak', 'Tatyana', NULL, 'tatygr08@hotmail.com', '347 879 1978', 'Trip to Pittsburgh Aug.1-Aug.3 was wonderful. Thanks a lot to the talented and very experienced Nelya Shevchenko and bus driver Pavel. They are created a perfect and friendly atmosphere and showed that they both are real professionals. Trip was interesting , we learned a lot of new information, but it was not annoying or boring. Will highly recommend Nelya and Pavel to all future tourists. Hope that  Nelya and Pavel will read my review and know that their work is very much appreciated!', NULL, NULL, NULL, NULL, NULL, '69.114.164.192', 'ool-4572a4c0.dyn.optonline.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_9_3) AppleWebKit/537.75.14 (KHTML, like Gecko) Version/7.0.3 Safari/537.75.14', 'USA', '', '42rhhjnappvnmptf6bbclep354');
INSERT INTO tour_testimonial VALUES(360, NULL, NULL, '2015-08-17', 'SERGEY', 'GLADUN', NULL, 'gladuns@inbox.ru', '+380973369075', 'Хочу поговорить с менеджером тура КАЛИФОРНИЯ - НЕВАДА - АРИЗОНА - ЮТА - 10 дней Как и в какое время на Вас выйти по SKYPE или VIBER Спасибо', NULL, NULL, NULL, NULL, NULL, '176.36.20.131', 'host-176-36-20-131.la.net.ua', 'Mozilla/5.0 (Windows NT 6.1; rv:40.0) Gecko/20100101 Firefox/40.0', 'Ukraine', 'KIEV', 't09c4fi5c379kvfaib9r85llq4');
INSERT INTO tour_testimonial VALUES(361, NULL, NULL, '2015-08-25', 'Иванова', 'Ольга', NULL, 'ion2009@ukr.net', '+380674876987', 'Добрый день! <br />\r\nБуду с семьей в Нью Йорке 30 декабря. Есть ли у Вас туры из Нью Йорка продолжительностью до 10 дней с новогодней программой в самом Нью Йорке! Учитывая, что в США первый раз?!  Заранее спасибо за ответ! Ольга', NULL, NULL, NULL, NULL, NULL, '83.143.237.128', 'ip-237-128.css.od.ua', 'Mozilla/5.0 (iPad; CPU OS 8_0_2 like Mac OS X) AppleWebKit/600.1.4 (KHTML, like Gecko) Version/8.0 Mobile/12A405 Safari/600.1.4', 'Ukraine', '', 'q20dqd27l9850s9daracgibbj3');
