INSERT INTO tour_testimonial VALUES(363, NULL, NULL, '2015-09-08', 'Гаврилова', 'Юлия', NULL, 'fortuna1008@mail.ru', '+79119117771', 'Добрый день!<br />\r\nПодскажите, пожалуйста, есть ли уже информация о датах начала тура "Звезды Атлантики: от океана до океана" на 20 дней и его стоимость  на 2016 год. Интересует время начала тура с 20-х чисел апреля 2016 года. ', NULL, NULL, NULL, NULL, NULL, '91.212.146.20', '91.212.146.20', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'Russia', 'Санкт-Петербург', 'b8lvk43ur48f5k9mdfjbgtr096');
INSERT INTO tour_testimonial VALUES(364, NULL, NULL, '2015-09-10', 'Samoukova', 'Liudmila ', NULL, 'liudmila19@yandex.ru', '516-670-7332', 'Я – ваш регулярный клиент. В конце августа, наконец-то, удалось поучаствовать в 10 дневной поездке в Калифорнию, Неваду, Аризону, Юту. Поездка была замечательная, благодаря гиду Анвару, шофер Хосе- тоже был замечательный. Анвар – хорошо-организован, супер-пунктуален, дает много интересной информации – по существу, понимает людей, видно, что старается, следует программе и НЕ ХАЛТУРИТ, как, увы, делают многие другие гиды последнее время. <br />\r\nПредпоследняя 3 дневная поездка в Вирджинию с Майклом (Майком – 55-60 лет, полноватый, темноволосый) в конце весны-начале лета разочаровала: постоять одной ногой в Лексингтоне НЕ означает «знакомство с городом», бесконечные перерывы, долгие 60-90 минутные обеды, 40 мин.перерывы на кофе, выезд из гостиниц утром в 9 (!) и еще и часовые афтернун брейки (фиесты) - с 4 дня до 5 дня – с возвратом в гостиницу для отдыха. Где и когда такое было раньше?! День туда и день обратно – сплошные фильмы, никакой информации, остаётся один день – на пещеры. Вот тебе и «горная Вирджиния»! Так из-за того, что он так очевидно тянул время – еще больше все устали! Полное разочарование от поездки. А потом знакомые мне с восторгом рассказывали об из 4-х дневной поездке с Эмилем (молодым) в Вирджинию, а я-то тоже записывалась на 4 дня, но меня в последний момент поставили перед фактом, что будет только 3 дня и нет вариантов. Выброшенные деньги и время. <br />\r\nПоездка в Канаду на 6 дней в августе 2013 года с Борисом- тоже была прекрасной (из-за городов) и ужасной из-за гида Бориса (полноватый, лет 60).  Никакой информации по Канаде он нам не дал. Рассказывал что-то про королей, про Англию, очень скучно. День туда и посленый день – одни фильмы. Водил только в рестораны на 25 долларов и говорил, что дешевле мы ничего и нигде не найдем. Выезжали в 9 утра из гостиниц. Измучал всех какой-то бесконечной религиозной пургой и отсебячиной. В группе были и ортодоксы, и протестанты, и евреи, и другие верующие – просто невозможно было слушать это его «религиозное хамство и басни». В конце, я не дала ему типы, так как было, абсолютно,  не за что, так он ОТЧИТАЛ меня при всей группе! Надвинулся на меня как бандит всем своим , сорри, пузом, навис как зек какой-то и наорал, что я ему типов не положила! Он, разве, имеет право выбивать из людей тиры?! Это что за криминальные поборы такие?! <br />\r\nКороче, после таких разочарований все время хочется расстаться с New Tours, но Анвар и Калифорния стали прекрасным светлым лучом. Спасибо!!! Искренне и от всей души. Вот Анвар – это, реально, классный и профессиональный экскурсовод.<br />\r\nТакже спасибо за трансфер с Владимиром (туда и обратно) – замечательный водитель!!! <br />\r\nЕще понравилась гид Елена – в Бостон на 2 дня (октябрь 2014). Хотя был дождь, но она – молодец. Информированныя, деликатная, старается сделать всё – для людей... <br />\r\nГИДЫ – ЭТО ВАШЕ ВСЁ!!! Без преувеличения! В ту или иную стророну.    <br />\r\n', NULL, NULL, NULL, NULL, NULL, '12.190.183.2', '12.190.183.2', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', 'Brooklyn', 'fucsii3k09lisqijsb5aiq6qo1');
INSERT INTO tour_testimonial VALUES(365, NULL, NULL, '2015-09-10', 'Кучинская', 'Ана', NULL, '72gg72@gmail.com', '4165204959', 'Вы ошиблись с фотографией, у вас на сайте вида на Арку Моста Божественной Любви в Сент Луисе.<br />\r\nРекомендую поменять картинку. Две верхние - это Торонто.<br />\r\nНижняя - Сент Луис', NULL, NULL, NULL, NULL, NULL, '38.117.100.216', '38.117.100.216', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_8_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/44.0.2403.89 Safari/537.36', 'Canada', 'Thornhill', 'tn5vhlnmpjjct264e6tlgt7ku1');
