INSERT INTO tour_testimonial VALUES(367, NULL, NULL, '2015-09-28', 'Vashkevich', 'Pavel', NULL, 'addamm@mail.ru', '79261478750', 'Добрый день!<br />\r\nБыл в США в августе''2015.<br />\r\nВторой раз взял тур у вашей компании (первый тур брал в 2014 г.). В первый раз в прошлом году тур (поездка и рассказ гида) понравился, в этом году - крайне не доволен!!!!!<br />\r\nПоездка была в Бостон (2 дня).<br />\r\n<br />\r\nЧто не понравилось: началось все с того, что водитель не знал дороги и сказал "разберемся" (я сам слышал) и в итоге ехали намного дольше оговоренного времени; динамики в микроавтобусе работали плохо: то ничего не было слышно, то "свистел" микрофон; и гид (насколько я помню, Лена) ужасно про все рассказывала - большая половина рассказов было про ее знакомых и про то, как они тут или там были и что у них было в то или иное время; выходить и фотографировать давали тоже очень мало времени; достопримечательностей увидели мало; из рассказов тоже ничего не понятно, к сожалению. Постоянно в дороге и в бегах каких-то...<br />\r\n<br />\r\nПод конец поездки понял, что не только я не доволен, но и еще пару человек. Но за них я не могу что-либо говорить...<br />\r\n<br />\r\nПонравился только городок ведьм и музей там. Остальное оставило очень плохие впечатления от поездки с вашей компанией в этот раз.<br />\r\n<br />\r\nБольше никогда не буду обращаться к вам за турами и друзьям своим не только не буду советовать вас, но и ограждать от вас! ((<br />\r\n<br />\r\nВыброшенные $200 на ветер...<br />\r\n<br />\r\nПавел.', NULL, NULL, NULL, NULL, NULL, '95.28.72.89', '95-28-72-89.broadband.corbina.ru', 'Mozilla/5.0 (Windows NT 6.3; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/47.0.2516.0 Safari/537.36', 'Russia', 'Moscow', 'mjhcmu013mto48l7b9bmjunh96');
INSERT INTO tour_testimonial VALUES(368, NULL, NULL, '2015-09-30', 'Fartushynska', 'Halyna', NULL, 'elbrushalya@yahoo.com', '917742-5163', 'Very bad experience with this company. My mother Volodymyra Fartushynska, 14, made a deposit for a trip to the Niagara Falls on Saturday, September 26,2015. She was late by 3 min. The bus left at 6:00AM as it was confirmed by Nelya, seat 27. Complete miscommunication, no notice that bus was<br />\r\nleaving. The tour guide had no idea where my mom suppose to get on a bus, there was no phone number to call the bus crew members. She waited at the stop for 20 min, until people from the other bus came and told her that her bus is gone. So my mom missed the tour. Finally I started calling the New Tours office. The lady who called herself manager, told me that bus left at 6:17(lie). I also ask them the name and phone number of the company owner, but they refused to give it to me. Couple time they hang up phone on me. Then I got upset, as everybody would, and told them that I will write a bad review on them online, and the \\\\\\"lady-manager\\\\\\" accused me in threatening them. The main thing that bothers me is that my husband and me are taxy drivers, and if we new early that the bus was leaving, we would pick her up and catch the bus at later stops. Poor management, 0 stars for customer service. Never again with this company. <br />\r\n', NULL, NULL, NULL, NULL, NULL, '108.41.242.199', 'pool-108-41-242-199.nycmny.fios.verizon.net', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.135 Safari/537.36 Edge/12.10240', 'USA', '', 'ofc2vb6frdbje4lpin3dh39m06');
INSERT INTO tour_testimonial VALUES(369, NULL, NULL, '2015-09-30', 'Bendersky', 'Natalya', NULL, 'natalyabendersky@gmail.com', '8585040182', 'Проехали бы гораздо с большим удовольствием , если бы наш гид Светлана соответствовала бы своему предназначению хотя бы минимально !!! Вела себя агрессивно , а информацией либо не делилась либо вообще лучше так и не делилась бы - просто жаль то настроение - которое эта дама умудрилась испортить практически всем участникам нашей группы', NULL, NULL, NULL, NULL, NULL, '66.75.27.9', 'cpe-66-75-27-9.san.res.rr.com', 'Mozilla/5.0 (Windows NT 6.3; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', 'n Diego', 'l4pcs7fv564clp9luuddq72pm1');
INSERT INTO tour_testimonial VALUES(370, NULL, NULL, '2015-10-04', 'Gibson', 'Vera', NULL, 'verag7777@gmail.com', '7184791107', 'Hello dear New Tours, I would like to thank you for wonderful tour to Canada on September 16 (5 days), 2015. Special thanks to tour guide Michael and driver Sergey, they did everything to make this trip enjoyable. We liked all excursions in Montreal, Quebec, Thousand Islands and Niagara Falls, maybe we did not see a lot of Toronto (this could be reconsidered in future by your company, visiting mall is not such a good idea), hotel in Toronto (Radisson) in the middle of nowhere and not so great - need to be changed, old and dated). Hotel in Montreal (Travelodge) was the best, renovated to modern standards and in the center of the city, small rooms but perfect. Thanks again and see you in future tours!    ', NULL, NULL, NULL, NULL, NULL, '66.108.64.56', 'cpe-66-108-64-56.nyc.res.rr.com', 'Mozilla/5.0 (Windows NT 6.3; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', '', '8ovpujt862md0cqnic4m1fpn37');
INSERT INTO tour_testimonial VALUES(371, NULL, NULL, '2015-10-05', 'Bogdanova', 'Julia', NULL, 'offtourisme@gmail.com', '0487245811', 'Добрый день! Отправляли Вам запрос на почту про Новый год в США (Майами, Санта Барбара, Малибу) на прошлой неделе. Запрос так и не отвечен, Вы получили его?<br />\r\nHello! We sent you a letter of enquiry last week - New Year''s Holiday in USA (Maiami, Santa Barbara, Malibu). Still haven''t an answer. Did you get that letter?', NULL, NULL, NULL, NULL, NULL, '178.136.57.10', '178-136-57-10.od.vega-ua.net', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36', 'Ukraine', 'Odessa', '5mrlv0td8uv9aqkbd7eheav3q1');
