INSERT INTO tour_testimonial VALUES(373, NULL, NULL, '2015-10-16', 'perl', 'mikhail', NULL, 'misssa18@optimum.net', '3475200808', 'Мы ездили в Чикаго (6 дн. с 10.10.2015). Тур очень понравился. Великолепный  гид Борис и прекрасный водитель Сергей. Большое спасибо за отличное  путешествие.   Валентина и Михаил.', NULL, NULL, NULL, NULL, NULL, '67.82.243.3', 'ool-4352f303.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36', 'USA', 'Brooklyn', 'q6vt0mekd239394pk7ub6d19q1');
INSERT INTO tour_testimonial VALUES(374, NULL, NULL, '2015-10-19', 'Белкина', 'Лариса', NULL, 'larisa.belkina@gmail.com', '+79036630771', 'Добрый день.<br />\r\nХочу выразить благодарность гидам Борису за экскурсию в Вашингтон 07-08.10, Наталье за Нью-Йорк 09.10 и Ирине за Ниагарский водопад 12-13.10. Очень профессиональные гиды. <br />\r\nТакже хочу высказать замечания по-поводу размещения в отелях в г. Нью-Йорк. Не понятно, зачем размещать туристов в отеле "Best Western Queens Court Hotel". Отель находится в Китайском (или Корейском) квартале, где проблема просто поесть. Плюс туристов из него забирают на экскурсии самых первых и потом везут очень долго на Брайтон-Бич, чтобы забрать других туристов. Вечером в Квинс туристов привозят самых последних (около 22:30) и размещение занимает около часа! Почему сразу нельзя поселить туристов на Брайтон-Бич? Из-за этого сильно испорчено впечатление от тура.', NULL, NULL, NULL, NULL, NULL, '193.189.68.110', 'h1110.porttelecom.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:41.0) Gecko/20100101 Firefox/41.0', 'Russia', 'Москва', 'ggmddlm8uoo36471u03oojc2t1');
INSERT INTO tour_testimonial VALUES(375, NULL, NULL, '2015-10-23', 'Добыч', 'Татьяна', NULL, 'assistantesg@gmail.com', '+79039334840', 'Добрый день! мы будем в Калифорнии 10 ноября, хотелось бы посетить долину Напа с гидом. Нас интересует 6-ти часовой тур с посещением винных хозяйств. ', NULL, NULL, NULL, NULL, NULL, '217.28.221.156', '217.28.221.156', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/36.0.1985.125 Safari/537.36', 'Russia', 'Novosibirsk', '8tedsrv7npctr0phiv6i5hbev5');
INSERT INTO tour_testimonial VALUES(376, NULL, NULL, '2015-10-27', 'Karp', 'Nina', NULL, 'bufcr01@gmail.com', '972-50-6699740', 'По рекомендации наших друзей(они ездили в 2014 году с гидом по имени Борис) заказали тур на 5 дней в Канаду 16-21 сентября и 23-24 в Вашингтон. К сожалению в Канаде нам очень не повезло с гидом (Майкл). Рассказывал предельно мало и не интересно, вечно нервничал. В итоге был очень неприятный интендент со сбором чаевых. <br />\r\nУжасное впечатление о вашей организации исправил прекрассный экскурсовод по имени Амин. Мы с ним ездили в Вашингтон. Столько сколько ох рассказал по дороге, прежнему гиду(Майклу) и не снилось .<br />\r\nНе смотря на приезд папы Римского в Вашингтон , мы везде успели и даже больше. Никаких нервов , всё предельно корректно, вежливо и интересно .<br />\r\nПобольше бы таких гидов как Амин и не дай бог никому попасть на Майкла .... ', NULL, NULL, NULL, NULL, NULL, '79.176.123.17', 'bzq-79-176-123-17.red.bezeqint.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.80 Safari/537.36', 'Israel', '', 'rbudk0t1t291nnmbspjsjjn5m5');
INSERT INTO tour_testimonial VALUES(377, NULL, NULL, '2015-11-02', 'madrid', 'francisco madrid', NULL, 'FMADRID@VIAJESMEDIASILVER.COM', '0034667282375', 'Buenos dГ­as,<br />\r\n<br />\r\nSomos una agencia de viajes de EspaГ±a y tenemos un grupo de estudiantes interesados en ir x tres semanas a NY..para recibir clases de ingles.<br />\r\nTrabajan con agencias Вї? Tenemos algГєn descuento sobre el pvp?<br />\r\n<br />\r\nNecesitarГ­a saber que tipos de 1 dГ­a y de ВЅ dГ­a tienen disponibles su mejor precio, asi como otras actividades que se puedan hacer.<br />\r\n<br />\r\nQuedo a la espera de sus noticias.<br />\r\n<br />\r\nReciban un cordial saludo.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '79.157.219.42', '42.Red-79-157-219.dynamicIP.rima-tde.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.80 Safari/537.36', 'Other ..', 'GRANADA', 's7eef2jnf5qjfoqm32lni2s6e2');
INSERT INTO tour_testimonial VALUES(378, NULL, NULL, '2015-11-02', 'Филипова', 'Ирина', NULL, 'ms.filippovairina@mail.ru', '+79292439922', 'Здравствуйте! В декабре 2014 года ездила в тур по южным и северным штатам. Всё очень понравилось. Но больше всего понравилось на юге, в особенности как была организована поездка, экскурсионная программа. Я просто в восторге от экскурсовода Игоря Есина. В мае снова планирую поездку и хотелось бы попасть именно к нему. Спасибо Нью Турс!  ', NULL, NULL, NULL, NULL, NULL, '146.158.104.187', 'dhcp-187-104-158-146.metrosg.ru', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.0; Trident/5.0)', 'Russia', 'Санкт-Петербург', '9jdbp9ofbhp9te0h6kk7pds4k4');
INSERT INTO tour_testimonial VALUES(379, NULL, NULL, '2015-11-11', 'Белкина', 'Евгения', NULL, 'belka612@mail.ru', '+972546322014', 'Здравствуйте! Заказала через израильского агента ваш тур по Канаде на двоих 31.05.16.за 800долларов. До сих пор нет ответа от агента, принят ли вами заказ. По его словам, ждёт "ОК". Есть ли гарантия, что тур состоится? Приемлемо ли  повышение цены тура (на сайте - 770 долларов) при том, что мы присоединяемся к группе в Канаде, а не едем из США?', NULL, NULL, NULL, NULL, NULL, '5.29.192.146', '5.29.192.146', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; rv:11.0) like Gecko', 'Israel', 'Кирьят Ям', 'ev7ot5a6hvdulimmnampc0n3r4');
INSERT INTO tour_testimonial VALUES(380, NULL, NULL, '2015-11-17', 'Evseeva', 'larisa', NULL, 'evseeva_39@mail.ru', '9148307434', 'Здравствуйте,есть ли у вас предложения по посещению ретритов,школ медитаций,фестивалей ,випассаны или что-то в этом роде?', NULL, NULL, NULL, NULL, NULL, '108.14.238.216', 'pool-108-14-238-216.nycmny.fios.verizon.net', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.86 Safari/537.36', 'USA', 'White Plains', 'v1aa74rmslunsmc6q9euq3huj5');
INSERT INTO tour_testimonial VALUES(381, NULL, NULL, '2015-11-23', 'Дружинина', 'Татьяна', NULL, 'tat184@mail.ru', '8-911-955-20-43', 'Тур Атлантика и Солнечная Флорида: Нью-Йорк, Вашингтон, Орландо, Майями.  1-10.10.2015г.<br />\r\n<br />\r\nПо экскурсии в Вашингтон. Я оплатила тур полностью 20.05.2015г, т.е. за 4 месяца до его начала. Я предварительно, а именно еще 21 мая,  заказала себе место в автобусе на экскурсию  3-4 октября в Вашингтон - предпоследний ряд за гидом, место у прохода.  Мне по электронной почте указали место №47 (при большом автобусе).  Почему-то, на случай маленького автобуса номер места мне не сообщили. Обращаю ваше внимание, что при таком раннем бронировании я могла претендовать на первый ряд автобуса.<br />\r\nАвтобус в Вашингтон предоставили маленький. Гид в резкой форме заявил, что все, у кого места после 20 ряда, должны сесть на последний ряд автобуса.  На последнем ряду кресла не наклонялись и там было очень жарко. Впоследствии двум женщинам, сидящим там,  стало плохо. Вообще, это полное безобразие предоставлять такой маленький автобус для такой дальней поездки. Я сказала гиду, что бронировала места за 4 месяца до поездки и пересаживаться на последний ряд отказалась. И попросила его позвонить в Нью Турс для подтверждения. Но в ответ гид стал при мне громко обсуждать с кем-то два варианта решения вопроса: вызвать полицию или (дословно) выкинуть меня из автобуса и оставить на дороге. Надо сказать, что я много путешествую, проехала  35 стран мира и нигде, даже в самой нищей и отсталой стране, я не сталкивалась с такой наглостью и хамством. <br />\r\nПо Майами Бич. Если бы я заранее знала, где будет находиться отель, я бы не стала покупать этот тур. <br />\r\nРасскажите, пожалуйста, а что делать на курорте после 17.00, т.е. после захода солнца? Ездить каждый вечер в Авентуру и повышать объемы продаж торгового центра? Где можно вечером прогуляться? Может быть, гулять вдоль шоссе с машинами?<br />\r\nЯ, вообще, ехала в активное путешествие. И планировала посмотреть South Beach и  Майами? В итоге, мне пришлось ехать на целый день на South Beach и потратить 1 час времени тряски на автобусе туда и еще час времени обратно. Без возможности зайти в отель переодеться и отдохнуть. А в Майами поездка на автобусе заняла 2 часа времени. Это что - нормально спланированный тур?<br />\r\n<br />\r\nПо окончании путешествия я задумалась, зачем я вообще покупала этот тур. Купить 2 экскурсии я и так могла через вашу фирму. Забронировать отели, да еще в нормальном месте, я могла через Booking.com. Что я получила? Один трансфер в Майами? Это, конечно, никуда не годится. А экскурсия в Вашингтон, организованная еврейской диаспорой, это большое пятно для Нью Турса. Я планировала купить через вашу фирму еще несколько путешествий: Англия-Шотландия-Уэльс-Ирландия, Сорренто и Барии, Бавария. Ну, не знаю теперь. Мое предыдущее путешествие через Нью Турс    (Нью-Йорк, Ниагарский водопад, Лос-Анжелес, Сан-Диего, Лас-Вегас, каньоны, Сан-Франциско) оставило хорошее впечатление. А сейчас, прошел уже месяц, но я до сих пор испытываю неприятный осадок.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '78.140.205.178', 'mail.hotel-spb.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.86 Safari/537.36', 'Russia', 'Санкт-Петербург', 'gi2b46lcku6iv6o65njg3irkp1');
INSERT INTO tour_testimonial VALUES(382, NULL, NULL, '2015-12-01', 'Горошко', 'Тамара', NULL, 'ultraturplus@mail.ru', '00380504078247', 'Добрый день!<br />\r\nКак с Вами связаться?<br />\r\nЕсть ли у Вас Вайбер?', NULL, NULL, NULL, NULL, NULL, '193.178.228.64', 'goroshko-kz1.rs.net.ua', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:42.0) Gecko/20100101 Firefox/42.0', 'Ukraine', 'Сумы', '54enumrg3db14poohekrn01cv5');
INSERT INTO tour_testimonial VALUES(383, NULL, NULL, '2015-12-03', 'HatthewOr', 'HatthewOr', NULL, 'viklamas@yandex.com', '123456', 'cialis and alcohol side effects total members<br />\r\n http://pharmshop-online.com - generic cialis  cialis funny<br />\r\n generic cialis - order generic cialis online usa<br />\r\n cialis doses i forgot my password<br />\r\n', NULL, NULL, NULL, NULL, NULL, '5.164.196.52', '5x164x196x52.dynamic.nn.ertelecom.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/45.0.2454.101 Safari/537.36', '', 'Havana', 'e10tig214h6r504celnsj5tdl7');
INSERT INTO tour_testimonial VALUES(384, NULL, NULL, '2015-12-23', 'Gitelman', 'Oleg', NULL, '1muramu0@gmail.com', '61 414445056', 'We are return travelers from Australia and interesting in ЧИКАГО И ВЕЛИКИЕ ОЗЕРА tour starts on 30 Aug 16.<br />\r\nWhat is the payment rules?<br />\r\nMay we pay some deposit, when the rest by cash on arrival.<br />\r\nThank you. Oleg<br />\r\n', NULL, NULL, NULL, NULL, NULL, '220.233.94.142', '142.94.233.220.static.exetel.com.au', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:39.0) Gecko/20100101 Firefox/39.0', 'Other ..', 'Sydney', 'hgsrt04q5h7s41uscq2h7e97i4');
INSERT INTO tour_testimonial VALUES(385, NULL, NULL, '2016-01-02', 'Kolomiiets', 'Iryna', NULL, '0506708434@mail.ru', '+380506708434', 'Добрый день!!! <br />\r\nВсех сотрудников фирмы \\"NewTours\\" поздравляем с Новым 2016-м годом!!!!!<br />\r\n<br />\r\nНесколько слов по туру: Мы путешествовали от Вашей фирмы по программе \\"От Океана до Океана\\" с 15.10.2015г. по 01.11.2015г. <br />\r\nСам тур нам очень понравился, т.к. был очень увлекательным, познавательным и интересным. <br />\r\nВсе гиды по туру были очень эрудированными профессионалами своего дела. Конечно много информации мы получили и от самих эмигрантов, которые путешествовали с нами в группе, 18 дней. <br />\r\nХотелось бы, что бы Вы учли и некоторые наши замечания: <br />\r\n1) Ничего на память не осталось от самой фирмы. Надо придумать хотя-бы какие-то сувениры, косметички, магниты с логотипом Вашей фирмы и вручать их хотя-бы тем туристам, которые взяли путёвки на длительные туры. <br />\r\n2) Поздравлять туристов с их днём рождения, если этот день совпал во время путешествия. У нас на Украине все турфирмы дарят своим туристам что-то на память ( CD диск или открытку, ручку или брелок) и поздравляют с днём рождения. Эти мелочи хорошо запоминаются. А у Вас каждый день давай чаевые, а с Вашей стороны ничего туристам даже на память не остаётся. <br />\r\n3) Очень важное замечание! Во время нашего тура в дороге мы дважды смотрели один и тот же древний фильм 1906года.<br />\r\nА ведь сколько интересных передач и познавательных можно было показать об Америке.<br />\r\nПроехали всю Калифорнию и так не хватало во время путешествия красивой мелодии \\"Калифорния\\" . Сколько красивой музыки и латиноамериканской мелодии существует и мы ни разу это не услышали. Было скучно ехать длительное время без музыки. Звучала только красивая мелодия во время поездки в Вашингтон, я даже поблагодарила гида, Леонида за муз. дополнение.<br />\r\n4) Жаль было потерянного дня, когда в Лас-Вегасе с утра обломался автобус и мы целый день просидели под отелем в пром зоне. А потом всю ночь ехали в следующий город. Страшно было за водителя, так как он фактически с утра занимался ремонтом автобуса, а потом всю ночь ехал. Это было вне правил и так поступать нельзя. <br />\r\n<br />\r\nМы надеемся , что Вы наши пожелания учтёте. А в целом мы получили много позитива, положительных эмоций и каждый день вспоминаем это путешествие и рассказываем всем своим друзьям и родственникам. У нас на Украине на одном из каналов по ТВ, часто показывают передачу \\"Орёл и Решка\\" и как раз сейчас показывают путешествия по США, и нам очень приятно смотреть и вспоминать те места где мы побывали. А вчера с большим интересом смотрели по ТВ передачу о встрече Нового года в Нью-Йорке на Тайм-Сквер. Немного позавидовали тем людям, которые там были. В самом Нью-Йорке мы провели сравнительно мало времени и хотелось бы ещё раз приехать туда. А ещё хотелось бы посетить Филадельфию, Чикаго, Майями. Может быть мы ещё раз совершим путешествие через Вашу фирму, т.к. у нас открыты визы на 10лет. <br />\r\nМы посетили много стран , но Америка оставила самое яркое впечатление и воспоминания, особенно этот тур \\"От Океана до Океана\\". <br />\r\n<br />\r\nС уважением, туристы из Украины.  <br />\r\n', NULL, NULL, NULL, NULL, NULL, '46.133.187.107', '46-133-187-107.dialup.umc.net.ua', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/47.0.2526.106 Safari/537.36', 'Ukraine', 'Kharkov', 'uc47p6fvdu9j6gbu8iebaabmi4');
INSERT INTO tour_testimonial VALUES(386, NULL, NULL, '2016-01-06', 'Петухова', 'Людмила', NULL, 'Lpetuhova@mail.ru', '', '28.12.15 г. ездила  в Ващингтон.Экскурсия хорошо организована, продумана.Отдельное спасибо Эмилю.Умение привлечь и удерживать внимание и интерес к повествованию , грамотная речь ,  внутренняя культура и прекрасное владение профессиональной информацией доставили нашей группе большое удовольствие . ', NULL, NULL, NULL, NULL, NULL, '46.39.53.14', '46.39.53.14', 'Mozilla/5.0 (Windows NT 5.1; rv:42.0) Gecko/20100101 Firefox/42.0', 'Russia', 'Москва', 'r0am7dm9ojc7e5m0n03i2f1gq5');
INSERT INTO tour_testimonial VALUES(387, NULL, NULL, '2016-01-08', 'Рогачев', 'Василий', NULL, 'enashimo@gmail.com', '+79882475115', 'Здравствуйте! Очень хочется поделиться приятными впечатлениями о фирме New Tours (NT)! Лучше поздно, чем никогда!<br />\r\nНа NT вышли самостоятельно в апреле 2015. Тур на 12 дней покупали с большой осторожностью (для нас фирма NT не была знакома), оплатили 0,5 суммы – остальное при встрече с гидом.<br />\r\nВсе детали тура и сопровождение до встречи с гидом согласовывали с Liliya Gelfand (спасибо ей за внимание). Посещали Америку с NT в сентябре 2015, по маршруту Чикаго - Нью Йорк – Вашингтон - Ниагарские водопады - Нью Йорк. NT забронировал для нас с женой отель в центре Чикаго (Hyatt Loop). Конечно волновались что нас ждет (первый раз с этой турфирмой, + на другом конце Земли). И вот первая встреча: в микроавтобусе небольшая компания (видимо сказался кризис) из России, ближнего (с ней) и дальнего зарубежья. Водитель Сергей (контактный и бесконфликтный человек) и Гид (да именно с большой буквы, потому что он самый лучший!) Борис фамилия (боюсь ошибиться) Волкин! Не знаю где он учился мастерству общения, но все туристы слушали и слушались его как дети воспитателя. Борис понравился нашей семье как очень грамотный, общительный, исключительно эрудированный, ценящий свою работу и туристов человек!<br />\r\nБыли приятно удивлены дополнительными бесплатными, не входящими в тур, экскурсиями! В Чикаго провели три дня, с выездом в Мэдисон и Милуоки, с посещением "безумного" хранилища разнообразных (от зубочистки, до настоящего паровоза) вещей "House on the Rock" и, конечно же, посещение Willis Tower, Бахайского храма и катание на речном трамвайчике с выходом в озеро Мичиган. <br />\r\nЗатем был переезд в Нью Йорк с посещением города Детройт и музея Форда (впечатляющий музей). По прибытию в Нью Йорк к сожалению пришлось расстаться с нашей дружной группой и великолепным Гидом Борисом.<br />\r\nВ остальных экскурсиях по туру так же были грамотные, хорошо выполняющие свою работу экскурсоводы: Валерий - обзорная по Нью Йорку. Эмин (отдельный плюс) - поездка в Вашингтон с посещением Мемориалов и Кеннеди Центра, Арлингтонского мемориального кладбища, посещение Музеев Аэронавтики и Космонавтики, Национальной картинной галереи и многого другого. Рита – поездка к Ниагарскому водопаду. Благодаря этим гидам мы узнали много нового (и не только по программе тура), открыли для себя Америку)). Хотя посещали эту страну не в первый раз.<br />\r\nПо туру были представлены достойные отели, гиды предлагали проверенные места питания (кто не хотел со всеми, выбирали пункты питания по своему предпочтению). Тур был очень насыщенный и познавательный, дни были заняты от утра до ночи и по возвращению в отель мы были полны информацией и впечатлениями!<br />\r\nБольшое спасибо от нашей семьи за грамотно составленный и организованный тур, прекрасных гидов и великолепно проведенное время!<br />\r\nНа семейном совете мы решили продолжить "сотрудничество" с New Tours (в планах запад и юг Америки, Мексика). Особенно это может ускорить предложенный от New Tours дисконт!', NULL, NULL, NULL, NULL, NULL, '95.153.135.246', '95x153x135x246.kubangsm.ru', 'Mozilla/5.0 (Windows NT 10.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2486.0 Safari/537.36 Edge/13.10586', 'Russia', 'Краснодар', '6u99rrb760v49rah00oga5fn43');
INSERT INTO tour_testimonial VALUES(388, NULL, NULL, '2016-01-14', 'фарберов', 'марк', NULL, 'mrf4655@GMAIL.COM', '0546684033', 'Здравствуйте<br />\r\nЯ хотел знать или есть у вас туры на языке иврит<br />\r\nСпасибо', NULL, NULL, NULL, NULL, NULL, '176.228.83.190', '176-228-83-190.orange.net.il', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/47.0.2526.106 Safari/537.36', 'Israel', '', 'prepnohna04rvhd44hpq5e84o0');
