INSERT INTO tour_testimonial VALUES(390, NULL, NULL, '2016-01-19', 'Монахов', 'Сергей', NULL, 'monahovavera@gmail.com', '89166348388', 'Аляска Круиз и Тур по земле Аляски - 13 дней включает в себя посещение Ванкувера. Но у нас есть только американская виза.Необходимо получать канадскую визу?? или можно обойтись только американской.', NULL, NULL, NULL, NULL, NULL, '109.252.26.3', 'ppp109-252-26-3.pppoe.spdop.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/47.0.2526.111 Safari/537.36', 'Russia', 'Москва', 'q1dqfnvgfq4mle4q190n6u07n4');
INSERT INTO tour_testimonial VALUES(391, NULL, NULL, '2016-02-13', 'Kapitulsky', 'Leonid', NULL, 'lkapitulsky@yahoo.com', '972524755809', 'Добрый день. Я с женой планируем тур из серии -звезды атлантики. Хотим посетить  тур АТЛАНТИКА США и КАНАДА, 12 дней. Нас устраивает дата начало тура  с 11  октября 2016. <br />\r\nНас интересуют следующие вопросы<br />\r\n1) Эта дата гарантирована или нет. Ведь нам нужно заказывать полет.<br />\r\n2) Правильно ли я понимаю что мы можем прибыть в Нью Йорк 11.10.16 и взять обратный вылет на 22.10.16.<br />\r\n3) Есть ли возможность заказать трансфер аэропорт-гостиница и обратно. Стоимость этого трансфера.<br />\r\n4) Известна ли  в какую гостиницу в Нью Йорке мы прибываем в первый день из аэропорта.<br />\r\nЗаранее благодарю Вас за ответ.', NULL, NULL, NULL, NULL, NULL, '79.181.110.64', 'bzq-79-181-110-64.red.bezeqint.net', 'Mozilla/5.0 (Windows NT 10.0; Trident/7.0; rv:11.0) like Gecko', 'Israel', 'migdal haemek', 'bplkrprvrc9ok40qb6sukptjr0');
INSERT INTO tour_testimonial VALUES(392, NULL, NULL, '2016-02-15', 'zhozefivcoe', 'zhozefivcoe', NULL, 'grabishcheva.zhozefina@mail.ru', '123456', 'Здравствуйте! <br />\r\n <br />\r\nЕсть юридические вопросы в России? <br />\r\nПредставим Ваши интересы в судах и государственных органах РФ. <br />\r\nВзыскание долгов, интеллектуальное право, семейное право, оформление недвижимости и наследства, сопровождение инвестиционных проектов, проверка контрагентов и ещё боле 150 юридических услуг. <br />\r\nТОП-3 среди юридических фирм России, репутация и огромный опыт. <br />\r\nОставьте свой вопрос здесь:  http://янштейн.рф/', NULL, NULL, NULL, NULL, NULL, '91.79.3.35', 'ppp91-79-3-35.pppoe.mtu-net.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/37.0.2062.124 YaBrowser/14.10.2062.12521 Safari/537.36', '', 'MOSCOW', '4a6ilaqvdj1gccq3oiohkolsp6');
INSERT INTO tour_testimonial VALUES(393, NULL, NULL, '2016-02-25', 'Зильберблюм', 'Ефим', NULL, 'ial15@012.net.il', '972-542579521', 'Путешествовали в Вашингтон.С Анваром и Александром.Все было на высшем уровне.Единственное замечание,завтрак в гостинице.Для такого отеля это не прилично.Спасибо.Мы пользуемся Вашими услугами 16 лет.', NULL, NULL, NULL, NULL, NULL, '46.120.199.34', '46-120-199-34.static.012.net.il', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.116 Safari/537.36', 'Israel', 'Нетания', 'mvv0q7grba05bcaqsjehluhr03');
INSERT INTO tour_testimonial VALUES(394, NULL, NULL, '2016-02-26', 'maeshiro', ' kenri', NULL, 'mobile_eigyou-2@unext.jp', '0368633302', 'Hello, I hope this email finds you well. I am Kenri Maeshiro from U-NEXT. I am in charge of infrastructure projects and video streaming services in Japan.<br />\r\n<br />\r\nWe are contacting you to propose our Prepaid SIM for foreign residents and visitors. Our prepaid SIM has the best sales performance in Japan.<br />\r\n<br />\r\nPlease refer to the following the proposal our advantage, and introduction of our company.<br />\r\n<br />\r\n-Proposal (Increasing visitors and delaying internet services for visitors.)<br />\r\n<br />\r\nFrom January through September in 2015, more than 8million people visited Japan from China, Taiwan, and Hong Kong. The number of visitors hits record-high and estimated visitors will be increasing until 2020 for the Tokyo Olympics.<br />\r\nOn the other hand, the insufficient availability of the public internet for the visitors is effecting their complaints.<br />\r\n<br />\r\nWould it be possible for you to sell our Prepaid SIM for customers to address the needs?<br />\r\n<br />\r\n-Our advantage. (There is no alternate benefit!)<br />\r\n <br />\r\nWe have four great benefits. <br />\r\n<br />\r\n1. The wholesale price is cheaper than others. Therefore, it will generate substantial profit for retailers.<br />\r\n2. It is easy to setup, and easy to use.<br />\r\n3. Customize your own packages. <br />\r\n4. Available 24 hours 365 days a year customer service in English and other languages.<br />\r\n<br />\r\nFor more information, please see the following the help page or contact us!<br />\r\n<br />\r\n<br />\r\nU-NEXT Prepaid SIM website<br />\r\nhttp://umobile.jp/d/lp/prepaid/eng.html<br />\r\nOn the website, it has only 15 day and 30 day plans. Now we have 7day plans as well. <br />\r\n <br />\r\n-Company profile<br />\r\n<br />\r\n-Main business activities: Content Platform business<br />\r\n- Video streaming service “U-NEXT” Project planning and development, system management, and marketing. <br />\r\n-Marketing of Optic fiber internet, LTE network, and ISP etc.<br />\r\n-Establish: February 3rd, 2009.<br />\r\n-Number of employees: 338 As of December 31st, 2015.<br />\r\n-Sales:  1,776,340,000yen<br />\r\n-Stock: Tokyo Stock Exchange Mothers<br />\r\n-Website:  http://unext.co.jp/<br />\r\n<br />\r\nThank you for considering. We look forward to your response!<br />\r\n', NULL, NULL, NULL, NULL, NULL, '124.141.122.157', '124-141-122-157.rev.home.ne.jp', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.116 Safari/537.36', '&#12381;&#12398;&#20182;..', 'Shibuya-ku', '7brklrjvl1s5qdb0u36s1pjfj7');
INSERT INTO tour_testimonial VALUES(395, NULL, NULL, '2016-03-04', 'Zhuravleva ', 'Svetlana ', NULL, 'Svetik.jyra@gmail.com', '2404495413', 'Очень понравилось путешествовать именно с вашей  компанией,т.к.есть и не очень приятный опыт с другими русскими агентствами.Уважительное отношение в офисе,все что озвучили девочки, выполнили на сто процентов мы ездили  на Ниагару,в Вашингтон,Нью-Йорк, но больше всего понравилась экскурсия в Бостон.У нас была гид Елена Медведовская,самые тёплые слова благодарности ей.Профессионал высокого класса,она так показала нам город,что мы влюбились в него.Доброжелательное отношение к каждому, красивая манера изложения, глубокие знания предмета( я по образованию историк) ,мы остались оч. довольны и благодарны и Елене ,и нашему водителю Исаю, они подарили нам два дня праздника.', NULL, NULL, NULL, NULL, NULL, '24.146.182.190', 'ool-1892b6be.dyn.optonline.net', 'Mozilla/5.0 (iPad; CPU OS 9_2_1 like Mac OS X) AppleWebKit/601.1 (KHTML, like Gecko) CriOS/48.0.2564.104 Mobile/13D15 Safari/601.1.46', 'USA', 'Rockville ', 'g1f87qhopveogt6qf5q161s1m6');
