INSERT INTO tour_testimonial VALUES(398, NULL, NULL, '2016-03-28', 'Балтобаев', 'Асангул', NULL, 'asangul@mail.ru', '+996543120050', 'Предлагаю Вам еще одно перспективное направаление для богатых любителей автопутешествий и экстрима -"Золотое Сафари". Бюджет 30-100т.дол. или наличие:внедорожник с жилым прицепом,мультикоптер и металлоискатель. Срок экспедиции 1-2 мес..Регион высокогорный Кыргызстан.Результат масса впечатлений,"джек пот"(100-150)т.дол.и фонтан адреналина! С уважением Асангул.', NULL, NULL, NULL, NULL, NULL, '212.112.126.176', '212-112-126-176.aknet.kg', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.87 Safari/537.36', 'Other ..', 'Бишкек', 'nd5d4rfsi0mq0pha69180vafr2');
INSERT INTO tour_testimonial VALUES(399, NULL, NULL, '2016-03-30', 'Grinshtein', 'Julia', NULL, 'scanica@scanica.ca', '416-302-4707', 'Skaz''ite poz''alyista a do skolki obzornii tyr po New Yorky. Vo skolko mi moz''em bit the latest v Manhattone?', NULL, NULL, NULL, NULL, NULL, '99.238.176.188', 'CPE788df7b45631-CM788df7b45630.cpe.net.cable.rogers.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.87 Safari/537.36', 'Canada', 'Toronto', '3cctsdn349ujahhr2jb2m8krf6');
INSERT INTO tour_testimonial VALUES(400, NULL, NULL, '2016-04-06', 'Dmytriiev', 'Mykhailo', NULL, 'dmytriievmv@yahoo.com', '+380673215716', 'Наш тур проходил с 25.03 по 03.04.2016 (Нью Йорк, Вашингтон, Бостон, Ниагара).<br />\r\nХотим поблагодарить Вас за организацию экскурсий. Особая признательность Волкину Борису за интересные и содержательные рассказы, веселые конкурсы во время тура в Вашингтон.<br />\r\nОднако, были отдельные моменты, которые омрачали радость от путешествия:<br />\r\n- Ниагарский парк на ремонте до лета, о чем никто не предупредил. Ехать 10 часов в один конец и наткнуться на стройку весьма обидно;<br />\r\n- у нашего гида в Бостон Анвара было плохое настроение и он старательно нам его передавал. По дороге читал с литочка неинтересную, ненужную и не запоминающуюся информацию. На вопросы отвечать отказывался. Мы потом молились чтобы нам его не поставили на другие экскурсии.<br />\r\nОднако в целом впечатления хорошие. Многие наши друзья планируют впервые ехать в США и консультируются с нами стоит ли брать тур. Будем рекомендовать Вашу фирму.', NULL, NULL, NULL, NULL, NULL, '77.91.145.116', '77-91-145-116.client.telesystems.ua', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2486.0 Safari/537.36 Edge/13.10586', 'Ukraine', 'Kiev', 'mms0pat0ammctceecgo692s7u6');
INSERT INTO tour_testimonial VALUES(401, NULL, NULL, '2016-04-12', 'Лазарев', 'Борис', NULL, 'boglaz@gmail.com', '0545458321', '11-12 апреля я и моя супруга участвовали в экскурсии "Вашингтон" под руководством гида Бориса Волкина.<br />\r\nЭкскурсия произвела очень сильное впечатление во всех отношениях: четкая организация тура, отличное обслуживание<br />\r\nводителя,комфортные условия в гостинице - и, конечно, в первую очередь -великолепная работа гида.<br />\r\nЕго эрудиция, знание мельчайших деталей американской истории, уверенное владение аудиторией<br />\r\nпонравились всем экскурсантам. Спасибо Борису !<br />\r\n', NULL, NULL, NULL, NULL, NULL, '74.68.59.247', 'cpe-74-68-59-247.nj.res.rr.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:45.0) Gecko/20100101 Firefox/45.0', 'Israel', 'Хайфа', 'dvk4pr3up0cslma8m6rq5burj7');
INSERT INTO tour_testimonial VALUES(402, NULL, NULL, '2016-04-23', 'Yoffe', 'Victor', NULL, 'victor.yoffe@gmail.com', '972542587766', 'Have problem with connection in Zambia. Kindly send voucher for Goldenberg family on my mail<br />\r\nVictor', NULL, NULL, NULL, NULL, NULL, '197.220.19.177', 'host-197-220-19-177.iconnect.zm', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'Israel', 'Port Elizabeth', 'k2k327o40166vot9p15ockd7p0');
INSERT INTO tour_testimonial VALUES(403, NULL, NULL, '2016-04-29', 'нечитайло', 'зинаида', NULL, 'ne.zinayida@gmail.com', '0000', 'очень понравилось.экскурсовод дока.водитель профи.группа отличная.забыла в автобусе эл.книгу нашли позвонили и т.д.благодарна за помощь. есть несколько дней хочу с вами сделать экскурсию по Нью-Йорку. огромное спасибо.', NULL, NULL, NULL, NULL, NULL, '207.38.136.249', '207-38-136-249.c3-0.avec-ubr2.nyr-avec.ny.cable.rcn.com', 'Mozilla/5.0 (Windows NT 6.3) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'Germany', 'бохум', 'v8j93uhoeoot2kbhm3ua57phv3');
INSERT INTO tour_testimonial VALUES(404, NULL, NULL, '2016-05-04', 'Еремина', 'Ольга', NULL, 'foxik81@bk.ru', '+79221143006', 'Добрый день, у меня вопрос по поводу тура в диснейленд. Хотелось бы приобрести тур для двоих взрослых и двух детей 13 лет, с выездом в начале августа.Нужна информация по выезду на 7 дней:<br />\r\n1.в какие дни августа выезд,<br />\r\n2.какие варианты гостиниц вы предлагаете(интересует 3-4 звезды с завтраками, также интересуют гостиницы на территории диснейленда), <br />\r\n3.нужно посещение парков:Magic Kingdom, Disney''s Animal Kingdom Theme Park, Disney''s Typhoon Lagoon Water Park, Disney''s Hollywood Studios.<br />\r\n4.цена тура актуальна? в одном месте указано 399 + перелет+трансфер, в другом - 489+перелет+трансфер. <br />\r\n5.Сколько выйдет трансфер? указано что в 4 и 5 день трансфер шаттл, а в 1,2,3 и 6 день что? такси?<br />\r\n6. номер должен быть либо двухкомнатный на четверых, либо 2 номера на двоих, так как это разные семьи.<br />\r\n7. есть ли экскурсия по Орландо (за отдельную плату в свободный день)', NULL, NULL, NULL, NULL, NULL, '94.31.215.21', '21.215-31-94.telenet.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:45.0) Gecko/20100101 Firefox/45.0', 'Russia', 'Екатеринбург', '3un0u19t6ur4509sqd1c1fcua7');
INSERT INTO tour_testimonial VALUES(405, NULL, NULL, '2016-05-06', 'Пешнина', 'Ирина', NULL, 'irina.peshnina@i.ua', '050-311-77-52', 'Добрый день! Меня зовут Ирина.Хочу с подругой осенью 2016 года путешествовать по США(тур Калифорния,Невада..10дней.)+ Майями(2 ночи)Как можно связаться с Натальей Шеремет? Мы Планировали вылет с Киева в Лос-Анджелес)Жду ответа.', NULL, NULL, NULL, NULL, NULL, '93.72.204.97', 'clean.shielder.volia.net', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/50.0.2661.94 Safari/537.36', 'Ukraine', 'Киев', 'tjplq9a72b0rasva8g2dfeu3m2');
INSERT INTO tour_testimonial VALUES(406, NULL, NULL, '2016-05-10', 'РЕШЕТИЛОВ', 'ИГОРЬ', NULL, 'BYRITTO13@GMAIL.COM', '0380957111270', 'В АПРЕЛЕ 2016Г С 15 ПО 25 ПУРИШЕСТВОВАЛИ С НЬЮ ТУРС ПО КАЛИФОРНИИ.ТУР ИЗУМИТЕЛЬНЫЙ, выстроен хорошо, информации много,гид подготовлен на 100%.Мы с супругой остались крайне довольны,спасибо.Особое спасибо гиду Анвару,он внес в тур то звено,которое не у всх операторов,мы раньше,получали.Имеется ввиду глубина знания темы,общая коммуникация с коллективом,готовность сразу и неприменно,помочь в любом вопросе.Улыбка и сдержанная реакция на различный юмор-многого стоит.Кто попадает в тур с Аваром-Вам повезло!Денег на такие туры не жалко,но дорого.Ложка дегтя по прилету домой-утерянный чемодан авиакомпанией,но это уже другая итория.Удачи Нью Турс и дальше.', NULL, NULL, NULL, NULL, NULL, '130.180.211.29', '130.180.211.29', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.0; Trident/5.0)', 'Ukraine', 'КИЕВ', 'l1ikk7vnchspm74srhtgmi95m7');
INSERT INTO tour_testimonial VALUES(407, NULL, NULL, '2016-05-11', 'КАРИМОВ', 'СИЯВУШ', NULL, '0557000000@mail.ru', '+994555903311', 'привет пожалуста помогите мне,у меня ест виза США и КАНАДЕ,я хочу океан до океане туру покупат,США и КАНАДЕ <br />\r\nЯ В МЕЦЯЦ ИЮНЕ ИЛИ  ИЮЛЕ ЛИБОЕ ВРЕМЯ МОГУ УЛЕТАТ,ВЫ МНЕ ПРЕДЛАГАЙТЕ ПЕРВЫЕ США ИЛИ КАНАДЕ УЛЕТАТ,Я ОТ ВАС ЖДУ ОТВЕТЫ.<br />\r\nХОРОШИЕ ГРУППАВОЙ ТУРУ ПРЕДЛАГАЙТЕ МНЕ Я СРАЗУ ОТ ВАС КУПЛЮ,<br />\r\nКСТАТЕ Я В НОЯБРЯ БЫЛ НЮУ ЮОРКЕ И У NEWTOURS SКУПИЛА 3 ТУРУ МНЕ ОЧЕН ПОНРАВИЛСА NEWTOURS<br />\r\n', NULL, NULL, NULL, NULL, NULL, '5.44.39.109', '5.44.39.109', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/50.0.2661.94 Safari/537.36', 'Other ..', 'Баку', 'l7uriqe5cf9lllmnhdm0cpqla6');
INSERT INTO tour_testimonial VALUES(408, NULL, NULL, '2016-05-12', 'Паршина', 'Галина', NULL, 'galpar@inbox.ru', '+79165223072', 'Здравствуйте! Хочу выразить свою благодарность за прекрасно организованный шестидневный тур в Чикаго ( с 26.04.16 по 1.05.16). Были в туре в составе группы с очень квалифицированным и обаятельным гидом Борисом Волкиным.  Не смотря на длительные переезды, тур проходил насыщенно, увлекательно и весело. Наш гид, просто кладезь информации, сумел создать теплую и дружескую атмосферу в группе, поэтому путешествие прошло очень здорово. Тур оказался насыщенным по программе, с посещением замечательных музеев, красивых городов. Особенно поразил Чикаго, была замечательная пешеходная прогулка по городу с увлекательным рассказом гида, и очень милая экскурсия на кораблике по водным артериям города. <br />\r\nСпасибо вашей компании за прекрасно организованные туры, успехов и процветания.', NULL, NULL, NULL, NULL, NULL, '195.19.33.234', 'h234.net33.bmstu.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'Russia', 'Москва', 'en34rvquvtgjpkidonrvkc64g1');
INSERT INTO tour_testimonial VALUES(409, NULL, NULL, '2016-05-12', 'Сазонова', 'Ольга', NULL, 'olgiv174@mail.ru', '+79127761310', 'Здравствуйте!<br />\r\nВернулись из поездки по 4 штатам (Калифорния-Юта-Невада-Аризона). Дата поездки 09.04.16-18.04.16.<br />\r\nОчень понравилось! Привезли домой массу впечатлений! Особую благодарность хочется выразить Шеремет Наталье за высокий профессионализм, внимание и отзывчивость! <br />\r\nС уважением, Ольга и Юрий Сазоновы. ', NULL, NULL, NULL, NULL, NULL, '77.222.98.190', 'pool-77-222-98-190.is74.ru', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2486.0 Safari/537.36 Edge/13.10586', 'Russia', 'Челябинск', 'pu8hik636lkh9cc4ut7jktkd77');
INSERT INTO tour_testimonial VALUES(410, NULL, NULL, '2016-05-16', 'Rozman', 'Anna', NULL, 'annarozman1@gmail.com', '718-916-3062', 'Мы купили 2х дневную поездку на Ниагарский водопад на 11 Мая, 2016.  Хочу начать с того, что в автобусе, на котором мы ехали, не работал туалет. Может он и работал, но он был закрыт, и мы боялись выпить глоток воды, не зная, когда сможем добраться до туалета. Мы ждали 4 часа, до того, как смогли выйти из автобуса и найти туалет (на не запланированной стоянке) Чему наш гид был очень недоволен и попенял нам, что мы задержали автобус на 24 минуты. Китайский буфет, в который нас привезли, предложил нам ужасную еду за достаточно высокую цену $15. Мы не возражали бы заплатить эти деньги, если бы эта еда того стоила.  Для тех, кто хочет ехать с New Tours - подумайте несколько раз.  Мы, во всяком случае, больше никогда с этой компанией не поедем. ', NULL, NULL, NULL, NULL, NULL, '140.251.216.196', 'pc077374.med.cornell.edu', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', 'New York', '8h1hnbouh4uc6jsikdci8l3qe1');
INSERT INTO tour_testimonial VALUES(411, NULL, NULL, '2016-05-23', 'GuestSoacy', 'GuestSoacy', NULL, 'samburton202@aol.co.uk', '123456', 'guest test post <br />\r\nbbcode <br />\r\nhtml <br />\r\nhttp://google.tn/ simple', NULL, NULL, NULL, NULL, NULL, '46.161.9.14', '46.161.9.14', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/48.0.2564.82 Safari/537.36 OPR/35.0.2066.37', '', 'Salonta', 'ntt9jv5kkeptqar0vlo696dps2');
INSERT INTO tour_testimonial VALUES(412, NULL, NULL, '2016-05-24', 'Андрианова', 'Мария', NULL, 'mar22spb@yandex.ru', '+79219475690', 'Добрый день. Опять хочу поехать в тур от вашей компании. Пока меня интересует тур Бостон-КейпКод 7 дней с 28 июля. Один вопрос: Смогу я вернутся  в NY с этого тура на 1 день раньше, то есть 02 августа и может ваша компания помочь в этом организовав обратный трансфер? С Ув. Мария.', NULL, NULL, NULL, NULL, NULL, '109.195.86.173', '109x195x86x173.static-business.spb.ertelecom.ru', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/50.0.2661.102 Safari/537.36', 'Russia', 'Санкт-Петербург', '3rjjajd5a7t9k6ib83bj987au0');
INSERT INTO tour_testimonial VALUES(413, NULL, NULL, '2016-05-24', 'Vinokurova', 'Margarita Vinokurova', NULL, 'margarita_vinokurova1@yahoo.com', '6504380225', 'Здравствуйте, я только что вернулась из Нью Йорка.  Очень довольна вашими турами, их было пять:<br />\r\nпервый тур был в Питсбург, с Нелли, c 6 по 9 мая, и несмотря на то, что дорога очень длинная, но Нелли так интересно рассказывала про историю Америки, про города, про Амишей, про культуру, что путь прошел незаметно.<br />\r\nВторой тур был в Вашингтон, со Львом. Тоже очень знающий экскурсовод. Только одно мне показалось странным - мы на кладбище провели полтора часа. Мне кажется, что для такой короткой поездки, полтора часа на кладбище слишком долго. <br />\r\nИ в Бостон была очень хорошая поездка.<br />\r\nНо лучше всего была шестидневная поездка "Лучшее в Канаде". Очень насыщенная программа, прекрасный гид Майкл, знающий и мудрый человек. Никаких конфликтов не было в поездке, несмотря на то, что ситуации спорные возникали и он решал их мастерски. <br />\r\nХорошая поездка была по Нью Иорку с Наташей. И водитель был большой молодец (кажется его звали Алекс), легко проезжал по тесному Нью Йорку и доставлял нас во все туристические места без промедления.<br />\r\nСпасибо большое Аде, которая помогала мне с покупкой туров. Она всегда была внимательна к моим интересам и оповещала об изменениях заранее, и дала мне в пару прекрасных людей, с которыми мы жили душа в душу.<br />\r\nОсобенное спасибо за то, что 6 дневный тур в Канаду не отменили, а вместо этого компановали группы тех, кто ехал на 6 дней, на 4 дня по Канаде, и тех, кто ехал на 2 дня в Ниагару.<br />\r\nВсем большое спасибо за прекрасно проведенный отпуск!<br />\r\nС уважением,<br />\r\nРита из Сан Франциско.', NULL, NULL, NULL, NULL, NULL, '148.87.19.194', 'inet-hqmc01-o.oracle.com', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/50.0.2661.102 Safari/537.36', 'USA', 'San Bruno', 'i32obu389vvl4t3lh1s0hsd184');
INSERT INTO tour_testimonial VALUES(414, NULL, NULL, '2016-05-28', '---', 'Руслан', NULL, 'alfakzn@mail.ru', '---', 'Путешествовал туром Нью-Йорк - Лос-Анджелес - Национальные парки - Лас-Вегас (апрель 2016) - 10 дней. <br />\r\nОчень интересный, познавательный и разнообразный тур. Всем советую. Гидом был Анвар. Работу выполнил на 100%. На все возникающие вопросы были даны полные ответы. Кроме того, его интересный рассказ про США позволил узнать эту страну глубже.<br />\r\nСкорее всего, съезжу в США еще раз. Благо, визу дали на 3 года. Выберу другой интересный тур, а смотреть там есть что. Мне советовали съездить на Аляску.<br />\r\nВсем рекомендую съездить США. Хотя бы один раз в жизни там стоит побывать.  ', NULL, NULL, NULL, NULL, NULL, '217.198.10.101', '217.198.10.101', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'Russia', '', 'p5t4rg243simcm6a6ku2gv6rd2');
INSERT INTO tour_testimonial VALUES(415, NULL, NULL, '2016-05-30', 'Боголюбова', 'Лариса', NULL, 'evgrafovnal@ukr.net', '+380503539571', 'Я и Алла Короткова (тоже из Киева) хотим выразить огромную благодарность нашему гиду АНВАРУ, который в апреле сопровождал нас по туру "Калифорния-Невада-Аризона-Юта". Его доброжелательное отношение ко всем категориям туристов, внимание, забота, опека, помощь во всех возникающих трудностях, терпение, юмор и, наконец, неутомимость просто восхищают! А уж профессиональные знания о Штатах, истории, всех достопримечательностях тура и, лавное, - умение доходчиво и грамотно рассказать о них достойны всяческих похвал. Мы считаем, что АНВАР заслуживает высшего балла в рейтинге гидов Америки', NULL, NULL, NULL, NULL, NULL, '95.133.113.254', '254-113-133-95.pool.ukrtel.net', 'Mozilla/5.0 (Windows NT 5.1; rv:46.0) Gecko/20100101 Firefox/46.0', 'Ukraine', 'Киев', 'rb01f9gns6fkii6a2tm3b8hs66');
