INSERT INTO tour_testimonial VALUES(417, NULL, NULL, '2016-06-04', 'Mordvintseva', 'Tatyana', NULL, 'mina19501950@yahoo.com', '718 435-1477 ', 'Дорогой Нью-турс,спасибо Вам за пятидневный маршрут по Канаде от меня и друзей, которых я приобрела во время этого замечательного путешествия с совершенно изумительными гидами и водителями. Имена гидов:Ворис Волкин и Александр Герман. Имена Водителей: Исайя и Слава. Отныне путешествовать по вашим маршрутам нам хотелось бы только с ними.', NULL, NULL, NULL, NULL, NULL, '68.194.250.61', 'ool-44c2fa3d.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 10.0; WOW64; rv:46.0) Gecko/20100101 Firefox/46.0', 'USA', '', '87m1c0tup00cb7jsv1481jf0o7');
INSERT INTO tour_testimonial VALUES(418, NULL, NULL, '2016-06-06', 'Shur', 'Israel', NULL, 'israel.zinash@gmail.com', '+972 532121307', 'Участвовал в туре по четырем западным штатам 06.05.2016-15.05.2016. Тур был очень интересным, насыщенным и прекрасно организованным. Гид Анвар заслуживает самой высокой оценки. Большое спасибо NEW TOURS и Наталье Шеремет за прекрасный тур и обслуживание.', NULL, NULL, NULL, NULL, NULL, '5.29.156.84', '5.29.156.84', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/50.0.2661.102 Safari/537.36', 'Israel', '', 'ihp0nns5624mmkfd7dskr92df1');
INSERT INTO tour_testimonial VALUES(419, NULL, NULL, '2016-06-10', 'Dolgopat', 'Evgeny', NULL, 'dolgopyat@gmail.com', '+972526762081', 'Хочу поблагодарить вас за прекрасно проведенный тур 18 мая в Вашингтон. Гид Лев и водитель Слава настоящие профессионалы. Все было безупречно. Обязательно посоветую вашу компанию в своём блоге. Спасибо!!!', NULL, NULL, NULL, NULL, NULL, '192.115.248.2', '192.115.248.2', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/43.0.2357.134 Safari/537.36', 'Israel', 'Rehovot', 'mqg36dn69qeo4grs65ql41o2a3');
INSERT INTO tour_testimonial VALUES(420, NULL, NULL, '2016-06-11', 'Gavrilova', 'Yulia', NULL, 'fortuna1008@mail.ru', '79119117777', 'ОГРОМНАЯ БЛАГОДАРНОСТЬ гиду Светлане за интересное и запоминающееся путешествие по Западному побережью!!! Светлана, спасибо за интереснейшую информацию и  замечательное владение различными темами поездки! Светлана настоящий профессионал в своем деле и человек с прекрасным чувством юмора!!! Светлана, удачи Вам!!!!    ', NULL, NULL, NULL, NULL, NULL, '178.71.2.207', 'ip.178-71-2-207.avangarddsl.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'Russia', 'saint-Petersburg', 'r320toesufam2tvl9lsg7fk2n2');
INSERT INTO tour_testimonial VALUES(421, NULL, NULL, '2016-06-11', 'Gavrilova', 'Yulia', NULL, 'fortuna1008@mail.ru', '79119117777', 'Очень жаль тех туристов кому предстоит жить в Нью Йорке в отеле "La Quinta Inn Queens". В отеле КЛОПЫ!!!!! Это отвратительно!!!! Если вы хотите сделать селфи с клопами - то приезжайте в этот отель.  Ужасно! If you want to make a selfie with bedbugs you need come to this hotel. Disgusting hotel with BEDBUGS!!!! Awful! В отеле отвратительные завтраки! Если есть возможность бронируйте другой отель!!!!', NULL, NULL, NULL, NULL, NULL, '178.71.2.207', 'ip.178-71-2-207.avangarddsl.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'USA', 'saint-Petersburg', 'hno6v64vva91da6q8uo8k4hk03');
INSERT INTO tour_testimonial VALUES(422, NULL, NULL, '2016-06-11', 'Gavrilova', 'Yulia', NULL, 'fortuna1008@mail.ru', '79119117777', 'Если есть возможность уточняйте кто будет вашим гидов. Например, поездка в Вашингтон с Анваром  - это потерянное время и деньги!!!! Отсутствие профессиональных навыков экскурсовода поражает. Если бы этот человек назывался "сопровождающим туристической группы" - это было бы логично, т.к. на профессиональное звание гида Анвар абсолютно не тянет. Неинтересное, заунывное преподнесение информации, заключающееся в зачитывании информации из Википедии!!! Весь автобус мило спал, т.к. слушать это было невозможно, неинтересно и скучно!!!    ', NULL, NULL, NULL, NULL, NULL, '178.71.2.207', 'ip.178-71-2-207.avangarddsl.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'USA', 'saint-Petersburg', 'fhmhg1g3ncqjq7ihse0l5ddfn1');
INSERT INTO tour_testimonial VALUES(423, NULL, NULL, '2016-06-11', 'Gavrilova', 'Yulia', NULL, 'fortuna1008@mail.ru', '79119117777', 'Огромное спасибо гиду Эмилю за удивительно интересную поездку в Новую Англию (Бостон)!!!! Эмиль настоящий знаток своего дела и ПРЕКРАСНЫЙ экскурсовод!!!! Хорошо, чтобы было побольше таких профессионалов в сфере туризма!!! ', NULL, NULL, NULL, NULL, NULL, '178.71.2.207', 'ip.178-71-2-207.avangarddsl.ru', 'Mozilla/5.0 (Windows NT 5.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/49.0.2623.112 Safari/537.36', 'USA', 'saint-Petersburg', '1pn7u954ihcisb20m19gplj1v1');
INSERT INTO tour_testimonial VALUES(424, NULL, NULL, '2016-06-12', 'Surgutskis', 'Nikolajus', NULL, 'nikolajus.vln@gmail.com', '+37069814149', 'Хотим выразить огромную благодарность гиду Михаилу, проводившему экскурсию «НЬЮ-ЙОРК. ПОЛНАЯ ОБЗОРНАЯ ЭКСКУРСИЯ С ЛАНЧЕМ» 24-го мая, за крайне профессиональную программу. Михаил абсолютно компетентен во всех вопросах, вежлив и корректен. Большое спасибо! Порекомендуем вашу компанию всем друзьям и знакомым. С уважением, Жанна, Николай, г. Вильнюс', NULL, NULL, NULL, NULL, NULL, '84.240.35.79', 'lan-84-240-35-79.vln.skynet.lt', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:46.0) Gecko/20100101 Firefox/46.0', 'Other ..', 'Vilnius', 'mjjvfiedlh301lprhp3t408ip0');
INSERT INTO tour_testimonial VALUES(425, NULL, NULL, '2016-06-19', 'Shtabnoy', 'Vladimir', NULL, 'vladsht@comcast.net', '(908)428-7235', 'Compliment! - we just got back from tour to Yellowstone from June 11 to June 18. Very interesting and well organized tour, very good guide - Dmitry. Everything what we saw was beyond our expectations.', NULL, NULL, NULL, NULL, NULL, '98.221.145.189', 'c-98-221-145-189.hsd1.nj.comcast.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', 'Hillsborough', '89c0f7l3kc3qdkeid43qcf6sg2');
INSERT INTO tour_testimonial VALUES(426, NULL, NULL, '2016-06-23', 'Косенко', 'Инна', NULL, 'nataly-sun@inbox.ru', '+79612795178', 'В апреле с вашей фирмой ездила в Бостон. Это было замечательное путешествие! Очень понравился гид Елена: занимательные истории,  интересные факты, доброжелательная обстановка. Это прекрасно, что человек любит свою работу и делает её с удовольствием.  Очень довольны, что воспользовались услугами вашей фирмы.<br />\r\nБыло бы чудесно, если бы имелась возможность выбирать гида для поездки. ', NULL, NULL, NULL, NULL, NULL, '47.16.64.55', 'ool-2f104037.dyn.optonline.net', 'Mozilla/5.0 (Linux; Android 5.0; SAMSUNG SM-G900H Build/LRX21T) AppleWebKit/537.36 (KHTML, like Gecko) SamsungBrowser/4.0 Chrome/44.0.2403.133 Mobile Safari/537.36', 'Russia', 'Москва', 'p6crg0bm709flq0p1bstukgke7');
INSERT INTO tour_testimonial VALUES(427, NULL, NULL, '2016-06-23', 'Олейникова', 'Ольга', NULL, 'olga.oleinikova@yahoo.com', '5108466014', 'Спасибо за вашу работу. Вы сделали все, чтобы неделя - всего неделя- в Н.Й. стала для нас незабываемой по впечатлениям и очень легкой в организации. Еще до приезда в Н.Й. меня приятно удивило внимание ваших сотрудников. Отдельное спасибо Олесе, с помощью которой решились все трудные проблемы. Конечно, восхитительной была экскурсия на Ниагарский водопад. И китайский ресторан, который почемы-то так ругали в отзывах, оказался приспособлен к любому желудку. Но особо хочется сказать об экскурсоводе Эмиле. Такой высокий профессионализм, такие разносторонние знания, такая забота о подопечных не часто встречаются в наше время. Если можно, передайте ему, что мы послушались его совета и не выкинули накидки с водопада. Они нас спасли в страшную грозу в день отъезда. Вспоминаем его часто и по разным поводам и только добрыми словами. Спасибо вашему агенству.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '73.202.10.160', 'c-73-202-10-160.hsd1.ca.comcast.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.103 Safari/537.36', 'USA', 'Аламеда', 'cf82nuenfv6nm0f16jafc85994');
INSERT INTO tour_testimonial VALUES(428, NULL, NULL, '2016-07-07', 'Mordvintseva', 'Tatyana', NULL, 'mina19501950@yahoo.com', '718 435-1477', 'НДень независимости Америки мы всретили в штате Мэйн с Вашим туром и Вашим гидом Анваром, нашим земляком и прекрасным организатором, рассказчиком и другом. Ему и Азизу мы очень благодарны.Мечтаем поехать с Анваром в Вермонт.', NULL, NULL, NULL, NULL, NULL, '68.194.250.61', 'ool-44c2fa3d.dyn.optonline.net', 'Mozilla/5.0 (Windows NT 10.0; WOW64; rv:47.0) Gecko/20100101 Firefox/47.0', 'USA', 'Brooklyn', '7eabvj5rnm5s3lr0rln8ilu917');
INSERT INTO tour_testimonial VALUES(429, NULL, NULL, '2016-07-09', 'Kelly', 'Glen and Valentina', NULL, 'valentinankelly@verizon.net', '7034075047', 'Our tour to Cape Cod was very enjoyable and enriching.  Nellie, our guide, was very knowledgeable and professional and the driver, Pasha, was an excellent driver, very punctual, helpful to the tourists, and kept the vehicle very clean and pleasant music playing while driving.   The hotel was located central to everything you want to see in Cape Cod, and it was affordable,clean and well managed, with 2 swimming pools.  In general, I don''t think we could have gotten so much out every facet of Cape Cod with any other company than New Tours.  The excursions were well planned and executed.  We will recommend this company to our friends and plan to book more tours in the future. We do wish the website was in English, as well, so that''s why we gave it a "9". ', NULL, NULL, NULL, NULL, NULL, '72.66.90.122', 'pool-72-66-90-122.washdc.fios.verizon.net', 'Mozilla/5.0 (Windows NT 10.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.103 Safari/537.36', 'USA', 'Arlington', '6l8kgf0d91u8mv3q0anqbjm4o1');
