INSERT INTO tour_testimonial VALUES(436, NULL, NULL, '2016-08-16', 'капитульский', 'леонид', NULL, 'lkapitulsky@yahoo.com', '972524755809', 'Добрый день. Нас 2 семьи ( Капитульский и Блувштейн) Мы заказали и оплатила тур 12 дней- звезды Атлантики с 23.08.16. Осталось 6 дней до прибытия с США. До сих пор у нас нет никакой информации о туре и гостиницах проживания. Нам было обещано ,что мы получим информацию за 7-10 дней до тура. На последнее мое письмо ( два дня назад) ответа не получил.<br />\r\n<br />\r\nЯ прошу выслать нам документацию по туру заранее. Это очень важно для нас для заказа и планирования дальнейшего нашего путешествия. Надеюсь на Ваше понимание.<br />\r\n<br />\r\nСпасибо .<br />\r\n<br />\r\nНе подумайте что мы нудные. ', NULL, NULL, NULL, NULL, NULL, '79.177.24.37', 'bzq-79-177-24-37.red.bezeqint.net', 'Mozilla/5.0 (Windows NT 10.0; Trident/7.0; rv:11.0) like Gecko', 'Israel', 'мигдаль емек', 'j3foa6frp0dq2rkphfqflhafh2');
INSERT INTO tour_testimonial VALUES(437, NULL, NULL, '2016-09-18', 'Gur', 'Zeev', NULL, 'gur.zeev@yahoo.com', '+972-4-8741942', 'Tour: Chicago and Great Lakes on 08/30/2016 with Boris Volkin, 6 days.<br />\r\nI would like to express my sincere gratitude and many thanks to the guide Boris Volkin for his very professional and very interesting conduction of the tour as well as for his kind attentiveness to the special needs of the members of his group. His extensive knowledge of the subject and his excellent guidance of the tour contributed a lot to the tour’s success.<br />\r\nP.S. Please do not send any advertisement on my e-mail address. Thank you.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '46.121.73.124', '46-121-73-124.static.012.net.il', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; rv:11.0) like Gecko', 'Israel', '', 'i0mvs5q1j0djv41tlf75sdg4n5');
