INSERT INTO tour_testimonial VALUES(449, NULL, NULL, '2016-11-22', 'Jerschow', 'Elina', NULL, 'ejerschow@yahoo.com', '917.362.5291', 'Hi,<br />\r\n<br />\r\nI would like to select a trip to Florida for my parents, ideally in January or February, if possible to Key West.<br />\r\nCould you please help with some options for this?<br />\r\nThank you,<br />\r\nElina', NULL, NULL, NULL, NULL, NULL, '74.108.56.13', 'pool-74-108-56-13.nycmny.fios.verizon.net', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/602.2.14 (KHTML, like Gecko) Version/10.0.1 Safari/602.2.14', 'USA', 'New Yrok', 'qvf0j4rmumgqp0ukrbegrb3be1');
INSERT INTO tour_testimonial VALUES(450, NULL, NULL, '2016-11-23', 'Dreyfus', 'Boris', NULL, 'borisdreyfus@gmail.com', '7819291979', 'Это что,путешествие в прошлое???<br />\r\n<br />\r\n5 день –28 февраля 2017 г.,– вторник<br />\r\nРанним утром выезд в аэропорт. Регистрация и вылет в Камбоджу в Сием-Реапа (55 минут полета). По<br />\r\nприбытию мы отправляемся в Ват-Ангкор и Байон (экскурсия около 3,5 часов). По завершению тура мы<br />\r\nпобываем на туристическом рынке, где можно будет приобрести сувениры на память о посещении Камбоджи.<br />\r\nЗатем переезд в отель. Размещение в отеле. Свободное время. Отдых.<br />\r\n6 день – 01 февраля 2017 г.,– среда<br />\r\nУтром вылет в Бангкок (полет около 1 часа). Затем перелет местными авиалиниями на остров Пукет (время в<br />\r\nпути 1,5 часа). По прилету, трансфер в отель-резорт (около 1 часа). Во второй половине дня размещение в<br />\r\nотеле-резорте. Отдых. Свободное время. Купания в океане.<br />\r\n7 день – 02 февраля 2017 г.,– четверг<br />\r\nДень отдыха на берегу моря. Вечером поездка в Мыанг-Пукет. Прогулка по городу. Шоппинг центры. Время<br />\r\nна ужин. Возвращение в отель. Вторая ночь в резорт-оте', NULL, NULL, NULL, NULL, NULL, '98.229.221.200', 'c-98-229-221-200.hsd1.ma.comcast.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/54.0.2840.99 Safari/537.36', 'USA', 'Salem', '81retdcqafegol9tc6hnk7db80');
INSERT INTO tour_testimonial VALUES(451, NULL, NULL, '2016-12-02', 'mccvdvgoj', 'mccvdvgoj', NULL, 'meriel_bertolasio59@rambler.ru', '123456', 'Добрый день! <br />\r\nПомощь в оформлении частным лицам и сотрудникам фирм пропусков в метrо в сеть немецких гипермаркетов МЕТРО.  <br />\r\nhttp://www.metro-ccc.ru <br />\r\nЗаконно по юридическому договору сделаем на физических лиц и сотрудников организаций пропуска в метrо в сеть супермаркетов «METRO»:карточка metro с вашим фото(делается при вас в самом магазине METRO Cash and Carry),с личным номером,кодом,магнитной полосой, названием предприятия, от которой вы будете нами зарегистрированы. Вы можете проводить с собой двоих человек. Карты клиента metro оформляются: на граждан России и иностранных граждан.Оформление делается без предоплаты, то есть вначале мы оформляем вас,вы получаете карты metro, потом оплачиваете. Оплата производится в течение 1-го рабочего дня после оформления через Сбербанк России ,немецкие гипермаркеты "Метро Кэш энд Кэрри" работают 24 часа.Срок действия пропуска в метrо три года, по истечении этого срока договор перезаключается по взаимному согласию сторон.Для оказания этой услуги мы находим юридические лица, у которых есть свободные места в этих тц,и заключаем с ними соответствующие юридические договора, по которым учреждения обязуются предоставить вам право пользоваться их местами в этих немецких магазинах  сроком на три года. Регистрация производятся в разных немецких супермаркетах МЕТРО КЭШ ЭНД КЭРРИ, по выбору юридических лиц в соответствии с их территориальным месторасположением. Получив карты метро в одном из немецких магазинов  МЕТРО КЕШ ЭНД КЭРРИ вы можете ей пользоваться в любых других магазинах этой сети тц МETRO Cash&Cаrry в России и за границей. <br />\r\nP.S. <br />\r\nПОЖАЛУЙСТА, НЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ДЛЯ ЗАКАЗА КАРТ-КЛИЕНТА ИСПОЛЬЗУЙТЕ контакт-форму с сайта. <br />\r\nВАШ ЗАКАЗ БУДЕТ ПРИНЯТ И ОБРАБОТАН В ТЕЧЕНИЕ РАБОЧЕГО ДНЯ. <br />\r\nИСПОЛНЕНИЕ ЗАКАЗА 5-7 РАБОЧИХ ДНЕЙ. <br />\r\nПОЛУЧЕНИЕ В  ГОРОДАХ:Adygea,Astrakhan,Barnayl,Bryansk,Belgorod,Владимир,Volgograd,Волжский,Vologda,Voronej,Voronezh region,Ekaterinburg,Ivanovo,Ijevsk,Irkytsk,Kazan,Калининград,Kalyga,Кемерово,Киров,Kopeisk,Krasnodar,Красноярск,Kursk,Lipetsk,Magnitogorsk,Moskva,Московская область,Набережные Челны,Nijnii Novgorod,Nizhny Tagil,Novokuznetsk,Novorossiysk,Новосибирск,Omsk,Оренбург,Орёл,Пенза,Perm,Пятигорск,Ростов-на-Дону,Рязань,Samara,Санкт-Петербург,Саратов,Serpyxov,Smolensk,Stavropol,Стерлитамак,Syrgyt,Тверь,Тольятти,Tomsk,Tula,Tyumen,Ульяновск,Yfa,Cheboksary,Chelyabinsk,Ярославль,Sevastopol,Симферополь.', NULL, NULL, NULL, NULL, NULL, '94.29.57.248', 'ppp94-29-57-248.pppoe.spdop.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/37.0.2062.124 Safari/537.36', '', 'MOSCOW', 'qp35n9nda4c8r29g40v7101sc7');
INSERT INTO tour_testimonial VALUES(452, NULL, NULL, '2016-12-05', 'Татти', 'Юлиан', NULL, 'yulik@netvision.net.il', '0523861245', 'Уважаемые господа!<br />\r\nЯ в июле послал вам список желаемых для посещения мест. Вы обещали после августа составить маршрут на лето 2017. С тех пор тишина. Если вы потеряли мой список, я могу написать новый.Если вы не можете это сделать, сообщите.<br />\r\nС уважением.<br />\r\nЮлиан.', NULL, NULL, NULL, NULL, NULL, '188.120.154.215', 'BB-154-215.018.net.il', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/54.0.2840.99 Safari/537.36', 'Israel', 'Кадима', 'is1i3ac5phr5uk8dc763tgrh45');
