INSERT INTO tour_testimonial VALUES(492, NULL, NULL, '2017-05-26', 'Curtistar', 'Curtistar', NULL, 'xezne.r@hceap.info', '81723571543', 'Alergyx – это уникальная, безопасная и эффективная комбинация растительных экстрактов, которая, будучи принятой внутрь, уже в течение 10 минут блокирует реакцию организма на аллерген, останавливая или предотвращая проявление аллергии. Полный курсовой прием препарата в течение 30 дней полностью избавляет от хронических форм недуга, очищает от токсинов и восстанавливает организм. <br />\r\nALERGYX помогает нашему телу выработать собственные «блокирующие антитела», которые НАВСЕГДА ИСКЛЮЧАТ ВОЗМОЖНОСТЬ ПОВТОРНОГО ВОЗНИКНОВЕНИЯ АЛЛЕРГИИ. <br />\r\nОфициальный сайт: http://alergyx.bxox.info', NULL, NULL, NULL, NULL, NULL, '37.115.205.66', '37-115-205-66.broadband.kyivstar.net', 'Mozilla/5.0 (Windows NT 10.0; WOW64; rv:41.0) Gecko/20100101 Firefox/41.0', '', 'Kwajalein', 'ojcc26v8vgjvhff6unjl7jvfv0');
