INSERT INTO tour_testimonial VALUES(494, NULL, NULL, '2017-05-28', '', '', NULL, 'fundingteam+newtours.us@probusinessfunding.com', '972-514-4543', 'Hi, letting you know that http://ProBusinessFunding.com can find your business a SBA or private loan for $2,000 - $350K Without high credit or collateral. <br />\r\n <br />\r\nFind Out how much you qualify for here: <br />\r\n <br />\r\nhttp://ProBusinessFunding.com/i.php?url=newtours.us&id=e72 <br />\r\n <br />\r\nMinimum requirements include your company being established for at least a year and with current gross revenue of at least 120K. Eligibility and funding can be completed in as fast as 48hrs. Terms are personalized for each business so I suggest applying to find out exactly how much you can get on various terms. <br />\r\n <br />\r\nThis is a free service from a qualified lender and the approval will be based on the annual revenue of your business. These funds are Non-Restrictive, allowing you to spend the full amount in any way you require including business debt consolidation, hiring, marketing, or Absolutely Any Other expense. <br />\r\n <br />\r\nIf you need fast and easy business funding take a look at these programs now as there is limited availability. <br />\r\n <br />\r\nClick Here: http://ProBusinessFunding.com/i.php?url=newtours.us&id=e72 <br />\r\n <br />\r\nHave a great day, <br />\r\nThe Pro Business Funding Team <br />\r\n <br />\r\nunsubscribe/remove - http://probusinessfunding.com/r.php?url=newtours.us&id=e72', NULL, NULL, NULL, NULL, NULL, '192.171.253.65', '192.171.253.65', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:27.0) Gecko/20100101 Firefox/27.0', '', '', 'oh07uvf2es4br9b4p1frfk0fk0');
INSERT INTO tour_testimonial VALUES(495, NULL, NULL, '2017-05-29', 'Akhmedkarimova', 'Daniya', NULL, 'daniya.akhmedkarimova@russianschool.com', '7815583701', 'Добрый день!<br />\r\n<br />\r\nЯ хотела бы поблагодарить вашу компанию за организацию замечательной тур поездки по Нью-Йорку. Все было очень хорошо организованно и по графику! Особую благодарность хочу выразить Михаэлю нашему гиду, благодаря которому мы не только многое узнали о Нью-Йорке, но и просто замечательно отдохнули! Мы смогли пройтись по всем достопримечательностям и он всегда давал нам время на то чтобы мы смогли сделать фотографии (что было немало важно для нас&#128521;). Мне очень понравился его стиль - это был не монолог о Нью-Йорке а диалог: он задавал нам какие-то вопросы и с радостью отвечал на наши. <br />\r\nЕщё раз спасибо за этот тур! Обязательно буду рекомендовать вашу компанию своим друзьям и знакомым &#128521; Надеюсь в будущем ещё воспользуюсь услугами вашей компании!<br />\r\n<br />\r\nСпасибо!<br />\r\n<br />\r\nДания', NULL, NULL, NULL, NULL, NULL, '108.26.252.156', 'pool-108-26-252-156.bstnma.fios.verizon.net', 'Mozilla/5.0 (Windows NT 6.1; WOW64; Trident/7.0; rv:11.0) like Gecko', 'USA', '', 'rucio7dsq51lt2ad9glpsrlfs2');
