INSERT INTO tour_testimonial VALUES(497, NULL, NULL, '2017-05-31', 'Matiash', 'Ann Matiash', NULL, 'amatiash@cablevision.com', '3475269040', 'We had an excellent time this Memorial weekend on the 3day trip to Pittsburg.  Our tour guide Nellie is the most informative guide we''ve ever had.  She made 7 hours trip pass in no time, since her program and the way she tells stories are amazing. We had 52 people on the bus and had the greatest time, she is someone I would love to go on tour with again.  Thanks so much!', NULL, NULL, NULL, NULL, NULL, '216.2.193.1', 'user1.cablevision.com', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.96 Safari/537.36', 'USA', 'Staten Island', 'pc82fq03uv14bgt42q762mea24');
