INSERT INTO tour_testimonial VALUES(500, NULL, NULL, '2017-06-06', 'Кириллов', 'Евгений', NULL, 'kirilloveg2@yandex.ru', '+79183289655', 'Доброго времени суток, я не смог поехать в тур, я оплатил предоплату в 400дол. и остальную сумму за меня оплатила Татьяна Винда. Поездка была застрахована от не выезда, плизз, подскажите как вернуть стоимость тура, в какую страховую компанию обращаться?', NULL, NULL, NULL, NULL, NULL, '95.153.131.248', '95x153x131x248.kubangsm.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.36', 'Russia', 'Новороссийск', 'knpa7mch38si8v7pgjdr7igg56');
INSERT INTO tour_testimonial VALUES(501, NULL, NULL, '2017-06-07', 'Мебель каталог', 'Мебель каталог', NULL, 'sl.eep.m.as.t.er@top.bxox.info', '88377157974', '   При оформлении интерьера зала очень частой проблемой является небольшая площадь этой комнаты. Поэтому перед владельцами стоит непростая задача: разместить мягкую мебель, столик, тумбочку под телевизор, обязательно должна присутствовать мебельная стенка. Дизайнеры советуют не загромождать лишними предметами маленькую комнату, постараться приобрести самое необходимое.<br />\r\n   Сэкономит место стенка под телевизор, при покупке такой модели с нишей для техники отпадает необходимость приобретения тумбы для телевизора. Линии и формы мебели должны быть четкими, лаконичными. Для экономии свободного места, если позволяет планировка, можно приобрести угловой диван. Угловую форму может иметь и стенка в зал, существует множество компактных, но в тоже время вместительных моделей этой мебели.<br />\r\n   Увеличить пространство на уровне восприятия помогут светлые обои и светлые тона обивки мягкой мебели. Правильно расположенные светильники также создадут уютную атмосферу в зале, помогут подчеркнуть достоинства и скрыть недостатки планировки. Для комнаты побольше мебель можно выбирать в более темных тонах, цвет натурального дерева будет гармонировать с любыми обоями.<br />\r\n <br />\r\n <br />\r\nОфициальный сайт: http://pronews24.ru/<br />\r\n', NULL, NULL, NULL, NULL, NULL, '176.8.241.146', '176-8-241-146.broadband.kyivstar.net', 'Mozilla/5.0 (compatible; MSIE 9.0; Windows NT 6.0; Trident/5.0; Trident/5.0)', '', 'www.imp-mebeli.ru', 'e2qoklch4rd6n1b1lucprtukr4');
