INSERT INTO tour_testimonial VALUES(503, NULL, NULL, '2017-06-12', 'Wening', 'Irina', NULL, 'ellen@edcappraisals.com', '', '8 -9 июня я была в двухдневном автобусном туре в Бостоне. Хочу выразить огромную благодарность нашему гиду Анвару. Буквально энциклопедические знания, методика построения лекций, глубина поданного материала, высокий профессионализм просто потрясают! <br />\r\nВпечатлили также прекрасная организация поездки, интеллигентность и доброта этого замечательного человека. <br />\r\n<br />\r\nЕщё раз огромное спасибо! <br />\r\nИрина  <br />\r\n', NULL, NULL, NULL, NULL, NULL, '69.141.244.28', 'c-69-141-244-28.hsd1.nj.comcast.net', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/51.0.2704.79 Safari/537.36 Edge/14.14393', 'USA', '', 'e6mq4v3s5vud1ldgi6rj7ulb06');
INSERT INTO tour_testimonial VALUES(504, NULL, NULL, '2017-06-19', 'КОЗЛОВА', 'ЕЛЕНА', NULL, 'elenaakozlova@yandex.ru', '+7916-314-4811', 'Добрый день. В этом году посетила США. Но, к сожалению, не увидела парк секвой в Йосемити он закрыт. Заинтересовал тур Гора Президентов, Йеллостоун и т.п.  Есть ли возможность на этом руте как-то увидеть секвойи. И как организован будет маршрут из Москвы. Виза имеется. Спасибо за ответ.', NULL, NULL, NULL, NULL, NULL, '194.135.210.190', '194.135.210.190', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; rv:11.0) like Gecko', 'Russia', '', 'acevc8quubnvlod4d53fqq7f56');
