INSERT INTO tour_testimonial VALUES(510, NULL, NULL, '2017-06-24', 'Шалашова', 'Наталия ', NULL, 'natalia_sha@mail.ru', '+79217533391', 'Отзыв на тур California 7 days, 05/26-06/01/17 от компании NEW TOURS<br />\r\n<br />\r\nЯ первый раз ездила этой компании. Осталась очень довольна слаженной работой всего коллектива, в частности: туроператора Натальи, с которой первоначально разговаривала по телефону и получила исчерпывающую информацию о туре; затем мы переписывалась с ней – на любые мои вопросы я оперативно получала подробные ответы.<br />\r\nЕще хочу отметить отличную работу нашего гида Анвара Хайруллина. Отличный специалист высокой квалификации, заботливый, тактичный, галантный мужчина.<br />\r\nНаша группа получила море любопытной информации. Анвар обеспечивал нам не только экскурсионную и культурную программу, но и позаботился о нашем быте (обед, продукты, сувениры и т.д.)<br />\r\nВесь тур я оцениваю на отлично!<br />\r\n<br />\r\nСовет туристам, отправляющимся в подобный тур:<br />\r\nПри посещении каньонов (Гранд и Брайс каньон) необходима удобная обувь (кроссовки, кеды, ботинки)<br />\r\nЖелаю всем приятных путешествий и только положительных эмоций!<br />\r\n', NULL, NULL, NULL, NULL, NULL, '92.100.65.177', 'ppp92-100-65-177.pppoe.avangarddsl.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.36', 'Russia', 'Санкт-Петербург', 'old915c9je2ktekoikh7k94k83');
INSERT INTO tour_testimonial VALUES(511, NULL, NULL, '2017-06-24', 'Давыдов', ' Борис', NULL, 'Davidov5960@gmail.com', '972544760366', 'Уважаемые руководители Ньютурс! С 24.5-4.6 2017г.     Мы с моей женой Светланой,имели огромное удовольс-твие путешествовать по 4 штатам Америки-это Калифорния,Невада,Юта и Аризона.Думаю и даже уверен,  что озвучу мнение всех 36 членов нашей дружной группы - Сильней-  ший профессионализм,личное обаяние,глубокое и всеобъемлющее знание предмета,огромные чисточе- ловеческие качества, все это относится к нашему уважаемому Гиду- Хайрулину Анвару!!! Огромное ему за все,за все СПАСИБОООООО!!!!! от всей нашей дружной группы!!! А Вам, Руководителям НьюТурс, огромных творческих успехов во всех ваших начинаниях! Огомное Вам спасибо за этот   прекрасный тур!!!', NULL, NULL, NULL, NULL, NULL, '213.57.138.115', 'dynamic-213-57-138-115.hotnet.net.il', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.36', 'Israel', 'Ришон ле Цион', '7qtag5hegnb42jeo5gu6c8h8f3');
