INSERT INTO tour_testimonial VALUES(521, NULL, NULL, '2017-07-10', 'Разумовский', 'Виктор', NULL, 'gratinov@gmail.com', '2013989246', 'Гораздо приятнее писать благодарственные, а не критические отзывы, но после сегодняшней экскурсии по Нью-Йорку, к сожалению, осталось очень неожиданное чувство досады за традиционный «русский сервис», встречающийся даже в Америке. Вот как это было. Автобус прибыл к месту, где его стоя выглядывало десятка полтора в основном не очень молодых людей (мне 76 лет), с опозданием на целый час. При этом гид скороговоркой в легком стиле проговорила \\"извините за задержку\\" даже не стараясь казаться виноватой. Никто не  потрудился предупредить о такой задержке, хоть телефоны участников экскурсии (например, мой) в турбюро были записаны. В дальнейшем я понял, что такое опоздание никак не оторазилось на общей продолжительности экскурсии, и она, как ни в чем не бывало, закончилась, вероятно, в обычно положенные 15:20. Общение с гидом в группе из 25 человек оказалось проблематичным (либо всех расталкивая нужно было держаться в 1-2 метрах от нее, либо невольно пропускал какую-то информацию на шумной улице, поскольку иногда нельзя было включать микрофон, а экскурсантам не раздают динамики, чтобы слышать даже шепот экскурсовода, не обязательно сбиваясь в плотное кольцо вокруг него, и не заставляя его тратить время в ожидании, когда все окажутся рядом). Неоднократно гид пересчитывала экскурсантов, как цыплят, вместо того, чтобы раздать всем какие-то отличительные знаки или хорошо заметные номера, позполяющие не только гиду, но и членам группы, которые плохо знают друг друга и не всегда уверены, что они идут  с теми, с кем должны. Даже поднятый вверх зонтик гида - не лучший \\"маяк\\" в пестрой толпе. Информации, делающей экскурсию интересной, к сожалению, было мало. Почему-то гид слишком много разговаривала  по телефону. Автобусная часть программы заняла всего 1 час 10 мин. При таком дефиците времени (из-за позднего начала экскурсии) перерыв на обед вполне можно было сократить с 45 до 30 мин. <br />\r\nВпечатление такое, что экскурсии устраивает не турбюро с многолетним опытом работы, а человек, впервые решивший немного поводить людей по родному городу.<br />\r\nСоветую посмотреть как организованы экскурсии в большинстве столиц Европы, где история, конечно, побогаче, но объектов для показа на порядок меньше.  <br />\r\n', NULL, NULL, NULL, NULL, NULL, '173.54.23.217', 'pool-173-54-23-217.nwrknj.fios.verizon.net', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/59.0.3071.115 Safari/537.36', 'USA', '--- Select ---', 'triplbu9kg2nnq3ga32n0t1763');
