INSERT INTO tour_testimonial VALUES(598, NULL, NULL, '2017-08-08', 'Epshteyn', 'Sam', NULL, 'kgdoom@gmail.com', '6468297555', '  Хочется выразить большую благодарность за организацию и проведения тура по Калифорнии 28.07.2017г. - 06.08.2017г.под руководством гида тура Хайрулина Анвара.<br />\r\n    В начале поездки гидом был роизедён очень грамотный и подробный инструктаж группы  по режиму и безопасности, который предотвратил травмы, несчастные случаи.  Чёткое планрование режима и программы тура со стороны гида обеспечило полное выполнение программы тура. <br />\r\n    Очень грамотно, эмоционально и профессионально, в доступной для всех форме, был изложен материал. Гид отвечал подробно на все дополнительные вопросы со стороны зкскурсантов. <br />\r\n    Очень хочется отметить коммуникабельность , дружелюбие,правильный психологиеский подход к каждому члену группы.<br />\r\n       Горько осознавать , что некоторые члены группы ( Ревзин Игорьи его семья, Ситникова Марина с сыном ) необъективно оценили работу Анвара, прикрывая свои проступки по нарушению режима,  откровенной ложью по отношнгию к нему. Мы присутствовали при инценденте , когда они угрожали ему физической расправой (г. Сан Франциско возле русской провославной церкви). Неединожды  они требовали в ультимативной форме  изменить маршрут, огласовнный большинством в группе, в  угоду их интересам.<br />\r\n    Просим вас вынести благодарность за отличнрое проведение тура нашему гиду Хайрулину Анвару.<br />\r\n<br />\r\n<br />\r\n                                                                                                                                                        07. 08 2017г.<br />\r\n                                                                                             <br />\r\n<br />\r\n<br />\r\n<br />\r\n                                                                                <br />\r\n                                                                                Эпштейн Сэм, г 