INSERT INTO tour_testimonial VALUES(663, NULL, NULL, '2017-09-06', 'StaslNex', 'StaslNex', NULL, 'eco-les09@bigmir.net', '82281494139', 'вагонка с сучком <br />\r\n <br />\r\n <br />\r\nПиломатериалы <br />\r\nПосле предварительного естественной сушки бревна и кряжи распиливают в продольном направлении на несколько параллельных плоскостей. При этом получают различные пиломатериалы: доски, брусья, бруски, горбыль, пластины и четвертини.Дошкы бывают толщиной от 16 мм и более и делятся на необрезные, полуобрезни и обрезные. Необрезные доски получают при распиливании бревна или кряжа в продольном направлении. <br />\r\nКромки в таких досок острые, а ширина - ризна.У полуобрезних досок часть кромки остается неопиленными и один конец бывает тоньше. Обрезные доски получают, когда бревно или кряж предварительно опыляют с двух сторон, чтобы при распиловке выходили полностью обрезные доски без обзола и одинаковой ширини.У практике доски толщиной 20-30 мм называют тесом, толщиной 20 мм - двадцаткой, 25 мм-дюймовку, а 30 мм - тридцаткой.Щоб повысить сортность пиломатериала, при распиловке сердцевину ствола часто випилюють.Пры выполнении столярных работ в доме наиболее удобны обрезные доски и бруски, а также четирьохбитни брусья пиломатериалы толщиной и шириной более 100 мм. По числу опиленных сторон брусья бывают двух-, трех- и четирехкантними.Горбиль - боковые части бревна, срезанные при продольном распиливании. Может быть разной толщины и ширины. Горбыль применяют для устройства заборов, стен сараев, для настилки наката на чердачном перекрытии, подшивки теплых пидлог.Дошкы, бруски и брусья делят на 5 сортов. В столярном деле используют 1-й и 2-й сорта, в строительстве - все сорти.В индивидуальном строительстве часто применяют так называемые пластины и четвертины. Первые получают, распыляя бревно пополам (на две половины), то есть вдоль, вторые - распыляя пластины на две части. <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\n[url={url}]{keyword}[/url] <br />\r\n <br />\r\nhttps://eco-les.club/dierievoobrobka <br />\r\nhttps://eco-les.club/dierievoobrobka/nastilannia_parkietnoyi_pidloghi <br />\r\nhttps://eco-les.club/dierievoobrobka/tiepla_pidlogha <br />\r\nhttps://eco-les.club/dierievoobrobka/pidloghi_iz_friezierovanikh_doshchok <br />\r\nhttps://eco-les.club/dierievoobrobka/vlashtuvannia_pidloghi <br />\r\nhttps://eco-les.club/dierievoobrobka/ulashtuvannia_skhodiv_u_dvopovierkhovomu_budinku <br />\r\nhttps://eco-les.club/dierievoobrobka/faniera <br />\r\nhttps://eco-les.club/dierievoobrobka/zagholovok_stat_i0 <br />\r\nhttps://eco-les.club/dierievoobrobka/krughlii_lis_ <br />\r\nhttps://eco-les.club/dierievoobrobka/zagholovok_stat_i <br />\r\nhttps://eco-les.club/dierievoobrobka/kharaktieristika_dierievnikh_porid <br />\r\nhttps://eco-les.club/price ', NULL, NULL, NULL, NULL, NULL, '81.162.224.132', '81.162.224.132', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.96 Safari/537.36', '', '', 'gh2mbeur6b1g8jb03atp5t9oc7');
