INSERT INTO tour_testimonial VALUES(681, NULL, NULL, '2017-09-11', 'Животовский ', 'Ярослав ', NULL, 'zhslava1978@mail.ru ', '+7(777)-268-22-09', 'Здравствуйте, уважаемые господа!<br />\r\n<br />\r\nВ августе-месяце я путешествовал в рамках тура "Звезды Атлантики - два океана". Прежде всего, мне хотелось бы поблагодарить компанию "Нью Турс" за организацию очень интересного тура. Тур прошел довольно удачно, за исключением форс-мажора, который никто не мог предусмотреть: наш гид Анвар Хайруллин во время поездки предлагал различные  варианты времяпровождения в Лас-Вегасе и Сан-Фарнциско вместо основной программы в этих городах - туристам был предоставлен выбор разных экскурсий за дополнительную оплату. Я выбрал однодневную поездку на стеклянный мост на Гранд-Каньон. Это была очень интересная и впечатляющая поездка,  обратно в Лас-Вегас я благополучно вернулся, только, к сожалению, с  6-часовым опозданием, так как силами полиции был перекрыт участок дороги до Лас-Вегаса, на котором произошла сильная авария с двумя жертвами. К сожалению, не удалось посмотреть вечернее световое шоу (которое было предусмотрено программой тура) и сходить на цирковое представление (которое не входило в программу тура). Помимо форс-мажора, в котором оказался я, была похожая ситуация у туристов, купивших полет над Гранд-Каньоном (время полета - 3 или 4 часа утра) в день переезда из Лас-Вегаса во Фресно. Они вынуждены были вернуться с опозданием на 2 или 3 часа. Это, просто для информации. Понятно, что предусмотреть такие ситации не может никто. <br />\r\n<br />\r\nНо, у меня вызывает вопрос такое обстоятельство:  Анвар меня просил об этих ситуациях не говорить водителю Марсело (почему - не знаю. Может быть, потому что Марсело мог поставить в курс дела его руководство). <br />\r\nХотелось бы знать, почему для него это было нежелательно? <br />\r\nИ правильно ли поступал Анвар? <br />\r\nВсе ли дополнительные экскурсии, которые предлагает гид, согласуются с вашей компанией? <br />\r\n<br />\r\nПо Анвару, в целом хочется отметить, что он в рамка своих возможностей он, безусловно, старался учитывать пожелания всех туристов, очень коммуникабельный, и в целом, у нас с ним сложились хорошие отношения. Но, хотел бы обратить внимание на один нюанс: но в самый первый день в общения с туристами Анвар акцентировал наше внимание на том, что является сертифицированным гидом с 32-летним стажем и правом работать в 38 штатах.  Это, безусловно, хорошо, но турист оценивает гида по работе, и такие подробности туристу знать не обязательно, тем более в самый первый день. Вот, над этим, я думаю, ему имеет смысл поработать. <br />\r\n<br />\r\n<br />\r\nОчень хочется отметить профессиональную работу гидов Льва (2-дневная поездка в Вашингтон) и Натальи (обзорная экскурсия по Нью-Йорку). Великолепный, профессиональный подход к туристам, тактичное и корректное отношение. Ну, и, конечно же, знание своего дела.   <br />\r\n', NULL, NULL, NULL, NULL, NULL, '146.23.228.26', 'tcoatyproxysg1.chevron.com', 'Mozilla/5.0 (Windows NT 10.0; WOW64; Trident/7.0; GIL 3.5; rv:11.0) like Gecko', 'Kazakstan', 'Алматы', 'm0q0oefnvmm411gvakhf40idi3');
