INSERT INTO tour_testimonial VALUES(751, NULL, NULL, '2017-10-18', 'seoslonikpid', 'seoslonikpid', NULL, 'seoslon-veb-studija@rambler.ru', '123456', 'Здравствуйте! <br />\r\n <br />\r\nПродвижение сайта для увеличения заявок, звонков и продаж с гарантией результата. <br />\r\nПочему мы гарантируем результат? <br />\r\n <br />\r\nМы успешно продвинули более 350 сайтов <br />\r\nТоповые места в 3 рейтингах SEO-компаний <br />\r\n841 812 рублей, сэкономленных на контекстной рекламе <br />\r\n7 650 заявок в месяц получают наши клиенты <br />\r\n55 678 число посетителей наших сайтов <br />\r\n11 сертификатов <br />\r\n8 специалистов <br />\r\n <br />\r\nВ чем заключается наша работа? <br />\r\nВ реконструкции сайта, его доработке и исправлении ошибок, чтобы поисковая система отображала его в самом начале списка. <br />\r\n <br />\r\nПродажи с вашего сайта начнут расти уже через 3 месяца продвижения. <br />\r\n <br />\r\nХотите знать, почему ваш сайт сейчас не в топе? Напишите нам на seo@seoslon.com и получите бесплатный экспресс-аудит вашего сайта и коммерческое предложение за 24 часа. <br />\r\nВ письме укажите ваш контактный телефон и ссылку на сайт. <br />\r\nhttp://seoslonik.com', NULL, NULL, NULL, NULL, NULL, '94.29.60.249', 'ppp94-29-60-249.pppoe.spdop.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:33.0) Gecko/20100101 Firefox/33.0', '', 'Krasnojarsk', 'bo61iivgqkflm6j2e39he9v4b7');
