INSERT INTO tour_testimonial VALUES(754, NULL, NULL, '2017-10-18', 'ScottSeefe', 'ScottSeefe', NULL, 'jumpdalane1974@plusgmail.ru', '262441587', 'Попробуй свои силы в международном конкурсе красоты и выиграй денежный приз и подарки от спонсоров. <br />\r\nУчастие в конкурсе красоты бесплатно для всех участников. <br />\r\nЗарегистрироваться и принять участие можно на сайте конкурса https://goo.gl/GWLpvv <br />\r\nТак же предлагаем широкие рекламные возможности. <br />\r\n--------------- <br />\r\nTry your hand at international beauty contest and win cash prizes and gifts from sponsors. <br />\r\nParticipation in the beauty contest is free of charge for all participants. <br />\r\nRegister and participate in the contest website https://goo.gl/GWLpvv <br />\r\nWe also offer wide advertising opportunities.', NULL, NULL, NULL, NULL, NULL, '80.252.154.233', 'unspecified.progtech.ru', 'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:43.0) Gecko/20100101 Firefox/43.0', '', 'Москва', 'cl7tbok3aps0ulakhm9b01rt30');
