INSERT INTO tour_testimonial VALUES(837, NULL, NULL, '2017-11-11', 'Берлин', 'Юрий', NULL, 'yyurka@hotmail.com', '917-301-9823', 'В октябре мы с женой ездили по 4-м западным штатам. Очень хорошо подобран 10-дневный маршрут. Поездка удалась во многом благодаря усилиям нашего гида Анвара.<br />\r\nСпасибо ему за професионализм, эрудицию, умение показать и рассказать все самое главное и интересное. Очень понравилось его умение работать с группой.  <br />\r\nЕсли мы еще раз обратимся в вашу компанию, его в этом будет его большая заслуга.<br />\r\n', NULL, NULL, NULL, NULL, NULL, '72.225.113.9', 'mta-72-225-113-9.nj.rr.com', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:56.0) Gecko/20100101 Firefox/56.0', 'USA', '', '731bljo6dtst87956tkgcqjgv7');
INSERT INTO tour_testimonial VALUES(838, NULL, NULL, '2017-11-11', 'Дух', 'Наталья', NULL, 'Van.dudko@yandex.ru', '+79161493067', 'Звезды Атлантики: Наталья, Павел, Рита и Эмиль.<br />\r\nПавел - наш водитель в экскурсиях в Филадельфию и Вашингтон. Профессиональный, аккуратный, чёткий, внимательный и очень вежливый человек.<br />\r\nЭмиль - полиглот, тонкий, ироничный, не жалеющий себя. Мне было удивительно, как он выдерживает такие нагрузки, отдавая нам намного больше, чем мы ожидали. <br />\r\nНаталья - звезда Нью-Йорка. Интеллигентная и обаятельная провела великолепную экскурсию, не дала замерзнуть, вкусно накормила, подробно ответила на все бытовые вопросы.<br />\r\nРита - в поездке в Филадельфию первая знакомила нас с Америкой. Провела интересную экскурсию, была очень внимательна и вежлива. <br />\r\nИван Дудко и Наталья Дух.<br />\r\n04.11.2017-13.11.2017<br />\r\nСпасибо вам!', NULL, NULL, NULL, NULL, NULL, '95.108.244.55', 'trbo54f.trbo.yandex.net', 'Mozilla/5.0 (Linux; Android 6.0.1; SM-G925I Build/MMB29K) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/60.0.3112.113 YaBrowser/17.9.0.523.00 Mobile Safari/537.36', 'USA', '', 'mniuoj29l7hef6rekfogekrs03');
