INSERT INTO tour_testimonial VALUES(1010, NULL, NULL, '2018-01-01', 'Saulius', 'Anzelika', NULL, 'admin@doklas.com', '+37069876833', 'Друзья!! Нам под 60, мы много путешествуем, в том числе самостоятельно. Если кто-нибудь из вас собирается в США, очень советую: не тратьте лишнее время на поиски гидов, составление маршрутов, изучение достопримечательностей, поиск и бронирование отелей... Потому что для этого есть замечательная компания NEW TOURS, которую мне так повезло найти в интернете. Любой путешественник из бесчисленного количества предлагаемых туров  сможет выбрать на свой вкус. Мы путешествовали с NEW TOURS в октябре 2017 года по туру «Атлантика США и Канада» 14 дней из серии «Звезды Атлантики», но до сих пор перед глазами стоит ощущение чудесного и комфортного пребывания в этих странах. Хочу сказать большое спасибо компании и лично гидам за ответственное отношение к работе и первоклассное качество оказываемых услуг! Все гиды знают и любят Америку и Канаду. Благодаря их профессионализму, добросовестности, искренней доброжелательности мы увидели то, что хотели и еще множество интереснейших мест! И все это под надежным и заботливым крылом гидов. Абсолютная уверенность в том, что тебе покажут все самое лучшее и еще больше. Огромное спасибо начитанному, высокообразованному, интеллигентно-энциклопедическому Емилю, что он появился в нашей жизни и так удивительно объемно показал нам Вашингтон. Не менее образованный водитель Володя, который давно имеет свою транспортную компанию в Нью-Йорке и работает с NEW TOURS (он нас возил в Канаду, так как по нашей дате собралось только 4 туриста и нас отправили на минивене почти как индивидуальный тур) так заразил нас интересом к Америке, рассказывая о других штатах, что хочется вернуться еще не раз. Шесть дней, проведенных вместе с Галиной, фантастика! Это смесь открыточных видов и потаенных, но невероятной красоты уголков Канады. Мы увидели бесконечные грани этой удивительной страны. Галина замечательный гид и очень приятный человек, создающий дружескую и теплую атмосферу общения! Галина интересный и образованный собеседник, внимательный, отзывчивый и позитивный человек. Не помню имен гидов по Бостону и Нью Йорку, но мы почувствовали себя не как на протокольном мероприятии, а как в гостях у добрых и очень увлеченных своим делом старых знакомых. Хочу отметить высокое качество работы компании: никогда никаких опозданий (что мы очень ценим), все экскурсии проходили строго по ваучеру и допоздна. Правда, было неприятно, когда за неделю до поездки выдали ваучер, мы узнали, что нам поменяли очередность экскурсионных дней, поэтому пропал наш один из вечеров в Бродвейском театре в первом ряду. Спасибо огромное за приятный и шикарно организованный отдых и замечательное настроение! После поездки остались только положительные эмоции! Мы мечтаем вернуться в эту потрясающую страну и конечно же в сопровождении NEW TOURS. С Новым 2018 годом!!!<br />\r\nP.S. Мы только что вернулись из Кубы. Советую заказывать гостиницы, трансферы, экскурсии по интернету, так как туры на Кубу в мировых турагенствах пока еще стоят дороже.<br />\r\nАнжелика<br />\r\n', NULL, NULL, NULL, NULL, NULL, '188.69.211.154', 'md-188-69-211-154.omni.lt', 'Mozilla/5.0 (Windows NT 10.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.84 Safari/537.36', 'Other ..', 'Vilnius', 'h1jdkaa24llsbui5vdaq7dfb93');
INSERT INTO tour_testimonial VALUES(1011, NULL, NULL, '2018-01-03', 'Чурляева', 'Инна', NULL, 'inessik-07@mail.ru', '89612780788', 'Здравствуйте! Хочу сказать вашей фирме огромное спасибо за грамотную организацию экскурсий, за продуманные маршруты и , конечно, за уже любимого гида Елену Медведовскую. Этого гида для сопровождения экскурсии выбирала уже второй раз. В 2014 году -это была обзорная экскурсия по Нью-Йорку, в этом голу поездка в Бостон и к Амишам. Елена всегда дополняет экскурсию рассказами о стране, о людях, об особенностях культуры, рассказывает много историй. Также очень понравилось, что все те пассажиры кто задавал сопутствующие вопросы  получали ответы. Она ничью просьбу не оставляет без внимания. Еще раз спасибо вам за прекрасно проведенное время и эрудированный персонал.До встречи летом 2018 ', NULL, NULL, NULL, NULL, NULL, '5.139.159.16', '5.139.159.16', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:57.0) Gecko/20100101 Firefox/57.0', 'Russia', 'Ростов-на-Дону', 'dacr5oc7d08c3pdsb3a0j4jpj7');
