INSERT INTO tour_testimonial VALUES(1115, NULL, NULL, '2018-02-04', 'Jliaprazy', 'Jliaprazy', NULL, 'jliafug@gmail.com', '83613192678', '"Привет, #uname!" Отличие вышек-тур от строительных лесов <br />\r\nСтроительные вышки туры, по сути, имеют такое же назначение, как и строительные леса, но отличаются от них жесткостью конструкции, позволяющей выставлять вышки на высоту, не закрепляясь к фасаду. Это значительно расширяет сферу их применения при локальных строительных работах, как на фасаде, так и при монтажных работах с перекрытиями. <br />\r\nБлагодаря своей сборно-разборной конструкции, оснащенной колесами на жестком основании вышки туры позволяют достаточно быстро производить их установку и демонтаж, а также имеют высокую мобильность и легкую транспортабельность, что зачастую является необходимым условием при внутренней отделке строительных объектов. Смотрите цены и характеристики, покупайте: <br />\r\nвышка тура всп и расценки строительные леса <br />\r\nВ целях безопасности работников вышки оснащены опорными винтами, которые регулируют вертикальное положение, когда вышка тура используется на неровной поверхности и стабилизаторами, которые надежно фиксируют конструкцию при работе на большой высоте. Настил, на котором находятся рабочие, снабжен боковыми ограждениями, что обеспечивает дополнительную безопасность. <br />\r\nТак же вышки-туры передвижные оборудованы колесами, выполненными из высокопрочного материала, которые выдерживают общую распределенную нагрузку до 720 кг. и фиксируются тормозами. <br />\r\nРазные размеры и ярусная, модульная конструкция строительных вышек позволяют выбрать именно тот вариант, который максимально подойдет для выполнения необходимых Вам работ.', NULL, NULL, NULL, NULL, NULL, '178.122.56.151', 'mm-151-56-122-178.brest.dynamic.pppoe.byfly.by', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/56.0.2924.87 YaBrowser/17.3.1.840 Yowser/2.5 Safari/537.36', '', 'Brest', 'ogf8iplo4k67ucvq3li7j65396');
