INSERT INTO tour_testimonial VALUES(1146, NULL, NULL, '2018-02-16', 'Трофимова', 'Елена', NULL, 'elena_tr@mail.ru', '+7921 3040905', 'Мы с мужем в составе небольшой группы туристов путешествовали 10 дней по Калифорнии, Неваде, Аризоне и Юте (с 21 по 29 января 2018 г.). Остались чрезвычайно довольны самим путешествием – маршрутом, программой и расписанием тура, замечательными городами и курортами, которые мы посетили, потрясающими природными парками и заповедниками, легендарными дорогами и удивительными пейзажами, которые мы наблюдали из окна автомобиля весь наш путь. У нас остались очень хорошие впечатления от отелей, которые нам предоставила компания. Мы также чрезвычайно благодарны нашему гиду - Игорю Есину, чьи экскурсии и рассказы во время пути были очень интересными, умными, запоминающимися. Игорь также прекрасно справился со всеми организационными вопросами, всегда был точен и исключительно добросовестно выполнял свои обязанности. Хочется также отметить высокий профессионализм Игоря, который во всех ситуациях действовал, прежде всего, в интересах туристов. <br />\r\n<br />\r\nГотовы с полной ответственностью рекомендовать этот тур и услуги гида Игоря Есина всем туристам.<br />\r\n<br />\r\n', NULL, NULL, NULL, NULL, NULL, '95.27.90.62', '95-27-90-62.broadband.corbina.ru', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/64.0.3282.167 Safari/537.36', 'Russia', 'Санкт-Петербург', 'r7a1b9v214hb8qfqji4p395ue7');
