INSERT INTO tour_testimonial VALUES(1169, NULL, NULL, '2018-02-27', 'CPROLoably', 'CPROLoably', NULL, 'novak@contrpro.ru', '86951598271', 'Мы Контроль проект продает сервис аудит многоквартирных домов, коттеджей.Применяем в возведенье,проектирование,оформление бань такие виды строительных как: дерево, газобетон, керамзитобетонных блоков, кирпич, каркасные дома. <br />\r\n <br />\r\nМы фирма Контроль проект проектируем, проектируем дома и продаём уже готовые проекты построек. Проектный план отдельного жилого дачного домика, созданный нашими проектировщиками, выделит ваш собственный дизайн, обеспечит удобный стиль жизни. Мы поможем выбрать исходный материал, этажность, расположение дома на участке таким образом, затем чтобы он стал целостным спектром с ландшафтом. Проектировка домов и коттеджей, сделанное нашей фирмой - это воплощенная в жизнь мечта. С нашей компанией работают только мастера, которые прошли стажировку в превосходнейших проектных бюро. <br />\r\n <br />\r\nСотрудники нашей фирмы работаем без посредников, благодаря которым мы экономим ваши деньги и время. <br />\r\n <br />\r\nФирма осуществляет полный комплекс работ по архитектурному проектированию и далее содействию проектов на всех этапах - от составления технического задания до внесения помещений в использование. <br />\r\n <br />\r\nоформление дачи в собственность в 2018: оформление дачи в собственность в 2018', NULL, NULL, NULL, NULL, NULL, '92.240.139.74', '92-240-139-74.clients.tlt.100megabit.ru', 'Mozilla/5.0 (Windows NT 10.1; Win64; rv:38.0) Gecko/20100101 Firefox/38.0', 'Russia', 'Samara', '5bt92k9i43lelo5ac0596sbep2');
