INSERT INTO tour_testimonial VALUES(1241, NULL, NULL, '2018-04-05', 'Suslov', 'Natalia', NULL, 'northportot@gmail.com', '646 269 8707', 'Very disappointed with the Trip to Pittsburg, when booking the trip the travel agent insured us that it was one of the best travel guides and just amazing trip.  The driver was close to 70 year old and he was the only driver on the bus.  The guide kept saying that he is very tired and he did not have any other driver to relieve him of extended driving time.  The guide seemed very informative and friendly, she did talk a lot and gave out a lot of information.  Although a lot of this information was not factual but more her "movie style" interpretation of it.  The guide very often would confuse right from left and tourists would miss where to look at while driving on the bus, realizing that the''ve been looking on the wrong side.   The bus was comfortable and the program was ok, but the entire trip we felt extremely rushed.  Even when we would arrive to a place on time we were "always late" and constantly rushed to leave.  On many occasions the tour guide was not clear with instructions and when majority of tourists misunderstood her, they were blamed for not listening and yelled at publicly.  One of the major issues of the trip was the food.    As far as dinner goes, the hotel was in isolated location with no walking distance to any convenience stores or a single restaurant.  Tour guide informed all the tourists that the hotel has an amazing restaurant and everyone should eat there and that would be their only option or of course they can take car service to another restaurant in downtown.  The food was absolutely horrible and expensive, the waitress didn''t get the order right, plates were dirty, fish and burgers overcooked etc.  Very few tourists even ate there and most ended up just skipping dinner.  We wasted $70 for 2 adults and 2 kids, just to throw majority of our food out.  The second day our last excursion finished at 5 p.m. and we asked the tour guide where we can go for dinner.  She clearly stated to us that even the hotel restaurant now would be closed and it''s not her responsibility anymore where we go, she did her tour and took us to hotel.  She also did not give any information about restaurants that can be ordered out from or other options, aside from saying "I think there is a super expensive Italian Restaurant within 20 minute walking distance, but I know nothing about it".  Walking on no sidewalks in the middle of the roads and grass...in the dark...The tour guide also informed the group that she is so happy that her day ended 1-1.5 earlier and that''s why she is so wonderful.  When several people inquired if at least the driver could make a stop at the supermarket to at least get snacks and some kind of dinner for the kids...there were 10 kids!  out of 37 tourists, and even after we passed a huge supermarket with an empty parking lot, she again reminded that it''s non of her business  and she is very tired ready to go to bed and did all she had to do.  After this honestly the whole trip went down the drain, she didn''t like the remarks that my husband made and publicly kept commenting on the situation in front of the whole bus.  Sadly, although majority of tourists agreed that dinner was just horrible, noone really said anything to her and she made my husband a scapegoat and kept blaming him for things he didn''t even say or do...on top of being pretty rude at times again publicly.  There is a lot more to say unfortunately, but all I know that out of all the trip I took with your company years back the tour guide or the bus driver never put us in a situation like this.  She kept blaming my husband for things that he didn''t even say, talk badly about him with other tourists and asking them to call back to the agency to tell what a good person she is and what a great job she was doing.  Honestly the whole experience ended up just being awful.  ', NULL, NULL, NULL, NULL, NULL, '170.24.138.123', '170.24.138.123', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_12_6) AppleWebKit/604.5.6 (KHTML, like Gecko) Version/11.0.3 Safari/604.5.6', 'USA', 'Northport', '937iu4uokkb5lnfh0q39s815e7');
