INSERT INTO tour_testimonial VALUES(1276, NULL, NULL, '2018-04-24', 'Rogertug', 'Rogertug', NULL, 'zersmomeri1972@plusgmail.ru', '325385626', 'Здравствуйте, меня зовут Николай. <br />\r\nЯ частный Директолог или по другому говоря специалист по настройке контекстной рекламы. <br />\r\n <br />\r\nЗанимаюсь профессиональной настройкой Яндекс.Директ и Google.Adwords более 6 лет - с 2012 года. <br />\r\n <br />\r\nЗа это время наработал много опыта в контекстной рекламе в компаниях как наемный специалист: работал в недвижимости (компания “Этажи”), такси, пластиковых окнах, стоматологии, в оптово-розничном магазине детских товаров (компания “Амата”). <br />\r\n <br />\r\nТак же много фрилансил и успешно поработал с: <br />\r\n- Салонами красоты (Москва) <br />\r\n- Фитнес клубами (Москва) <br />\r\n- Танцевальными студиями (Москва) <br />\r\n- Строительством домов (Москва) <br />\r\n- Установкой ГБО на автомобили (Москва / Краснодар / Махачкала) <br />\r\n- Интернет-магазином детских колясок (Россия) <br />\r\n- Интернет-магазином карнавальных костюмов (Россия) <br />\r\n- Интернет-магазином спортивного питания (Москва и Область) <br />\r\n- Интернет-магазином спортивных товаров (Россия) <br />\r\n- Продажа Бетона (Москва) <br />\r\n- Пошив обуви на заказ (Москва) <br />\r\n- Консалтинговые услуги (Москва) <br />\r\n- Ремонт квартир (Краснодар) <br />\r\n- Пошив женской одежды (Санкт-Петербург) <br />\r\n <br />\r\nВ работе нет шаблонных тарифов по количеству ключей, если это не интернет-магазин, для всех остальных семантика собирается от 500 до 30 000 шт. Все зависит от предлагаемых Вами услуг или товаров. <br />\r\n <br />\r\n+ Бесплатный аудит ваших РК. Выявляю ошибки которые съедают бюджет и не приносят целевых посетителей. <br />\r\n <br />\r\nВам нужен качественный контекст, который приведет целевых посетителей на сайт? - пишите на почту: zns.wiki@gmail.com <br />\r\n <br />\r\nС Уважением Николай.', NULL, NULL, NULL, NULL, NULL, '80.252.154.233', 'unspecified.progtech.ru', 'Mozilla/5.0 (Windows NT 6.2; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/57.0.2987.133 Safari/537.36', '', 'Москва', 'trlcelmrlfh3c4obfvse5etra0');
