INSERT INTO tour_testimonial VALUES(1278, NULL, NULL, '2018-04-25', 'Drapkin', 'Elena ', NULL, 'ederbikova@hotmail.com', '6466200403', 'This was my first time going on a tour with New Tours company. I went to China. This trip was very poorly organized. We saw very little of the main attractions/sights. Most of the time we spent on activities where we were forced to buy some stuff, such as unknown medicine, or overpriced pearls and etc. The tour guide spoke Russian very poorly, had a poor grasp of the Russian language, inadequate to lead a tour.  All the hotels were very far from the center of the city and it usually took us an hour or more to get to any of the attractions. The restaurants  where we ate were disgusting , dirty, and had no soap to wash our hands, and no toilet paper. After this tour I will not be    using New Tours for any further trips and will let my friends know  the poor quality of the tour.', NULL, NULL, NULL, NULL, NULL, '74.82.17.84', '74.82.17.84', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/65.0.3325.181 Safari/537.36', 'USA', 'rockaway park', 'kdi3nfsvlibon52kllq04earh0');
