INSERT INTO tour_testimonial VALUES(1280, NULL, NULL, '2018-04-26', 'metrohnir', 'metrohnir', NULL, 'gwenn_taliulu26@rambler.ru', '106811701', 'Добрый день! <br />\r\n <br />\r\nОформим на частных лиц и сотрудников учереждений карты клиента метро  в сеть немецких супермаркетов «МЕТРО Кэш энд Керри».  <br />\r\n <br />\r\nhttp://купить-карту-метро.рф <br />\r\n <br />\r\nЗаконно по договору оформим на частных лиц и сотрудников фирм карты metro в сеть немецких гипермаркетов МЕТРО КЕШ ЭНД КЭРРИ: пропуск в метrо с вашим фото (делается в самом магазине в вашем присутствии), с номером, штрих - кодом, со специальной магнитной полосой, названием фирмы, от которой вы будете нами зарегистрированы. <br />\r\n <br />\r\nВы можете проводить с собой двоих человек. <br />\r\n <br />\r\nПропуска в метро оформляются: на граждан России и иностранных граждан. <br />\r\n <br />\r\nОформление делается без предоплаты, то есть вначале мы оформляем вас, вы получаете карты клиента metro, потом оплачиваете. <br />\r\n <br />\r\nОплата производится в течение 1-го рабочего дня после оформления, немецкие магазины  "Metro Cash & Carry" работают 24 часа. <br />\r\n <br />\r\nДля оказания этой услуги мы находим организации, у которых есть свободные места в этих торговых центрах, и заключаем с ними соответствующие договора, по которым юридические лица обязуются предоставить вам право пользоваться их местами в этих гипермаркетах. <br />\r\n <br />\r\nРегистрация производятся во всех тц Метро Кэш энд Керри. <br />\r\n <br />\r\nПолучив карточки метро в одном из немецких гипермаркетов METRO Cash & Carry вы можете ею пользоваться в любых других магазинах этой сети супермаркетов МETRO Cash and Cаrry в России и за границей. <br />\r\n <br />\r\nПОЖАЛУЙСТА, НЕ ОТВЕЧАЙТЕ НА ЭТО ПИСЬМО, ДЛЯ ЗАКАЗА КАРТ-КЛИЕНТА ИСПОЛЬЗУЙТЕ контакт-форму с сайта http://купить-карту-метро.рф <br />\r\n <br />\r\nВАШ ЗАКАЗ БУДЕТ ПРИНЯТ И ОБРАБОТАН В ТЕЧЕНИЕ РАБОЧЕГО ДНЯ. <br />\r\n <br />\r\nИСПОЛНЕНИЕ ЗАКАЗА 2-3 РАБОЧИХ ДНЯ. <br />\r\n <br />\r\nПОЛУЧЕНИЕ В 50 ГОРОДАХ И РЕГИОНАХ РОССИИ: <br />\r\nАдыгея, Arkhangelsk, Astrakhan, Barnaul, Brjansk, Belgorod, Vladimir, Volgograd, Voljskii, Вологда, Voronej, Воронежская область, Екатеринбург, Иваново, Ижевск, Иркутск, Kazan, Kaliningrad, Калуга, Kemerovo, Kirov, Kopeysk, Krasnodar, Krasnoyarsk, Kursk, Lipeck, Magnitogorsk, Moscow, Moskovskaja oblast, Naberejnue Chelnu, Nijnii Novgorod, Nizhny Tagil, Novokyzneck, Novorossiysk, Новосибирск, Omsk, Orenbyrg, Орёл, Пенза, Пермь, Пятигорск, Ростов-на-Дону, Rjazan, Самара, Sankt-Peterbyrg, Саратов, Serpyxov, Smolensk, Stavropol, Стерлитамак, Syrgyt, Тверь, Toljatti, Tomsk, Tyla, Тюмень, Ulyanovsk, Ufa, Cheboksaru, Cheljabinsk, Jaroslavl, Sevastopol, Simferopol.', NULL, NULL, NULL, NULL, NULL, '91.76.185.35', 'ppp91-76-185-35.pppoe.mtu-net.ru', 'Mozilla/5.0 (Windows NT 6.3; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.84 Safari/537.36', '', 'Москва', 'upp60o05ktgc84ipvvfcoi9224');
INSERT INTO tour_testimonial VALUES(1281, NULL, NULL, '2018-04-27', 'Абсалямова', 'Надежда', NULL, 'INFO@HIMTUR.RU', '+7 967 258-4393', 'Добрый день! Отправляла заявку на обзорную экскурсию по Нью Йорку с круизом к статуе Свободы на понедельник, 30/04. Но ответа ни с подтверждением ни с отказом я от Вас не получила. Я прилетаю в Нью Йорк 29/04 и буду жить в отеле Comfort Inn Brooklyn и вечером 29/04 и целый день 30/04 мне заняться нечем. Просьба присоединить меня к групповой экскурсии особенно на 30/04. По возможности просьба перезвонить мне по +7 967 258-4393 и сообщить есть ли такая возможность, надеяться мне на вашу помощь или нет. Спасибо, с Уважением', NULL, NULL, NULL, NULL, NULL, '213.85.152.82', '213.85.152.82', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/65.0.3325.181 Safari/537.36', 'Russia', 'Москва', '0852riki66fk9tnr048t27h7q1');
