INSERT INTO tour_testimonial VALUES(1321, NULL, NULL, '2018-05-26', 'Nazimov', 'Svetlana', NULL, 'nazimov.svetlana@gmail.com', '+9725444613687', 'Добрый день уважаемвя  администрация компании, путешествовали  с подругой  с вами  3  недели и я обязана поделиться впечатлениями Главное что волнует гида вашей  компании четко донести информацию до нас, а для водителя  довести нас  до нужного пункта вовремя  , ни минутой позже.НО МЫ УВАЖАЕМАЯ    АДМИНИСТРАЦИЯ В ОТПУСКЕ ,А НЕ В ИЗРАИЛЬСКОЙ  АРМИИ: ЦАХАЛ, Переезды  не   легкие ,хочется  немного  музыки ,юмора, поставить какой то  фильм о месте  где  мы   а гид 6,7,8,9  часов   рассказывает,усыпаешь под его однотонный  рассказ, жаль, а самый  неприятный  случай  произошел с уважаемым  гидом Анвар.ВО  ВРЕМЯ ПЕРЕЕЗДА Гранд -Каньена <br />\r\n ,на границе  штатов  Невада и Аризона  мы ночевали  в гостинице,   Утром как обычно мы  едим дальше  ,я  с подругой в автобусе  в 8 ровно ,пять минут не ждем ,так было  сказано  в начале  гидом, в 8,15  поехали и через  7   минут  ,я хочу  отметить  через  7 минут,моя подруга обнаружила что забыла  сумочку  с деньгами  и паспортом  в номере,мы просили  гида остановить автобус и мы вернемся в номер,на что гид АНВАР сказал не положено по  инструкции,он  сказал он созванивается  с гостиницей  , и если они   нашли ,сумочка будет  выслана  за нами  и с его опыта таких случаев было много  у него. ПОВЕРИЛИИИИИИ,сумочка была найдена   в номере ,но Анвар сказал что администрация гостиницы отказываюся  посылать,,,   ВЫХОДИТЕЕЕЕЕ И ЕДЬТЕ НА  ТАКСИ  ЗА  ПАСПОРТОМ , ГОВОРИТ АНВАР ,БЫЛ ДАН  ПРИКАЗ НАШИМ  ГИДОМ,,,,,Два часа наша  группа нас  ждала,170 долл за такси мы заплатили и сколько  здоровья  нам  это  стоило,а ведь семь  минут  повернуть  автобус ,,,для  уВажаемого Анвара и нашего  водителя  инструкция  важнее всего .Уважаемая  администрация  мы  люди и с нами случатся неприятности и чуть чуть гибкости совсем не помешает Анвару и его водителю Мы живем в ИЗРАИЛЕ  много  лет , все время в напряженности ,ну  расслабились бывает  в отпуске,чуть чуть гибкости  и человечности просим  теперь  уже  для  других  туристов,и если честно я думаю что не буду рекомендовать  путешествовать израильтянам с NEW TOURS.Буду очень  рада услышать и ваше мнение по этому неприятному моменту который затмил  очень много прекрасных впечатлений об Америке,УДАЧИ ', NULL, NULL, NULL, NULL, NULL, '5.102.208.46', 'CUST-46.208.102.5.018.net.il', 'Mozilla/5.0 (Windows NT 10.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'Israel', 'NETANYA', '1hhgs97acodpe10dcftsnavv23');
