INSERT INTO tour_testimonial VALUES(1336, NULL, NULL, '2018-06-03', 'Перова', 'Альбина', NULL, 'perova-albina@yandex.ru', '8 919 999 99 99', 'Хочу выразить благодарность экскурсоводу Дмитрию (поездка на майские 2018 из Лос-Анджелеса до Сан-Франциско). Потрясающий гид, душевный человек с невероятным чувством юмора и широким кругозором. Очень интересный собеседник. Вся группа была от него в восторге. Очень интересная поездка. Дмитрий не только профессионал с большой буквы, но и очень внимательный и отзывчивый человек. Группа была, мягко сказать, не молодая, а одна из туристок случайно повредила ногу, несмотря на это Дмитрию удалось и выдержать темп и постоянно помогать и уделять внимание каждому туристу из нашей группы. Спасибо огромное, Дмитрий! Нью-турс теперь только с Вами!!! ', NULL, NULL, NULL, NULL, NULL, '176.14.199.210', '176.14.199.210', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.170 Safari/537.36 OPR/53.0.2907.68', 'USA', 'Москва', 'hrh6ioisco00f7v5rsm36c4ut3');
