INSERT INTO tour_testimonial VALUES(1341, NULL, NULL, '2018-06-08', 'KennethGrava', 'KennethGrava', NULL, 'exwylkottpidd1961@plusgmail.ru', '8 985 206 01 42', 'Добрый день! <br />\r\nНаша компания является производителем уникальных календарей-трансформеров. <br />\r\n <br />\r\nОни отлично продаются как сувенир, как подарок, как календарь, как игрушка-антистресс. И действительно, бесконечная трансформация завораживает! Трансформер удивляет и детей и взрослых! <br />\r\n <br />\r\nСегодня мы предлагаем трансформер приуроченный к предстоящему Чемпионату Мира по футболу 2018 г., который пройдет у нас в стране. В одном сувенире мы разместили 11 городов, где пройдут матчи Чемпионата, их гербы, достопримечательности и календарь на 2019 год. <br />\r\n <br />\r\nТак же изготавливаем по трансформеры по вашим макетам, с вашим дизайном! <br />\r\n <br />\r\nУдивляйте вместе с нами! <br />\r\nБудьте первыми в своем регионе/городе! <br />\r\n <br />\r\nНадеемся на взаимовыгодное сотрудничество! <br />\r\n <br />\r\nПоближе познакомиться с продуктом можно у нас на сайте <br />\r\nhttp://print-finder.ru/service_2_5/ <br />\r\n <br />\r\nС уважением, <br />\r\nООО «Кубпартнер» <br />\r\nprint-finder.ru <br />\r\nМосква, ул. Суворовская, 19А, ДЦ «Галатекс» <br />\r\nzakaz@print-finder.ru <br />\r\n8 985 206 01 42', NULL, NULL, NULL, NULL, NULL, '80.252.155.198', 'unspecified.progtech.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.36', '', 'Москва', 'o96esd4a65q2o8ofva5s3jfpa4');
