INSERT INTO tour_testimonial VALUES(1347, NULL, NULL, '2018-06-14', 'Williamlib', 'Williamlib', NULL, 'iblipuse1991@plusgmail.ru', '126288312', 'Here we want to give you the info about the reputation of your company on the internet. <br />\r\n <br />\r\nRead the article until the end and we promise that you’ll get a lot of useful information! <br />\r\n <br />\r\nYour clients will be able to post their reviews about the product they’ve bought or about the service they’ve paid for only in two cases: <br />\r\n1. They’re extremely satisfied with the product (service); <br />\r\n2. They’re extremely disappointed with the product (service) and they will write repulsive reviews that will make your potential clients think there’s something wrong with your product or service! <br />\r\n <br />\r\nWe’re ready to help the business owners deal with the second group of customers and suggest our services. <br />\r\nWe are the Www.ReviewOne.org Company and we deal with writing and posting customer reviews on almost all social platforms of Russian internet and more. <br />\r\n* The reviews are written only by real people; <br />\r\n* We work with companies in America, Europe, and Russia; <br />\r\n* Our prices are lower than the ones of our competitors (whose number is almost zero); <br />\r\n* Ready for a long-lasting cooperation. <br />\r\n <br />\r\nVisit the website for a more detailed information: https://reviewone.org', NULL, NULL, NULL, NULL, NULL, '80.252.154.233', 'unspecified.progtech.ru', 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/56.0.2924.87 Safari/537.36 OPR/43.0.2442.1144', '', 'Москва', 't9qhu5fuv0a1ppm40av442a7r2');
INSERT INTO tour_testimonial VALUES(1348, NULL, NULL, '2018-06-14', 'Nikabom', 'Nikabom', NULL, 'nika#genniick[ufgytixupukojowy,2,5]@outlook.com', '88466539991', 'Металлические строительные леса <br />\r\nЛеса из стальных или алюминиевых труб производятся промышленным способом в двух основных вариантах — рамные и модульные. К рамным относятся флажковые, штыревые леса и вышки-туры, к модульным — клиновые, хомутовые, подвесные (крепление к несущим конструкциям зданий) и модульные (системные) леса. Конструкция строительных лесов, не зависимо от их типа, должна соответствовать ГОСТ 27321-87, ГОСТ 24258-88 и храниться по ГОСТ 15150-69. <br />\r\nВажно: прежде, чем перейти к подробному описанию металлических строительных лесов, нужно отметить сразу — все они требуют анкерного крепления к стене здания, вдоль или вокруг которого выставляются! Наибольшая высота, на которую возможно вывести строительные леса без крепления к стене здания, не должна превышать 4 м и только при условии, если площадка, на которой выстраиваются леса — идеально горизонтальна и утрамбована, обязательно организован отвод дождевых вод. Не соблюдение этого правила приведет к опрокидыванию или обрушению всей конструкции лесов. Где можно найти и леса строительные купить в минске <br />\r\nРамные или флажковые строительные леса (нормативная нагрузка — 200 кг/м2) <br />\r\nВ их комплект входят: боковые рамы (с лестницей и без нее), стойки для диагонального и горизонтального крепления боковых рам между собой, башмаки для опоры на грунт — все эти элементы выполнены из стали. Размеры рам, установочная дистанция меж ними у каждого производителя несколько различаются, схема построения при этом одинакова. <br />\r\nЭтот тип лесов популярен по двум причинам — они дешевы и просты в сборке. Крепежи рамных лесов заводятся в предназначенные для них отверстия и фиксируются поворотом «флажка». По вертикали элементы лесов соединяются вводом вышестоящей рамы в гнездо расположенной ниже, без дополнительной фиксации. <br />\r\nСтроительные леса рамные предназначены для кладочных и отделочных работ на прямых фасадах зданий, их высота сборки не должна превышать 50 м (для кладки — 20-25 м, для отделки — 40 м). <br />\r\nПеред тем, как приступить к установке рамных лесов, следует обдумать схему их построения и расположение ярусов с лестницами (лучше начертить), выяснить виды и количество необходимых элементов конструкции лесов. <br />\r\nСборка рамных лесов происходит в следующем порядке: <br />\r\n1.	На готовой площадке отмеряются отрезки между рамами (как правило, шаг равен 3 м) и выкладываются опорные доски-лежни, поверху — стальные башмаки. В них заводятся рамы, образующие первый ярус лесов. Их выставляют строго вертикально — по отвесу, соединяют раскосами и стяжками; <br />\r\n2.	Второй ярус — соединение вертикальных рам с нижним ярусом, фиксация их диагональными/горизонтальными стяжками (используются уровень и отвес). Для будущей укладки настилов выставляются горизонтальные ребра ригелей. С первого по завершающий (наивысший) ярус диагональные стяжки необходимо устанавливать в шахматном порядке, т.е. их местоположение не должно быть одинаково с соседними секциями ярусов по вертикали; <br />\r\n3.	Установка лестничных конструкций, расположенных под углом (рабочие могут подниматься и по вертикальным лестницам, встроенным в рамы, но это не удобно и затрудняет ход работ). Наклонные лестницы выставляются по мере подъема ярусов; <br />\r\n4.	Обязательное крепление возводимой конструкции лесов к зданию с использованием крюков с втулками, анкерами-пробками, надежно соединяющими рамы лесов со стеной (проверить!). Крепление лесов со стеной выполнить в шахматном порядке, шаг — 4 м; <br />\r\n5.	Вывод ярусов строительных лесов на необходимую высоту, повторяя описанные выше операции (начиная со 2-го яруса); <br />\r\n6.	В торцах собранных лесов выставляются торцевые связи-штанги, по всей длине ярусов, в тех секциях, где нет диагональных стяжек — установить продольные (горизонтальные) связи, выступающие в роли ограждения. <br />\r\nДемонтаж строительных лесов выполняется в обратном порядке, по направлению сверху-вниз. <br />\r\nШироко представленные на строительном рынке рамные леса предлагаются по средней цене в 170 руб. за м2, их месячная аренда обойдется в 60 руб. за м2. <br />\r\nШтыревые строительные леса (нормативная нагрузка — 200 кг/м2) <br />\r\nПо своей конструкции и технике сборки эти леса так же просты, как и рамные — их горизонтальные элементы крепятся вводом штырей в полые трубки-проушины, приваренные к вертикальным стойкам. Нижние опоры стоек рам заводятся в башмаки, каждый новый уровень собирается поэтапно, большую жесткость лесам придают раскосы, устанавливаемые диагонально. <br />\r\nШтыревые леса выстраиваются до 40 метровой высоты, их применяют в основном при кладочных и редко — в отделочных работах. При всей простоте и надежности, этот тип лесов допускает комбинирование их с хомутовыми лесами, благодаря чему удается выстроить сложные каркасные схемы. <br />\r\nСреднерыночная стоимость лесов этого типа — 550 руб. за м2, аренда — 100 руб. за м2 в месяц. Причина более высокой по сравнению с рамными (флажковыми) лесами стоимости — способность к большим нагрузкам, т.к. в их конструкции применяются стальные трубы со значительной толщиной стенки (к примеру, ЛШ 100 — диаметр стальной трубы 57 мм, стенка — 3,5 мм). <br />\r\nСтроительные леса Вишнева (нормативная нагрузка — 200-250 кг/м2) <br />\r\nРамы этих лесов устанавливаются при сборке не в вертикальном, а в горизонтальном положении. Они соединяют вертикальные стойки сразу над башмаками основания, а в каждом новом ярусе служат опорой для настила. Усиление конструкции лесов Вишнева не требует диагональных связей, это единственный тип строительных лесов, не нуждающийся в них. <br />\r\nЛестницы строительных лесов Вишнева не встроены в раму, они — самостоятельный элемент, устанавливаемый под углом внутри конструкции лесов. Лестницы и рамы ограждения оснащены штырями, которые заводятся в проушины стоек (аналогично креплению связей у штыревых лесов). <br />\r\nЛеса Вишнева предназначены для реставрационных и отделочных работ на высоте до 40 м как внутри, так и снаружи зданий. Начиная со второго яруса стойки этих лесов необходимо закрепить на стене, по горизонтали с шагом 6 м, по вертикали — на каждом ярусе (используются анкера, костыли и стальная проволока, оттяжки и кронштейны). <br />\r\nИх средняя стоимость — 300 руб. за м2, цена месячной аренды — 80 руб. за м2. <br />\r\nКлиновые строительные леса (нормативная нагрузка — 200-300 кг/м2) <br />\r\nЭти леса устроены более сложно, чем описанные выше — составляющие их элементы фиксируются стальными клиньями, вбиваемыми/выбиваемыми молотком. Такой тип крепления многократно повышает надежность лесов, они способны нести большую нагрузку, чем рамные или штыревые леса. <br />\r\nФорма клина, которым соединяются стойки и ригели клиновых лесов, не допускает самопроизвольного расклинивания, а фланцевые замки на стойках снабжены восемью отверстиями — для построения лесов необходимой пространственной формы. При демонтаже лесов извлеченные из соединений клинья вкладываются в особые отверстия, которыми снабжены стойки. <br />\r\nМаксимальная высота, на которую поднимаются клиновые строительные леса — 40 м. Их используют как в строительно-отделочных работах, в том числе и высотных, так и для временных конструкций общественного назначения — зрительных трибун и концертных сцен, лестничных спусков. Этот тип лесов популярен у судо/авиастроителей. <br />\r\nЦена за м2 клиновых лесов в среднем составляет 200 руб., аренда м2 обойдется в 80 руб. за месяц. <br />\r\nХомутовые строительные леса (нормативная нагрузка — 200-250 кг/м2) <br />\r\nОдин из первых видов строительных лесов. Все сборные элементы этих лесов соединяют хомуты — поворотные (повторные) и глухие. Они сложны в сборке, но и высота, на которую их вывести, двукратно превышает возможности прочих видов лесов — 80 м. Стойки и ригели заводятся в хомуты, которые после затягивают резьбовыми болтами. <br />\r\nЭтот тип лесов дает доступ к любой пространственной конструкции, будь то купола или сложные архитектурные выступы, создающие для рамных, штыревых или клиновых лесов «мертвые зоны» по периметру. Возможности построения ярусов любой высоты, комбинирование с любыми типами металлических лесов — все это оправдывает их достаточно высокую цену и сложную сборку. <br />\r\nНужно отметить, что хомутовые строительные леса производятся в двух вариантах, различающихся по диаметру профиля: «профессиональные» — используется стальная труба сечением 57 мм; «облегченные» — диаметр труб 48 мм. Как правило, при сборке хомутовых лесов используются оба типоразмера стоек — 2 м и 4 м, чередуемые при монтаже. Продольные связи также двух размеров (3,6 и 5 м) и так же чередуемы. <br />\r\nХомутовые леса стоят порядка 450 руб. за м2, арендная цена — 75 руб./м2/месяц. <br />\r\nЛеса строительные подвесные (нормативная нагрузка — 200 кг/м2) <br />\r\nОпорой для лесов этой конструкции служит само здание (его перекрытия), т.е. нижний их ярус не касается земли. В тех случаях, когда частичное или полное отсутствие места подле здания не позволяет установить ни один другой вариант лесов, подвесные леса незаменимы. Помехи в виде пристроек, значительная высота объекта, архитектурные элементы слабой прочности, потребность в окружении лесами всего периметра здания, одновременное ведение коммуникационных и ландшафтных работ (сжатые сроки) — все это задачи для подвесных лесов. Они применяются при отделочно-реставрационных работах. <br />\r\nВыступающие наружу элементы подвесных лесов надежно удерживают консоли (материал — швеллер №10), закрепленные в распорку между перекрытиями, их соединяют между собой поперечины и связи на хомутах. Другими словами, за исключением опорных консолей, подвесные леса в остальном являются вариацией хомутовых строительных лесов (1,5" поперечины и связи, 2" стойки, 2,5 мм стенка стальных труб). <br />\r\nКаждый новый ярус соединен с консолями на совпадающим с ним этаже здания и с нижним ярусом, вертикальные стойки обязательно крепить анкерами к стенам (шаг 4 м). <br />\r\nПриобрести в готовом виде можно лишь часть подвесных лесов — ту, что образует внешние ярусы, т.е. элементы хомутовых лесов. Распорки-консоли рассчитываются и производятся под конкретный объект и не могут быть унифицированы в силу конструктивных различий разных зданий — их нужно заказывать дополнительно. Цена подвесных лесов только договорная.', NULL, NULL, NULL, NULL, NULL, '80.249.94.24', '80.249.94.24', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:57.0) Gecko/20100101 Firefox/57.0', '', 'Banepa', '6sl6t5k5ecfiv9hf7kknnuhe31');
