INSERT INTO tour_testimonial VALUES(1361, NULL, NULL, '2018-06-30', 'Irinapoela', 'Irinapoela', NULL, 'irinakotirr962@mail.ru', '88657591958', 'Металлические строительные леса <br />\r\nЛеса из стальных или алюминиевых труб производятся промышленным способом в двух основных вариантах — рамные и модульные. К рамным относятся флажковые, штыревые леса и вышки-туры, к модульным — клиновые, хомутовые, подвесные (крепление к несущим конструкциям зданий) и модульные (системные) леса. Конструкция строительных лесов, не зависимо от их типа, должна соответствовать ГОСТ 27321-87, ГОСТ 24258-88 и храниться по ГОСТ 15150-69. <br />\r\nВажно: прежде, чем перейти к подробному описанию металлических строительных лесов, нужно отметить сразу — все они требуют анкерного крепления к стене здания, вдоль или вокруг которого выставляются! Наибольшая высота, на которую возможно вывести строительные леса без крепления к стене здания, не должна превышать 4 м и только при условии, если площадка, на которой выстраиваются леса — идеально горизонтальна и утрамбована, обязательно организован отвод дождевых вод. Не соблюдение этого правила приведет к опрокидыванию или обрушению всей конструкции лесов. Где можно найти и строительные леса б/у купить в минске цена', NULL, NULL, NULL, NULL, NULL, '46.28.103.55', '46.28.103.55', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/62.0.3202.89 Safari/537.36 OPR/49.0.2725.47', '', 'Kakamega', 'bga93fqad5ukbubb8li5llq0o1');
