INSERT INTO tour_testimonial VALUES(1377, NULL, NULL, '2018-07-06', 'Попов Дмитрий', 'Попов Дмитрий', NULL, 'theinotburgca2010@plusgmail.ru', '7 926 477-22-35', 'Здравствуйте, меня зовут Попов Дмитрий, я специалист по работе с 1C, стаж работы более 12 лет. Могу выполнить абсолютно любые задачи по Автоматизация 1С: ЕРП, СРМ и др. <br />\r\n <br />\r\nУстановка и внедрение + могу обучить ваших сотрудников или лично вас работе с 1С <br />\r\n <br />\r\n------Распространенные обращения ко мне по 1С: <br />\r\n_______________________ <br />\r\n1. Помогу закрыть месяц <br />\r\n_______________________ <br />\r\n2. Не знаете вашу прибыль? - Выведу себестоимость из кризиса. <br />\r\n_______________________ <br />\r\n3. Не работает 1С? - звоните. Удаленно уже дешевле <br />\r\n_______________________ <br />\r\n4. Автоматизирую ваше предприятие, подберу программные продукты 1С, настрою, внедрю и реализую все ваши желания <br />\r\n_______________________ <br />\r\n5. Не можете сделать воронку? - 1С:срм именно для вас <br />\r\n_______________________ <br />\r\n6. Новые сотрудники долго обручаются? - Сделаю для них инструкции <br />\r\n_______________________ <br />\r\n7. Сотрудники работают неправильно? - Внедрю бизнес процессы <br />\r\n_______________________ <br />\r\n8. Долго обрабатываются заявки? - С 1С:срм можете отслеживать время до секунды <br />\r\n_______________________ <br />\r\n9. Хотите улучшить 1С, но не хотите изменять конфигурацию, - звоните, я вам помогу <br />\r\n_______________________ <br />\r\n10. 1С неправильно считает? <br />\r\n_______________________ <br />\r\n11. Периодически не хватает товара? - Настрою автоматическое пополнение <br />\r\n_______________________ <br />\r\n12. Проблемы со складом? - легко решаемы <br />\r\n_______________________ <br />\r\n13. Не знаете какую программу выбрать? Проконсультирую бесплатно <br />\r\n_______________________ <br />\r\n14. Автоматизирую ваш склад, настрою ячеистое хранение и авто-размещение и авто-подбор <br />\r\n_______________________ <br />\r\n15. Не можете разграничить права? - помогу <br />\r\n_______________________ <br />\r\n16. Клиенты отваливаются, и Вы не знаете почему? - обращайтесь. <br />\r\n <br />\r\n------+Что умею: <br />\r\n1. Доработать все, сто угодно на платформе 8 <br />\r\n2. Настройка бизнесс процессов <br />\r\n3. Полное знает Управление торговлей и СРМ <br />\r\n4 управление проектами по ЕРП <br />\r\n5. Работал с Норильским Никелем, Норма Кабель, Развитие, ГФК, Эко-Нива, БМВ-Лизинг, ФСЭ,Футжитсу технологии солюшнз <br />\r\n <br />\r\n------+Получены Сертификаты: <br />\r\nконсультант по Управлению торговлей, <br />\r\nКонсультант по Зарплате и Управлению персоналом <br />\r\nКурсов много пройдено- могу скинуть резюме. <br />\r\n <br />\r\n------+Если Вам интересны мои услуги, пишите! <br />\r\n------------+Моя почта: promaster1c@gmail.com <br />\r\n------------------+ 7 926 477-22-35 <br />\r\n <br />\r\nСпасибо что прочли моё сообщение, отвечу на все ваши вопросы.', NULL, NULL, NULL, NULL, NULL, '80.252.154.233', 'unspecified.progtech.ru', 'Mozilla/5.0 (Windows NT 6.3; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/56.0.2924.87 Safari/537.36', '', 'Москва', 'a7g9h9d38vluuqbnktpnmbg0v4');
