INSERT INTO tour_testimonial VALUES(1379, NULL, NULL, '2018-07-08', 'Олег Васильев', 'Олег Васильев', NULL, 'o_chetverik@mail.ru', '+79057102040', 'Доброго времени суток! <br />\r\n <br />\r\nПредставляю вашему вниманию магазин дешевого, уникального контента http://textnet.ru/ <br />\r\n <br />\r\n <br />\r\nНемного об услугах http://textnet.ru/ и что входит в эти услуги: <br />\r\n <br />\r\n1. Вытягиваем статьи из вебархива, уникальность 90-100%, попадутся статьи с уникальностью меньше 90%, в ЛК есть возврат магазину. <br />\r\n2. Делается вычитка операторами, такой шлак, как генерация, синонимайзинг, плохой рерайт, вы <br />\r\nне встретите в магазине. <br />\r\n3. Тематики любые, вытягиваем практически на любую тематику. <br />\r\n4. На нужные рубрики лучше делайте предзаказы, тогда магазин отправляет сразу свежие статьи, минуя витрину, тем самым у вас всегда будут свежие статьи. <br />\r\n5. Подпишитесь в магазине на нужные вам рубрики, тогда постоянно будете получать информацию о новых статьях. <br />\r\n6. Реферальная программа, теперь вы можете привлекать рефералов, используя ссылку или промоматериалы, которые увидите в личном кабинете. <br />\r\n7. Можете на основе данных статей заказывать и сайты, как на русском, так и инглиш. <br />\r\n <br />\r\n <br />\r\nСтоимость: <br />\r\n <br />\r\n1. Статьи на русском языке - 9р!!! <br />\r\n2. Статьи на инглиш - 15р <br />\r\n3. Сайты на русском языке - 5000р (в стоимость входит 100к контента) <br />\r\n4. Сайты на инглиш - 7000р (в стоимость входит 250к контента) <br />\r\n <br />\r\nЗа всеми подробностями обращайтесь по следующим контактам: <br />\r\n <br />\r\nSkype: OLEGarx666 ICQ: 96562666, живой чат на сайте или пишите на внутреннюю почту магазина (контакты в футере).', NULL, NULL, NULL, NULL, NULL, '95.25.113.22', '95-25-113-22.broadband.corbina.ru', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.36', '', 'РњРѕСЃРєРІР°', '5cb8ueb84951tub3df