INSERT INTO tour_testimonial VALUES(1390, NULL, NULL, '2018-07-12', 'Irinapoela', 'Irinapoela', NULL, 'irinakotirr962@mail.ru', '84251615671', 'Металлические строительные леса <br />\r\nЛеса из стальных или алюминиевых труб производятся промышленным способом в двух основных вариантах — рамные и модульные. К рамным относятся флажковые, штыревые леса и вышки-туры, к модульным — клиновые, хомутовые, подвесные (крепление к несущим конструкциям зданий) и модульные (системные) леса. Конструкция строительных лесов, не зависимо от их типа, должна соответствовать ГОСТ 27321-87, ГОСТ 24258-88 и храниться по ГОСТ 15150-69. <br />\r\nГде можно найти и леса строительные купить <br />\r\nВажно: прежде, чем перейти к подробному описанию металлических строительных лесов, нужно отметить сразу — все они требуют анкерного крепления к стене здания, вдоль или вокруг которого выставляются! Наибольшая высота, на которую возможно вывести строительные леса без крепления к стене здания, не должна превышать 4 м и только при условии, если площадка, на которой выстраиваются леса — идеально горизонтальна и утрамбована, обязательно организован отвод дождевых вод. Не соблюдение этого правила приведет к опрокидыванию или обрушению всей конструкции лесов.', NULL, NULL, NULL, NULL, NULL, '80.249.91.104', '80.249.91.104', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.84 Safari/537.36', '', 'Kakamega', '0p7folpbh6tuhe07deutc368h3');
