INSERT INTO tour_testimonial VALUES(1395, NULL, NULL, '2018-07-14', 'Anthonyraido', 'Anthonyraido', NULL, 'mehnmorucha1963@plusgmail.ru', '168126745', 'Частный сертифицированный интернет-маркетолог с опытом работы более 10 лет предлагает свои услуги по настройке и сопровождению рекламных кампаний в контекстной рекламе Яндекс Директ и Google Adwords. <br />\r\nИмею опыт работы в разных нишах: автомобили, банки, недвижимость, салон красоты, продажа детских игрушек и др. <br />\r\nРаботаю с бюджетами от 25 000 руб. до 250 000 руб./месяц по фиксированной ставке. <br />\r\nСтоимость услуг: <br />\r\nНастройка кампаний: 7000 руб. за одну рекламную систему(Яндекс/Гугл) или 10 000 руб. за две (Яндекс + Гугл). Разовая услуга. Срок настройки – 3 дня. <br />\r\nСопровождение и оптимизация рекламных кампаний: 15000 руб./мес. за одну рекламную систему (Яндекс/Гугл) или 25 000 руб./мес. за две (Яндекс + Гугл). Регулярная услуга. <br />\r\n <br />\r\nНачните получать клиентов с интернет уже сейчас! Увеличьте продажи, заказав услугу, написав мне на почту: Info.corporate@yandex.ru', NULL, NULL, NULL, NULL, NULL, '80.252.155.198', 'unspecified.progtech.ru', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/62.0.3202.89 Safari/537.36 OPR/49.0.2725.47', '', 'РњРѕСЃРєРІР°', 't8m468fdg71hhm600q06ifct36');
