INSERT INTO tour_testimonial VALUES(1418, NULL, NULL, '2018-07-27', 'Илья Глазунов', 'Илья Глазунов', NULL, 'makaronova.sara@mail.ru', '+7(495)648-65-45', 'Здравствуйте! Компания «Белое Облако» предлагает Вам перенести работу с управленческой отчетностью и другие данные на наши высокопроизводительные зарубежные сервера. <br />\r\nРаботайте с вашими данными в России из-за рубежа, быстро, легко и безопасно. (при желании заказчика можем разместить данные и на наших Российских серверах) <br />\r\n <br />\r\nО компании в цифрах: 8 лет на 130 компаний клиентов в 46 регионах России <br />\r\nОсновные преимущества для Вас: <br />\r\n1. Ускоряется работа с базами 1С в 10-ки раз за счет мощности серверов дисков SSD и NVMe <br />\r\n2. Доступ к Вашим данным защищен 2-ух факторной OTP-аутентификации – никто другой не войдет. <br />\r\n3. При наступлении форс-мажорных обстоятельств возможность выключить ваш сервер в течении 3 секунд благодаря автоматической системе экстренного отключения с помощью телефонного звонка <br />\r\n4. Система легко масштабируется <br />\r\n5. Нет необходимости в закупке дорогостоящего оборудования <br />\r\n <br />\r\nВ базовую комплектацию уже входят <br />\r\n1. Возможность бесплатно протестировать выбранный сервер <br />\r\n1. Внимательная служба поддержки пользователе поможет быстро переехать на Ваши зарубежные удаленные сервера и решит любую проблему с Вашим сервером <br />\r\n2. Высокая доступность 99,9% <br />\r\n3. SLA и Финансовая ответственность за простой <br />\r\n4. Лицензии Windows и программы для удаленного доступа уже входят. <br />\r\n5. Лицензионная система резервного копирования Veem с глубиной восстановления данных 3 месяца <br />\r\n6. Пакет безопасности уровня «Premium», Firewall, VPN, защита от DDoS-атак <br />\r\nСтоимость от 470 р./мес. за пользователя <br />\r\n <br />\r\nКалькулятор по ссылке https://www.whitecloud24.ru/server-1s-v-oblake/ <br />\r\nПри заказе сервера сообщите оператору промокод со словами #Пенсия не наступит# и получите скидку 10% на 2 месяца аренды сервера <br />\r\n <br />\r\nТак же мы можем полностью перевести работу Вашей организации на удаленные сервера развернув для Вас корпоративное «Белое Облако», что избавит Вас от простоев на 99% повысит безопасность на 60% и сэкономит до 70% бюджета <br />\r\nПодробности по ссылке https://www.whitecloud24.ru <br />\r\nЕсли есть любые предложения и замечания пишите на почту sales@itexo.ru', NULL, NULL, NULL, NULL, NULL, '5.188.210.36', '5.188.210.36', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:53.0) Gecko/20100101 Firefox/53.0', '', 'РњРѕСЃРєРІР°', 'of9cja01qiumo78j6hevl856m7');
INSERT INTO tour_testimonial VALUES(1419, NULL, NULL, '2018-07-28', '', '', NULL, 'noreply@profunder-247.com', '', 'Quicker and Easier than the SBA, http://ProFunder-247.com can get your business a loan for $2K-350,000 With low-credit and without collateral. <br />\r\n <br />\r\nUse our fast form to See exactly how much you can get, No-Cost: <br />\r\n <br />\r\nhttp://ProFunder-247.com <br />\r\n <br />\r\nIf you''ve been established for at least a year you are already pre-qualified. Our Quick service means funding can be completed within 48hrs. Terms are specific for each business so I suggest applying to find out exactly how much you can get. <br />\r\n <br />\r\nThis is a free service from a qualified lender and the approval will be based on the annual revenue of your business. Funds are also Non-Restrictive, allowing you to use the full amount in any way including bills, taxes, hiring, marketing, expansion, or Absolutely Any Other expense. <br />\r\n <br />\r\nThere are limited SBA and private funds available so please apply now if interested: <br />\r\n <br />\r\nhttp://ProFunder-247.com <br />\r\n <br />\r\nHave a great day, <br />\r\nThe Pro Funder 247 Team <br />\r\n <br />\r\nhttp://ProFunder-247.com/r.php?url=newtours.us&id=e107', NULL, NULL, NULL, NULL, NULL, '193.169.252.46', '193.169.252.46', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/32.0.1700.76 Safari/537.36', '', '', 'tgb8s96187r4nuk4qhgc9hv863');
