INSERT INTO tour_testimonial VALUES(1422, NULL, NULL, '2018-08-02', 'tfccoinscombxcd', 'tfccoinscombxcd', NULL, 'tfccoins@rambler.ru', '74951270965', 'Здравствуйте! <br />\r\n <br />\r\n- Криптовалюта; <br />\r\n- SWIFT (международные платежи); <br />\r\n- Переводы по РФ (минимизация НДС, закрывающие документы); <br />\r\n- Работа с наличными д/с <br />\r\n <br />\r\nПодробнее: <br />\r\n• оплатить криптовалюту с расчетного счета юридического лица с необходимым Вам назначением платежа, в том числе с НДС. (будет предоставлена закрывающая документация); <br />\r\n• продать криптовалюту с получением безналичных средств на счета своей компании или третьих лиц с необходимым назначением платежа как по территории РФ так и в любой точке мира; <br />\r\n• купить криптовалюту  любым удобным способом на 2-4% ниже биржевого курса; <br />\r\n• совершить выгодный обмен безналичных средств на криптовалюту; <br />\r\n• продать криптовалюту с выводом средств в любую точку мира; <br />\r\n• получить наличные за биткоин или другие виртуальные монеты; <br />\r\n• минимизировать НДС в сделках с криптовалютой; <br />\r\n• получить полный пакет необходимых финансовых документов; <br />\r\n• Осуществить любые операции с безналичными средствами юр. лиц <br />\r\n <br />\r\nДля получения подробной информации Вы можете посетить наш сайт http://tfccoins.com/  или напишите нам письмо support@tfccoins.com <br />\r\nА так же связаться с московским представителем по телефону +7 (495) 127-09-65', NULL, NULL, NULL, NULL, NULL, '91.79.24.118', 'ppp91-79-24-118.pppoe.mtu-net.ru', 'Mozilla/5.0 (Windows NT 5.1; rv:40.1) Gecko/20100101 Firefox/40.1', '', 'РњРѕСЃРєРІР°', '9ng94m72kiska56i4n7k1305m0');
