INSERT INTO tour_testimonial VALUES(1447, NULL, NULL, '2018-08-20', 'germanyforrussiansjp', 'germanyforrussiansjp', NULL, 'roman.ponomaryov@rambler.ru', '491787128488', 'Добрый день! <br />\r\n <br />\r\nНаша фирма находится в Германии и предлагает различные услуги. <br />\r\n <br />\r\nМы гарантируем высокое качество обслуживания при минимальных ценах! <br />\r\n <br />\r\nПеречень услуг: <br />\r\n <br />\r\n— Лечение в клиниках и медицинский туризм в Германии <br />\r\n <br />\r\n— Помощь в приобретении недвижимости в Германии <br />\r\n <br />\r\n— Экскурсии и туры (VIP, шоппинг) по Германии и Европе <br />\r\n <br />\r\n— Устные переводы и сопровождение по всей Германии <br />\r\n <br />\r\n— Транспортные услуги и трансферы по всей Германии <br />\r\n <br />\r\n— Бизнес-эмиграция и получение ВНЖ и ПМЖ в Германии <br />\r\n <br />\r\n— Консультации при открытии фирм и филиалов в Германии <br />\r\n <br />\r\nНаш сайт: http://www.germany-for-russians.com', NULL, NULL, NULL, NULL, NULL, '91.79.24.35', 'ppp91-79-24-35.pppoe.mtu-net.ru', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:56.0) Gecko/20100101 Firefox/56.0', '', 'РњРѕСЃРєРІР°', 'o36nspqlk0h767cn581atv2595');
