INSERT INTO tour_testimonial VALUES(1467, NULL, NULL, '2018-09-03', 'electricalexuk', 'electricalexuk', NULL, 'smirnov.alex.alex@rambler.ru', '74951270598', 'Здравствуйте! <br />\r\n <br />\r\nПоставляем промышленное электрооборудование c 1997 года. Восемь часов рабочего времени <br />\r\nпосвящаем исключительно данному оборудованию. Глубокое знание продукта. <br />\r\n <br />\r\nОкажем проф. помощь по выбору ЧРП, УПП, для асинхронных эл. двигателей. <br />\r\nПодберем замену на качественные комплектующие из промышленного электрооборудования. <br />\r\nВышлем опросные листы на сложное оборудование. Окажем тех. поддержку. <br />\r\nБесплатная доставка до терминала трансп комп в Москве, поставка в регионы. <br />\r\n <br />\r\nВ Вашем распоряжении, со склада в Москве: <br />\r\n <br />\r\n-Автоматические выключатели до 6300А включительно <br />\r\n-Автоматы защиты электродвигателя <br />\r\n-Блоки питания <br />\r\n-Выключатели нагрузки <br />\r\n-Датчики промышленные <br />\r\n-Джойстики <br />\r\n-Дифф.автоматы <br />\r\n-ИБП для промышленности <br />\r\n-ИБП для гражданского строительства <br />\r\n-Кнопки и лампочки (светосигнальная арматура) <br />\r\n-Конденсаторные установки <br />\r\n-Контакторы <br />\r\n-Контроллеры <br />\r\n-Устройства плавного пуска <br />\r\n-Частотные преобразователи <br />\r\n-Шкафы и щиты распределительные <br />\r\n <br />\r\nИ многое другое: <br />\r\n <br />\r\nСервоприводы, шаговые двигатели Lexium, Энкодеры, реле Zelio Logic, <br />\r\nблоки питания, Трансформаторы напряжения, твердотельные реле ..., и т. д. <br />\r\n <br />\r\nБудем Рады стать партнером Вашей компании, по поставкам <br />\r\nкомплектующих промышленного назначения. <br />\r\nЗа свой счет доставим до терминала транспортной компании в Москве. <br />\r\n <br />\r\n <br />\r\nhttp://www.electrical-production.ru', NULL, NULL, NULL, NULL, NULL, '91.79.13.48', 'ppp91-79-13-48.pppoe.mtu-net.ru', 'Mozilla/5.0 (Windows NT 7.1; Win64; rv:32.1) Gecko/20100101 Firefox/32.1',