INSERT INTO tour_testimonial VALUES(1575, NULL, NULL, '2018-10-06', 'FBparty', 'FBparty', NULL, 'fbp.arty@yandex.ru', '81616951941', 'Мы от всей души поздравляем Вас с предстоящим событием, которое Вы собираетесь отметить и желаем получить от праздника массу положительных впечатлений и незабываемых эмоций. «Фантастическое Бюро Развлечений» - это команда творческих людей – профессионалов с интересным креативным мышлением, которые помогут сделать любое торжество ярким, оригинальным и волшебным. Организация праздников нашей командой неординарных личностей и индивидуальный  подход к каждому клиенту – залог успеха эксклюзивного и неповторимого праздника, ВАШЕГО праздника! <br />\r\n <br />\r\nСтудия праздников «ФБР» занимается организацией праздничных мероприятий любого формата. Будем рады видеть Вас в числе наших клиентов! <br />\r\n <br />\r\nПриятных  и веселых Вам праздников! <br />\r\n <br />\r\nС Уважением, Студия Праздников «Фантастическое Бюро Развлечений». <br />\r\n <br />\r\n«Почему мы?» <br />\r\nПраздник должен быть у каждого! Мы поможем реализовать все Ваши самые необычные идеи и воплотить мечту в реальность. Разработаем индивидуальный сценарий специально для вашего торжества, а наши профессионалы займутся организацией мероприятия любого уровня и масштаба. <br />\r\n <br />\r\nНу и самое главное: «Почему мы?» <br />\r\n <br />\r\n1. Оригинальность и индивидуальный подход к каждому. <br />\r\nУ нас нет «заезженных», старых и «избитых» сценариев и конкурсов. Все люди разные, а это значит, что каждому необходим особенный подход. Вы – неповторимы и индивидуальны, а значит и Ваш праздник должен быть исключительным и запоминающимся. Вы достойны неповторимого праздника ручной работы! <br />\r\n <br />\r\n2. Ответственность и надежность. <br />\r\nМы ответственно относимся ко всем проводимым мероприятиям, внимательно прислушиваемся к мнению и пожеланиям наших заказчиков. Для нас важно, чтобы те люди, которые обратились по организации праздника, стали нашими постоянными клиентами.  Если Вы доверили проведение своего мероприятия студии «ФБР», Вы можете быть уверены, что Ваше торжество в надежных руках профессионалов своего дела. <br />\r\n <br />\r\n3. Обширный спектр услуг. <br />\r\nПланируя торжество заблаговременно, часто на деле оказывается, что забот и нюансов в подготовке оказывается слишком много. Голова идёт кругом, когда начинаются поиски места проведения мероприятия, самого лучшего  ведущего на свадебное торжество, зажигательного и веселого аниматора на детский праздник, профессионала – оформителя залов, необыкновенного фотографа, видео оператора и т.д. Только дружная и слаженная творческая команда способна сделать такой важный для Вас день самым волшебным и запоминающимся. <br />\r\n <br />\r\nНу, и конечно, Вас приятно удивят наши скидки и акции! <br />\r\n <br />\r\nПодробнее: <br />\r\n <br />\r\n+7(903)965-90-90 <br />\r\n <br />\r\n+7(925)202-46-26', NULL, NULL, NULL, NULL, NULL, '95.143.216.131', '95.143.216.131', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.170 Safari/537.36 OPR/53.0.2907.99', '', '', 'rqpe9dnhts9fr125ac2dmpets2');
