INSERT INTO tour_testimonial VALUES(1702, NULL, NULL, '2018-10-27', 'Gregorynub', 'Gregorynub', NULL, 'pavelkrasilnikov1994143aez@rambler.ru', '85977144647', 'Свободный путешественник сиречь будто понимать постоянно и моментально для своем либо взятом в аренду <br />\r\nавтомобиле в Сочи. <br />\r\nМы продолжаем наше автомобильно-пешее странствие сообразно Сочи! Сегодня мы посетим на своем <br />\r\nиначе взятом в аренду в Сочи автомобиле Сырой каньоны реки Псахо, Троеце-Георгиевский женский <br />\r\nубежище, а также увидим личный музей Этнографический комплекс «Двор Дружбы Народов» <br />\r\nи попробуем настоящую кавказскую кухню в ресторане «Амшенский двор» <br />\r\nИтак начинаем с подготовки вещей и укладки их в багажник вашего или взятого прокат авто в Сочи в <br />\r\nаренду автомобиля. Мы будем пробиться практически четырехкилометровый каньон, <br />\r\nзаполненный водой и потому должны фигурировать обуты в соответствующу обувь – в идеале это <br />\r\nтрекинговые легкие кроссовки, однако коль таковых пропали, то совершенно приемлемы будут обычные <br />\r\nпляжные туфли, которые защитят ноги через порезов, скольжения и при этом не разбухнут и <br />\r\nне расклеятся через длительного нахождения в воде. Также, очевидно необходим солнце <br />\r\nзащитный крем для тела, купальник, полотенце, рюкзак, перекус, питьевая вода, Go Pro <br />\r\nи хоршее настоение) <br />\r\nСайт: https://condios.ru/', NULL, NULL, NULL, NULL, NULL, '109.235.184.95', 'host-109-235-184-95.bisv.ru', 'Mozilla/5.0 (Windows NT 6.3; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', '', 'Udon Thani', 'nvugb8rvdlog7p6d879gmoln16');
INSERT INTO tour_testimonial VALUES(1703, NULL, NULL, '2018-10-27', 'Николай', 'Николай', NULL, 'sofronova.1968@inbox.ru', '89852200882', 'Приветствую Вас, меня зовут Николай. <br />\r\nМоя профессия: интернет-маркетолог. <br />\r\nРаботаю в сфере интернет-маркетинга уже более 7 лет. <br />\r\nА точнее: <br />\r\n <br />\r\n- 4.6 года я занимаюсь Seo продвижением сайтов и прекрасно понимаю сколько факторов влияют на рост трафика и позиций в поисковой системе Яндекс и Google. Имею опыт продвижения высоко-конкурентных коммерческих сайтов по региону Москва и МО. Это пластиковые окна и сайт агентств по недвижимости. <br />\r\n <br />\r\n- 2.1 года занимаюсь привлечение трафика путём настроек контекстной рекламы в Яндекс.Директ <br />\r\n <br />\r\n- Пол года занимаюсь разработкой одностраничников (Landing Page) - в связи с чем не высокая цена работы. <br />\r\n <br />\r\nЧто я могу сделать для Вас: <br />\r\n <br />\r\n1. Настроить контекстную рекламу Я.Директ <br />\r\n- Сроки разработки рекламных компаний: 3-5 дней; <br />\r\n- Стоимость 3500 руб. <br />\r\n <br />\r\n2. Внутренняя оптимизация сайтов (SEO) <br />\r\n- Сбор семантического ядра с 8 типами данных, в том числе конкурентность запроса. <br />\r\n- Кластеризация семантического ядра - тоесть распределение ключевых запросов по страницам сайта <br />\r\n- Внутренняя оптимизация сайта целиком или постраничный (Мета данные + переработка текстов) <br />\r\n- Аудит всего сайта или аудит конкретных страниц на релевантность страницы под ключевые запросы. <br />\r\n <br />\r\n3. Разработка Landing Page <br />\r\n- Сроки: 7 дней <br />\r\n- Цена: 6500 руб <br />\r\n <br />\r\nСмотрите. <br />\r\nУ вас наверняка есть и будут вопросы по каким либо направлениям, будь это Seo, контекстная реклама или создание сайта, Я всегда готов оказать Вам бесплатные консультации по вашим вопросам: <br />\r\n <br />\r\nТелефон: +89652200882 - Николай <br />\r\nПочта: okseoru@gmail.com', NULL, NULL, NULL, NULL, NULL, '31.173.83.52', '31.