INSERT INTO tour_testimonial VALUES(1718, NULL, NULL, '2018-10-30', 'Genadiyberee', 'Genadiyberee', NULL, 'burulov19803@gmail.com', '87858936715', ' <br />\r\n <br />\r\nФормат пекарни «возле дома» – это новый для Украины франчайзинговый проект мини-пекарен. <br />\r\n«Сімейна пекарня» – всеукраинская сеть пекарен. Главная идея проекта – предложить свежую выпечку, буквально из печи, приготовленную рядом с домом. Безупречный вкус и аромат выпечки оценили тысячи клиентов, перейдя в разряд постоянных покупателей. <br />\r\nНебольшой магазин-пекарня со свежеиспеченной выпечкой и ароматным кофе настраивает посетителей на отдых от городской суеты. <br />\r\nУзнать больше об особенностях развития бизнеса по франшизе «Сімейна пекарня» можно будет на форуме FRANCHITHINK International Restaurant & Hotels Forum. <br />\r\nРегистрируйся на сайте: http://franchithink.com/', NULL, NULL, NULL, NULL, NULL, '5.188.180.216', '5.188.180.216', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.170 Safari/537.36 OPR/53.0.2907.99', 'Ukraine', '', 'timqdif4o3tsafq0t25lp8p2s6');
