INSERT INTO tour_testimonial VALUES(1731, NULL, NULL, '2018-11-01', 'Novikov', 'Aleksandr', NULL, 'a_nv@mail.ru', '+79219324485', 'С 16 по 21 ноября 2018 года путешествовали с гидом Борисом Волкиным из Нью-Йорка в Чикаго и обратно (тур "Чикаго и Великие озера"). Программа тура была насыщенной и чрезвычайно интересной, позволила проехать по нескольким штатам и посетить знаменитые города США - Кливленд, Чикаго, Милуоки, Мэдисон, Детройт. Центральное место в программе занимает Чикаго – город с легендарной историей, активной современной жизнью, великолепной архитектурой и своеобразной атмосферой. Чикаго расположен на берегу озера Мичиган, а центр даунтауна с его небоскребами «прорезает» река. Все вместе представляет собой удивительную гармонию урбанистической и природной среды. <br />\r\nКакими бы не были красоты Чикаго и других замечательных мест в штатах Огайо, Иллинойс, Мичиган, но без гида Бориса Волкина путешествие не могло бы быть таким замечательным и не принесло бы столько впечатлений. Борис – великолепный рассказчик, обладающий глубокими знаниями об истории и современности США. Он великолепно разбирается во всем многообразии религиозных конфессий, представленных в США, обладает системными знаниями о мировых религиях. Борис настоящий профессионал: помимо эрудиции и умения увлечь, он также прекрасно справился со всеми организаторскими функциями, всегда действовал в интересах туристов. <br />\r\nУ Бориса замечательное чувство юмора и ангельское терпение. Во время путешествия он сумел создать в группе удивительно теплую, дружественную и творческую атмосферу. <br />\r\nСо всей ответственностью можем порекомендовать этот тур другим туристам. Хотим также выразить нашу искреннюю благодарность Борису. <br />\r\nЕлена и Александр, Санкт-Петербург', NULL, NULL, NULL, NULL, NULL, '95.27.70.54', '95-27-70-54.broadband.corbina.ru', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.77 Safari/537.36', 'Russia', 'Sant Petersburg', 'i452csikvt4cb05ius260l8vl3');
