eЯen sie fast drei volle Punkte hinter ihren Qualifikationsergebnissen zurьckfallen. <br />\r\n <br />\r\nUnebenheiten waren die sauberste Routine des Olympiasiegers, obwohl dies traditionell die schwдchste Disziplin war. <br />\r\n <br />\r\nAls sie zuletzt auf dem Erdboden stand, brauchte sie eine Punktezahl von 13. 307, um Murakami zu erobern, um Gold zu erhalten, und selbst mit deinem Schritt auЯerhalb der Grenzen erzielte Biles 15. bezirk, um den Titel mit 1. 693 Mark zu besiegeln. <br />\r\n <br />\r\n"Ich wьnschte, ich hдtte eine bessere Leistung zeigen kцnnen, weil mein nicht der Turner bin", fьgte Biles hinzu, jener bei den Olympischen Spiel 2016 vier Goldmedaillen gewann. <br />\r\n <br />\r\n"Aber wir machen jedermann Fehler und fallen - es ist nur, denn Sie aufstehen und einander selbst beweisen. " <br />\r\n <br />\r\nBiles verhalf den USA zu anfang der Woche zu einem nachdrьcklichen Gold der Frauen weiterhin ihr letzter Sieg brachte ihr den zwцlften Weltmeistertitel ein. <br />\r\n <br />\r\nSie hat 15 Weltmeisterschaftsmedaillen erhalten, fьnf hinter Rekordhalterin Khorkina.', NULL, NULL, NULL, NULL, NULL, '46.28.70.165', 'dedic-djenya-225506.hosted-by-itldc.com', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36', '', 'Taiping', 'v5ahi2r2s969mkr5kgidp871l0');
