INSERT INTO tour_testimonial VALUES(1857, NULL, NULL, '2018-11-20', 'Ashleyelofe', 'Ashleyelofe', NULL, '324ewr4567re4@7rek.ru', '83199235588', ' <br />\r\nОснованный в 1736 году как крепость, Челябинск к XIX веку стал одним из крупнейших торговых центров Урала, а к концу века и всей России в связи с появлением в 1892 году железнодорожного сообщения города с Москвой] . В связи с активным строительством промышленных предприятий в Челябинске в годы первых пятилеток, а затем и эвакуацией заводов во время Великой Отечественной войны, город стал одним из крупнейших в СССР промышленных центров. Из-за интенсивного производства в городе танков и других боевых машин в военный период Челябинску в 2015 году присвоили звание города трудовой доблести и славы], а сам город в народе получил название «Танкоград» . <br />\r\n <br />\r\n <br />\r\n <br />\r\n <br />\r\n <br />\r\nВыставочный зал Союза художников Челябинска <br />\r\n <br />\r\nЧелябинский Выставочный зал Союза художников считается одним из самых крупных специализированных учреждений в России. Он был создан в 1980 г. и органично вписался в культурную жизнь города. Здесь проходят групповые, персональные и тематические выставки. <br />\r\n <br />\r\n', NULL, NULL, NULL, NULL, NULL, '37.113.182.123', 'dynamicip-37-113-182-123.pppoe.chel.ertelecom.ru', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/68.0.3440.106 Safari/537.36', '', 'Hohenems', 'ailp1iksb6s82dghk01h23ba50');
