INSERT INTO tour_testimonial VALUES(1953, NULL, NULL, '2018-12-04', 'Андрей', 'Андрей', NULL, 'galya-basova@list.ru', '81234567890', 'Приветствую Вас, меня зовут Андрей и я являюсь сертифицированным - Золотым партнером по CMS Bitrix и CRM Bitrix24. <br />\r\n <br />\r\nЯ и моя небольшая команда профессионалов осуществляет техническую поддержку, модернизацию и обслуживание сайтов на Битриксе. Мы работаем над тем, чтобы ваш проект полностью отвечал поставленным целям и задачам с учетом особенностей вашего бизнеса. <br />\r\n <br />\r\nВАЖНО! На все, что мы делаем распространяется гарантия 12 месяцев. <br />\r\n <br />\r\nМАКСИМАЛЬНАЯ ИНТЕГРАЦИЯ <br />\r\nНастроим обмен сайта с 1С даже если нет официального модуля. Разработаем механизмы интеграции с CRM системами, товарными агрегаторами, службами доставки и службами оплаты <br />\r\n <br />\r\nРАБОТА С КОНТЕНТОМ <br />\r\nОбновление и размещение на сайте нового контента больше не будет проблемой. Такие операции как: публикация новостей, размещение статей, обновление каталога товаров и прайс-листов, размещение акций и спецпредложений мы берем на себя. <br />\r\n <br />\r\nПРОГРАММИРОВАНИЕ И ДОРАБОТКА САЙТА <br />\r\nПоможем с доработкой текущего кода и написанием нового. Установим и внедрим модули с Marketplace или напишем собственные под ваши задачи. Проведем аудит кода и устраним все уязвимости, а также проведем автоматизацию ваших бизнес процессов <br />\r\n <br />\r\nРеализовано более 150 сложных проектов. <br />\r\nДоработок выполнено - на более 11 000 часов. <br />\r\nГотов по запросу прислать портфолио работ и сертификаты. <br />\r\nМы в ТОП50 рейтинге по Москве - по созданию и поддержке интернет-магазинов. <br />\r\n <br />\r\nМы знаем, что битрикс дорогая система для обслуживания. <br />\r\nУ нас не Московские цены, а цены г. Ульяновска - Убедитесь сами. <br />\r\n <br />\r\nЕсли у вас имеются вопросы, смело пишите на почту: andrey.1cbitrix@gmail.com <br />\r\nили звоните по номеру: +7 (495) 118-43-49 <br />\r\nИли по Skype: voiimond <br />\r\n <br />\r\nСпасибо за прочтение.', NULL, NULL, NULL, NULL, NULL, '80.252.154.233', 'unspecified.progtech.ru', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64; rv:52.0) Gecko/20100101 Firefox/52.0', '', 'РњРѕСЃРєРІР°', 'a8e1tju70mgsu0ns8ioqokfth4');
