INSERT INTO tour_testimonial VALUES(1982, NULL, NULL, '2018-12-09', 'Edwardoxync', 'Edwardoxync', NULL, 'imagedents@gmail.com', '85499136655', 'zikunof@gmail.com <br />\r\n+7(978) 787-38-66 <br />\r\nhttps://vk.com/remont.kvartir.krym <br />\r\n <br />\r\nПреимущества обращения в специализированную компанию в Севастополе: <br />\r\nмы осуществляем все виды работ – вам не нужно искать специалистов для того, чтобы побелить потолок, поклеить обои, установить теплый пол, заменить сантехнику и т. п. Абсолютно все выполняет наш сплоченный коллектив; <br />\r\n <br />\r\n- высокий профессионализм – у нас трудятся мастера с большой буквы, для которых нет сложных и неразрешимых задач, поэтому мы беремся за заказы любой сложности; <br />\r\n- оптимальные цены – при условии безупречного качества на свои услуги мы устанавливаем разумные и полностью обоснованные цены. Проведя небольшой анализ рынка, вы можете убедиться лично, что более привлекательных предложений в Крыму нет; <br />\r\n- минимальные сроки – на работу у нас уходит столько времени, сколько того требует технологический процесс и ни минуты больше, потому что мы ценим время своих клиентов и знаем, с каким нетерпением люди всегда ожидают завершения ремонта; <br />\r\n- оснащение – весь необходимый инструментарий, приборы и аппараты есть в наличии, причем лучшего качества, от известных производителей, что существенно отличает нашу компанию от частников, порой работающих кустарными способами.', NULL, NULL, NULL, NULL, NULL, '77.123.201.212', '77.123.201.212.tscrimea.com', 'Mozilla/5.0 (Windows NT 6.3; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/68.0.3440.106 Safari/537.36', '', 'Севастополь', 'hk8bsqcem886866bqml2nc31j7');
