INSERT INTO tour_testimonial VALUES(2072, NULL, NULL, '2018-12-22', 'VolodimirtoShved', 'VolodimirtoShved', NULL, '77012star@gmail.com', '86257857786', 'http://it-citynt.ru/forum/user/16650/<br />\r\n <br />\r\n <br />\r\nВолодимир Швед - бізнесмен. ґвалтівнік і згвалтування - це два колосальних лиха.<br />\r\nУникнути згвалтування і "привертають ситуацій" можливо. Насамперед вирішите для себе самі, на яку відстань підпускати розмовляє з вами поза приміщенням людини, а тим більше, якщо їх багато. Чи не потрібно і при цьому озирнутися, чи немає поруч проїжджої дороги, під''їзду, густих чагарників, так би мовити місця, куди вас без особливих зусиль затягнути. Не підходьте дуже близько до стоїть автомашині, з якої у вас невинно запитують, як доїхати на таку-то вулицю. Дві дівчата-школярки ось так підійшли - і 2 дні стали замкнутими в суспільстві примушували і били їх хлопців ...<br />\r\n <br />\r\nhttp://it-citynt.ru/forum/user/16650/<br />\r\nhttp://primaline.ru/forum/user/590/<br />\r\n <br />\r\nПравда, якщо час дня дуже пізніше, можна нікого не дочекатися. З одного молодою жінкою був прецедент: виліз з кущиків хлопчик трохи нижче її. Схопив за руку, скомандував: "Пішли в під''їзд". Тоді вона, трохи оговтавшись, відповіла: "Ти що, з глузду з''їхав?" А сама дивиться: чи немає ще кого то навколо. І як закричить несамовито: "Па-а-па! На допомогу! "Парніще навіть відскочив від несподіванки. "Ну, ти що кричиш? Ножем вдарю - відразу ж умолкнешь! "А вона відчуває, що немає ножа, і знову як закричить:" Люди! Допоможіть, адже він один! "Станув ворог в темних кущах, ніби й не було.<br />\r\nПсихологія ґвалтівніка: що рухає ґвалтівнікамі, коли вони скоюють злочини?<br />\r\n <br />\r\n <br />\r\n <br />\r\nhttp://pravitelstvorb.ru/forum/user/4109/<br />\r\nhttp://aliot.su/communication/forum/user/327/<br />\r\n <br />\r\n <br />\r\nПравда, якщо час дня дуже пізніше, можна нікого не дочекатися. З одного молодою жінкою був прецедент: виліз з кущиків хлопчик трохи нижче її. Схоп